INSERT INTO `domain` VALUES (2603204,'gnl|CDD|316874',_binary 'Domain of unknown function (DUF4417).  This family of proteins is functionally uncharacterized. This family of proteins is found in bacteria and viruses. Proteins in this family are typically between 220 and 340 amino acids in length. There is a single completely conserved residue G that may be functionally important.','pfam14386','DUF4417'),(2603205,'gnl|CDD|310019',_binary 'Phage portal protein, SPP1 Gp6-like.  This protein forms a hole, or portal, that enables DNA passage during packaging and ejection. It also forms the junction between the phage head (capsid) and the tail proteins. During SPP1 morphogenesis, Gp6 participates in the procapsid assembly reaction. This family also includes the old Pfam family Phage_min_cap (PF05126).','pfam05133','Phage_prot_Gp6'),(2603206,'gnl|CDD|226974',_binary 'Phage terminase-like protein, large subunit [General function prediction only].','COG4626','COG4626'),(2603207,'gnl|CDD|281364',_binary 'Phage Terminase.  The majority of the members of this family are bacteriophage proteins, several of which are thought to be terminase large subunit proteins. There are also a number of bacterial proteins of unknown function.','pfam03354','Terminase_1'),(2603208,'gnl|CDD|286444',_binary 'Phage protein Gp19/Gp15/Gp42.  This family of proteins are functionally uncharacterized. They are found in a variety of bacteriophage.','pfam09355','Phage_Gp19'),(2603209,'gnl|CDD|336001',_binary 'Phage capsid family.  Family of bacteriophage hypothetical proteins and capsid proteins.','pfam05065','Phage_capsid'),(2603210,'gnl|CDD|273690',_binary 'phage major capsid protein, HK97 family.  This model family represents the major capsid protein component of the heads (capsids) of bacteriophage HK97, phi-105, P27, and related phage. This model represents one of several analogous families lacking detectable sequence similarity. The gene encoding this component is typically located in an operon encoding the small and large terminase subunits, the portal protein and the prohead or maturation protease. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR01554','prophage_Lp3_protein_18'),(2603211,'gnl|CDD|308872',_binary 'ADP-ribosyltransferase exoenzyme.  This is a family of bacterial and viral bi-glutamic acid ADP-ribosyltransferases, where, in Aeromonas salmonicida AexT, E403 is the catalytic residue and E401 contributes to the transfer of ADP-ribose to the target protein. In clostridial species it is actin that is being ADP-ribosylated; this result is lethal and dermonecrotic in infected mammals.','pfam03496','ADPrib_exo_Tox'),(2603212,'gnl|CDD|238144',_binary 'VIP2; A family of actin-ADP-ribosylating toxin. A member of the Bacillus-prodiced vegetative insecticidal proteins (VIPs) possesses high specificity against the major insect pest, corn rootworms, and belongs to a classs of binary toxins and regulators of biological pathways distinct from classical A-B toxins. A novel family of insecticidal ADP-ribosyltransferses were isolated from Bacillus cereus during vegetative growth, where VIP1 likely targets insect cells and VIP2 ribosylates actin. VIP2 shares significant sequence similarity with enzymatic components of other binary toxins, Clostridium botulinum C2 toxin, C. perfringens iota toxin, C. piroforme toxin, C. piroforme toxin and C. difficile toxin.','cd00233','VIP2'),(2603213,'gnl|CDD|340103',_binary 'Tail assembly protein Gp24 and Gp25.  Bacteriophages (viruses of bacteria) use a specialized organelle called a tail to deliver their genetic material and proteins across the cell envelope during infection. In phages the most complex part of these contractile injection systems, the base-plate, is responsible for coordinating host recognition or other environmental signals with sheath contraction. In T4 phage, 15 different proteins encoded by Gene Products (Gps), make up the base-plate and proximal region of the tail tube. The base-plate is divided into inner, intermediate and peripheral regions. Gp25 is located in the inner region of the base-plate. It interacts with Gp53 connecting the core bundle to the central hub and the tube, stabilizing the entire assembly. Gp25 has a structurally conserved loop (residues 47-49), mediating the interaction between LysM (residues 46-82 in Gp53) and the core bundle. Orthologues of Gp25 contain an EPR motif (Glu-Pro-Arg, residues 85-87 of Gp25), which interacts with the core bundle and points towards the region of the Gp27-Gp48 interface. In summary, Gp25 plays a critical role in sheath assembly and contraction. This domain family is found on Gp24 and Gp25 Mycobacterium phages.','pfam17388','GP24_25'),(2603215,'gnl|CDD|287830',_binary 'Protein of unknown function (DUF2744).  This is a viral family of proteins with unknown function.','pfam10910','DUF2744'),(2603216,'gnl|CDD|313949',_binary 'Protein of unknown function (DUF2746).  This family of proteins has no known function.','pfam10874','DUF2746'),(2603217,'gnl|CDD|227699',_binary 'Phage-related protein [Function unknown].','COG5412','COG5412'),(2603218,'gnl|CDD|107029',_binary 'putative minor structural protein.','PHA01351','PHA01351'),(2603220,'gnl|CDD|349760',_binary 'partition proteins ParAB family.  ParA and ParB of Caulobacter crescentus belong to a conserved family of bacterial proteins implicated in chromosome segregation. ParB binds to DNA sequences adjacent to the origin of replication and localizes to opposite cell poles shortly following the initiation of DNA replication. ParB regulates the ParA ATPase activity by promoting nucleotide exchange in a fashion reminiscent of the exchange factors of eukaryotic G proteins. ADP-bound ParA binds single-stranded DNA, whereas the ATP-bound form dissociates ParB from its DNA binding sites. Increasing the fraction of ParA-ADP in the cell inhibits cell division, suggesting that this simple nucleotide switch may regulate cytokinesis. ParA shares sequence similarity to a conserved and widespread family of ATPases which includes the repA protein of the repABC operon in Rhizobium etli symbiotic plasmid. This operon is involved in the plasmid replication and partition.','cd02042','ParAB_family'),(2603221,'gnl|CDD|224113',_binary 'ATPases involved in chromosome partitioning [Cell division and chromosome partitioning].','COG1192','Soj'),(2603222,'gnl|CDD|222854',_binary 'ParA-like protein; Provisional.','PHA02518','PHA02518'),(2603223,'gnl|CDD|316165',_binary 'AAA domain.  This family includes a wide variety of AAA domains including some that have lost essential nucleotide binding residues in the P-loop.','pfam13614','AAA_31'),(2603224,'gnl|CDD|334629',_binary 'CobQ/CobB/MinD/ParA nucleotide binding domain.  This family consists of various cobyrinic acid a,c-diamide synthases. These include CbiA and CbiP from S.typhimurium, and CobQ from R. capsulatus. These amidases catalyze amidations to various side chains of hydrogenobyrinic acid or cobyrinic acid a,c-diamide in the biosynthesis of cobalamin (vitamin B12) from uroporphyrinogen III. Vitamin B12 is an important cofactor and an essential nutrient for many plants and animals and is primarily produced by bacteria. The family also contains dethiobiotin synthetases as well as the plasmid partitioning proteins of the MinD/ParA family.','pfam01656','CbiA'),(2603225,'gnl|CDD|148565',_binary 'VirC1 protein.  This family consists of several bacterial VirC1 proteins. In Agrobacterium tumefaciens, a cis-active 24-base-pair sequence adjacent to the right border of the T-DNA, called overdrive, stimulates tumor formation by increasing the level of T-DNA processing. It is thought that the virC operon which enhances T-DNA processing probably does so because the VirC1 protein interacts with overdrive. It has now been shown that the virC1 gene product binds to overdrive but not to the right border of T-DNA.','pfam07015','VirC1'),(2603226,'gnl|CDD|274549',_binary 'cellulose synthase operon protein YhjQ.  Members of this family are the YhjQ protein, found immediately upsteam of bacterial cellulose synthase (bcs) genes in a broad range of bacteria, including both copies of the bcs locus in Klebsiella pneumoniae. In several species it is seen clearly as part of the bcs operon. It is identified as a probable component of the bacterial cellulose metabolic process not only by gene location, but also by partial phylogenetic profiling, or Haft-Selengut algorithm (), based on a bacterial cellulose biosynthesis genome property profile. Cellulose plays an important role in biofilm formation and structural integrity in some bacteria. Mutants in yhjQ in Escherichia coli, show altered morphology an growth, but the function of YhjQ has not yet been determined. [Cell envelope, Biosynthesis and degradation of surface polysaccharides and lipopolysaccharides].','TIGR03371','cellulose_yhjQ'),(2603227,'gnl|CDD|225447',_binary 'Septum formation inhibitor-activating ATPase [Cell division and chromosome partitioning].','COG2894','MinD'),(2603228,'gnl|CDD|312607',_binary 'ATPase MipZ.  MipZ is an ATPase that forms a complex with the chromosome partitioning protein ParB near the chromosomal origin of replication. It is responsible for the temporal and spatial regulation of FtsZ ring formation.','pfam09140','MipZ'),(2603229,'gnl|CDD|223563',_binary 'ATPases involved in chromosome partitioning [Cell division and chromosome partitioning].','COG0489','Mrp'),(2603230,'gnl|CDD|349756',_binary 'septum site-determining protein MinD.  Septum site-determining protein MinD is part of the operon MinCDE that determines the site of the formation of a septum at mid-cell, an important part of bacterial cell division. MinC is a nonspecific inhibitor of the septum protein FtsZ. MinE is the supressor of MinC. MinD plays a pivotal role, selecting the mid-cell over other sites through the activation and regulation of MinC and MinE. MinD is a membrane-associated ATPase, related to nitrogenase iron protein.','cd02036','MinD'),(2603231,'gnl|CDD|182756',_binary 'cell division inhibitor MinD; Provisional.','PRK10818','PRK10818'),(2603232,'gnl|CDD|139909',_binary 'putative crown gall tumor protein VirC1; Provisional.','PRK13849','PRK13849'),(2603233,'gnl|CDD|337804',_binary 'NUBPL iron-transfer P-loop NTPase.  This family contains ATPases involved in plasmid partitioning. It also contains the cytosolic Fe-S cluster assembling factor NBP35 which is required for biogenesis and export of both ribosomal subunits.','pfam10609','ParA'),(2603234,'gnl|CDD|274585',_binary 'plasmid partitioning protein RepA.  Members of this family are the RepA (or ParA) protein involved in replicon partitioning. All known examples occur in bacterial species with two or more replicons, on a plasmid or the smaller chromosome. Note that an apparent exception may be seen as a pseudomolecule from assembly of an incompletely sequenced genome. Members of this family belong to a larger family that also includes the enzyme cobyrinic acid a,c-diamide synthase, but assignment of that name to members of this family would be in error. [Mobile and extrachromosomal element functions, Plasmid functions].','TIGR03453','partition_RepA'),(2603235,'gnl|CDD|223531',_binary 'Antiactivator of flagellar biosynthesis FleN, an ATPase [Cell motility].','COG0455','flhG'),(2603236,'gnl|CDD|131023',_binary 'septum site-determining protein MinD.  This model describes the bacterial and chloroplast form of MinD, a multifunctional cell division protein that guides correct placement of the septum. The homologous archaeal MinD proteins, with many archaeal genomes having two or more forms, are described by a separate model. [Cellular processes, Cell division].','TIGR01968','Septum_site-determinin...'),(2603240,'gnl|CDD|238038',_binary 'HNH nucleases; HNH endonuclease signature which is found in viral, prokaryotic, and eukaryotic proteins. The alignment includes members of the large group of homing endonucleases, yeast intron 1 protein, MutS, as well as bacterial colicins, pyocins, and anaredoxins.','cd00085','HNHc'),(2603241,'gnl|CDD|340225',_binary 'Mycobacterium phage hypothetical protein Gp44.1.  This is a family with unknown function. Family members are hypothetical proteins found in Mycobacterium phages.','pfam17510','Gp44'),(2603242,'gnl|CDD|259851',_binary 'Helix-turn-helix domain of Hin and related proteins.  This domain model summarizes a family of DNA-binding domains unique to bacteria and represented by the Hin protein of Salmonella. The basic HTH domain is a simple fold comprised of three core helices that form a right-handed helical bundle. The principal DNA-protein interface is formed by the third helix, the recognition helix, inserting itself into the major groove of the DNA. A diverse array of HTH domains participate in a variety of functions that depend on their DNA-binding properties. HTH_Hin represents one of the simplest versions of the HTH domains; the characterization of homologous relationships between various sequence-diverse HTH domain families remains difficult. The Hin recombinase induces the site-specific inversion of a chromosomal DNA segment containing a promoter, which controls the alternate expression of two genes by reversibly switching orientation. The Hin recombinase consists of a single polypeptide chain containing a C-terminal DNA-binding domain (HTH_Hin) and a catalytic domain.','cd00569','HTH_Hin_like'),(2603243,'gnl|CDD|234847',_binary 'FAD-dependent thymidylate synthase; Reviewed.','PRK00847','thyX'),(2603244,'gnl|CDD|334952',_binary 'Thymidylate synthase complementing protein.  Thymidylate synthase complementing protein (Thy1) complements the thymidine growth requirement of the organisms in which it is found, but shows no homology to thymidylate synthase. The bacterial members of this family at least are flavin-dependent thymidylate synthases.','pfam02511','Thy1'),(2603245,'gnl|CDD|274010',_binary 'thymidylate synthase, flavin-dependent.  Two forms of microbial thymidylate synthase are known: ThyA (2.1.1.45) and ThyX (2.1.1.148). This model describes ThyX, a homotetrameric flavoprotein. Both enzymes convert dUMP to dTMP. Under oxygen-limiting conditions, thyX can complement a thyA mutation. [Purines, pyrimidines, nucleosides, and nucleotides, 2\'-Deoxyribonucleotide metabolism].','TIGR02170','Thymidylate_synthase_ThyX'),(2603246,'gnl|CDD|224270',_binary 'Predicted alternative thymidylate synthase [Nucleotide transport and metabolism].','COG1351','THY1'),(2603247,'gnl|CDD|334100',_binary 'DNA polymerase family A.','pfam00476','DNA_pol_A'),(2603248,'gnl|CDD|214687',_binary 'DNA polymerase A domain.','smart00482','POLAc'),(2603249,'gnl|CDD|223820',_binary 'DNA polymerase I - 3\'-5\' exonuclease and polymerase domains [DNA replication, recombination, and repair].','COG0749','PolA'),(2603250,'gnl|CDD|235591',_binary 'DNA polymerase I; Provisional.','PRK05755','PRK05755'),(2603251,'gnl|CDD|273160',_binary 'DNA polymerase I.  All proteins in this family for which functions are known are DNA polymerases Many also have an exonuclease motif. This family is based on the phylogenomic analysis of JA Eisen (1999, Ph.D. Thesis, Stanford University). [DNA metabolism, DNA replication, recombination, and repair].','TIGR00593','DNA_polymerase_I'),(2603252,'gnl|CDD|176474',_binary 'Polymerase I functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication.  Family A polymerase (polymerase I) functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication. DNA-dependent DNA polymerases can be classified in six main groups based upon phylogenetic relationships with E. coli polymerase I (classA), E. coli polymerase II (class B), E.coli polymerase III (class C), euryarchaaeota polymerase II (class D), human polymerase  beta (class x), E. coli UmuC/DinB and eukaryotic RAP 30/Xeroderma pigmentosum variant (class Y). Family A polymerase are found primarily in organisms related to prokaryotes and include prokaryotic DNA polymerase I (pol I) ,mitochondrial polymerase delta, and several bacteriphage polymerases including those from odd-numbered phage (T3, T5, and T7). Prokaryotic Pol Is have two functional domains located on the same polypeptide; a 5\'-3\' polymerase and 5\'-3\' exonuclease. Pol I uses its 5\' nuclease activity to remove the ribonucleotide portion of newly synthesized Okazaki fragments and DNA polymerase activity to fill in the resulting gap. A combination of phylogenomic and signature sequence-based (or phonetic) approaches is used to understand the evolutionary relationships among bacteria. DNA polymerase I is one of the conserved proteins that is used to search for protein signatures. The structure of these polymerases resembles in overall morphology a cupped human right hand, with fingers (which bind an incoming nucleotide and interact with the single-stranded template), palm (which harbors the catalytic amino acid residues and also binds an incoming dNTP) and thumb (which binds double-stranded DNA) subdomains.','cd08637','DNA_pol_A_pol_I_C'),(2603253,'gnl|CDD|176476',_binary 'Phylum Aquificae Pol A is different from Escherichia coli  Pol A by three signature sequences.  Family A polymerase functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication. DNA-dependent DNA polymerases can be classified in six main groups based upon phylogenetic relationships with E. coli polymerase I (classA), E. coli polymerase II (class B), E.coli polymerase III (class C), euryarchaaeota polymerase II (class D), human polymerase  beta (class x), E. coli UmuC/DinB and eukaryotic RAP 30/Xeroderma pigmentosum variant (class Y). Family A polymerase are found primarily in organisms related to prokaryotes and include prokaryotic DNA polymerase I ,mitochondrial polymerase delta, and several bacteriphage polymerases including those from odd-numbered phage (T3, T5, and T7). Prokaryotic Pol Is have two functional domains located on the same polypeptide; a 5\'-3\' polymerase and 5\'-3\' exonuclease. Pol I uses its 5\' nuclease activity to remove the ribonucleotide portion of newly synthesized Okazaki fragments and DNA polymerase activity to fill in the resulting gap. A combination of phylogenomic and signature sequence-based (or phonetic) approaches is used to understand the evolutionary relationships among bacteria. DNA polymerase I is one of the conserved proteins that is used for phylogenetic anaylsis of bacteria. Species of the phylum Aquificae grow in extreme thermophilic environments. The Aquificae are non-spore-forming, Gram-negative rods and strictly thermophilic. Phylum Aquificae Pol A is different from E. coli Pol I by three signature sequences consisting of a 2 amino acids (aa) insert, a 5-6 aa insert and a 6 aa deletion. These signature sequences may provide a molecular marker for the family Aquificaceae and related species.','cd08639','DNA_pol_A_Aquificae_like'),(2603254,'gnl|CDD|237876',_binary 'bifunctional 3\'-5\' exonuclease/DNA polymerase; Provisional.','PRK14975','PRK14975'),(2603255,'gnl|CDD|334610',_binary '3\'-5\' exonuclease.  This domain is responsible for the 3\'-5\' exonuclease proofreading activity of E. coli DNA polymerase I (polI) and other enzymes, it catalyzes the hydrolysis of unpaired or mismatched nucleotides. This domain consists of the amino-terminal half of the Klenow fragment in E. coli polI it is also found in the Werner syndrome helicase (WRN), focus forming activity 1 protein (FFA-1) and ribonuclease D (RNase D). Werner syndrome is a human genetic disorder causing premature aging; the WRN protein has helicase activity in the 3\'-5\' direction. The FFA-1 protein is required for formation of a replication foci and also has helicase activity; it is a homolog of the WRN protein. RNase D is a 3\'-5\' exonuclease involved in tRNA processing. Also found in this family is the autoantigen PM/Scl thought to be involved in polymyositis-scleroderma overlap syndrome.','pfam01612','DNA_pol_A_exo1'),(2603256,'gnl|CDD|176473',_binary 'Family A polymerase primarily fills DNA gaps that arise during DNA repair, recombination and replication.  DNA polymerase family A, 5\'-3\' polymerase domain. Family A polymerase functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication. DNA-dependent DNA polymerases can be classified into six main groups based upon phylogenetic relationships with E. coli polymerase I (classA), E. coli polymerase II (class B), E.coli polymerase III (class C), euryarchaeota polymerase II (class D), human polymerase  beta (class X), E. coli UmuC/DinB and eukaryotic RAP 30/Xeroderma pigmentosum variant (class Y). Family A polymerases are found primarily in organisms related to prokaryotes and include prokaryotic DNA polymerase I, mitochondrial polymerase gamma, and several bacteriophage polymerases including those from odd-numbered phage (T3, T5, and T7). Prokaryotic polymerase I (pol I) has two functional domains located on the same polypeptide; a 5\'-3\' polymerase and a 5\'-3\' exonuclease. Pol I uses its 5\' nuclease activity to remove the ribonucleotide portion of newly synthesized Okazaki fragments and the DNA polymerase activity to fill in the resulting gap. The structure of these polymerases resembles in overall morphology a cupped human right hand, with fingers (which bind an incoming nucleotide and interact with the single-stranded template), palm (which harbors the catalytic amino acid residues and also binds an incoming dNTP) and thumb (which binds double-stranded DNA) subdomains.','cd06444','DNA_pol_A'),(2603257,'gnl|CDD|214681',_binary '3\'-5\' exonuclease.  3\' -5\' exonuclease proofreading domain present in DNA polymerase I, Werner syndrome helicase, RNase D and other enzymes.','smart00474','35EXOc'),(2603258,'gnl|CDD|176477',_binary 'DNA polymerase A type from plastids of higher plants possibly involve in DNA replication or in the repair of errors occurring during replication.  DNA polymerase A type from plastids of higher plants possibly involve in DNA replication or in the repair of errors occurring during replication. Family A polymerase functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication. DNA-dependent DNA polymerases can be classified in six main groups based upon phylogenetic relationships with E. coli polymerase I (classA), E. coli polymerase II (class B), E.coli polymerase III (class C), euryarchaaeota polymerase II (class D), human polymerase  beta (class x), E. coli UmuC/DinB and eukaryotic RAP 30/Xeroderma pigmentosum variant (class Y). Family A polymerase are found primarily in organisms related to prokaryotes and include prokaryotic DNA polymerase I ,mitochondrial polymerase delta, and several bacteriphage polymerases including those from odd-numbered phage (T3, T5, and T7).   The three-dimensional structure of plastid DNA polymerase has substantial similarity to Pol I. The structure of Pol I resembles in overall morphology a cupped human right hand, with fingers (which bind an incoming nucleotide and interact with the single-stranded template), palm (which harbors the catalytic amino acid residues and also binds an incoming dNTP) and thumb (which binds double-stranded DNA) subdomains.','cd08640','DNA_pol_A_plastid_like'),(2603259,'gnl|CDD|176475',_binary 'DNA polymerase theta is a low-fidelity family A enzyme implicated in translesion synthesis and in somatic hypermutation.  DNA polymerase theta is a low-fidelity family A enzyme implicated in translesion synthesis (TLS) and in somatic hypermutation (SHM). DNA-dependent DNA polymerases can be classified in six main groups based upon phylogenetic relationships with E. coli polymerase I (classA), E. coli polymerase II (class B), E.coli polymerase III (class C), euryarchaaeota polymerase II (class D), human polymerase  beta (class x), E. coli UmuC/DinB and eukaryotic RAP 30/Xeroderma pigmentosum variant (class Y). Family A polymerase functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication. Pol theta is an exception among family A polymerases and generates processive single base substitutions. Family A polymerase are found primarily in organisms related to prokaryotes and include prokaryotic DNA polymerase I (pol I) ,mitochondrial polymerase delta, and several bacteriphage polymerases including those from odd-numbered phage (T3, T5, and T7). Prokaryotic Pol Is have two functional domains located on the same polypeptide; a 5\'-3\' polymerase and 5\'-3\' exonuclease. Pol I uses its 5\' nuclease activity to remove the ribonucleotide portion of newly synthesized Okazaki fragments and DNA polymerase activity to fill in the resulting gap. Polymerase theta mostly has amino-terminal helicase domain, a carboxy-terminal polymerase domain and an intervening space region.','cd08638','DNA_pol_A_theta'),(2603260,'gnl|CDD|176480',_binary 'Polymerase I functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication.  Family A polymerase functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication. DNA-dependent DNA polymerases can be classified in six main groups based upon phylogenetic relationships with E. coli polymerase I (classA), E. coli polymerase II (class B), E.coli polymerase III (class C), euryarchaaeota polymerase II (class D), human polymerase  beta (class x), E. coli UmuC/DinB and eukaryotic RAP 30/Xeroderma pigmentosum variant (class Y). Family A polymerase are found primarily in organisms related to prokaryotes and include prokaryotic DNA polymerase I ,mitochondrial polymerase delta, and several bacteriphage polymerases including those from odd-numbered phage (T3, T5, and T7). Prokaryotic Pol Is have two functional domains located on the same polypeptide; a 5\'-3\' polymerase and 5\'-3\' exonuclease. Pol I uses its 5\' nuclease activity to remove the ribonucleotide portion of newly synthesized Okazaki fragments and DNA polymerase activity to fill in the resulting gap. A combination of phylogenomic and signature sequence-based (or phonetic) approaches is used to understand the evolutionary relationships among bacteria. DNA polymerase I is one of the conserved proteins that is used to search for protein signatures. The structure of these polymerases resembles in overall morphology a cupped human right hand, with fingers (which bind an incoming nucleotide and interact with the single-stranded template), palm (which harbors the catalytic amino acid residues and also binds an incoming dNTP) and thumb (which binds double-stranded DNA) subdomains.','cd08643','DNA_pol_A_pol_I_B'),(2603261,'gnl|CDD|176651',_binary 'DEDDy 3\'-5\' exonuclease domain of Escherichia coli DNA polymerase I and similar bacterial family-A DNA polymerases.  Escherichia coli-like Polymerase I (Pol I), a subgroup of family-A DNA polymerases, contains a DEDDy-type DnaQ-like 3\'-5\' exonuclease domain in the same polypeptide chain as the polymerase domain. The exonuclease domain contains three conserved sequence motifs termed ExoI, ExoII and ExoIII, with a specific YX(3)D pattern at ExoIII. These motifs are clustered around the active site and contain four conserved acidic residues that serve as ligands for the two metal ions required for catalysis. The 3\'-5\' exonuclease domain of DNA polymerases has a fundamental role in reducing polymerase errors and is involved in proofreading activity. E. coli DNA Pol I is involved in genome replication but is not the main replicating enzyme. It is also implicated in DNA repair.','cd06139','DNA_polA_I_Ecoli_like_exo'),(2603262,'gnl|CDD|176654',_binary 'DEDDy 3\'-5\' exonuclease domain of Ribonuclease D and similar proteins.  Ribonuclease (RNase) D is a bacterial enzyme involved in the maturation of small stable RNAs and the 3\' maturation of tRNA. It contains a DEDDy-type DnaQ-like 3\'-5\' exonuclease domain possessing three conserved sequence motifs termed ExoI, ExoII and ExoIII, with a specific YX(3)D pattern at ExoIII. These motifs are clustered around the active site and contain four conserved acidic residues that serve as ligands for the two metal ions required for catalysis. In vivo, RNase D only becomes essential upon removal of other ribonucleases. Eukaryotic RNase D homologs include yeast Rrp6p, human PM/Scl-100, and the Drosophila melanogaster egalitarian protein.','cd06142','RNaseD_exo'),(2603263,'gnl|CDD|223426',_binary 'Ribonuclease D [Translation, ribosomal structure and biogenesis].','COG0349','Rnd'),(2603264,'gnl|CDD|340183',_binary 'Phage protein Gp52.  This domain of unknown function is found in Mycobacterium phage.','pfam17468','Gp52'),(2603265,'gnl|CDD|333878',_binary 'Calcineurin-like phosphoesterase.  This family includes a diverse range of phosphoesterases, including protein phosphoserine phosphatases, nucleotidases, sphingomyelin phosphodiesterases and 2\'-3\' cAMP phosphodiesterases as well as nucleases such as bacterial SbcD or yeast MRE11. The most conserved regions in this superfamily centre around the metal chelating residues.','pfam00149','Metallophos'),(2603266,'gnl|CDD|274169',_binary 'ribonucleoside-triphosphate reductase, adenosylcobalamin-dependent.  This model represents a group of adenosylcobalamin(B12)-dependent ribonucleotide reductases (RNR) related to the characterized species from Lactococcus leichmannii. RNR\'s are responsible for the conversion of the ribose sugar of RNA into the deoxyribose sugar of DNA. This is the rate-limiting step of DNA biosynthesis. Thus model identifies NrdJ enzymes only in cyanobacteria, lactococcus and certain bacteriophage. A separate model (TIGR02504) identifies a larger group of divergent B12-dependent RNR\'s. [Purines, pyrimidines, nucleosides, and nucleotides, 2\'-Deoxyribonucleotide metabolism].','TIGR02505','RTPR'),(2603267,'gnl|CDD|153085',_binary 'Class II ribonucleotide reductase, monomeric form.  Ribonucleotide reductase (RNR) catalyzes the reductive synthesis of deoxyribonucleotides from their corresponding ribonucleotides. It provides the precursors necessary for DNA synthesis. RNRs are separated into three classes based on their metallocofactor usage. Class I RNRs, found in eukaryotes, bacteria, and bacteriophage, use a diiron-tyrosyl radical. Class II RNRs, found in bacteria, bacteriophage, algae and archaea, use coenzyme B12 (adenosylcobalamin, AdoCbl). Class III RNRs, found in anaerobic bacteria, bacteriophage, and archaea, use an FeS cluster and S-adenosylmethionine to generate a glycyl radical. Many organisms have more than one class of RNR present in their genomes. All three RNRs have a ten-stranded alpha-beta barrel domain that is structurally similar to  the domain of PFL (pyruvate formate lyase). Class II RNRs are found in bacteria that can live under both aerobic and anaerobic conditions. Many, but not all members of this class, are found to be homodimers. This particular subfamily is found to be active as a monomer. Adenosylcobalamin interacts directly with an active site cysteine to form the reactive cysteine radical.','cd01676','RNR_II_monomer'),(2603268,'gnl|CDD|274168',_binary 'ribonucleoside-diphosphate reductase, adenosylcobalamin-dependent.  This model represents a group of adenosylcobalamin(B12)-dependent ribonucleotide reductases (Class II RNRs) related to the characterized species from Pyrococcus, Thermoplasma, Corynebacterium, and Deinococcus. RNR\'s are responsible for the conversion of the ribose sugar of RNA into the deoxyribose sugar of DNA. This is the rate-limiting step of DNA biosynthesis. This model identifies genes in a wide range of deeply branching bacteria. All are structurally related to the class I (non-heme iron dependent) RNRs. In most species this gene is known as NrdJ, while in mycobacteria it is called NrdZ. [Purines, pyrimidines, nucleosides, and nucleotides, 2\'-Deoxyribonucleotide metabolism].','TIGR02504','ribonucleotide_reductase'),(2603269,'gnl|CDD|153089',_binary 'Class II ribonucleotide reductase, dimeric form.  Ribonucleotide reductase (RNR) catalyzes the reductive synthesis of deoxyribonucleotides from their corresponding ribonucleotides. It provides the precursors necessary for DNA synthesis. RNRs are separated into three classes based on their metallocofactor usage. Class I RNRs, found in eukaryotes, bacteria, and bacteriophage, use a diiron-tyrosyl radical. Class II RNRs, found in bacteria, bacteriophage, algae and archaea, use coenzyme B12 (adenosylcobalamin, AdoCbl). Class III RNRs, found in anaerobic bacteria, bacteriophage, and archaea, use an FeS cluster and S-adenosylmethionine to generate a glycyl radical. Many organisms have more than one class of RNR present in their genomes. All three RNRs have a ten-stranded alpha-beta barrel domain that is structurally similar to the domain of PFL (pyruvate formate lyase). Class II RNRs are found in bacteria that can live under both aerobic and anaerobic conditions. Many, but not all members of this class are found to be homodimers. Adenosylcobalamin interacts directly with an active site cysteine to form the reactive cysteine radical.','cd02888','RNR_II_dimer'),(2603270,'gnl|CDD|335131',_binary 'Ribonucleotide reductase, barrel domain.','pfam02867','Ribonuc_red_lgC'),(2603271,'gnl|CDD|236330',_binary 'ribonucleotide-diphosphate reductase subunit alpha; Validated.','PRK08665','PRK08665'),(2603272,'gnl|CDD|235796',_binary 'ribonucleotide-diphosphate reductase subunit alpha; Validated.','PRK06406','PRK06406'),(2603273,'gnl|CDD|223287',_binary 'Ribonucleotide reductase, alpha subunit [Nucleotide transport and metabolism].','COG0209','NrdA'),(2603274,'gnl|CDD|236152',_binary 'ribonucleotide-diphosphate reductase subunit alpha; Validated.','PRK08115','PRK08115'),(2603275,'gnl|CDD|153088',_binary 'Class I ribonucleotide reductase.  Ribonucleotide reductase (RNR) catalyzes the reductive synthesis of deoxyribonucleotides from their corresponding ribonucleotides. It provides the precursors necessary for DNA synthesis. RNRs are separated into three classes based on their metallocofactor usage. Class I RNRs, found in eukaryotes, bacteria, and many viruses, use a diiron-tyrosyl radical. Class II RNRs, found in bacteria, bacteriophage, algae and archaea, use coenzyme B12 (adenosylcobalamin, AdoCbl). Class III RNRs, found in anaerobic bacteria, bacteriophages, and archaea, use an FeS cluster and S-adenosylmethionine to generate a glycyl radical. Many organisms have more than one class of RNR present in their genomes. All three RNRs have a ten-stranded alpha-beta barrel domain that is structurally similar to  the domain of PFL (pyruvate formate lyase). Class I RNR is oxygen-dependent and can be subdivided into classes Ia (eukaryotes, prokaryotes, viruses and phages) and Ib (which is found in prokaryotes only). It is a tetrameric enzyme of two alpha and two beta subunits; this model covers the major part of the alpha or large subunit, called R1 in class Ia and R1E in class Ib.','cd01679','RNR_I'),(2603276,'gnl|CDD|274170',_binary 'ribonucleoside-diphosphate reductase, alpha subunit.  This model represents the alpha (large) chain of the class I ribonucleotide reductase (RNR). RNR\'s are responsible for the conversion of the ribose sugar of RNA into the deoxyribose sugar of DNA. This is the rate-limiting step of DNA biosynthesis. Class I RNR\'s generate the required radical (on tyrosine) via a \'non-heme\' iron cofactor which resides in the beta (small) subunit. The alpha subunit contains the catalytic and allosteric regulatory sites. The mechanism of this enzyme requires molecular oxygen. E. Coli contains two versions of this enzyme which are regulated independently (NrdAB and NrdEF, where NrdA and NrdE are the large chains). Most organisms contain only one, but the application of the gene symbols NrdA and NrdE are somewhat arbitrary. This model identifies RNR\'s in diverse clades of bacteria, eukaryotes as well as numerous DNA viruses and phage. [Purines, pyrimidines, nucleosides, and nucleotides, 2\'-Deoxyribonucleotide metabolism].','TIGR02506','Ribonucleoside-diphosp...'),(2603277,'gnl|CDD|180772',_binary 'ribonucleotide reductase-like protein; Provisional.','PRK06948','PRK06948'),(2603278,'gnl|CDD|235828',_binary 'vitamin B12-dependent ribonucleotide reductase; Validated.','PRK06556','PRK06556'),(2603279,'gnl|CDD|153083',_binary 'Ribonucleotide reductase and Pyruvate formate lyase.  Ribonucleotide reductase (RNR) and pyruvate formate lyase (PFL) are believed to have diverged from a common ancestor. They have a structurally similar ten-stranded alpha-beta barrel domain that hosts the active site, and are radical enzymes. RNRs are found in all organisms and provide the only mechanism by which nucleotides are converted to deoxynucleotides. RNRs are separated into three classes based on their metallocofactor usage. Class I RNRs use a diiron-tyrosyl radical while Class II RNRs use coenzyme B12 (adenosylcobalamin, AdoCbl). Class III RNRs use an FeS cluster and S-adenosylmethionine to generate a glycyl radical. PFL, an essential enzyme in anaerobic bacteria, catalyzes the conversion of pyruvate and CoA to acteylCoA and formate in a mechanism that uses a glycyl radical.','cd00576','RNR_PFL'),(2603280,'gnl|CDD|181392',_binary 'ribonucleotide-diphosphate reductase subunit alpha; Validated.','PRK08332','PRK08332'),(2603283,'gnl|CDD|188230',_binary 'ribonucleoside-diphosphate reductase, alpha chain.  This model represents a small clade of ribonucleoside-diphosphate reductase, alpha chains which are sufficiently divergent from the usual Class I RNR alpha chains (NrdE or NrdA, TIGR02506) as to warrant their own model. The genes from Thermus thermophilus, Dichelobacter and Salinibacter are adjacent to the usual RNR beta chain. [Purines, pyrimidines, nucleosides, and nucleotides, 2\'-Deoxyribonucleotide metabolism].','TIGR02510','NrdE-prime'),(2603285,'gnl|CDD|128681',_binary 'zinc finger.','smart00400','ZnF_CHCC'),(2603286,'gnl|CDD|273595',_binary 'DNA primase, catalytic core.  Members of this family are DNA primase, a ubiquitous bacteria protein. Most members of this family contain nearly two hundred additional residues C-terminal to the region represented here, but conservation between species is poor and the C-terminal region was not included in the seed alignment. This protein contains a CHC2 zinc finger (pfam01807) and a Toprim domain (pfam01751). [DNA metabolism, DNA replication, recombination, and repair].','TIGR01391','DNA_primase'),(2603287,'gnl|CDD|280055',_binary 'CHC2 zinc finger.  This domain is principally involved in DNA binding in DNA primases.','pfam01807','zf-CHC2'),(2603288,'gnl|CDD|235551',_binary 'DNA primase; Validated.','PRK05667','dnaG'),(2603289,'gnl|CDD|223435',_binary 'DNA primase (bacterial type) [DNA replication, recombination, and repair].','COG0358','DnaG'),(2603292,'gnl|CDD|173779',_binary 'TOPRIM_primases: The topoisomerase-primase (TORPIM) nucleotidyl transferase/hydrolase domain found in the active site regions of bacterial DnaG-type primases and their homologs. Primases synthesize RNA primers for the initiation of DNA replication. DnaG type primases are often closely associated with DNA helicases in primosome assemblies.  The TOPRIM domain has two conserved motifs, one of which centers at a conserved glutamate and the other one at two conserved aspartates (DxD). This glutamate and two aspartates, cluster together to form a highly acid surface patch. The conserved glutamate may act as a general base in nucleotide polymerization by primases. The DXD motif may co-ordinate Mg2+, a cofactor required for full catalytic function. The prototypical bacterial primase. Escherichia coli DnaG is a single subunit enzyme.','cd01029','TOPRIM_primases'),(2603293,'gnl|CDD|214695',_binary 'topoisomerases, DnaG-type primases, OLD family nucleases and RecR proteins.','smart00493','TOPRIM'),(2603294,'gnl|CDD|338609',_binary 'Toprim-like.  This is a family or Toprim-like proteins.','pfam13155','Toprim_2'),(2603295,'gnl|CDD|173784',_binary 'TOPRIM_DnaG_primases: The topoisomerase-primase (TORPIM) nucleotidyl transferase/hydrolase domain found in the active site regions of proteins similar to Escherichia coli DnaG. Primases synthesize RNA primers for the initiation of DNA replication. DnaG type primases are often closely associated with DNA helicases in primosome assemblies.  The TOPRIM domain has two conserved motifs, one of which centers at a conserved glutamate and the other one at two conserved aspartates (DxD). This glutamate and two aspartates, cluster together to form a highly acid surface patch. The conserved glutamate may act as a general base in nucleotide polymerization by primases. The DXD motif may co-ordinate Mg2+, a cofactor required for full catalytic function.  E. coli DnaG is a single subunit enzyme.','cd03364','TOPRIM_DnaG_primases'),(2603297,'gnl|CDD|308543',_binary 'Recombination endonuclease VII.','pfam02945','Endonuclease_7'),(2603298,'gnl|CDD|177395',_binary 'recombination endonuclease VII; Provisional.','PHA02565','49'),(2603299,'gnl|CDD|340186',_binary 'Hypothetical phage protein Gp63.  This is a family of unknown function found in Mycobacterium.','pfam17471','Gp63'),(2603300,'gnl|CDD|340184',_binary 'Phage protein Gp68.  This is a domain of unknown function found in Mycobacterium phage.','pfam17469','Gp68'),(2603301,'gnl|CDD|238542',_binary 'GP4d_helicase is a homohexameric 5\'-3\' helicases. Helicases couple NTP hydrolysis to the unwinding of nucleic acid duplexes into their component strands.','cd01122','GP4d_helicase'),(2603302,'gnl|CDD|238484',_binary 'DnaB helicase C terminal domain. The hexameric helicase DnaB unwinds the DNA duplex at the  chromosome replication fork. Although the mechanism by which DnaB both couples ATP hydrolysis to translocation along DNA and denatures the duplex is unknown, a change in the quaternary structure of the protein involving dimerization of the N-terminal domain has been observed and may occur during the enzymatic cycle. This C-terminal domain contains an ATP-binding site and is therefore probably the site of ATP hydrolysis.','cd00984','DnaB_C'),(2603303,'gnl|CDD|316042',_binary 'AAA domain.  This AAA domain is found in a wide variety of presumed DNA repair proteins.','pfam13481','AAA_25'),(2603304,'gnl|CDD|223543',_binary 'RecA-superfamily ATPases implicated in signal transduction [Signal transduction mechanisms].','COG0467','RAD55'),(2603305,'gnl|CDD|168658',_binary 'replicative DNA helicase; Provisional.','PRK06749','PRK06749'),(2603306,'gnl|CDD|284219',_binary 'KaiC.  This family is in the P-loop NTPase superfamily and is found in archaea, bacteria and eukaryotes. More than one copy is sometimes found in each protein. This family includes KaiC, which is one of the Kai proteins among which direct protein-protein association may be a critical process in the generation of circadian rhythms in cyanobacteria.','pfam06745','ATPase'),(2603307,'gnl|CDD|238540',_binary 'RecA-like NTPases. This family includes the NTP binding domain of F1 and V1 H+ATPases, DnaB and related helicases as well as bacterial RecA and related eukaryotic and archaeal recombinases. This group also includes bacterial conjugation proteins and related DNA transfer proteins involved in type II and type IV secretion.','cd01120','RecA-like_NTPases'),(2603308,'gnl|CDD|223382',_binary 'Replicative DNA helicase [DNA replication, recombination, and repair].','COG0305','DnaB'),(2603309,'gnl|CDD|335478',_binary 'DnaB-like helicase C terminal domain.  The hexameric helicase DnaB unwinds the DNA duplex at the Escherichia coli chromosome replication fork. Although the mechanism by which DnaB both couples ATP hydrolysis to translocation along DNA and denatures the duplex is unknown, a change in the quaternary structure of the protein involving dimerization of the N-terminal domain has been observed and may occur during the enzymatic cycle. This C-terminal domain contains an ATP-binding site and is therefore probably the site of ATP hydrolysis.','pfam03796','DnaB_C'),(2603310,'gnl|CDD|334145',_binary 'alpha/beta hydrolase fold.  This catalytic domain is found in a very wide range of enzymes.','pfam00561','Abhydrolase_1'),(2603311,'gnl|CDD|223669',_binary 'Predicted hydrolases or acyltransferases (alpha/beta hydrolase superfamily) [General function prediction only].','COG0596','MhpC'),(2603312,'gnl|CDD|235135',_binary 'haloalkane dehalogenase; Provisional.','PRK03592','PRK03592'),(2603313,'gnl|CDD|184875',_binary 'acetoin dehydrogenase E2 subunit dihydrolipoyllysine-residue acetyltransferase; Provisional.','PRK14875','PRK14875'),(2603314,'gnl|CDD|274729',_binary '2-succinyl-6-hydroxy-2,4-cyclohexadiene-1-carboxylate synthase.  This protein catalyzes the formation of SHCHC, or (1 R,6 R)-2-succinyl-6-hydroxy-2,4-cyclohexadiene-1-carboxylate, by elmination of pyruvate from 2-succinyl-5-enolpyruvyl-6-hydroxy-3-cyclohexene-1-carboxylate (SEPHCHC). Note that SHCHC synthase activity previously was attributed to MenD, which in fact is SEPHCHC synthase. [Biosynthesis of cofactors, prosthetic groups, and carriers, Menaquinone and ubiquinone].','TIGR03695','menH_SHCHC'),(2603315,'gnl|CDD|211851',_binary 'pyrimidine utilization protein D.  This protein is observed in operons extremely similar to that characterized in E. coli K-12 responsible for the import and catabolism of pyrimidines, primarily uracil. This protein is a member of the hydrolase, alpha/beta fold family defined by pfam00067.','TIGR03611','RutD'),(2603316,'gnl|CDD|225176',_binary 'Lysophospholipase [Lipid metabolism].','COG2267','PldB'),(2603317,'gnl|CDD|338260',_binary 'Serine aminopeptidase, S33.  This domain is found in bacteria and eukaryotes and is approximately 110 amino acids in length. It is found in association with pfam00561. The majority of the members in this family carry the exopeptidase active-site residues of Ser-122, Asp-239 and His-269 as in UniProtKB:Q7ZWC2.','pfam12146','Hydrolase_4'),(2603318,'gnl|CDD|182637',_binary 'acyl-CoA esterase; Provisional.','PRK10673','PRK10673'),(2603319,'gnl|CDD|338449',_binary 'Alpha/beta hydrolase family.  This family contains alpha/beta hydrolase enzymes of diverse specificity.','pfam12697','Abhydrolase_6'),(2603320,'gnl|CDD|131480',_binary '3-oxoadipate enol-lactonase.  Members of this family are 3-oxoadipate enol-lactonase. Note that the substrate is known as 3-oxoadipate enol-lactone, 2-oxo-2,3-dihydrofuran-5-acetate, 4,5-Dihydro-5-oxofuran-2-acetate, and 5-oxo-4,5-dihydrofuran-2-acetate. The enzyme the catalyzes the fourth step in the protocatechuate degradation to beta-ketoadipate and then to succinyl-CoA and acetyl-CoA. 4-hydroxybenzoate, 3-hydroxybenzoate, and vanillate all can be converted in one step to protocatechuate. This enzyme also acts in catechol degradation. In genomes that catabolize both catechol and protocatechuate, two forms of this enzyme may be found. All members of the seed alignment for this model were chosen from within protocatechuate degradation operons of at least three genes of the pathway, from genomes with the complete pathway through beta-ketoadipate. [Energy metabolism, Other].','TIGR02427','b-ketoadipate_enol-lac...'),(2603321,'gnl|CDD|132386',_binary '2-hydroxy-6-oxo-6-phenylhexa-2,4-dienoate hydrolase.  Members of this family are 2-hydroxy-6-oxo-6-phenylhexa-2,4-dienoate hydrolase, or HOPD hydrolase, the BphD protein of biphenyl degradation. BphD acts on the product of ring meta-cleavage by BphC. Many species carrying bphC and bphD are capable of degrading polychlorinated biphenyls as well as biphenyl itself.','TIGR03343','2-hydroxy-6-oxo-6-phen...'),(2603322,'gnl|CDD|182555',_binary 'esterase; Provisional.','PRK10566','PRK10566'),(2603323,'gnl|CDD|236855',_binary '2-succinyl-6-hydroxy-2,4-cyclohexadiene-1-carboxylate synthase; Provisional.','PRK11126','PRK11126'),(2603324,'gnl|CDD|132100',_binary 'putative magnesium chelatase accessory protein.  Members of this family belong to the alpha/beta fold family hydrolases (pfam00561). Members are found in bacterial genomes if and only if they encoded for anoxygenic photosynthetic systems similar to that of Rhodobacter capsulatus and other alpha-Proteobacteria. Members often are encoded in the same operon as subunits of the protoporphyrin IX magnesium chelatase, and were once designated BchO. No literature supports a role as an actual subunit of magnesium chelatase, but an accessory role is possible, as suggested by placement by its probable hydrolase activity. [Energy metabolism, Photosynthesis].','TIGR03056','bchO_mg_che_rel'),(2603325,'gnl|CDD|224001',_binary 'Predicted acetyltransferases and hydrolases with the alpha/beta hydrolase fold [General function prediction only].','COG1075','LipA'),(2603326,'gnl|CDD|340144',_binary 'Gene 70 protein.  This family of unknown function is found in Mycobcterium phage and Actinobacteria.','pfam17429','GP70'),(2603327,'gnl|CDD|338454',_binary 'PD-(D/E)XK nuclease superfamily.  Members of this family belong to the PD-(D/E)XK nuclease superfamily.','pfam12705','PDDEXK_1'),(2603328,'gnl|CDD|187768',_binary 'CRISPR/Cas system-associated protein Cas4.  CRISPR (Clustered Regularly Interspaced Short Palindromic Repeats) and associated Cas proteins comprise a system for heritable host defense by prokaryotic cells against phage and other foreign DNA; Cas4 is RecB-like nuclease with three-cysteine C-terminal cluster.','cd09637','Cas4_I-A_I-B_I-C_I-D_II-B'),(2603329,'gnl|CDD|273040',_binary 'CRISPR-associated protein Cas4.  This model represents a family of proteins associated with CRISPR repeats in a wide set of prokaryotic genomes. This scope of this model has been broadened since it was first built to describe an archaeal subset only. The function of the protein is undefined. Distantly related proteins, excluded from this model, include ORFs from Mycobacteriophage D29 and Sulfolobus islandicus filamentous virus and a region of the Schizosaccharomyces pombe DNA replication helicase Dna2p.','TIGR00372','conserved_hypothetical...'),(2603331,'gnl|CDD|336486',_binary 'Transglycosylase-like domain.  This family of proteins are very likely to act as transglycosylase enzymes related to pfam00062 and pfam01464. These other families are weakly matched by this family, and include the known active site residues.','pfam06737','Transglycosylas'),(2603332,'gnl|CDD|340372',_binary 'Core lysozyme-like domain of resuscitation-promoting factor proteins.  Resuscitation-promoting factor (RPF) proteins, found in various (G+C)-rich Gram-positive bacteria, act to reactivate cultures from stationary phase. This protein shares elements of the structural core of lysozyme and related proteins. Furthermore, it shares a conserved active site glutamate which is required for activity, and has a polysaccharide binding cleft that corresponds to the peptidoglycan binding cleft of lysozyme. Muralytic activity of Rpf in Micrococcus luteus correlates with resuscitation, supporting a mechanism dependent on cleavage of peptidoglycan by RPF.','cd13925','RPF'),(2603333,'gnl|CDD|340370',_binary 'lytic transglycosylase-like domain of tail fiber-like proteins and similar domains.  These tail fiber-like proteins are multi-domain proteins that include a lytic transglycosylase (LT) domain. Members of the LT family include the soluble and insoluble membrane-bound LTs in bacteria, the LTs in bacteriophage lambda, and the eukaryotic \'goose-type\' lysozymes (goose egg-white lysozyme; GEWL). LTs catalyze the cleavage of the beta-1,4-glycosidic bond between N-acetylmuramic acid (MurNAc) and N-acetyl-D-glucosamine (GlcNAc), as do \'goose-type\' lysozymes. However, in addition to this, they also make a new glycosidic bond with the C6 hydroxyl group of the same muramic acid residue.','cd13402','LT_TF_like'),(2603335,'gnl|CDD|314021',_binary 'Protein of unknown function (DUF2786).  This family of proteins has no known function.','pfam10979','DUF2786'),(2603336,'gnl|CDD|292699',_binary 'Mycobacterial 2 TMS Phage Holin (M2 Hol) Family.  Phage_holin_8_1 is a family of two transmembrane mycobacteriophage holins, small hydrophobic proteins that effect lysis of host mycobacterial cells in conjunction with a mycobacteria-specific lysin, lysB. The product of lysB gene targets the mycobacteria outer membrane, the last barrier to bacteriophage release.','pfam16081','Phage_holin_7_1'),(2603337,'gnl|CDD|340054',_binary 'Gene 88 protein.  This family of unknown function is found in Bacteria.','pfam17338','GP88'),(2603340,'gnl|CDD|236092',_binary 'single-stranded DNA-binding protein; Provisional.','PRK07772','PRK07772'),(2603341,'gnl|CDD|273179',_binary 'single stranded DNA-binding protein (ssb).  All proteins in this family for which functions are known are single-stranded DNA binding proteins that function in many processes including transcription, repair, replication and recombination. Members encoded between genes for ribosomal proteins S6 and S18 should be annotated as primosomal protein N (PriB). Forms in gamma-protoeobacteria are much shorter and poorly recognized by this model. Additional members of this family include phage proteins. Eukaryotic members are organellar proteins. [DNA metabolism, DNA replication, recombination, and repair].','TIGR00621','Single-stranded_DNA-bi...'),(2603342,'gnl|CDD|239942',_binary 'SSB_OBF: A subfamily of OB folds similar to the OB fold of ssDNA-binding protein (SSB). SSBs bind with high affinity to ssDNA. They bind to and protect ssDNA intermediates during DNA metabolic pathways. All bacterial and eukaryotic SSBs studied to date oligomerize to bring together four OB folds in their active state. The majority (e.g. Escherichia coli SSB) have a single OB fold per monomer, which oligomerize to form a homotetramer. However, Deinococcus and Thermus SSB proteins have two OB folds per monomer, which oligomerize to form a homodimer. Mycobacterium tuberculosis SSB varies in quaternary structure from E. coli SSB. It forms a dimer of dimers having a unique dimer interface, which lends the protein greater stability. Included in this group are OB folds similar to Escherichia coli PriB. E.coli PriB is homodimeric with each monomer having a single OB fold. It does not appear to form higher order oligomers. PriB is an essential protein for the replication restart at forks that have stalled at sites of DNA damage. It also plays a role in the assembly of primosome during replication initiation at the bacteriophage phiX174 origin. PriB physically interacts with SSB and binds ssDNA with high affinity.','cd04496','SSB_OBF'),(2603343,'gnl|CDD|334074',_binary 'Single-strand binding protein family.  This family includes single stranded binding proteins and also the primosomal replication protein N (PriB). PriB forms a complex with PriA, PriC and ssDNA.','pfam00436','SSB'),(2603344,'gnl|CDD|223702',_binary 'Single-stranded DNA-binding protein [DNA replication, recombination, and repair].','COG0629','Ssb'),(2603345,'gnl|CDD|235626',_binary 'hypothetical protein; Validated.','PRK05853','PRK05853'),(2603346,'gnl|CDD|168659',_binary 'single-stranded DNA-binding protein; Provisional.','PRK06751','PRK06751'),(2603347,'gnl|CDD|180915',_binary 'single-stranded DNA-binding protein; Provisional.','PRK07275','PRK07275'),(2603348,'gnl|CDD|168660',_binary 'single-stranded DNA-binding protein; Validated.','PRK06752','PRK06752'),(2603349,'gnl|CDD|180517',_binary 'single-stranded DNA-binding protein; Provisional.','PRK06293','PRK06293'),(2603350,'gnl|CDD|184284',_binary 'single-stranded DNA-binding protein; Provisional.','PRK13732','PRK13732'),(2603351,'gnl|CDD|180777',_binary 'single-stranded DNA-binding protein; Provisional.','PRK06958','PRK06958'),(2603352,'gnl|CDD|235585',_binary 'single-stranded DNA-binding protein; Provisional.','PRK05733','PRK05733'),(2603353,'gnl|CDD|236362',_binary 'single-stranded DNA-binding protein; Provisional.','PRK09010','PRK09010'),(2603354,'gnl|CDD|136097',_binary 'single-stranded DNA-binding protein; Provisional.','PRK06863','PRK06863'),(2603355,'gnl|CDD|180986',_binary 'single-stranded DNA-binding protein; Provisional.','PRK07459','PRK07459'),(2603356,'gnl|CDD|181549',_binary 'single-stranded DNA-binding protein; Provisional.','PRK08763','PRK08763'),(2603357,'gnl|CDD|180914',_binary 'single-stranded DNA-binding protein; Provisional.','PRK07274','PRK07274'),(2603358,'gnl|CDD|236275',_binary 'single-stranded DNA-binding protein; Provisional.','PRK08486','PRK08486'),(2603359,'gnl|CDD|235782',_binary 'single-stranded DNA-binding protein; Provisional.','PRK06341','PRK06341'),(2603360,'gnl|CDD|239935',_binary 'ExoVII_LU_OBF: A subfamily of OB folds corresponding to the N-terminal OB-fold domain of Escherichia coli exodeoxyribonuclease VII (ExoVII) large subunit. E. coli ExoVII is composed of two non-identical subunits. E. coli ExoVII is a single-strand-specific exonuclease which degrades ssDNA from both 3-prime and 5-prime ends. ExoVII plays a role in methyl-directed mismatch repair in vivo. ExoVII may also guard the genome from mutagenesis by removing excess ssDNA, since the build up of ssDNA would lead to SOS induction and PolIV-dependent mutagenesis.','cd04489','ExoVII_LU_OBF'),(2603361,'gnl|CDD|169261',_binary 'single-stranded DNA-binding protein; Provisional.','PRK08182','PRK08182'),(2603362,'gnl|CDD|135984',_binary 'single-stranded DNA-binding protein; Provisional.','PRK06642','PRK06642'),(2603363,'gnl|CDD|338926',_binary 'OB-fold nucleic acid binding domain.  This family contains OB-fold domains that bind to nucleic acids.','pfam13742','tRNA_anti_2'),(2603364,'gnl|CDD|272979',_binary 'exodeoxyribonuclease VII, large subunit.  This family consist of exodeoxyribonuclease VII, large subunit XseA which catalyses exonucleolytic cleavage in either the 5\'->3\' or 3\'->5\' direction to yield 5\'-phosphomononucleotides. Exonuclease VII consists of one large subunit and four small subunits. [DNA metabolism, Degradation of DNA].','TIGR00237','exodeoxyribonuclease_V...'),(2603365,'gnl|CDD|234714',_binary 'exodeoxyribonuclease VII large subunit; Reviewed.','PRK00286','xseA'),(2603366,'gnl|CDD|334496',_binary 'OB-fold nucleic acid binding domain.  This family contains OB-fold domains that bind to nucleic acids. The family includes the anti-codon binding domain of lysyl, aspartyl, and asparaginyl -tRNA synthetases (see pfam00152). Aminoacyl-tRNA synthetases catalyze the addition of an amino acid to the appropriate tRNA molecule EC:6.1.1.-. This family also includes part of RecG helicase involved in DNA repair. Replication factor A is a hetero-trimeric complex, that contains a subunit in this family. This domain is also found at the C-terminus of bacterial DNA polymerase III alpha chain.','pfam01336','tRNA_anti-codon'),(2603367,'gnl|CDD|334153',_binary 'Clp protease.  The Clp protease has an active site catalytic triad. In E. coli Clp protease, ser-111, his-136 and asp-185 form the catalytic triad. Some members have lost active site residues and are therefore inactive, some contain one or two large insertions.','pfam00574','CLP_protease'),(2603368,'gnl|CDD|132927',_binary 'Caseinolytic protease (ClpP) is an ATP-dependent, highly conserved serine protease.  Clp protease (caseinolytic protease; ClpP; Peptidase S14) is a highly conserved serine protease present throughout in bacteria and eukaryota, but seems to be absent in archaea, mollicutes and some fungi. This subfamily only contains bacterial sequences. Clp proteases are involved in a number of cellular processes such as degradation of misfolded proteins, regulation of short-lived proteins and housekeeping removal of dysfunctional proteins. They are also implicated in the control of cell growth, targeting DNA-binding protein from starved cells. ClpP has also been linked to the tight regulation of virulence genes in the pathogens Listeria monocytogenes and Salmonella typhimurium. This enzyme belong to the family of ATP-dependent proteases; the functional Clp protease is comprised of two components: a proteolytic component and one of several regulatory ATPase components, both of which are required for effective levels of protease activity in the presence of ATP, although the proteolytic subunit alone does possess some catalytic activity. Active site consists of the triad Ser, His and Asp; some members have lost all of these active site residues and are therefore inactive, while others may have one or two large insertions. ClpP seems to prefer hydrophobic or non-polar residues at P1 or P1\' positions in its substrate. The protease exists as a tetradecamer made up of two heptameric rings stacked back-to-back such that the catalytic triad of each subunit is located at the interface between three monomers, thus making oligomerization essential for function.','cd07016','S14_ClpP_1'),(2603369,'gnl|CDD|223811',_binary 'Protease subunit of ATP-dependent Clp proteases [Posttranslational modification, protein turnover, chaperones / Intracellular trafficking and secretion].','COG0740','ClpP'),(2603370,'gnl|CDD|178955',_binary 'ATP-dependent Clp protease proteolytic subunit; Reviewed.','PRK00277','clpP'),(2603371,'gnl|CDD|132924',_binary 'Caseinolytic protease (ClpP) is an ATP-dependent, highly conserved serine protease.  Clp protease (caseinolytic protease; ClpP; Peptidase S14) is a highly conserved serine protease present throughout in bacteria and eukaryota, but seems to be absent in archaea, mollicutes and some fungi. Clp proteases are involved in a number of cellular processes such as degradation of misfolded proteins, regulation of short-lived proteins and housekeeping removal of dysfunctional proteins. Additionally, they are implicated in the control of cell growth, targeting DNA-binding protein from starved cells. ClpP has also been linked to the tight regulation of virulence genes in the pathogens Listeria monocytogenes and Salmonella typhimurium. This enzyme belong to the family of ATP-dependent proteases; the functional Clp protease is comprised of two components: a proteolytic component and one of several regulatory ATPase components, both of which are required for effective levels of protease activity in the presence of ATP, although the proteolytic subunit alone does possess some catalytic activity. Active site consists of the triad Ser, His and Asp; some members have lost all of these active site residues and are therefore inactive, while others may have one or two large insertions. ClpP seems to prefer hydrophobic or non-polar residues at P1 or P1\' positions in its substrate. The protease exists as a tetradecamer made up of two heptameric rings stacked back-to-back such that the catalytic triad of each subunit is located at the interface between three monomers, thus making oligomerization essential for function.','cd07013','S14_ClpP'),(2603372,'gnl|CDD|132928',_binary 'Caseinolytic protease (ClpP) is an ATP-dependent, highly conserved serine protease.  Clp protease (caseinolytic protease; ClpP; Peptidase S14) is a highly conserved serine protease present throughout in bacteria and eukaryota, but seems to be absent in archaea, mollicutes and some fungi. Clp proteases are involved in a number of cellular processes such as degradation of misfolded proteins, regulation of short-lived proteins and housekeeping removal of dysfunctional proteins. They are also implicated in the control of cell growth, targeting DNA-binding protein from starved cells. ClpP has also been linked to the tight regulation of virulence genes in the pathogens Listeria monocytogenes and Salmonella typhimurium. This enzyme belong to the family of ATP-dependent proteases; the functional Clp protease is comprised of two components: a proteolytic component and one of several regulatory ATPase components, both of which are required for effective levels of protease activity in the presence of ATP, although the proteolytic subunit alone does possess some catalytic activity. Active site consists of the triad Ser, His and Asp; some members have lost all of these active site residues and are therefore inactive, while others may have one or two large insertions. ClpP seems to prefer hydrophobic or non-polar residues at P1 or P1\' positions in its substrate. The protease exists as a tetradecamer made up of two heptameric rings stacked back-to-back such that the catalytic triad of each subunit is located at the interface between three monomers, thus making oligomerization essential for function.','cd07017','S14_ClpP_2'),(2603373,'gnl|CDD|237133',_binary 'ATP-dependent Clp protease proteolytic subunit; Reviewed.','PRK12553','PRK12553'),(2603374,'gnl|CDD|188055',_binary 'ATP-dependent Clp endopeptidase, proteolytic subunit ClpP.  This model for the proteolytic subunit ClpP has been rebuilt to a higher stringency. In every bacterial genome with the ClpXP machine, a ClpP protein will be found that scores well with this model. In general, this ClpP member will be encoded adjacent to the clpX gene, as were all examples used in the seed alignment. A large fraction of genomes have one or more additional ClpP paralogs, sometimes encoded nearby and sometimes elsewhere. The stringency of the trusted cutoff used here excludes the more divergent ClpP paralogs from being called authentic ClpP by this model. [Protein fate, Degradation of proteins, peptides, and glycopeptides].','TIGR00493','ATP-dependent_Clp_prot...'),(2603375,'gnl|CDD|184722',_binary 'ATP-dependent Clp protease proteolytic subunit; Provisional.','PRK14514','PRK14514'),(2603376,'gnl|CDD|237742',_binary 'ATP-dependent Clp protease proteolytic subunit; Provisional.','PRK14513','PRK14513'),(2603377,'gnl|CDD|214340',_binary 'ATP-dependent Clp protease proteolytic subunit.','CHL00028','clpP'),(2603378,'gnl|CDD|139060',_binary 'ATP-dependent Clp protease proteolytic subunit; Reviewed.','PRK12551','PRK12551'),(2603379,'gnl|CDD|132923',_binary 'Caseinolytic protease (ClpP) is an ATP-dependent protease.  Clp protease (caseinolytic protease; ClpP; endopeptidase Clp; Peptidase S14; ATP-dependent protease, ClpAP)-like enzymes are highly conserved serine proteases and belong to the ClpP/Crotonase superfamily. Included in this family are Clp proteases that are involved in a number of cellular processes such as degradation of misfolded proteins, regulation of short-lived proteins and housekeeping removal of dysfunctional proteins. They are also implicated in the control of cell growth, targeting DNA-binding protein from starved cells. The functional Clp protease is comprised of two components: a proteolytic component and one of several regulatory ATPase components, both of which are required for effective levels of protease activity in the presence of ATP. Active site consists of the triad Ser, His and Asp, preferring hydrophobic or non-polar residues at P1 or P1\' positions. The protease exists as a tetradecamer made up of two heptameric rings stacked back-to-back such that the catalytic triad of each subunit is located at the interface between three monomers, thus making oligomerization essential for function. Another family included in this class of enzymes is the signal peptide peptidase A (SppA; S49) which is involved in the cleavage of signal peptides after their removal from the precursor proteins by signal peptidases. Mutagenesis studies suggest that the catalytic center of SppA comprises a Ser-Lys dyad and not the usual Ser-His-Asp catalytic triad found in the majority of serine proteases. In addition to the carboxyl-terminal protease domain that is conserved in all the S49 family members, the E. coli SppA contains an amino-terminal domain. Others, including sohB peptidase, protein C, protein 1510-N and archaeal signal peptide peptidase, do not contain the amino-terminal domain. The third family included in this hierarchy is nodulation formation efficiency D (NfeD) which is a membrane-bound Clp-class protease and only found in bacteria and archaea. Majority of the NfeD genomes have been shown to possess operons containing a homologous NfeD/stomatin gene pair, causing NfeD to be previously named stomatin operon partner protein (STOPP). NfeD homologs can be divided into two groups: long and short forms. Long-form homologs have a putative ClpP-class serine protease domain while the short form homologs do not. Downstream from the ClpP-class domain is the so-called NfeD or DUF107 domain. N-terminal region of the NfeD homolog PH1510 from Pyrococcus horikoshii has been shown to possess serine protease activity having a Ser-Lys catalytic dyad.','cd00394','Clp_protease_like'),(2603380,'gnl|CDD|237741',_binary 'ATP-dependent Clp protease proteolytic subunit; Provisional.','PRK14512','PRK14512'),(2603381,'gnl|CDD|223689',_binary 'Periplasmic serine proteases (ClpP class) [Posttranslational modification, protein turnover, chaperones / Intracellular trafficking and secretion].','COG0616','SppA'),(2603384,'gnl|CDD|315955',_binary 'HNH endonuclease.  This is a zinc-binding loop of Fold group 7 as found in endo-deoxy-ribonucleases and HNH nucleases.','pfam13392','HNH_3'),(2603386,'gnl|CDD|335922',_binary 'Phage portal protein.  Bacteriophage portal proteins form a dodecamer and is located at a five-fold vertex of the viral capsid. The portal complex forms a channel through which the viral DNA is packaged into the capsid, and exits during infection. The portal protein is though to rotate during DNA packaging. Portal proteins from different phage show little sequence homology, so this family does not represent all portal proteins.','pfam04860','Phage_portal'),(2603387,'gnl|CDD|273677',_binary 'phage portal protein, HK97 family.  This model represents one of several distantly related families of phage portal protein. This protein forms a hole, or portal, that enables DNA passage during packaging and ejection. It also forms the junction between the phage head (capsid) and the tail proteins. It functions as a dodecamer of a single polypeptide of average mol. wt. of 40-90 KDa. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR01537','portal_protein'),(2603388,'gnl|CDD|227039',_binary 'Phage-related protein [Function unknown].','COG4695','COG4695'),(2603391,'gnl|CDD|236476',_binary 'recombinase A; Provisional.','PRK09354','recA'),(2603392,'gnl|CDD|238483',_binary 'RecA is a  bacterial enzyme which has roles in homologous recombination, DNA repair, and the induction of the SOS response.  RecA couples ATP hydrolysis to DNA strand exchange.','cd00983','recA'),(2603393,'gnl|CDD|162659',_binary 'protein RecA.  This model describes orthologs of the recA protein. RecA promotes hybridization of homolgous regions of DNA. A segment of ssDNA can be hybridized to another ssDNA region, or to a dsDNA region. ATP is hydrolyzed in the process. Part of the SOS respones, it is regulated by LexA via autocatalytic cleavage. [DNA metabolism, DNA replication, recombination, and repair].','TIGR02012','Protein_RecA'),(2603394,'gnl|CDD|333883',_binary 'recA bacterial DNA recombination protein.  RecA is a DNA-dependent ATPase and functions in DNA repair systems. RecA protein catalyzes an ATP-dependent DNA strand-exchange reaction that is the central step in the repair of dsDNA breaks by homologous recombination.','pfam00154','RecA'),(2603395,'gnl|CDD|77219',_binary 'DNA recombination protein RecA; Reviewed.','PRK09519','recA'),(2603397,'gnl|CDD|223544',_binary 'RecA/RadA recombinase [DNA replication, recombination, and repair].','COG0468','RecA'),(2603398,'gnl|CDD|238687',_binary 'RecA is a  bacterial enzyme which has roles in homologous recombination, DNA repair, and the induction of the SOS response.  RecA couples ATP hydrolysis to DNA strand exchange. While prokaryotes have a single RecA protein, eukaryotes have multiple RecA homologs such as Rad51, DMC1 and Rad55/57.  Archaea have the RecA-like homologs radA and radB.','cd01393','recA_like'),(2603413,'gnl|CDD|163593',_binary 'KaiC domain protein, PAE1156 family.  Members of this protein family are archaeal single-domain KaiC_related proteins, homologous to the Cyanobacterial circadian clock cycle protein KaiC, an autokinase/autophosphorylase that has two copies of the domain.','TIGR03881','KaiC_arch_4'),(2603415,'gnl|CDD|214640',_binary 'ATPases associated with a variety of cellular activities.  AAA - ATPases associated with a variety of cellular activities. This profile/alignment only detects a fraction of this vast family. The poorly conserved N-terminal helix is missing from the alignment.','smart00382','AAA'),(2603417,'gnl|CDD|236994',_binary 'DNA repair protein RadA; Provisional.','PRK11823','PRK11823'),(2603418,'gnl|CDD|238541',_binary 'Sms (bacterial radA) DNA repair protein. This protein is not related to archael radA any more than is to other RecA-like NTPases. Sms has a role in recombination and recombinational repair and is responsible for the stabilization or processing of branched DNA molecules.','cd01121','Sms'),(2603419,'gnl|CDD|223993',_binary 'Predicted ATP-dependent serine protease [Posttranslational modification, protein turnover, chaperones].','COG1066','Sms'),(2603420,'gnl|CDD|316040',_binary 'AAA domain.  This AAA domain is found in a wide variety of presumed phage proteins.','pfam13479','AAA_24'),(2603424,'gnl|CDD|273067',_binary 'DNA repair protein RadA.  The gene protuct codes for a probable ATP-dependent protease involved in both DNA repair and degradation of proteins, peptides, glycopeptides. Also known as sms. Residues 11-28 of the SEED alignment contain a putative Zn binding domain. Residues 110-117 of the seed contain a putative ATP binding site both documented in Haemophilus (SP:P45266) and in Listeria monocytogenes (SP:Q48761) . for E.coli see ( J. BACTERIOL. 178:5045-5048(1996)). [DNA metabolism, DNA replication, recombination, and repair].','TIGR00416','DNA_repair_protein_Rad...'),(2603431,'gnl|CDD|333874',_binary 'Beta-lactamase.  This family appears to be distantly related to pfam00905 and PF00768 D-alanyl-D-alanine carboxypeptidase.','pfam00144','Beta-lactamase'),(2603432,'gnl|CDD|224594',_binary 'Beta-lactamase class C and other penicillin binding proteins [Defense mechanisms].','COG1680','AmpC'),(2603433,'gnl|CDD|236894',_binary 'beta-lactamase/D-alanine carboxypeptidase; Provisional.','PRK11289','ampC'),(2603434,'gnl|CDD|171868',_binary 'D-aminopeptidase; Reviewed.','PRK13128','PRK13128'),(2603435,'gnl|CDD|236732',_binary 'beta-lactam binding protein AmpH; Provisional.','PRK10662','PRK10662'),(2603436,'gnl|CDD|337647',_binary 'Phage-related minor tail protein.  Members of this family are found in putative phage tail tape measure proteins.','pfam10145','PhageMin_Tail'),(2603437,'gnl|CDD|273790',_binary 'phage tail tape measure protein, TP901 family, core region.  This model represents a reasonably well conserved core region of a family of phage tail proteins. The member from phage TP901-1 was characterized as a tail length tape measure protein in that a shortened form of the protein leads to phage with proportionately shorter tails. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR01760','COG5283:_Phage-related...'),(2603440,'gnl|CDD|311933',_binary 'PE-PPE domain.  This domain is found C terminal to the PE (pfam00934) and PPE (pfam00823) domains. The secondary structure of this domain is predicted to be a mixture of alpha helices and beta strands.','pfam08237','PE-PPE'),(2603441,'gnl|CDD|239274',_binary 'NrdH-redoxin (NrdH) family; NrdH is a small monomeric protein with a conserved redox active CXXC motif within a TRX fold, characterized by a glutaredoxin (GRX)-like sequence and TRX-like activity profile. In vitro, it displays protein disulfide reductase activity that is dependent on TRX reductase, not glutathione (GSH). It is part of the NrdHIEF operon, where NrdEF codes for class Ib ribonucleotide reductase (RNR-Ib), an efficient enzyme at low oxygen levels. Under these conditions when GSH is mostly conjugated to spermidine, NrdH can still function and act as a hydrogen donor for RNR-Ib. It has been suggested that the NrdHEF system may be the oldest RNR reducing system, capable of functioning in a microaerophilic environment, where GSH was not yet available. NrdH from Corynebacterium ammoniagenes can form domain-swapped dimers, although it is unknown if this happens in vivo. Domain-swapped dimerization, which results in the blocking of the TRX reductase binding site, could be a mechanism for regulating the oxidation state of the protein.','cd02976','NrdH'),(2603442,'gnl|CDD|131249',_binary 'Glutaredoxin-like protein NrdH.  NrdH-redoxin is a representative of a class of small redox proteins that contain a conserved CXXC motif and are characterized by a glutaredoxin-like amino acid sequence and thioredoxin-like activity profile. Unlike other the glutaredoxins to which it is most closely related, NrdH aparrently does not interact with glutathione/glutathione reductase, but rather with thioredoxin reductase to catalyze the reduction of ribonucleotide reductase.','TIGR02194','Glutaredoxin-like_prot...'),(2603443,'gnl|CDD|274027',_binary 'Glutaredoxin-like protein, YruB-family.  This glutaredoxin-like protein family contains the conserved CxxC motif and includes the Clostridium pasteurianum protein YruB which has been cloned from a rubredoxin operon. Somewhat related to NrdH, it is unknown whether this protein actually interacts with glutathione/glutathione reducatase, or, like NrdH, some other reductant system.','TIGR02196','Gene_56_protein'),(2603444,'gnl|CDD|182381',_binary 'glutaredoxin-like protein; Provisional.','PRK10329','PRK10329'),(2603445,'gnl|CDD|223767',_binary 'Glutaredoxin and related proteins [Posttranslational modification, protein turnover, chaperones].','COG0695','GrxC'),(2603446,'gnl|CDD|334091',_binary 'Glutaredoxin.','pfam00462','Glutaredoxin'),(2603447,'gnl|CDD|239510',_binary 'Glutaredoxin (GRX) family, GRX bacterial class 1 and 3 (b_1_3)-like subfamily; composed of bacterial GRXs, approximately 10 kDa in size, and proteins containing a GRX or GRX-like domain. GRX is a glutathione (GSH) dependent reductase, catalyzing the disulfide reduction of target proteins such as ribonucleotide reductase. It contains a redox active CXXC motif in a TRX fold and uses a similar dithiol mechanism employed by TRXs for intramolecular disulfide bond reduction of protein substrates. Unlike TRX, GRX has preference for mixed GSH disulfide substrates, in which it uses a monothiol mechanism where only the N-terminal cysteine is required. The flow of reducing equivalents in the GRX system goes from NADPH -> GSH reductase -> GSH -> GRX -> protein substrates. By altering the redox state of target proteins, GRX is involved in many cellular functions including DNA synthesis, signal transduction and the defense against oxidative stress. Different classes are known including  E. coli GRX1 and GRX3, which are members of this subfamily.','cd03418','GRX_GRXb_1_3_like'),(2603448,'gnl|CDD|131255',_binary 'Glutaredoxin-like protein.  This family of glutaredoxin-like proteins is limited to the Actinobacteria and contains the conserved CxxC motif.','TIGR02200','conserved_hypothetical...'),(2603449,'gnl|CDD|274017',_binary 'Glutaredoxin, GrxC family.  Glutaredoxins are thioltransferases (disulfide reductases) which utilize glutathione and NADPH as cofactors. Oxidized glutathione is regenerated by glutathione reductase. Together these components compose the glutathione system. Glutaredoxins utilize the CXXC motif common to thioredoxins and are involved in multiple cellular processes including protection from redox stress, reduction of critical enzymes such as ribonucleotide reductase and the generation of reduced sulfur for iron sulfur cluster formation. Glutaredoxins are capable of reduction of mixed disulfides of glutathione as well as the formation of glutathione mixed disulfides. This family of glutaredoxins includes the E. coli protein GrxC (Grx3) which appears to have a secondary role in reducing ribonucleotide reductase (in the absence of GrxA) possibly indicating a role in the reduction of other protein disulfides. [Energy metabolism, Electron transport].','TIGR02181','GRX_bact'),(2603450,'gnl|CDD|239275',_binary 'Arsenate Reductase (ArsC) family; composed of TRX-fold arsenic reductases and similar proteins including the transcriptional regulator, Spx. ArsC catalyzes the reduction of arsenate [As(V)] to arsenite [As(III)], using reducing equivalents derived from glutathione (GSH) via glutaredoxin (GRX), through a single catalytic cysteine. This family of predominantly bacterial enzymes is unrelated to two other families of arsenate reductases which show similarity to low-molecular-weight acid phosphatases and phosphotyrosyl phosphatases. Spx is a general regulator that exerts negative and positive control over transcription initiation by binding to the C-terminal domain of the alpha subunit of RNA polymerase.','cd02977','ArsC_family'),(2603451,'gnl|CDD|239017',_binary 'Glutaredoxin (GRX) family; composed of GRX, approximately 10 kDa in size, and proteins containing a GRX or GRX-like domain. GRX is a glutathione (GSH) dependent reductase, catalyzing the disulfide reduction of target proteins such as ribonucleotide reductase. It contains a redox active CXXC motif in a TRX fold and uses a similar dithiol mechanism employed by TRXs for intramolecular disulfide bond reduction of protein substrates. Unlike TRX, GRX has preference for mixed GSH disulfide substrates, in which it uses a monothiol mechanism where only the N-terminal cysteine is required. The flow of reducing equivalents in the GRX system goes from NADPH -> GSH reductase -> GSH -> GRX -> protein substrates. By altering the redox state of target proteins, GRX is involved in many cellular functions including DNA synthesis, signal transduction and the defense against oxidative stress. Different classes are known including human GRX1 and GRX2, as well as E. coli GRX1 and GRX3, which are members of this family. E. coli GRX2, however, is a 24-kDa protein that belongs to the GSH S-transferase (GST) family.','cd02066','GRX_family'),(2603452,'gnl|CDD|224311',_binary 'Arsenate reductase and related proteins, glutaredoxin family [Inorganic ion transport and metabolism].','COG1393','ArsC'),(2603453,'gnl|CDD|239327',_binary 'Glutaredoxin (GRX) family, PRX5 hybrid subfamily; composed of hybrid proteins containing peroxiredoxin (PRX) and GRX domains, which is found in some pathogenic bacteria and cyanobacteria. PRXs are thiol-specific antioxidant (TSA) proteins that confer a protective antioxidant role in cells through their peroxidase activity in which hydrogen peroxide, peroxynitrate, and organic hydroperoxides are reduced and detoxified using reducing equivalents derived from either thioredoxin, glutathione, trypanothione and AhpF. GRX is a glutathione (GSH) dependent reductase, catalyzing the disulfide reduction of target proteins. PRX-GRX hybrid proteins from Haemophilus influenza and Neisseria meningitis exhibit GSH-dependent peroxidase activity. The flow of reducing equivalents in the catalytic cycle of the hybrid protein goes from NADPH -> GSH reductase -> GSH -> GRX domain of hybrid -> PRX domain of hybrid -> peroxide substrate.','cd03029','GRX_hybridPRX5'),(2603455,'gnl|CDD|239325',_binary 'Glutaredoxin (GRX) family, Dishevelled, Egl-10, and Pleckstrin (DEP) subfamily; composed of uncharacterized proteins containing a GRX domain and additional domains DEP and DUF547, both of which have unknown functions.  GRX is a glutathione (GSH) dependent reductase containing a redox active CXXC motif in a TRX fold. It has preference for mixed GSH disulfide substrates, in which it uses a monothiol mechanism where only the N-terminal cysteine is required. By altering the redox state of target proteins, GRX is involved in many cellular functions.','cd03027','GRX_DEP'),(2603456,'gnl|CDD|131245',_binary 'Glutaredoxin-family domain.  This C-terminal domain with homology to glutaredoxin is fused to an N-terminal peroxiredoxin-like domain.','TIGR02190','probable_peroxiredoxin...'),(2603458,'gnl|CDD|314613',_binary 'Lsr2.  Lsr2 is a small, basic DNA-bridging protein present in Mycobacterium and related actinomycetes. It is a functional homolog of the H-NS-like proteins. H-NS proteins play a role in nucleoid organisation and also function as a pleiotropic regulator of gene expression.','pfam11774','Lsr2'),(2603459,'gnl|CDD|234698',_binary 'site-specific tyrosine recombinase XerC; Reviewed.','PRK00236','xerC'),(2603460,'gnl|CDD|274042',_binary 'tyrosine recombinase XerC.  The phage integrase family describes a number of recombinases with tyrosine active sites that transiently bind covalently to DNA. Many are associated with mobile DNA elements, including phage, transposons, and phase variation loci. This model represents XerC, one of two closely related chromosomal proteins along with XerD (TIGR02225). XerC and XerD are site-specific recombinases which help resolve chromosome dimers to monomers for cell division after DNA replication. In species with a large chromosome and homologs of XerC on other replicons, the chomosomal copy was preferred for building this model. This model does not detect all XerC, as some apparent XerC examples score in the gray zone between trusted (450) and noise (410) cutoffs, along with some XerD examples. XerC and XerD interact with cell division protein FtsK. [DNA metabolism, DNA replication, recombination, and repair].','TIGR02224','Tyrosine_recombinase_XerC'),(2603461,'gnl|CDD|271175',_binary 'DNA breaking-rejoining enzymes, C-terminal catalytic domain.  The DNA breaking-rejoining enzyme superfamily includes type IB topoisomerases and tyrosine based site-specific recombinases (integrases) that share the same fold in their catalytic domain containing conserved active site residues. The best-studied members of this diverse superfamily include Human topoisomerase I, the bacteriophage lambda integrase, the bacteriophage P1 Cre recombinase, the yeast Flp recombinase, and the bacterial XerD/C recombinases. Their overall reaction mechanism is essentially identical and involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. The enzymes differ in that topoisomerases cleave and then rejoin the same 5\' and 3\' termini, whereas a site-specific recombinase transfers a 5\' hydroxyl generated by recombinase cleavage to a new 3\' phosphate partner located in a different duplex region. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd00397','DNA_BRE_C'),(2603462,'gnl|CDD|227308',_binary 'Site-specific recombinase XerD [DNA replication, recombination, and repair].','COG4974','XerD'),(2603463,'gnl|CDD|274043',_binary 'tyrosine recombinase XerD.  The phage integrase family describes a number of recombinases with tyrosine active sites that transiently bind covalently to DNA. Many are associated with mobile DNA elements, including phage, transposons, and phase variation loci. This model represents XerD, one of two closely related chromosomal proteins along with XerC (TIGR02224). XerC and XerD are site-specific recombinases which help resolve chromosome dimers to monomers for cell division after DNA replication. In species with a large chromosome and with homologs of XerD on other replicons, the chomosomal copy was preferred for building this model. This model does not detect all XerD, as some apparent XerD examples score below the trusted and noise cutoff scores. XerC and XerD interact with cell division protein FtsK. [DNA metabolism, DNA replication, recombination, and repair].','TIGR02225','Tyrosine_recombinase_XerD'),(2603464,'gnl|CDD|234713',_binary 'site-specific tyrosine recombinase XerD; Reviewed.','PRK00283','xerD'),(2603465,'gnl|CDD|227307',_binary 'Site-specific recombinase XerC [DNA replication, recombination, and repair].','COG4973','XerC'),(2603466,'gnl|CDD|271179',_binary 'XerD and XerC integrases, C-terminal catalytic domains.  XerDC-like integrases are involved in the site-specific integration and excision of lysogenic bacteriophage genomes, transposition of conjugative transposons, termination of chromosomal replication, and stable plasmid inheritance. They share the same fold in their catalytic domain containing six conserved active site residues and the overall reaction mechanism with the DNA breaking-rejoining enzyme superfamily. In Escherichia coli, the Xer site-specific recombination system acts to convert dimeric chromosomes, which are formed by homologous recombination to monomers. Two related recombinases, XerC and XerD, bind cooperatively to a recombination site present in the E. coli chromosome. Each recombinase catalyzes the exchange of one pair of DNA strand in a reaction that proceeds through a Holliday junction intermediate. These enzymes can bridge two different and well-separated DNA sequences called arm- and core-sites. The C-terminal domain binds, cleaves, and re-ligates DNA strands at the core-sites, while the N-terminal domain is largely responsible for high-affinity binding to the arm-type sites.','cd00798','INT_XerDC_C'),(2603467,'gnl|CDD|271183',_binary 'C-terminal catalytic domain of recombinase RitC, a component of the recombinase trio.  Recombinases belonging to the RitA (also known as pAE1 due to its presence in the deletion prone region of plasmid pAE1 of Alcaligenes eutrophus H1), RitB, and RitC families are associated in a complex referred to as a Recombinase in Trio (RIT) element.  These RIT elements consist of three adjacent and unidirectional overlapping genes, one from each family (ritABC in order of transcription).  All three integrases contain a catalytic motif, suggesting that they are all active enzymes.  However, their specific roles are not yet fully understood.  All three families belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism.','cd01182','INT_RitC_C_like'),(2603468,'gnl|CDD|271177',_binary 'Shufflon-specific DNA recombinase Rci and Bacteriophage Hp1_like integrase, C-terminal catalytic domain.  Rci protein is a tyrosine recombinase specifically involved in Shufflon type of DNA rearrangement in bacteria. The shufflon of plasmid R64 consists of four invertible DNA segments which are separated and flanked by seven 19-bp repeat sequences. RCI recombinase facilitates the site-specific recombination between any inverted repeats results in an inversion of the DNA segment(s) either independently or in groups. HP1 integrase promotes site-specific recombination of the HP1 genome into that of Haemophilus influenza. Bacteriophage Hp1_like integrases are tyrosine based site specific recombinases. They belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism is essentially identical and involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd00796','INT_Rci_Hp1_C'),(2603469,'gnl|CDD|271195',_binary 'Uncharacterized site-specific tyrosine recombinase, C-terminal catalytic domain.  Tyrosine recombinase (integrase) belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain contains six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01195','INT_C_like_5'),(2603470,'gnl|CDD|271180',_binary 'C-terminal catalytic domain of Cre recombinase (also called integrase).  Cre-like recombinases are tyrosine based site specific recombinases. They belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The bacteriophage P1 Cre recombinase maintains the circular phage replicon in a monomeric state by catalyzing a site-specific recombination between two loxP sites. The catalytic core domain of Cre recombinase is linked to a more divergent helical N-terminal domain, which interacts primarily with the DNA major groove proximal to the crossover region.','cd00799','INT_Cre_C'),(2603471,'gnl|CDD|234935',_binary 'site-specific tyrosine recombinase XerC; Reviewed.','PRK01287','xerC'),(2603472,'gnl|CDD|334163',_binary 'Phage integrase family.  Members of this family cleave DNA substrates by a series of staggered cuts, during which the protein becomes covalently linked to the DNA through a catalytic tyrosine residue at the carboxy end of the alignment. The catalytic site residues in CRE recombinase are Arg-173, His-289, Arg-292 and Tyr-324.','pfam00589','Phage_integrase'),(2603473,'gnl|CDD|271193',_binary 'Integron integrase and similar protiens, C-terminal catalytic domain.  Integron integrases mediate site-specific DNA recombination between a proximal primary site (attI) and a secondary target site (attC) found within mobile gene cassettes encoding resistance or virulence factors. Unlike other site specific recombinases, the attC sites lack sequence conservation. Integron integrase exhibits broader DNA specificity by recognizing the non-conserved attC sites. The structure shows that DNA target site recognition are not dependent on canonical DNA but on the position of two flipped-out bases that interact in cis and in trans with the integrase. Integron-integrases are present in many natural occurring mobile elements, including transposons and conjugative plasmids. Vibrio, Shewanella, Xanthomonas, and Pseudomonas species harbor chromosomal super-integrons. All integron-integrases carry large inserts unlike the TnpF ermF-like proteins also seen in this group.','cd01193','INT_IntI_C'),(2603474,'gnl|CDD|271178',_binary 'C-terminal catalytic domain of recombinase RitB, a component of the recombinase trio.  Recombinases belonging to the RitA (also known as pAE1 due to its presence in the deletion prone region of plasmid pAE1 of Alcaligenes eutrophus H1), RitB, and RitC families are associated in a complex referred to as a Recombinase in Trio (RIT) element.  These RIT elements consist of three adjacent and unidirectional overlapping genes, one from each family (ritABC in order of transcription).  All three integrases contain a catalytic motif, suggesting that they are all active enzymes.  However, their specific roles are not yet fully understood.  All three families belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism.','cd00797','INT_RitB_C_like'),(2603475,'gnl|CDD|235339',_binary 'site-specific tyrosine recombinase XerS; Reviewed.','PRK05084','xerS'),(2603476,'gnl|CDD|223655',_binary 'Integrase [DNA replication, recombination, and repair].','COG0582','XerC'),(2603477,'gnl|CDD|271188',_binary 'C-terminal catalytic domain of recombinase RitA, a component of the recombinase trio.  Recombinases RitA (also known as pAE1), RitB, and RitC are encoded by three adjacent and overlapping genes. Collectively they are known as the Recombinase in Trio (RIT). This RitA family includes various bacterial integrases and integrases from the deletion-prone region of plasmid pAE1 of Alcaligenes eutrophus H1. All three integrases contain a catalytic motif, suggesting that they are all active enzymes. However, their specific roles are not fully understood. All three families belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism is essentially identical and involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd01188','INT_RitA_C_like'),(2603478,'gnl|CDD|271194',_binary 'Uncharacterized site-specific tyrosine recombinase, C-terminal catalytic domain.  Tyrosine recombinase (integrase) belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain contains six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01194','INT_C_like_4'),(2603479,'gnl|CDD|271186',_binary 'Putative Transposase A from transposon Tn554, C-terminal catalytic domain.  This family includes putative Transposase A from transposon Tn554. It belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain contains six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01186','INT_tnpA_C_Tn554'),(2603480,'gnl|CDD|271189',_binary 'C-terminal catalytic domain of integrases from bacterial phages and conjugate transposons.  This family of tyrosine based site-specific integrases is has origins in bacterial phages and conjugate transposons. One member is the integrase from Bacillus subtilis conjugative transposon ICEBs1. ICEBs1 can be excised and transfered to various recipients in response to DNA damage or high concentrations of potential mating partners. The family belongs to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd01189','INT_ICEBs1_C_like'),(2603481,'gnl|CDD|271181',_binary 'C-terminal catalytic domain of Lambda integrase, a tyrosine-based site-specific recombinase.  Lambda-type integrases catalyze site-specific integration and excision of temperate bacteriophages and other mobile genetic elements to and from the bacterial host chromosome. They are tyrosine-based site-specific recombinase and belong to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The phage lambda integrase can bridge two different and well-separated DNA sequences called arm- and core-sites. The C-terminal domain binds, cleaves and re-ligates DNA strands at the core-sites, while the N-terminal domain is largely responsible for high-affinity binding to the arm-type sites.','cd00800','INT_Lambda_C'),(2603482,'gnl|CDD|271196',_binary 'Uncharacterized site-specific tyrosine recombinase, C-terminal catalytic domain.  Tyrosine recombinase (integrase) belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain contains six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01196','INT_C_like_6'),(2603483,'gnl|CDD|271197',_binary 'FimB and FimE and related proteins, integrase/recombinases.  This CD includes proteins similar to E.coli FimE and FimB and Proteus mirabilis MrpI. FimB and FimE are the regulatory proteins during expression of type 1 fimbriae in Escherichia coli. The fimB and fimE proteins direct the phase switch into the \'on\' and \'off\' position. MrpI is the regulatory protein of proteus mirabilis fimbriae expression. This family belongs to the integrase/recombinase superfamily.','cd01197','INT_FimBE_like'),(2603484,'gnl|CDD|182126',_binary 'tyrosine recombinase; Provisional.','PRK09871','PRK09871'),(2603485,'gnl|CDD|271192',_binary 'Uncharacterized site-specific tyrosine recombinase, C-terminal catalytic domain.  Tyrosine recombinase (integrase) belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain contains six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01192','INT_C_like_3'),(2603486,'gnl|CDD|338776',_binary 'Phage integrase, N-terminal SAM-like domain.','pfam13495','Phage_int_SAM_4'),(2603487,'gnl|CDD|336018',_binary 'Phage terminase, small subunit.','pfam05119','Terminase_4'),(2603488,'gnl|CDD|226270',_binary 'Phage terminase, small subunit [DNA replication, recombination, and repair].','COG3747','COG3747'),(2603489,'gnl|CDD|273691',_binary 'phage terminase, small subunit, putative, P27 family.  This model describes a distinct family of phage (and integrated prophage) putative terminase small subunit. Members tend to be adjacent to the phage terminase large subunit gene. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR01558','hypothetical_protein'),(2603520,'gnl|CDD|309515',_binary 'ERF superfamily.  The DNA single-strand annealing proteins (SSAPs), such as RecT, Red-beta, ERF and Rad52, function in RecA-dependent and RecA-independent DNA recombination pathways. This family includes proteins related to ERF.','pfam04404','ERF'),(2603522,'gnl|CDD|273206',_binary 'replicative DNA helicase.  This model describes the helicase DnaB, a homohexameric protein required for DNA replication. The homohexamer can form a ring around a single strand of DNA near a replication fork. An intein of > 400 residues is found at a conserved location in DnaB of Synechocystis PCC6803, Rhodothermus marinus (both experimentally confirmed), and Mycobacterium tuberculosis. The intein removes itself by a self-splicing reaction. The seed alignment contains inteins so that the model built from the seed alignment will model a low cost at common intein insertion sites. [DNA metabolism, DNA replication, recombination, and repair].','TIGR00665','DnaB'),(2603525,'gnl|CDD|236093',_binary 'replicative DNA helicase; Validated.','PRK07773','PRK07773'),(2603526,'gnl|CDD|180177',_binary 'replicative DNA helicase; Provisional.','PRK05636','PRK05636'),(2603527,'gnl|CDD|274672',_binary 'phage replicative helicase, DnaB family, HK022 subfamily.  Members of this family are phage (or prophage-region) homologs of the bacterial homohexameric replicative helicase DnaB. Some phage may rely on host DnaB, while others encode their own verions. This model describes the largest phage-specific clade among the close homologs of DnaB, but there are, or course, other DnaB homologs from phage that fall outside the scope of this model. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR03600','phage_DnaB'),(2603528,'gnl|CDD|180232',_binary 'replicative DNA helicase; Provisional.','PRK05748','PRK05748'),(2603529,'gnl|CDD|181547',_binary 'replicative DNA helicase; Provisional.','PRK08760','PRK08760'),(2603530,'gnl|CDD|235907',_binary 'replicative DNA helicase; Provisional.','PRK07004','PRK07004'),(2603531,'gnl|CDD|235525',_binary 'replicative DNA helicase; Provisional.','PRK05595','PRK05595'),(2603533,'gnl|CDD|181562',_binary 'replicative DNA helicase; Provisional.','PRK08840','PRK08840'),(2603534,'gnl|CDD|136106',_binary 'replicative DNA helicase; Validated.','PRK06904','PRK06904'),(2603535,'gnl|CDD|236278',_binary 'replicative DNA helicase; Provisional.','PRK08506','PRK08506'),(2603536,'gnl|CDD|181193',_binary 'replicative DNA helicase; Provisional.','PRK08006','PRK08006'),(2603538,'gnl|CDD|181676',_binary 'replicative DNA helicase; Provisional.','PRK09165','PRK09165'),(2603539,'gnl|CDD|180528',_binary 'replicative DNA helicase; Provisional.','PRK06321','PRK06321'),(2603541,'gnl|CDD|168322',_binary 'replicative DNA helicase; Provisional.','PRK05973','PRK05973'),(2603549,'gnl|CDD|222856',_binary 'polynucleotide kinase; Provisional.','PHA02530','pseT'),(2603550,'gnl|CDD|319805',_binary 'C-terminal phosphatase domain of T4 polynucleotide kinase/phosphatase (PNKP) and related phosphatases.  This family includes the C-terminal domain of the bifunctional enzyme T4 polynucleotide kinase/phosphatase, PNKP. The PNKP phosphatase domain can catalyze the hydrolytic removal of the 3\'-phosphoryl of DNA, RNA and deoxynucleoside 3\'-monophosphates. This family belongs to the haloacid dehalogenase-like (HAD) hydrolases, a large superfamily of diverse enzymes that catalyze carbon or phosphoryl group transfer reactions on a range of substrates, using an active site aspartate in nucleophilic catalysis. Members of this superfamily include 2-L-haloalkanoic acid dehalogenase, azetidine hydrolase, phosphonoacetaldehyde hydrolase, phosphoserine phosphatase, phosphomannomutase, P-type ATPases and many others. HAD hydrolases are found in all three kingdoms of life, and most genomes are predicted to contain multiple HAD-like proteins. Members possess a highly conserved alpha/beta core domain, and many also possess a small cap domain, the fold and function of which is variable. HAD hydrolases are sometimes referred to as belonging to the DDDD superfamily of phosphohydrolases.','cd07502','HAD_PNKP-C'),(2603551,'gnl|CDD|338887',_binary 'AAA domain.  This family of domains contain only a P-loop motif, that is characteristic of the AAA superfamily. Many of the proteins in this family are just short fragments so there is no Walker B motif.','pfam13671','AAA_33'),(2603552,'gnl|CDD|226986',_binary 'Predicted kinase [General function prediction only].','COG4639','COG4639'),(2603553,'gnl|CDD|223718',_binary 'Predicted kinase [General function prediction only].','COG0645','COG0645'),(2603557,'gnl|CDD|226573',_binary 'Predicted nucleotide kinase [Nucleotide transport and metabolism].','COG4088','COG4088'),(2603558,'gnl|CDD|308210',_binary 'Transcription factor WhiB.  WhiB is a putative transcription factor in Actinobacteria, required for differentiation and sporulation.','pfam02467','Whib'),(2603576,'gnl|CDD|132932',_binary 'Nodulation formation efficiency D (NfeD) is a membrane-bound ClpP-class protease.  Nodulation formation efficiency D (NfeD; stomatin operon partner protein, STOPP; DUF107) is a member of membrane-anchored ClpP-class proteases. Currently, more than 300 NfeD homologs have been identified - all of which are bacterial or archaeal in origin. Majority of these genomes have been shown to possess operons containing a homologous NfeD/stomatin gene pair, causing NfeD to be previously named STOPP (stomatin operon partner protein). NfeD homologs can be divided into two groups: long and short forms. Long-form homologs have a putative ClpP-class serine protease domain while the short form homologs do not. Downstream from the ClpP-class domain is the so-called NfeD or DUF107 domain. N-terminal region of the NfeD homolog PH1510 (1510-N or PH1510-N) from Pyrococcus horikoshii has been shown to possess serine protease activity and has a Ser-Lys catalytic dyad, preferentially cleaving hydrophobic substrates. Difference in oligomeric form and catalytic residues between 1510-N (forming a dimer) and ClpP (forming a tetradecamer) shows a possible functional difference: 1510-N is likely to have a regulatory function while ClpP is involved in protein quality control.','cd07021','Clp_protease_NfeD_like'),(2603578,'gnl|CDD|132934',_binary 'Signal peptide peptidase A (SppA), a serine protease, has catalytic Ser-Lys dyad.  Signal peptide peptidase A (SppA; Peptidase S49; Protease IV): SppA is found in all three domains of life and is involved in the cleavage of signal peptides after their removal from the precursor proteins by signal peptidases. This subfamily contains members with either a single domain (sometimes referred to as 36K type), such as sohB peptidase, protein C and archaeal signal peptide peptidase, or an amino-terminal domain in addition to the carboxyl-terminal protease domain that is conserved in all the S49 family members (sometimes referred to as 67K type), similar to E. coli and Arabidopsis thaliana SppA peptidases. Site-directed mutagenesis and sequence analysis have shown these SppAs to be serine proteases. The predicted active site serine for members in this family occurs in a transmembrane domain. Mutagenesis studies also suggest that the catalytic center comprises a Ser-Lys dyad and not the usual Ser-His-Asp catalytic triad found in the majority of serine proteases. Interestingly, the single membrane spanning E. coli SppA carries out catalysis using a Ser-Lys dyad with the serine located in the conserved carboxy-terminal protease domain and the lysine in the non-conserved amino-terminal domain.','cd07023','S49_Sppa_N_C'),(2603581,'gnl|CDD|273227',_binary 'signal peptide peptidase SppA, 36K type.  The related but duplicated, double-length protein SppA (protease IV) of E. coli was shown experimentally to degrade signal peptides as are released by protein processing and secretion. This protein shows stronger homology to the C-terminal region of SppA than to the N-terminal domain or to the related putative protease SuhB. The member of this family from Bacillus subtilis was shown to have properties consistent with a role in degrading signal peptides after cleavage from precursor proteins, although it was not demonstrated conclusively. [Protein fate, Degradation of proteins, peptides, and glycopeptides].','TIGR00706','Putative_signal_peptid...'),(2603582,'gnl|CDD|110924',_binary 'Serine dehydrogenase proteinase.  This family of archaebacterial proteins, formerly known as DUF114, has been found to be a serine dehydrogenase proteinase distantly related to ClpP proteinases that belong to the serine proteinase superfamily. The family has a catalytic triad of Ser, Asp, His residues, which shows an altered residue ordering compared with the ClpP proteinases but similar to that of the carboxypeptidase clan.','pfam01972','SDH_sah'),(2603583,'gnl|CDD|132933',_binary 'Signal peptide peptidase A (SppA) 36K type, a serine protease, has catalytic Ser-Lys dyad.  Signal peptide peptidase A (SppA; Peptidase S49; Protease IV) 36K type: SppA is found in all three domains of life and is involved in the cleavage of signal peptides after their removal from the precursor proteins by signal peptidases. Members in this subfamily are all bacterial and include sohB peptidase and protein C. These are sometimes referred to as 36K type since they contain only one domain, unlike E. coli SppA that also contains an amino-terminal domain. Site-directed mutagenesis and sequence analysis have shown these SppAs to be serine proteases. The predicted active site serine for members in this family occurs in a transmembrane domain. Mutagenesis studies also suggest that the catalytic center comprises a Ser-Lys dyad and not the usual Ser-His-Asp catalytic triad found in the majority of serine proteases.','cd07022','S49_Sppa_36K_type'),(2603587,'gnl|CDD|227605',_binary 'Phage-related minor tail protein [Function unknown].','COG5280','COG5280'),(2603588,'gnl|CDD|226462',_binary 'SLT domain proteins [General function prediction only].','COG3953','COG3953'),(2603590,'gnl|CDD|334586',_binary 'Peptidase family M23.  Members of this family are zinc metallopeptidases with a range of specificities. The peptidase family M23 is included in this family, these are Gly-Gly endopeptidases. Peptidase family M23 are also endopeptidases. This family also includes some bacterial lipoproteins for which no proteolytic activity has been demonstrated. This family also includes leukocyte cell-derived chemotaxin 2 (LECT2) proteins. LECT2 is a liver-specific protein which is thought to be linked to hepatocyte growth although the exact function of this protein is unknown.','pfam01551','Peptidase_M23'),(2603591,'gnl|CDD|223810',_binary 'Membrane proteins related to metalloendopeptidases [Cell envelope biogenesis, outer membrane].','COG0739','NlpD'),(2603592,'gnl|CDD|334552',_binary 'Putative peptidoglycan binding domain.  This domain is composed of three alpha helices. This domain is found at the N or C-terminus of a variety of enzymes involved in bacterial cell wall degradation. This domain may have a general peptidoglycan binding function. This family is found N-terminal to the catalytic domain of matrixins. The domain is found to bind peptidoglycan experimentally.','pfam01471','PG_binding_1'),(2603593,'gnl|CDD|225943',_binary 'Putative peptidoglycan-binding domain-containing protein [Cell envelope biogenesis, outer membrane].','COG3409','COG3409'),(2603595,'gnl|CDD|213747',_binary 'spore cortex-lytic enzyme.  Members of this protein family are the spore cortex-lytic enzyme SleB from Bacillus subtilis and other Gram-positive, endospore-forming bacterial species. This protein is stored in an inactive form in the spore and activated during germination. [Cellular processes, Sporulation and germination].','TIGR02869','Spore_cortex-lytic_enzyme'),(2603596,'gnl|CDD|227278',_binary 'Membrane-bound metallopeptidase [Cell division and chromosome partitioning].','COG4942','COG4942'),(2603597,'gnl|CDD|236782',_binary 'lipoprotein NlpD; Provisional.','PRK10871','nlpD'),(2603598,'gnl|CDD|238045',_binary 'Helix-turn-helix XRE-family like proteins. Prokaryotic DNA binding proteins belonging to the xenobiotic response element family of transcriptional regulators.','cd00093','HTH_XRE'),(2603599,'gnl|CDD|316006',_binary 'Cro/C1-type HTH DNA-binding domain.  This is a helix-turn-helix domain that probably binds to DNA.','pfam13443','HTH_26'),(2603617,'gnl|CDD|271185',_binary 'Integrase IntN1 of Bacteroides mobilizable transposon NBU1 and similar proteins, C-terminal catalytic domain.  IntN1 is a tyrosine recombinase for the integration and excision of Bacteroides mobilizable transposon NBU1 from the host chromosome. IntN1 does not require strict homology between the recombining sites seen with other tyrosine recombinases. This family belongs to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd01185','INTN1_C_like'),(2603618,'gnl|CDD|131303',_binary 'integron integrase.  Members of this family are integrases associated with integrons (and super-integrons), which are systems for incorporating and expressing cassettes of laterally transferred DNA. Incorporation occurs at an attI site. A super-integron, as in Vibrio sp., may include over 100 cassettes. This family belongs to the phage integrase family (pfam00589) that also includes recombinases XerC (TIGR02224) and XerD (TIGR02225), which are bacterial housekeeping proteins. Within this family of integron integrases, some are designated by class, e.g. IntI4, a class 4 integron integrase from Vibrio cholerae N16961. [DNA metabolism, DNA replication, recombination, and repair, Mobile and extrachromosomal element functions, Other].','TIGR02249','Integrase/recombinase_...'),(2603619,'gnl|CDD|271184',_binary 'Uncharacterized site-specific tyrosine recombinase, C-terminal catalytic domain.  Tyrosine recombinase (integrase) belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain containing six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01184','INT_C_like_1'),(2603623,'gnl|CDD|182125',_binary 'tyrosine recombinase; Provisional.','PRK09870','PRK09870'),(2603629,'gnl|CDD|271182',_binary 'Bacteriophage P4 integrase, C-terminal catalytic domain.  P4-like integrases are found in temperate bacteriophages, integrative plasmids, pathogenicity and symbiosis islands, and other mobile genetic elements. The P4 integrase mediates integrative and excisive site-specific recombination between two sites, called attachment sites, located on the phage genome and the bacterial chromosome. The phage attachment site is often found adjacent to the integrase gene, while the host attachment sites are typically situated near tRNA genes. This family belongs to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd00801','INT_P4_C'),(2603634,'gnl|CDD|185315',_binary 'integrase/recombinase; Provisional.','PRK15417','PRK15417'),(2603635,'gnl|CDD|271191',_binary 'Uncharacterized site-specific tyrosine recombinase, C-terminal catalytic domain.  Tyrosine recombinase (integrase) belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain contains six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01191','INT_C_like_2'),(2603636,'gnl|CDD|222904',_binary 'integrase; Provisional.','PHA02601','int'),(2603639,'gnl|CDD|176648',_binary 'DEDDh 3\'-5\' exonuclease domain family.  DEDDh exonucleases, part of the DnaQ-like (or DEDD) exonuclease superfamily, catalyze the excision of nucleoside monophosphates at the DNA or RNA termini in the 3\'-5\' direction. These proteins contain four invariant acidic residues in three conserved sequence motifs termed ExoI, ExoII and ExoIII. DEDDh exonucleases are classified as such because of the presence of specific Hx(4)D conserved pattern at the ExoIII motif. The four conserved acidic residues are clustered around the active site and serve as ligands for the two metal ions required for catalysis. Most DEDDh exonucleases are the proofreading subunits (epsilon) or domains of bacterial DNA polymerase III, the main replicating enzyme in bacteria, which functions as the chromosomal replicase. Other members include other DNA and RNA exonucleases such as RNase T, Oligoribonuclease, and RNA exonuclease (REX), among others.','cd06127','DEDDh'),(2603640,'gnl|CDD|223916',_binary 'DNA polymerase III, epsilon subunit and related 3\'-5\' exonucleases [DNA replication, recombination, and repair].','COG0847','DnaQ'),(2603641,'gnl|CDD|214685',_binary 'exonuclease domain in DNA-polymerase alpha and epsilon chain, ribonuclease T and other exonucleases.','smart00479','EXOIII'),(2603642,'gnl|CDD|200235',_binary 'putative phage-type endonuclease.  Members of this protein family are found often in phage genomes and in prokaryotic genomes in uncharacterized regions that resemble integrated prophage regions.','TIGR03033','hypothetical_protein'),(2603643,'gnl|CDD|227668',_binary 'Phage-related protein, predicted endonuclease [DNA replication, recombination, and repair].','COG5377','COG5377'),(2603644,'gnl|CDD|335497',_binary 'RecT family.  The DNA single-strand annealing proteins (SSAPs), such as RecT, Red-beta, ERF and Rad52, function in RecA-dependent and RecA-independent DNA recombination pathways. This family includes proteins related to RecT.','pfam03837','RecT'),(2603650,'gnl|CDD|334588',_binary 'DNA methylase.  Members of this family are DNA methylases. The family contains both N-4 cytosine-specific DNA methylases and N-6 Adenine-specific DNA methylases.','pfam01555','N6_N4_Mtase'),(2603652,'gnl|CDD|183177',_binary 'putative methyltransferase; Provisional.','PRK11524','PRK11524'),(2603653,'gnl|CDD|184255',_binary 'putative methylase; Provisional.','PRK13699','PRK13699'),(2603657,'gnl|CDD|338518',_binary 'Helix-turn-helix domain.  Members of this family contains a DNA-binding helix-turn-helix domain. This family contains many example antitoxins from bacterial toxin-antitoxin systems. These antitoxins are likely to be DNA-binding domains.','pfam12844','HTH_19'),(2603658,'gnl|CDD|316117',_binary 'Helix-turn-helix domain.  This domain is a helix-turn-helix domain that probably binds to DNA.','pfam13560','HTH_31'),(2603659,'gnl|CDD|227697',_binary 'Uncharacterized protein conserved in bacteria [Function unknown].','COG5410','COG5410'),(2603660,'gnl|CDD|335271',_binary 'Terminase-like family.  This family represents a group of terminase proteins.','pfam03237','Terminase_6'),(2603661,'gnl|CDD|225720',_binary 'Predicted chitinase [General function prediction only].','COG3179','COG3179'),(2603662,'gnl|CDD|338805',_binary 'D-alanyl-D-alanine carboxypeptidase.  This family resembles VanY, pfam02557, which is part of the peptidase M15 family.','pfam13539','Peptidase_M15_4'),(2603667,'gnl|CDD|309815',_binary 'Type III restriction enzyme, res subunit.','pfam04851','ResIII'),(2603668,'gnl|CDD|333970',_binary 'Helicase conserved C-terminal domain.  The Prosite family is restricted to DEAD/H helicases, whereas this domain family is found in a wide variety of helicases and helicase related proteins. It may be that this is not an autonomously folding unit, but an integral part of the helicase.','pfam00271','Helicase_C'),(2603670,'gnl|CDD|350684',_binary 'DEXH-box helicase domain of DEAD-like helicase restriction enzyme family proteins.  This family is composed of helicase restriction enzymes and similar proteins such as TFIIH basal transcription factor complex helicase XPB subunit. These proteins are part of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd17926','DEXHc_RE'),(2603671,'gnl|CDD|197757',_binary 'helicase superfamily c-terminal domain.','smart00490','HELICc'),(2603672,'gnl|CDD|214692',_binary 'DEAD-like helicases superfamily.','smart00487','DEXDc'),(2603678,'gnl|CDD|350668',_binary 'N-terminal DEAD/H-box helicase domain of superfamily 2 helicases.  The DEAD/H-like superfamily 2 helicases comprise a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This N-terminal domain contains the ATP-binding region.','cd00046','SF2-N'),(2603684,'gnl|CDD|350180',_binary 'C-terminal helicase domain of the SNF family helicases.  The Sucrose Non-Fermenting (SNF) family includes chromatin-remodeling factors, such as CHD proteins and SMARCA proteins, recombination proteins Rad54, and many others. They are DEAD-like helicases belonging to superfamily (SF)2, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. Similar to SF1 helicases, SF2 helicases do not form toroidal structures like SF3-6 helicases. Their helicase core consists of two similar protein domains that resemble the fold of the recombination protein RecA. This model describes the C-terminal domain, also called HelicC.','cd18793','SF2_C_SNF'),(2603699,'gnl|CDD|238545',_binary 'Hexameric Replicative Helicase RepA.  RepA is encoded by a plasmid, which is found in most Gram negative bacteria. RepA is a 5\'-3\' DNA helicase which can utilize ATP, GTP and CTP to a lesser extent.','cd01125','repA'),(2603703,'gnl|CDD|240129',_binary 'Prim_Pol: Primase-polymerase (primpol) domain of the type found in bifunctional replicases from archaeal plasmids, including ORF904 protein of the crenarchaeal plasmid pRN1 from Sulfolobus islandicus (pRN1 primpol). These primpol domains belong to the archaeal/eukaryal primase (AEP) superfamily. This group includes archaeal plasmids and bacteriophage AEPs. The ORF904 protein is a multifunctional protein having ATPase, primase and DNA polymerase activity, and may play a role in the replication of the archaeal plasmid. The pRN1 primpol domain exhibits DNA polymerase and primase activities; a cluster of active site residues (three acidic residues, and a histidine) is required for both these activities. For pRN1 primpol, the primase activity prefers dNTPs to rNTPs; incorporation of dNTPs requires rNTP as cofactor. The pRN1 primpol contains an unusual zinc-binding stem, which is not conserved in other members of this group.','cd04859','Prim_Pol'),(2603704,'gnl|CDD|214927',_binary 'Bifunctional DNA primase/polymerase, N-terminal.  Members of this family adopt a structure consisting of a core of antiparallel beta sheets. They are found in various bacterial hypothetical proteins, and have been shown to harbour both primase and polymerase activities.','smart00943','Prim-Pol'),(2603717,'gnl|CDD|176479',_binary 'Polymerase I functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication.  Family A polymerase (polymerase I) functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication. DNA-dependent DNA polymerases can be classified in six main groups based upon phylogenetic relationships with E. coli polymerase I (classA), E. coli polymerase II (class B), E.coli polymerase III (class C), euryarchaaeota polymerase II (class D), human polymerase  beta (class x), E. coli UmuC/DinB and eukaryotic RAP 30/Xeroderma pigmentosum variant (class Y). Family A polymerase are found primarily in organisms related to prokaryotes and include prokaryotic DNA polymerase I ,mitochondrial polymerase delta, and several bacteriphage polymerases including those from odd-numbered phage (T3, T5, and T7). Prokaryotic Pol Is have two functional domains located on the same polypeptide; a 5\'-3\' polymerase and 5\'-3\' exonuclease. Pol I uses its 5\' nuclease activity to remove the ribonucleotide portion of newly synthesized Okazaki fragments and DNA polymerase activity to fill in the resulting gap. A combination of phylogenomic and signature sequence-based (or phonetic) approaches is used to understand the evolutionary relationships among bacteria. DNA polymerase I is one of the conserved proteins that is used to search for protein signatures. The structure of these polymerases resembles in overall morphology a cupped human right hand, with fingers (which bind an incoming nucleotide and interact with the single-stranded template), palm (which harbors the catalytic amino acid residues and also binds an incoming dNTP) and thumb (which binds double-stranded DNA) subdomains.','cd08642','DNA_pol_A_pol_I_A'),(2603723,'gnl|CDD|339140',_binary 'HNH endonuclease.  This domain is related to other HNH domain families such as pfam01844. Suggesting that these proteins have a nucleic acid cleaving function.','pfam14279','HNH_5'),(2603724,'gnl|CDD|309383',_binary 'Phage Mu protein F like protein.  Members of this family are found in double-stranded DNA bacteriophages, and in some bacteria. A member of this family is required for viral head morphogenesis in bacteriophage SPP1. This family is possibly a minor head protein. This family may be related to the family TT_ORF1 (pfam02956).','pfam04233','Phage_Mu_F'),(2603726,'gnl|CDD|336288',_binary 'Domain of unknown function (DUF932).  Family of prokaryotic proteins with unknown function. Contains a number of highly conserved polar residues that could suggest an enzymatic activity.','pfam06067','DUF932'),(2603727,'gnl|CDD|274510',_binary 'phage/plasmid-like protein TIGR03299.  Members of this uncharacterized protein family are found in various Mycobacterium phage genomes, in Streptomyces coelicolor plasmid SCP1, and in bacterial genomes near various markers that suggest lateral gene transfer. The function is unknown. [Mobile and extrachromosomal element functions, Other].','TIGR03299','LGT_TIGR03299'),(2603729,'gnl|CDD|340359',_binary 'Glycoside hydrolase family 19, chitinase domain.  Chitinases are enzymes that catalyze the hydrolysis of the beta-1,4-N-acetyl-D-glucosamine linkages in chitin polymers. Glycoside hydrolase family 19 chitinases are found primarily in plants (classes I, III, and IV), but some are found in bacteria. Class I and II chitinases are similar in their catalytic domains. Class I chitinases have an N-terminal cysteine-rich, chitin-binding domain which is separated from the catalytic domain by a proline and glycine-rich hinge region. Class II chitinases lack both the chitin-binding domain and the hinge region. Class IV chitinases are similar to class I chitinases, but they are smaller in size due to certain deletions. Despite lacking any significant sequence homology with lysozymes, structural analysis reveals that family 19 chitinases, together with family 46 chitosanases, are similar to several lysozymes including those from T4-phage and from goose. The structures reveal that the different enzyme groups arose from a common ancestor glycohydrolase antecedent to the prokaryotic/eukaryotic divergence.','cd00325','chitinase_GH19'),(2603752,'gnl|CDD|349757',_binary 'Mrp/NBP35 ATP-binding protein family.  Mrp/NBP35 ATP-binding family protein are typically iron-sulfur (FeS) cluster scaffolds that function to assemble nascent FeS clusters for transfer to FeS-requiring enzymes. Members include the eukaryotic nucleotide-binding protein 1 (NUBP1) which is a component of the cytosolic iron-sulfur (Fe/S) protein assembly (CIA) machinery and the archael [NiFe] hydrogenase maturation protein HypB which is required for nickel insertion into [NiFe] hydrogenase.','cd02037','Mrp_NBP35'),(2603763,'gnl|CDD|349755',_binary 'Arsenical pump-driving ATPase ArsA.  ArsA ATPase functions as an efflux pump located on the inner membrane of the cell. This ATP-driven oxyanion pump catalyzes the extrusion of arsenite, antimonite and arsenate. Maintenance of a low intracellular concentration of oxyanion produces resistance to the toxic agents. The pump is composed of two subunits, the catalytic ArsA subunit and the membrane subunit ArsB, which are encoded by arsA and arsB genes, respectively. Arsenic efflux in bacteria is catalyzed by either ArsB alone or by ArsAB complex. The ATP-coupled pump, however, is more efficient. ArsA is composed of two homologous halves, A1 and A2, connected by a short linker sequence.','cd02035','ArsA'),(2603764,'gnl|CDD|139929',_binary 'plasmid-partitioning protein RepA; Provisional.','PRK13869','PRK13869'),(2603765,'gnl|CDD|349772',_binary 'bacterial tyrosine-kinase.  Bacterial tyrosine (BY)-kinases catalyze the autophosphorylation on a C-terminal tyrosine cluster and also phosphorylate endogenous protein substrates by using ATP as phosphoryl donor. Besides their capacity to function as tyrosine kinase, most of these proteins are also involved in the production and transport of exopolysaccharides. BY-kinases are involved in a number of physiological processes ranging from stress resistance to pathogenicity.','cd05387','BY-kinase'),(2603770,'gnl|CDD|223082',_binary 'Predicted ATPase involved in chromosome partitioning [Cell division and chromosome partitioning].','COG0003','ArsA'),(2603772,'gnl|CDD|226166',_binary 'CO dehydrogenase maturation factor [Cell division and chromosome partitioning].','COG3640','CooC'),(2603797,'gnl|CDD|176478',_binary 'Pol gammaA is a family A polymerase that is responsible for DNA replication and repair in mitochondria.  DNA polymerase gamma (Pol gamma), 5\'-3\' polymerase domain (Pol gammaA). Pol gammaA is a family A polymerase that is responsible for DNA replication and repair in mitochondria. Family A polymerase functions primarily to fill DNA gaps that arise during DNA repair, recombination and replication. DNA-dependent DNA polymerases can be classified into six main groups based upon phylogenetic relationships with E. coli polymerase I (classA), E. coli polymerase II (class B), E.coli polymerase III (class C), euryarchaeota polymerase II (class D), human polymerase beta (class X), E. coli UmuC/DinB and eukaryotic RAP 30/Xeroderma pigmentosum variant (class Y). Family A polymerases are found primarily in organisms related to prokaryotes and include prokaryotic DNA polymerase I, mitochondrial polymerase gammaA, and several bacteriophage polymerases including those from odd-numbered phage (T3, T5, and T7).   The structure of these polymerases resembles in overall morphology a cupped human right hand, with fingers (which bind an incoming nucleotide and interact with the single-stranded template), palm (which harbors the catalytic amino acid residues and also binds an incoming dNTP) and thumb (which binds double-stranded DNA) subdomains. Pol gammaA has also the right hand configuration. Pol gammaA has both polymerase and proofreading exonuclease activities separated by a spacer. Pol gamma holoenzyme is a heterotrimer containing one Pol gammaA subunit and a dimeric Pol gammaB subunit. Pol gamma is important for mitochondria DNA maintenance and mutation of the catalytic subunit of Pol gamma is implicated in more than 30 human diseases.','cd08641','DNA_pol_gammaA'),(2603831,'gnl|CDD|334664',_binary 'Toprim domain.  This is a conserved region from DNA primase. This corresponds to the Toprim domain common to DnaG primases, topoisomerases, OLD family nucleases and RecR proteins. Both DnaG motifs IV and V are present in the alignment, the DxD (V) motif may be involved in Mg2+ binding and mutations to the conserved glutamate (IV) completely abolish DnaG type primase activity. DNA primase EC:2.7.7.6 is a nucleotidyltransferase it synthesizes the oligoribonucleotide primers required for DNA replication on the lagging strand of the replication fork; it can also prime the leading stand and has been implicated in cell division. This family also includes the atypical archaeal A subunit from type II DNA topoisomerases. Type II DNA topoisomerases catalyze the relaxation of DNA supercoiling by causing transient double strand breaks.','pfam01751','Toprim'),(2603851,'gnl|CDD|179554',_binary 'haloalkane dehalogenase; Provisional.','PRK03204','PRK03204'),(2603868,'gnl|CDD|225441',_binary 'RecB family exonuclease [DNA replication, recombination, and repair].','COG2887','COG2887'),(2603872,'gnl|CDD|340178',_binary 'Gene Product 79.  This is a domain of unknown function found in Mycobacterium phage. Family members include the full Gp79 protein found in Mycobacteriophage L5. Mycobacteriophage L5, is a phage isolated from Mycobacterium smegmatis. It forms stable lysogens in M. smegmatis and has a broad host range among the pathogenic mycobacteria. L5 encodes gene products (gp) toxic to the host M. smegmatis. Expression of gp79 interferes with the cell membrane or cell-wall synthesis of M. smegmatis, leading to altered cell morphology. It also has a bactericidal effect on E. coli. The N-terminal segment of gp79 (amino acids 1-41) shares sequence similarity with the signal peptide of the D-alanylD-alanine carboxypeptidase of Bacillus licheniformis. This enzyme removes C-terminal D-alanyl residues from sugarpeptide cell-wall precursors and is also a penicillin-binding protein (PBP). The homology of the hydrophobic N-terminal part of gp79 to a PBP (penicillin-binding protein) signal peptide may indicate an interaction of gp79 with proteins or metabolites involved in the peptidoglycan synthesis of M. smegmatis.','pfam17463','Gp79'),(2603873,'gnl|CDD|223003',_binary 'hypothetical protein; Provisional.','PHA03169','PHA03169'),(2603877,'gnl|CDD|189968',_binary 'Collagen triple helix repeat (20 copies).  Members of this family belong to the collagen superfamily. Collagens are generally extracellular structural proteins involved in formation of connective tissue structure. The alignment contains 20 copies of the G-X-Y repeat that forms a triple helix. The first position of the repeat is glycine, the second and third positions can be any residue but are frequently proline and hydroxy-proline. Collagens are post translationally modified by proline hydroxylase to form the hydroxy-proline residues. Defective hydroxylation is the cause of scurvy. Some members of the collagen superfamily are not involved in connective tissue structure but share the same triple helical structure. The family includes bacterial collagen-like triple-helix repeat proteins.','pfam01391','Collagen'),(2603886,'gnl|CDD|223348',_binary 'Site-specific DNA methylase [DNA replication, recombination, and repair].','COG0270','Dcm'),(2603887,'gnl|CDD|238192',_binary 'Cytosine-C5 specific DNA methylases; Methyl transfer reactions play an important role in many aspects of biology. Cytosine-specific DNA methylases are found both in prokaryotes and eukaryotes. DNA methylation, or the covalent addition of a methyl group to cytosine within the context of the CpG dinucleotide, has profound effects on the mammalian genome. These effects include transcriptional repression via inhibition of transcription factor binding or the recruitment of methyl-binding proteins and their associated chromatin remodeling factors, X chromosome inactivation, imprinting and the suppression of parasitic DNA sequences. DNA methylation is also essential for proper embryonic development and is an important player in both DNA repair and genome stability.','cd00315','Cyt_C5_DNA_methylase'),(2603888,'gnl|CDD|333875',_binary 'C-5 cytosine-specific DNA methylase.','pfam00145','DNA_methylase'),(2603889,'gnl|CDD|273211',_binary 'DNA-methyltransferase (dcm).  All proteins in this family for which functions are known are DNA-cytosine methyltransferases. This family is based on the phylogenomic analysis of JA Eisen (1999, Ph.D. Thesis, Stanford University). [DNA metabolism, DNA replication, recombination, and repair].','TIGR00675','Modification_methylase'),(2603966,'gnl|CDD|310369',_binary 'Phage tail protein.  This family consists of several Siphovirus and other phage tail component proteins as well as some bacterial proteins of unknown function.','pfam05709','Sipho_tail'),(2603971,'gnl|CDD|223021',_binary 'large tegument protein UL36; Provisional.','PHA03247','PHA03247'),(2603972,'gnl|CDD|236090',_binary 'DNA polymerase III subunits gamma and tau; Validated.','PRK07764','PRK07764'),(2603978,'gnl|CDD|133475',_binary 'Peptidoglycan recognition proteins (PGRPs) are pattern recognition receptors that bind, and in certain cases, hydrolyze peptidoglycans (PGNs) of bacterial cell walls. PGRPs have been divided into three classes: short PGRPs (PGRP-S), that are small (20 kDa) extracellular proteins; intermediate PGRPs (PGRP-I) that are 40-45 kDa and are predicted to be transmembrane proteins; and long PGRPs (PGRP-L), up to 90 kDa, which may be either intracellular or transmembrane. Several structures of PGRPs are known in insects and mammals, some bound with substrates like Muramyl Tripeptide (MTP) or Tracheal Cytotoxin (TCT). The substrate binding site is conserved in PGRP-LCx, PGRP-LE, and PGRP-Ialpha proteins. This family includes Zn-dependent N-Acetylmuramoyl-L-alanine Amidase, EC:3.5.1.28. This enzyme cleaves the amide bond between N-acetylmuramoyl and L-amino acids, preferentially D-lactyl-L-Ala, in bacterial cell walls. The structure for the bacteriophage T7 lysozyme shows that two of the conserved histidines and a cysteine are zinc binding residues. Site-directed mutagenesis of T7 lysozyme indicates that two conserved residues, a Tyr and a Lys, are important for amidase activity.','cd06583','PGRP'),(2603979,'gnl|CDD|212030',_binary 'Lysin Motif is a small domain involved in binding peptidoglycan.  LysM, a small globular domain with approximately 40 amino acids, is a widespread protein module involved in binding peptidoglycan in bacteria and chitin in eukaryotes. The domain was originally identified in enzymes that degrade bacterial cell walls, but proteins involved in many other biological functions also contain this domain. It has been reported that the LysM domain functions as a signal for specific plant-bacteria recognition in bacterial pathogenesis. Many of these enzymes are modular and are composed of catalytic units linked to one or several repeats of LysM domains. LysM domains are found in bacteria and eukaryotes.','cd00118','LysM'),(2603980,'gnl|CDD|334554',_binary 'LysM domain.  The LysM (lysin motif) domain is about 40 residues long. It is found in a variety of enzymes involved in bacterial cell wall degradation. This domain may have a general peptidoglycan binding function. The structure of this domain is known.','pfam01476','LysM'),(2603981,'gnl|CDD|214760',_binary 'Ami_2 domain.','smart00644','Ami_2'),(2603982,'gnl|CDD|197609',_binary 'Lysin motif.','smart00257','LysM'),(2603984,'gnl|CDD|334572',_binary 'N-acetylmuramoyl-L-alanine amidase.  This family includes zinc amidases that have N-acetylmuramoyl-L-alanine amidase activity EC:3.5.1.28. This enzyme domain cleaves the amide bond between N-acetylmuramoyl and L-amino acids in bacterial cell walls (preferentially: D-lactyl-L-Ala). The structure is known for the bacteriophage T7 structure and shows that two of the conserved histidines are zinc binding.','pfam01510','Amidase_2'),(2603985,'gnl|CDD|180536',_binary 'autolysin; Reviewed.','PRK06347','PRK06347'),(2603987,'gnl|CDD|182727',_binary 'membrane-bound lytic murein transglycosylase D; Provisional.','PRK10783','mltD'),(2603988,'gnl|CDD|224306',_binary 'FOG: LysM repeat [Cell envelope biogenesis, outer membrane].','COG1388','LytE'),(2603990,'gnl|CDD|237555',_binary 'invasion associated secreted endopeptidase; Provisional.','PRK13914','PRK13914'),(2603995,'gnl|CDD|225042',_binary 'Deoxycytidylate deaminase [Nucleotide transport and metabolism].','COG2131','ComEB'),(2603996,'gnl|CDD|238613',_binary 'Deoxycytidylate deaminase domain. Deoxycytidylate deaminase catalyzes the deamination of dCMP to dUMP,  providing the nucleotide substrate for thymidylate synthase. The enzyme binds Zn++, which is required for catalytic activity. The activity of the enzyme is allosterically regulated by the ratio of dCTP to dTTP not only in eukaryotic cells but also in T-even phage-infected Escherichia coli, with dCTP acting as an activator and dTTP as an inhibitor.','cd01286','deoxycytidylate_deaminase'),(2603997,'gnl|CDD|222894',_binary 'deoxycytidylate deaminase; Provisional.','PHA02588','cd'),(2603998,'gnl|CDD|278795',_binary 'Cytidine and deoxycytidylate deaminase zinc-binding region.','pfam00383','dCMP_cyt_deam_1'),(2603999,'gnl|CDD|131622',_binary 'ComE operon protein 2.  This protein is found in the ComE operon for \'late competence\' as characterized in B. subtilis. Proteins in this family contain homology to a cytidine/deoxycytidine deaminase domain family (pfam00383), and may carry out this activity.','TIGR02571','putative_dCMP_deaminase'),(2604000,'gnl|CDD|238611',_binary 'Riboflavin-specific deaminase. Riboflavin biosynthesis protein RibD (Diaminohydroxyphosphoribosylaminopyrimidine deaminase) catalyzes the deamination of 2,5-diamino-6-ribosylamino-4(3H)-pyrimidinone 5\'-phosphate, which is an intermediate step in the biosynthesis of riboflavin.The ribG gene of Bacillus subtilis and the ribD gene of E. coli are bifunctional and contain this deaminase domain and a reductase domain which catalyzes the subsequent reduction of the ribosyl side chain.','cd01284','Riboflavin_deaminase-r...'),(2604001,'gnl|CDD|223663',_binary 'Cytosine/adenosine deaminases [Nucleotide transport and metabolism / Translation, ribosomal structure and biogenesis].','COG0590','CumB'),(2604002,'gnl|CDD|223195',_binary 'Pyrimidine deaminase [Coenzyme metabolism].','COG0117','RibD'),(2604003,'gnl|CDD|238612',_binary 'Nucleoside deaminases include adenosine, guanine and cytosine deaminases. These enzymes are Zn dependent and catalyze the deamination of nucleosides. The zinc ion in the active site plays a central role in the proposed catalytic mechanism, activating a water molecule to form a hydroxide ion that performs a nucleophilic attack on the substrate. The functional enzyme is a homodimer. Cytosine deaminase catalyzes the deamination of cytosine to uracil and ammonia and is a member of the pyrimidine salvage pathway. Cytosine deaminase is found in bacteria and fungi but is not present in mammals; for this reason, the enzyme is currently of interest for antimicrobial drug design and gene therapy applications against tumors. Some members of this family are tRNA-specific adenosine deaminases that generate inosine at the first position of their anticodon (position 34) of specific tRNAs; this modification is thought to enlarge the codon recognition capacity during protein synthesis. Other members of the family are guanine deaminases which deaminate guanine to xanthine as part of the utilization of guanine as a nitrogen source.','cd01285','nucleoside_deaminase'),(2604004,'gnl|CDD|316921',_binary 'MafB19-like deaminase.  A member of the nucleic acid/nucleotide deaminase superfamily prototyped by Neisseria MafB19. Members of this family are present in a wide phyletic range of bacteria and are predicted to function as toxins in bacterial polymorphic toxin systems.','pfam14437','MafB19-deam'),(2604005,'gnl|CDD|273015',_binary 'riboflavin biosynthesis protein RibD.  This model describes the ribD protein as found in Escherichia coli. The N-terminal domain includes the conserved zinc-binding site region captured in the model dCMP_cyt_deam and shared by proteins such as cytosine deaminase, mammalian apolipoprotein B mRNA editing protein, blasticidin-S deaminase, and Bacillus subtilis competence protein comEB. The C-terminal domain is homologous to the full length of yeast HTP reductase, a protein required for riboflavin biosynthesis. A number of archaeal proteins believed related to riboflavin biosynthesis contain only this C-terminal domain and are not found as full-length matches to this model. [Biosynthesis of cofactors, prosthetic groups, and carriers, Riboflavin, FMN, and FAD].','TIGR00326','eubact_ribD'),(2604006,'gnl|CDD|238406',_binary 'Cytidine and deoxycytidylate deaminase zinc-binding region. The family contains cytidine deaminases, nucleoside deaminases, deoxycytidylate deaminases and riboflavin deaminases. Also included are the apoBec family of mRNA editing enzymes.  All members are Zn dependent. The zinc ion in the active site plays a central role in the proposed catalytic mechanism, activating a water molecule to form a hydroxide ion that performs a nucleophilic attack on the substrate.','cd00786','cytidine_deaminase-like'),(2604009,'gnl|CDD|226126',_binary 'RecA-family ATPase [DNA replication, recombination, and repair].','COG3598','RepA'),(2604078,'gnl|CDD|235554',_binary 'DNA polymerase III subunit alpha; Validated.','PRK05673','dnaE'),(2604079,'gnl|CDD|273161',_binary 'DNA-directed DNA polymerase III (polc).  All proteins in this family for which functions are known are DNA polymerases. This family is based on the phylogenomic analysis of JA Eisen (1999, Ph.D. Thesis, Stanford University). [DNA metabolism, DNA replication, recombination, and repair].','TIGR00594','DNA_polymerase_III_sub...'),(2604080,'gnl|CDD|223660',_binary 'DNA polymerase III, alpha subunit [DNA replication, recombination, and repair].','COG0587','DnaE'),(2604081,'gnl|CDD|235868',_binary 'DNA polymerase III DnaE; Reviewed.','PRK06826','dnaE'),(2604082,'gnl|CDD|168927',_binary 'DNA polymerase III subunit alpha; Validated.','PRK07374','dnaE'),(2604083,'gnl|CDD|180749',_binary 'DNA polymerase III DnaE; Reviewed.','PRK06920','dnaE'),(2604084,'gnl|CDD|181933',_binary 'DNA polymerase III subunit alpha; Reviewed.','PRK09532','PRK09532'),(2604085,'gnl|CDD|235553',_binary 'error-prone DNA polymerase; Validated.','PRK05672','dnaE2'),(2604086,'gnl|CDD|311600',_binary 'Bacterial DNA polymerase III alpha subunit.','pfam07733','DNA_pol3_alpha'),(2604087,'gnl|CDD|180917',_binary 'DNA polymerase III DnaE; Reviewed.','PRK07279','dnaE'),(2604088,'gnl|CDD|235944',_binary 'DNA polymerase III DnaE; Validated.','PRK07135','dnaE'),(2604089,'gnl|CDD|135648',_binary 'DNA polymerase III DnaE; Validated.','PRK05898','dnaE'),(2604090,'gnl|CDD|213997',_binary 'Polymerase and Histidinol Phosphatase domain of alpha-subunit of bacterial polymerase III DnaE3.  PolIIIAs that contain an N-terminal PHP domain have been classified into four basic groups based on genome composition, phylogenetic, and domain structural analysis: polC, dnaE1, dnaE2, and dnaE3. The PHP (also called histidinol phosphatase-2/HIS2) domain is associated with several types of DNA polymerases, such as PolIIIA and family X DNA polymerases, stand alone histidinol phosphate phosphatases (HisPPases), and a number of uncharacterized protein families. DNA polymerase III holoenzyme is one of the five eubacterial DNA polymerases that is responsible for the replication of the DNA duplex. The alpha subunit of DNA polymerase III core enzyme catalyzes the reaction for polymerizing both DNA strands. The PolIIIA PHP domain has four conserved sequence motifs and contains an invariant histidine that is involved in metal ion coordination, and like other PHP structures, the PolIIIA PHP exhibits a distorted (beta/alpha) 7 barrel and coordinates up to 3 metals. Initially, it was proposed that PHP region might be involved in pyrophosphate hydrolysis, but such an activity has not been found. It has been shown that the PHP of PolIIIA has a trinuclear metal complex and is capable of proofreading activity. Bacterial genome replication and DNA repair mechanisms is related to the GC content of its genomes. There is a correlation between GC content variations and the dimeric combinations of PolIIIA subunits. Eubacteria can be grouped into different GC variable groups: the full-spectrum or dnaE1 group, the high-GC or dnaE2-dnaE1 group, and the low GC or polC-dnaE3 group.','cd12113','PHP_PolIIIA_DnaE3'),(2604091,'gnl|CDD|236003',_binary 'DNA polymerase III subunit alpha; Reviewed.','PRK07373','PRK07373'),(2604092,'gnl|CDD|213988',_binary 'Polymerase and Histidinol Phosphatase domain of alpha-subunit of bacterial polymerase III DnaE1.  PolIIIAs that contain an N-terminal PHP domain have been classified into four basic groups based on genome composition, phylogenetic, and domain structural analysis: polC, dnaE1, dnaE2, and dnaE3. The PHP (also called histidinol phosphatase-2/HIS2) domain is associated with several types of DNA polymerases, such as PolIIIA and family X DNA polymerases, stand alone histidinol phosphate phosphatases (HisPPases), and a number of uncharacterized protein families. DNA polymerase III holoenzyme is one of the five eubacterial DNA polymerases that are responsible for the replication of the DNA duplex. PolIIIA core enzyme catalyzes the reaction for polymerizing both DNA strands. dnaE1 is the longest compared to dnaE2 and dnaE3. A unique motif was also identified in dnaE1 and dnaE3 genes.','cd07433','PHP_PolIIIA_DnaE1'),(2604093,'gnl|CDD|335103',_binary 'PHP domain.  The PHP (Polymerase and Histidinol Phosphatase) domain is a putative phosphoesterase domain.','pfam02811','PHP'),(2604094,'gnl|CDD|213986',_binary 'Polymerase and Histidinol Phosphatase domain of alpha-subunit of bacterial polymerase III.  PolIIIAs that contain an N-terminal PHP domain have been classified into four basic groups based on genome composition, phylogenetic, and domain structural analysis: polC, dnaE1, dnaE2, and dnaE3. The PHP (also called histidinol phosphatase-2/HIS2) domain is associated with several types of DNA polymerases, such as PolIIIA and family X DNA polymerases, stand alone histidinol phosphate phosphatases (HisPPases), and a number of uncharacterized protein families. DNA polymerase III holoenzyme is one of the five eubacterial DNA polymerases that is responsible for the replication of the DNA duplex. The alpha subunit of DNA polymerase III core enzyme catalyzes the reaction for polymerizing both DNA strands. The PolIIIA PHP domain has four conserved sequence motifs and contains an invariant histidine that is involved in metal ion coordination, and like other PHP structures, exhibits a distorted (beta/alpha) 7 barrel and coordinates up to 3 metals. Initially, it was proposed that PHP region might be involved in pyrophosphate hydrolysis, but such activity has not been found. It has been shown that the PHP domain of PolIIIA has a trinuclear metal complex and is capable of proofreading activity.','cd07431','PHP_PolIIIA'),(2604095,'gnl|CDD|213990',_binary 'Polymerase and Histidinol Phosphatase domain of alpha-subunit of bacterial polymerase III at PolC gene.  DNA polymerase III alphas (PolIIIAs) that contain a PHP domain have been classified into four basic groups based on phylogenetic and domain structural analyses: polC, dnaE1, dnaE2, and dnaE3. The PolC group is distinct from the other three and is clustered together. The PHP (also called histidinol phosphatase-2/HIS2) domain is associated with several types of DNA polymerases, such as PolIIIA and family X DNA polymerases, stand alone histidinol phosphate phosphatases (HisPPases), and a number of uncharacterized protein families. DNA polymerase III holoenzyme is one of the five eubacterial DNA polymerases that are responsible for the replication of the DNA duplex. The alpha subunit of DNA polymerase III core enzyme catalyzes the reaction for polymerizing both DNA strands. PolC PHP is located in different location compare to dnaE1, 2, and 3. The PHP domain has four conserved sequence motifs and and contains an invariant histidine that is involved in metal ion coordination.The PHP domain of PolC is structurally homologous to other members of the PHP family that have a distorted (beta/alpha)7 barrel fold with a trinuclear metal site on the C-terminal side of the barrel. PHP domains found in dnaEs of thermophilic origin exhibit 3\'-5\' exonuclease activity. In contrast, PolC PHP lacks detectable nuclease activity.','cd07435','PHP_PolIIIA_POLC'),(2604096,'gnl|CDD|273601',_binary 'DNA polymerase III, alpha chain, Gram-positive type.  This model describes a polypeptide chain of DNA polymerase III. Full-length homologs of this protein are restricted to the Gram-positive lineages, including the Mycoplasmas. This protein is designated alpha chain and given the gene symbol polC, but is not a full-length homolog of other polC genes. The N-terminal region of about 200 amino acids is rich in low-complexity sequence, poorly alignable, and not included n this model. [DNA metabolism, DNA replication, recombination, and repair].','TIGR01405','DNA_polymerase_III_Pol...'),(2604097,'gnl|CDD|225087',_binary 'DNA polymerase III, alpha subunit (gram-positive type) [DNA replication, recombination, and repair].','COG2176','PolC'),(2604098,'gnl|CDD|339287',_binary 'Helix-hairpin-helix motif.  The HHH domain is a short DNA-binding domain.','pfam14579','HHH_6'),(2604099,'gnl|CDD|234767',_binary 'DNA polymerase III PolC; Validated.','PRK00448','polC'),(2604100,'gnl|CDD|197753',_binary 'DNA polymerase alpha chain like domain.  DNA polymerase alpha chain like domain, incl. family of hypothetical proteins.','smart00481','POLIIIAc'),(2604101,'gnl|CDD|239931',_binary 'DnaE_OBF: A subfamily of OB folds corresponding to the C-terminal OB-fold nucleic acid binding domain of Thermus aquaticus and Escherichia coli type C replicative DNA polymerase III alpha subunit (DnaE). The DNA polymerase holoenzyme of E. coli contains two copies of this replicative polymerase, each of which copies a different DNA strand. This group also contains Bacillus subtilis DnaE. Replication in B. subtilis and Staphylococcus aureus requires two different type C polymerases, polC and DnaE, both of which are thought to be included in the DNA polymerase holoenzyme. At the B. subtilis replication fork, polC appears to be involved in leading strand synthesis and DnaE in lagging strand synthesis.','cd04485','DnaE_OBF'),(2604102,'gnl|CDD|213989',_binary 'Polymerase and Histidinol Phosphatase domain of alpha-subunit of bacterial polymerase III at DnaE2 gene.  PolIIIA DnaE2 plays a role in SOS mutagenesis/translesion synthesis and has dominant effects in determining GC variability in the bacterial genome. PolIIIAs that contain an N-terminal PHP domain have been classified into four basic groups based on genome composition, phylogenetic, and domain structural analysis: polC, dnaE1, dnaE2, and dnaE3. The PHP (also called histidinol phosphatase-2/HIS2) domain is associated with several types of DNA polymerases, such as PolIIIA and family X DNA polymerases, stand alone histidinol phosphate phosphatases (HisPPases), and a number of uncharacterized protein families. DNA polymerase III holoenzyme is one of the five eubacterial DNA polymerases that are responsible for the replication of the DNA duplex. PolIIIA core enzyme catalyzes the reaction for polymerizing both DNA strands. PolC PHP is located in a different location compared to dnaE1, 2, and 3. dnaE1 is the longest compared to dnaE2 and dnaE3. A unique motif was also identified in dnaE1 and dnaE3 genes. The PHP domain has four conserved sequence motifs and contains an invariant histidine that is involved in metal ion coordination. PHP domains found in DnaEs of thermophilic origin exhibit 3\'-5\' exonuclease activity.','cd07434','PHP_PolIIIA_DnaE2'),(2604103,'gnl|CDD|213985',_binary 'Polymerase and Histidinol Phosphatase domain.  The PHP (also called histidinol phosphatase-2/HIS2) domain is associated with several types of DNA polymerases, such as PolIIIA and family X DNA polymerases, stand alone histidinol phosphate phosphatases (HisPPases), and a number of uncharacterized protein families. The PHP domain has four conserved sequence motifs and contains an invariant histidine that is involved in metal ion coordination. PHP in polymerases has trinuclear zinc/magnesium dependent proofreading activity. It has also been shown that the PHP domain functions in DNA repair. The PHP structures have a distorted (beta/alpha)7 barrel fold with a trinuclear metal site on the C-terminal side of the barrel.','cd07309','PHP'),(2604104,'gnl|CDD|213987',_binary 'Polymerase and Histidinol Phosphatase domain of Histidinol phosphate phosphatase.  HisPPase catalyzes the eighth step of histidine biosynthesis, in which L-histidinol phosphate undergoes dephosphorylation to produce histidinol. HisPPase can be classified into two types: the bifunctional HisPPase found in proteobacteria that belongs to the DDDD superfamily and the monofunctional Bacillus subtilis type that is a member of the PHP family. The PHP (also called histidinol phosphatase-2/HIS2) domain is associated with several types of DNA polymerases, such as PolIIIA and family X DNA polymerases, stand alone histidinol phosphate phosphatases (HisPPases), and a number of uncharacterized protein families. The PHP domain has four conserved sequence motifs and contains an invariant histidine that is involved in metal ion coordination. The PHP domain of HisPPase is structurally homologous to other members of the PHP family that have a distorted (beta/alpha)7 barrel fold with a trinuclear metal site on the C-terminal side of the barrel.','cd07432','PHP_HisPPase'),(2604106,'gnl|CDD|213993',_binary 'Polymerase and Histidinol Phosphatase domain of Histidinol phosphate phosphatase (HisPPase) AMP bound.  The PHP domain of this HisPPase family has an unknown function. It has a second domain inserted in the middle that binds adenosine 5-monophosphate (AMP). The PHP (also called histidinol phosphatase-2/HIS2) domain is associated with several types of DNA polymerases, such as PolIIIA and family X DNA polymerases, stand alone histidinol phosphate phosphatases (HisPPases), and a number of uncharacterized protein families. HisPPase catalyzes the eighth step of histidine biosynthesis, in which L-histidinol phosphate undergoes dephosphorylation to give histidinol. The PHP domain has four conserved sequence motifs and contains an invariant histidine that is involved in metal ion coordination. The PHP domain of HisPPase is structurally homologous to the other members of the PHP family that have a distorted (beta/alpha)7 barrel fold with a trinuclear metal site on the C-terminal side of the barrel.','cd07438','PHP_HisPPase_AMP'),(2604107,'gnl|CDD|213991',_binary 'Polymerase and Histidinol Phosphatase domain of bacterial polymerase X.  The bacterial/archaeal X-family DNA polymerases (PolXs) have a PHP domain at their C-terminus. The bacterial/archaeal PolX core domain and PHP domain interact with each other and together are involved in metal dependent 3\'-5\' exonuclease activity. The PHP (also called histidinol phosphatase-2/HIS2) domain is associated with several types of DNA polymerases, such as PolIIIA and family X DNA polymerases, stand alone histidinol phosphate phosphatases (HisPPases), and a number of uncharacterized protein families. The PHP domain has four conserved sequence motifs and contains an invariant histidine that is involved in metal ion coordination. PolX is found in all kingdoms, however bacterial PolXs have a completely different domain structure from eukaryotic PolXs. Bacterial PolX has an extended conformation in contrast to the common closed \'right hand\' conformation for DNA polymerases. This extended conformation is stabilized by the PHP domain. The PHP domain of PolX is structurally homologous to other members of the PHP family that has a distorted (beta/alpha)7 barrel fold with a trinuclear metal site on the C-terminal side of the barrel.','cd07436','PHP_PolX'),(2604109,'gnl|CDD|223686',_binary 'Predicted metal-dependent phosphoesterases (PHP family) [General function prediction only].','COG0613','COG0613'),(2604113,'gnl|CDD|236880',_binary 'LysM domain/BON superfamily protein; Provisional.','PRK11198','PRK11198'),(2604119,'gnl|CDD|131945',_binary 'spore coat assembly protein SafA.  SafA (YrbB) (SafA) of Bacillus subtilis is a protein found at the interface of the spore cortex and spore coat, and is dependent on SpoVID for its localization. This model is based on the N-terminal LysM (lysin motif) domain (see pfamAM model pfam01476) of SafA and, from several other spore-forming species, the protein with the most similar N-terminal region. However, this set of proteins differs greatly in C-terminal of the LysM domaim; blocks of 12-residue and 13-residue repeats are found in the Bacillus cereus group, tandem LysM domains in Thermoanaerobacter tengcongensis MB4, etc. in which one of which is found in most examples of endospore-forming bacteria. [Cellular processes, Sporulation and germination].','TIGR02899','hypothetical_conserved...'),(2604127,'gnl|CDD|227608',_binary 'Phage-related tail protein [Function unknown].','COG5283','COG5283'),(2604136,'gnl|CDD|236946',_binary 'putative peptidase; Provisional.','PRK11649','PRK11649'),(2604138,'gnl|CDD|180426',_binary 'hypothetical protein; Provisional.','PRK06148','PRK06148'),(2604139,'gnl|CDD|310573',_binary 'Protein of unknown function (DUF935).  This family consists of several bacterial proteins of unknown function as well as the Bacteriophage Mu gp29 protein.','pfam06074','DUF935'),(2604141,'gnl|CDD|309825',_binary 'Baseplate J-like protein.  The P2 bacteriophage J protein lies at the edge of the baseplate. This family also includes a number of bacterial homologs, which are thought to have been horizontally transferred.','pfam04865','Baseplate_J'),(2604142,'gnl|CDD|274051',_binary 'putative baseplate assembly protein.  This family consists of a large, conserved hypothetical protein in phage tail-like regions of at least six bacterial genomes: Gloeobacter violaceus PCC 7421, Geobacter sulfurreducens PCA, Streptomyces coelicolor A3(2), Streptomyces avermitilis MA-4680, Mesorhizobium loti, and Myxococcus xanthus. The C-terminal region is identified by the broader model pfam04865 as related to baseplate protein J from phage P2, but that relationship is not observed directly. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR02243','hypothetical_protein_S...'),(2604143,'gnl|CDD|225836',_binary 'Uncharacterized homolog of phage Mu protein gp47 [Function unknown].','COG3299','XkdT'),(2604166,'gnl|CDD|236628',_binary 'recombination and repair protein RecT; Reviewed.','PRK09846','recT'),(2604167,'gnl|CDD|129703',_binary 'recombinase, phage RecT family.  All proteins in this family for which functions are known bind ssDNA and are involved in the the pairing of homologous DNA This family is based on the phylogenomic analysis of JA Eisen (1999, Ph.D. Thesis, Stanford University). RecT and homologs are found in prophage regions of bacterial genomes. RecT works with a partner protein, RecE. [DNA metabolism, DNA replication, recombination, and repair, Mobile and extrachromosomal element functions, Prophage functions].','TIGR00616','Uncharacterized_protei...'),(2604168,'gnl|CDD|226246',_binary 'Recombinational DNA repair protein (RecE pathway) [DNA replication, recombination, and repair].','COG3723','RecT'),(2604171,'gnl|CDD|337449',_binary 'YqaJ-like viral recombinase domain.  This protein family is found in many different bacterial species but is of viral origin. The protein forms an oligomer and functions as a processive alkaline exonuclease that digests linear double-stranded DNA in a Mg(2+)-dependent reaction, It has a preference for 5\'-phosphorylated DNA ends. It thus forms part of the two-component SynExo viral recombinase functional unit.','pfam09588','YqaJ'),(2604173,'gnl|CDD|317950',_binary 'Papain fold toxin 1, glutamine deamidase.  A papain fold toxin domain found in bacterial polymorphic toxin systems. In these systems they might function either as a releasing peptidase or toxin. In Shigella flexneri, UniProtKB:Q8VSD5, this protein is expressed from a plasmid, and delivered into the host via the type III secretion system where it deamidates the glutamine residue at position 100 in ubiquitin-activating enzyme E2, UBC13, to a glutamic acid residue. Invasion of host cells by pathogens normally invokes an acute inflammatory response through activating the TRAF6-mediated signalling pathway. UBC13 helps to activate TRAF6. Thus deamidation of UBC13 results in the dampening of the inflammatory response. The key glutaminase deamidase activity is mediated by a cys-his-glu triad, present in all members of the family.','pfam15644','Gln_amidase'),(2604174,'gnl|CDD|313366',_binary 'Mu-like prophage I protein.  Members of this family of proteins comprise various viral Mu-like prophage I proteins.','pfam10123','Mu-like_Pro'),(2604175,'gnl|CDD|334841',_binary 'ParB-like nuclease domain.','pfam02195','ParBc'),(2604176,'gnl|CDD|214678',_binary 'ParB-like nuclease domain.  Plasmid RK2 ParB preferentially cleaves single-stranded DNA. ParB also nicks supercoiled plasmid DNA preferably at sites with potential single-stranded character, like AT-rich regions and sequences that can form cruciform structures. ParB also exhibits 5-->3 exonuclease activity.','smart00470','ParB'),(2604177,'gnl|CDD|319258',_binary 'ParB N-terminal-like domain, some attached to C-terminal S-adenosylmethionine-dependent methyltransferase domain.  This family represents domains related to the N-terminal domain of ParB, a DNA-binding component of the prokaryotic parABS partitioning system, fused to a variety of C-terminal domains, including S-adenosylmethionine-dependent methyltransferase-like domains. parABS contributes to the efficient segregation of chromosomes and low-copy number plasmids to daughter cells during prokaryotic cell division. The process includes the parA (Walker box) ATPase, the ParB DNA-binding protein and a parS cis-acting DNA sites. Binding of ParB to centromere-like parS sites is followed by non-specific binding to DNA (\'spreading\', which has been implicated in gene silencing in plasmid P1) and oligomerization of additional ParB molecules near the parS sites. It has been proposed that ParB-ParB cross-linking compacts the DNA, binds to parA via the N-terminal region, and leads to parA separating the ParB-parS complexes and the recruitment of the SMC (structural maintenance of chromosomes) complexes. The ParB N-terminal domain of Bacillus subtilis and other species contains a Arginine-rich ParB Box II with residues essential for bridging of the ParB-parS complexes. The arginine-rich ParB Box II consensus (I[VIL]AGERR[FYW]RA[AS] identified in several species is partially conserved with this family and related families. Mutations within the basic columns particularly debilitate spreading from the parS sites and impair SMC recruitment. The C-terminal domain contains a HTH DNA-binding motif and is the primary homo-dimerization domain, and binds to parS DNA sites. Additional homo-dimerization contacts are found along the N-terminal domain, but dimerization of the N-terminus may only occur after concentration at ParB-parS foci.','cd16401','ParB_N_like_MT'),(2604178,'gnl|CDD|319251',_binary 'Thermus thermophilus stage 0 sporulation protein J-like N-terminal domain, ParB family member.  Spo0J (stage 0 sporulation protein J) is a ParB family member, a critical component of the ParABS-type bacterial chromosome segregation system. The Spo0J N-terminal region acts in protein-protein interaction and is adjacent to the DNA-binding domain that binds to parS sites. Two Spo0J bind per parS site, and Spo0J interacts with neighbors via the N-terminal domain to form oligomers via an Arginine-rich patch (RRXR).  This superfamily represents the N-terminal domain of ParB, a DNA-binding component of the prokaryotic parABS partitioning system. parABS contributes to the efficient segregation of chromosomes and low-copy number plasmids to daughter cells during prokaryotic cell division. The process includes the parA (Walker box) ATPase, the ParB DNA-binding protein and a parS cis-acting DNA sites. Binding of ParB to centromere-like parS sites is followed by non-specific binding to DNA (\'spreading\', which has been implicated in gene silencing in plasmid P1) and oligomerization of additional ParB molecules near the parS sites. It has been proposed that ParB-ParB cross-linking compacts the DNA, binds to parA via the N-terminal region, and leads to parA separating the ParB-parS complexes and the recruitment of the SMC (structural maintenance of chromosomes) complexes. The ParB N-terminal domain of Bacillus subtilis and other species contains a Arginine-rich ParB Box II with residues essential for bridging of the ParB-parS complexes. The arginine-rich ParB Box II consensus (I[VIL]AGERR[FYW]RA[AS] identified in several species is partially conserved with this family and related families. Mutations within the basic columns particularly debilitate spreading from the parS sites and impair SMC recruitment. The C-terminal domain contains a HTH DNA-binding motif and is the primary homo-dimerization domain, and binds to parS DNA sites. Additional homo-dimerization contacts are found along the N-terminal domain, but dimerization of the N-terminus may only occur after concentration at ParB-parS foci.','cd16393','SPO0J_N'),(2604179,'gnl|CDD|319254',_binary 'nucleoid occlusion protein, N-terminal domain, and related domains of the ParB partitioning protein family.  Nucleoid occlusion protein has been shown in Bacillus subtilis to bind to specific DNA sequences on the chromosome (Noc-binding DNA sequences, NBS), inhibiting cell division near the nucleoid and thereby protecting the chromosome. This N-terminal domain is related to the N-terminal domain of ParB/repB partitioning system proteins.','cd16396','Noc_N'),(2604180,'gnl|CDD|224392',_binary 'Stage 0 sporulation protein J (antagonist of Soj) containing ParB-like nuclease domain [Transcription].','COG1475','Spo0J'),(2604183,'gnl|CDD|319264',_binary 'ParB N-terminal, parA-binding, -like domain of bacterial and plasmid parABS partitioning systems.  This family represents the N-terminal domain of ParB, a DNA-binding component of the prokaryotic parABS partitioning system. parABS contributes to the efficient segregation of chromosomes and low-copy number plasmids to daughter cells during prokaryotic cell division. The process includes the parA (Walker box) ATPase, the ParB DNA-binding protein and a parS cis-acting DNA sites. Binding of ParB to centromere-like parS sites is followed by non-specific binding to DNA (\'spreading\', which has been implicated in gene silencing in plasmid P1) and oligomerization of additional ParB molecules near the parS sites. It has been proposed that ParB-ParB cross-linking compacts the DNA, binds to parA via the N-terminal region, and leads to parA separating the ParB-parS complexes and the recruitment of the SMC (structural maintenance of chromosomes) complexes. The ParB N-terminal domain of Bacillus subtilis and other species contains a Arginine-rich ParB Box II with residues essential for bridging of the ParB-parS complexes. The arginine-rich ParB Box II consensus (I[VIL]AGERR[FYW]RA[AS] identified in several species is partially conserved with this family and related families. Mutations within the basic columns particularly debilitate spreading from the parS sites and impair SMC recruitment. The C-terminal domain contains a HTH DNA-binding motif and is the primary homo-dimerization domain, and binds to parS DNA sites. Additional homo-dimerization contacts are found along the N-terminal domain, but dimerization of the N-terminus may only occur after concentration at ParB-parS foci.','cd16407','ParB_N_like'),(2604184,'gnl|CDD|319261',_binary 'pNOB8 ParB-like N-terminal domain, plasmid partitioning system protein domain.  archaeal pNOB8 ParB acts in a plasmid partitioning system made up of 3 parts: AspA, ParA motor protein, and ParB, which links ParA to the protein-DNA superhelix. As demonstrated in Sulfolobus, AspA spreads along DNA, which allows ParB binding, and links to the Walker-motif containing ParA motor protein. The Sulfolobus ParB C-terminal domain resembles eukaryotic segregation protein CenpA, and other histones. This family is related to the N-terminal domain of ParB (Spo0J in Bacillus subtilis), a DNA-binding component of the prokaryotic parABS partitioning system and related proteins.','cd16404','pNOB8_ParB_N_like'),(2604185,'gnl|CDD|272946',_binary 'ParB/RepB/Spo0J family partition protein.  This model represents the most well-conserved core of a set of chromosomal and plasmid partition proteins related to ParB, including Spo0J, RepB, and SopB. Spo0J has been shown to bind a specific DNA sequence that, when introduced into a plasmid, can serve as partition site. Study of RepB, which has nicking-closing activity, suggests that it forms a transient protein-DNA covalent intermediate during the strand transfer reaction.','TIGR00180','Probable_chromosome-pa...'),(2604186,'gnl|CDD|319266',_binary 'ParB N-terminal-like domain of bacterial and plasmid parABS partitioning systems.  This family represents the N-terminal domain of ParB, a DNA-binding component of the prokaryotic parABS partitioning system. parABS contributes to the efficient segregation of chromosomes and low-copy number plasmids to daughter cells during prokaryotic cell division. The process includes the parA (Walker box) ATPase, the ParB DNA-binding protein and a parS cis-acting DNA sites. Binding of ParB to centromere-like parS sites is followed by non-specific binding to DNA (\'spreading\', which has been implicated in gene silencing in plasmid P1) and oligomerization of additional ParB molecules near the parS sites. It has been proposed that ParB-ParB cross-linking compacts the DNA, binds to parA via the N-terminal region, and leads to parA separating the ParB-parS complexes and the recruitment of the SMC (structural maintenance of chromosomes) complexes. The ParB N-terminal domain of Bacillus subtilis and other species contains a Arginine-rich ParB Box II with residues essential for bridging of the ParB-parS complexes. The arginine-rich ParB Box II consensus (I[VIL]AGERR[FYW]RA[AS] identified in several species is partially conserved with this family and related families. Mutations within the basic columns particularly debilitate spreading from the parS sites and impair SMC recruitment. The C-terminal domain contains a HTH DNA-binding motif and is the primary homo-dimerization domain, and binds to parS DNA sites. Additional homo-dimerization contacts are found along the N-terminal domain, but dimerization of the N-terminus may only occur after concentration at ParB-parS foci.','cd16409','ParB_N_like'),(2604217,'gnl|CDD|173172',_binary 'hypothetical protein; Provisional.','PRK14709','PRK14709'),(2604218,'gnl|CDD|225913',_binary 'Phage associated DNA primase [General function prediction only].','COG3378','COG3378'),(2604219,'gnl|CDD|235927',_binary 'hypothetical protein; Validated.','PRK07078','PRK07078'),(2604220,'gnl|CDD|273716',_binary 'phage/plasmid primase, P4 family, C-terminal domain.  This model represents a clade within a larger family of proteins from viruses of bacteria and animals. Members of this family are found in phage and plasmids of bacteria and archaea only. The model describes a domain of about 300 residues, found generally toward the protein C-terminus. [DNA metabolism, DNA replication, recombination, and repair, Mobile and extrachromosomal element functions, Prophage functions].','TIGR01613','putative_primase'),(2604221,'gnl|CDD|312290',_binary 'D5 N terminal like.  This domain is found in D5 proteins of DNA viruses and bacteriophage P4 DNA primases phages.','pfam08706','D5_N'),(2604222,'gnl|CDD|197953',_binary 'D5 N terminal like.  This domain is found in D5 proteins of DNA viruses and bacteriophage P4 DNA primases phages.','smart00885','D5_N'),(2604250,'gnl|CDD|214702',_binary 'HNH nucleases.','smart00507','HNHc'),(2604251,'gnl|CDD|280088',_binary 'HNH endonuclease.  His-Asn-His (HNH) proteins are a very common family of small nucleic acid-binding proteins that are generally associated with endonuclease activity.','pfam01844','HNH'),(2604252,'gnl|CDD|224321',_binary 'Restriction endonuclease [Defense mechanisms].','COG1403','McrA'),(2604276,'gnl|CDD|224380',_binary 'ABC-type transport system involved in resistance to organic solvents, periplasmic component [Secondary metabolites biosynthesis, transport, and catabolism].','COG1463','Ttg2C'),(2604283,'gnl|CDD|313985',_binary 'Protein of unknown function (DUF2637).  This family of proteins has no known function.','pfam10935','DUF2637'),(2604293,'gnl|CDD|338467',_binary 'Helix-turn-helix domain.  This domain is a DNA-binding helix-turn-helix domain.','pfam12728','HTH_17'),(2604294,'gnl|CDD|200128',_binary 'DNA binding domain, excisionase family.  An excisionase, or Xis protein, is a small protein that binds and promotes excisive recombination; it is not enzymatically active. This model represents a number of putative excisionases and related proteins from temperate phage, plasmids, and transposons, as well as DNA binding domains of other proteins, such as a DNA modification methylase. This model identifies mostly small proteins and N-terminal regions of large proteins, but some proteins appear to have two copies. This domain appears similar, in both sequence and predicted secondary structure (PSIPRED) to the MerR family of transcriptional regulators (pfam00376). [Unknown function, General].','TIGR01764','Probable_excisionase'),(2604295,'gnl|CDD|133390',_binary 'Helix-Turn-Helix DNA binding domain of truncated MerR-like proteins.  Proteins in this family mostly have a truncated helix-turn-helix (HTH) MerR-like domain. They lack a portion of the C-terminal region, called Wing 2 and the long dimerization helix that is typically present in MerR-like proteins. These truncated domains are found in response regulator receiver (REC) domain proteins (i.e., CheY), cytosine-C5 specific DNA methylases, IS607 transposase-like proteins, and RacA, a bacterial protein that anchors chromosomes to cell poles.','cd04762','HTH_MerR-trunc'),(2604351,'gnl|CDD|235966',_binary 'ribonucleotide-diphosphate reductase subunit alpha; Validated.','PRK07207','PRK07207'),(2604497,'gnl|CDD|173773',_binary 'Topoisomerase-primase domain. This is a nucleotidyl transferase/hydrolase domain found in type IA, type IIA and type IIB topoisomerases, bacterial DnaG-type primases, small primase-like proteins from bacteria and archaea, OLD family nucleases from bacterial and archaea, and bacterial DNA repair proteins of the RecR/M family. This domain has two conserved motifs, one of which centers at a conserved glutamate and the other one at two conserved aspartates (DxD). This glutamate and two aspartates, cluster together to form a highly acid surface patch. The conserved glutamate may act as a general base in nucleotide polymerization by primases and in strand joining in topoisomerases and, as a general acid in strand cleavage by topisomerases and nucleases. The DXD motif may co-ordinate Mg2+, a cofactor required for full catalytic function.','cd00188','TOPRIM'),(2604499,'gnl|CDD|337824',_binary 'Protein of unknown function (DUF2493).  Members of this family are all Proteobacteria. The function is not known.','pfam10686','DUF2493'),(2604520,'gnl|CDD|137836',_binary 'carboxylesterase BioH; Provisional.','PRK10349','PRK10349'),(2604529,'gnl|CDD|206754',_binary 'Phosphoribosyl transferase (PRT)-type I domain.  Phosphoribosyl transferase (PRT) domain. The type I PRTases are identified by a conserved PRPP binding motif which features two adjacent acidic residues surrounded by one or more hydrophobic residue. PRTases catalyze the displacement of the alpha-1\'-pyrophosphate of 5-phosphoribosyl-alpha1-pyrpphosphate (PRPP) by a nitrogen-containing nucleophile. The reaction products are an alpha-1 substituted ribose-5\'-phosphate and a free pyrophosphate (PP).  PRPP, an activated form of ribose-5-phosphate, is a key metabolite connecting nucleotide synthesis and salvage pathways. The type I PRTase family includes a range of diverse phosphoribosyl transferase enzymes and regulatory proteins of the nucleotide synthesis and salvage pathways, including adenine phosphoribosyltransferase EC:2.4.2.7., hypoxanthine-guanine-xanthine phosphoribosyltransferase, hypoxanthine phosphoribosyltransferase EC:2.4.2.8., ribose-phosphate pyrophosphokinase EC:2.7.6.1., amidophosphoribosyltransferase EC:2.4.2.14., orotate phosphoribosyltransferase EC:2.4.2.10., uracil phosphoribosyltransferase EC:2.4.2.9., and xanthine-guanine phosphoribosyltransferase EC:2.4.2.22.','cd06223','PRTases_typeI'),(2604533,'gnl|CDD|333885',_binary 'Phosphoribosyl transferase domain.  This family includes a range of diverse phosphoribosyl transferase enzymes. This family includes: Adenine phosphoribosyl-transferase EC:2.4.2.7, Hypoxanthine-guanine-xanthine phosphoribosyl-transferase, Hypoxanthine phosphoribosyl-transferase EC:2.4.2.8. Ribose-phosphate pyrophosphokinase i EC:2.7.6.1. Amidophosphoribosyltransferase EC:2.4.2.14. Orotate phosphoribosyl-transferase EC:2.4.2.10, Uracil phosphoribosyl-transferase EC:2.4.2.9, Xanthine-guanine phosphoribosyl-transferase EC:2.4.2.22. In Arabidopsis, at the very N-terminus of this domain is the P-Loop NTPase domain.','pfam00156','Pribosyltran'),(2604546,'gnl|CDD|274299',_binary 'helicase-exonuclease AddAB, AddA subunit, Firmicutes type.  AddAB, also called RexAB, substitutes for RecBCD in several bacterial lineages. These DNA recombination proteins act before synapse and are particularly important for DNA repair of double-stranded breaks by homologous recombination. The term AddAB is used broadly, with AddA homologous between the Firmicutes (as modeled here) and the alphaproteobacteria, while the partner AddB proteins show no strong homology across the two groups of species. [DNA metabolism, DNA replication, recombination, and repair].','TIGR02785','ATP-dependent_helicase...'),(2604548,'gnl|CDD|214794',_binary 'SprT homologues.  Predicted to have roles in transcription elongation. Contains a conserved HExxH motif, indicating a metalloprotease function.','smart00731','SprT'),(2604608,'gnl|CDD|179620',_binary 'putative periplasmic esterase; Provisional.','PRK03642','PRK03642'),(2604743,'gnl|CDD|336057',_binary 'Hom_end-associated Hint.  Homing endonucleases are encoded by mobile DNA elements that are found inserted within host genes in all domains of life. The crystal structure of the homing nuclease PI-Sce revealed two domains: an endonucleolytic centre resembling the C-terminal domain of Drosophila melanogaster Hedgehog protein, and a second domain containing the protein-splicing active site. This Domain corresponds to the latter protein-splicing domain.','pfam05203','Hom_end_hint'),(2604745,'gnl|CDD|197642',_binary 'Hint (Hedgehog/Intein) domain N-terminal region.  Hedgehog/Intein domain, N-terminal region. Domain has been split to accommodate large insertions of endonucleases.','smart00306','HintN'),(2604746,'gnl|CDD|339414',_binary 'Intein splicing domain.  Inteins are segments of protein which excise themselves from a precursor protein and mediate the rejoining of the remainder of the precursor (the extein). Most inteins consist of a splicing domain which is split into two segments by a homing endonuclease domain. This domain represents the splicing domain.','pfam14890','Intein_splicing'),(2604840,'gnl|CDD|182786',_binary 'tRNA-specific adenosine deaminase; Provisional.','PRK10860','PRK10860'),(2604921,'gnl|CDD|178549',_binary 'Probable pheophorbidase.','PLN02965','PLN02965'),(2604945,'gnl|CDD|224314',_binary 'Predicted transcriptional regulators [Transcription].','COG1396','HipB'),(2604952,'gnl|CDD|337685',_binary 'SprT-like family.  This family represents a domain found in eukaryotes and prokaryotes. The domain contains a characteristic motif of the zinc metallopeptidases. This family includes the bacterial SprT protein.','pfam10263','SprT-like'),(2604960,'gnl|CDD|238141',_binary 'SGNH_hydrolase, or GDSL_hydrolase, is a diverse family of lipases and esterases. The tertiary fold of the enzyme is substantially different from that of the alpha/beta hydrolase family and unique among all known hydrolases; its active site closely resembles the typical Ser-His-Asp(Glu) triad from other serine hydrolases, but may lack the carboxlic acid.','cd00229','SGNH_hydrolase'),(2604961,'gnl|CDD|238872',_binary 'SGNH_hydrolase subfamily. SGNH hydrolases are a diverse family of lipases and esterases. The tertiary fold of the enzyme is substantially different from that of the alpha/beta hydrolase family and unique among all known hydrolases; its active site closely resembles the Ser-His-Asp(Glu) triad found in other serine hydrolases.','cd01834','SGNH_hydrolase_like_2'),(2604962,'gnl|CDD|238871',_binary 'SGNH_hydrolase subfamily, similar to Ruminococcus flavefaciens XynB. Most likely a secreted hydrolase with xylanase activity. SGNH hydrolases are a diverse family of lipases and esterases. The tertiary fold of the enzyme is substantially different from that of the alpha/beta hydrolase family and unique among all known hydrolases; its active site closely resembles the Ser-His-Asp(Glu) triad found in other serine hydrolases.','cd01833','XynB_like'),(2604964,'gnl|CDD|238870',_binary 'Members of the SGNH-hydrolase superfamily, a diverse family of lipases and esterases. The tertiary fold of the enzyme is substantially different from that of the alpha/beta hydrolase family and unique among all known hydrolases; its active site closely resembles the Ser-His-Asp(Glu) triad from other serine hydrolases, but may lack the carboxlic acid. Myxobacterial members of this subfamily have been reported to be involved in adventurous gliding motility.','cd01832','SGNH_hydrolase_like_1'),(2604966,'gnl|CDD|307002',_binary 'GDSL-like Lipase/Acylhydrolase.','pfam00657','Lipase_GDSL'),(2604967,'gnl|CDD|338764',_binary 'GDSL-like Lipase/Acylhydrolase family.  This family of presumed lipases and related enzymes are similar to pfam00657.','pfam13472','Lipase_GDSL_2'),(2604968,'gnl|CDD|225353',_binary 'Lysophospholipase L1 and related esterases [Amino acid transport and metabolism].','COG2755','TesA'),(2605010,'gnl|CDD|336227',_binary 'Endodeoxyribonuclease RusA.  This family consists of several bacterial and phage Holliday junction resolvase (RusA) like proteins. The RusA protein of Escherichia coli is an endonuclease that can resolve Holliday intermediates and correct the defects in genetic recombination and DNA repair associated with inactivation of RuvAB or RuvC.','pfam05866','RusA'),(2605011,'gnl|CDD|226936',_binary 'Holliday junction resolvase [DNA replication, recombination, and repair].','COG4570','Rus'),(2605044,'gnl|CDD|239601',_binary 'RPA2_OBF_family: A family of oligonucleotide binding (OB) folds with similarity to the OB fold of the single strand (ss) DNA-binding domain (DBD)-D of human RPA2 (also called RPA32). RPA2 is a subunit of Replication protein A (RPA). RPA is a nuclear ssDNA-binding protein (SSB) which appears to be involved in all aspects of DNA metabolism including replication, recombination, and repair. RPA also mediates specific interactions of various nuclear proteins. In animals, plants, and fungi, RPA is a heterotrimer with subunits of 70KDa (RPA1), 32kDa (RPA2), and 14 KDa (RPA3). RPA contains six OB folds, which are involved in ssDNA binding and in trimerization. The ssDNA binding mechanism is believed to be multistep and to involve conformational change. This family also includes OB folds similar to those found in Escherichia coli SSB, the wedge domain of E. coli RecG (a branched-DNA-specific helicase), E. coli ssDNA specific exodeoxyribonuclease VII large subunit, Pyrococcus abyssi DNA polymerase II (Pol II) small subunit, Sulfolobus solfataricus SSB, and Bacillus subtilis YhaM (a 3\'-to-5\'exoribonuclease). It also includes the OB folds of breast cancer susceptibility gene 2 protein (BRCA2), Oxytricha nova telomere end binding protein (TEBP), Saccharomyces cerevisiae telomere-binding protein (Cdc13), and human protection of telomeres 1 protein (POT1).','cd03524','RPA2_OBF_family'),(2605051,'gnl|CDD|273682',_binary 'phage prohead protease, HK97 family.  This model describes the prohead protease of HK97 and related phage. It is generally encoded next to the gene for the capsid protein that it processes, and in some cases may be fused to it. This family does not show similarity to the prohead protease of phage T4 (see pfam03420). [Mobile and extrachromosomal element functions, Prophage functions, Protein fate, Other].','TIGR01543','Putative_prohead_protease'),(2605052,'gnl|CDD|309640',_binary 'Caudovirus prohead serine protease.  Family of Caudovirus prohead serine proteases also found in a number of bacteria possibly as the result of horizontal transfer.','pfam04586','Peptidase_S78'),(2605053,'gnl|CDD|226263',_binary 'Phage head maturation protease [General function prediction only].','COG3740','COG3740'),(2605063,'gnl|CDD|319255',_binary 'immunoglobulin-binding regulator IbrB activates eib genes.  IbrB (along with IbrA) activates immunoglobulin-binding eib genes in Escherichia coli. IbrB is related to the ParB N-terminal domain family, which includes DNA-binding proteins involved in chromosomal/plasmid segregation and transcriptional regulation, consistent with a possible mechanism for IbrB in DNA binding-related regulation of eib expression. The ParB like family is a diverse domain superfamily with structural and sequence similarity to ParB of bacterial chromosomes/plasmid parABS partitioning system and Sulfiredoxin (Srx), which is a reactivator of oxidatively inactivated 2-cys peroxiredoxins. Other families includes proteins related to StrR, a putative regulator in the biosynthetic gene cluster and a family containing a Pyrococcus furiosus nuclease and putative transcriptional regulators SbnI (Staphylococcus aureus siderophore biosynthetic gene cluster ) and EdeB (Brevibacillus brevis antimicrobial peptide edeine biosynthetic cluster). Nuclease activity has also been reported in arabidopsis Srx.','cd16397','IbrB_like'),(2605092,'gnl|CDD|338092',_binary 'Protein of unknwon function (DUF3310).  This is a family of conserved bacteriophage proteins of unknown function.','pfam11753','DUF3310'),(2605110,'gnl|CDD|312675',_binary 'Bifunctional DNA primase/polymerase, N-terminal.  Members of this family adopt a structure consisting of a core of antiparallel beta sheets. They are found in various bacterial hypothetical proteins, and have been shown to harbour both primase and polymerase activities.','pfam09250','Prim-Pol'),(2605124,'gnl|CDD|350620',_binary 'L-Ala-D-Glu peptidase, also known as L-alanyl-D-glutamate endopeptidase.  This L-Ala-D-Glu peptidase family includes L-alanyl-D-glutamate peptidase (bacteriophage T5) (also known as L-alanoyl-D-glutamate endopeptidase), and Ply118 and Ply500 L-Ala-D-Glu peptidase. Bacteriophage endolysin degrades the peptidoglycan of the bacterial host from within, leading to cell lysis and release of progeny virions. The bacteriophage endolysin Ply118 cleaves between L-Ala and D-Glu residues of Listeria cell wall peptidoglycan. This family belongs to the MEROPS peptidase M15 subfamily C.','cd14845','L-Ala-D-Glu_peptidase_...'),(2605177,'gnl|CDD|238035',_binary 'Hedgehog/Intein domain, found in Hedgehog proteins as well as proteins which contain inteins and undergo protein splicing (e.g. DnaB, RIR1-2, GyrA and Pol). In protein splicing an intervening polypeptide sequence - the intein - is excised from a protein, and the flanking polypeptide sequences - the exteins - are joined by a peptide bond. In addition to the autocatalytic splicing domain, many inteins contain an inserted endonuclease domain, which plays a role in spreading inteins. Hedgehog proteins are a major class of intercellular signaling molecules, which control inductive interactions during animal development. The mature signaling forms of hedgehog proteins are the N-terminal fragments, which are covalently linked to cholesterol at their C-termini. This modification is the result of an autoprocessing step catalyzed by the C-terminal fragments, which are aligned here.','cd00081','Hint'),(2605202,'gnl|CDD|316861',_binary 'Superinfection immunity protein.  This family includes the E. coli bacteriophage T4 superinfection immunity (imm) protein. When E. coli is sequentially infected with two T-even type bacteriophage the DNA of the superinfecting phage is excluded from the host, into the periplasmic space. The immunity protein plays a role in this process.','pfam14373','Imm_superinfect'),(2605207,'gnl|CDD|224000',_binary 'ATP-dependent exoDNAse (exonuclease V) beta subunit (contains helicase and exonuclease domains) [DNA replication, recombination, and repair].','COG1074','RecB'),(2605209,'gnl|CDD|226375',_binary 'ATP-dependent nuclease, subunit B [DNA replication, recombination, and repair].','COG3857','AddB'),(2605217,'gnl|CDD|197775',_binary 'Helix-turn-helix XRE-family like proteins.','smart00530','HTH_XRE'),(2605233,'gnl|CDD|225567',_binary 'N-acetyl-anhydromuramyl-L-alanine amidase [Cell envelope biogenesis, outer membrane].','COG3023','ampD'),(2605256,'gnl|CDD|333969',_binary 'DEAD/DEAH box helicase.  Members of this family include the DEAD and DEAH box helicases. Helicases are involved in unwinding nucleic acids. The DEAD box helicases are involved in various aspects of RNA metabolism, including nuclear transcription, pre mRNA splicing, ribosome biogenesis, nucleocytoplasmic transport, translation, RNA decay and organellar gene expression.','pfam00270','DEAD'),(2605290,'gnl|CDD|213641',_binary 'phage putative head morphogenesis protein, SPP1 gp7 family.  This model describes a region of about 110 amino acids found exclusively in phage-related proteins, internally or toward the C-terminus. One member, gp7 of phage SPP1, appears involved in head morphogenesis. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR01641','Uncharacterized_protei...'),(2605350,'gnl|CDD|350677',_binary 'DEXH/Q-box helicase domain of DEAD-like helicase Snf family proteins.  Sucrose Non-Fermenting (SNF) proteins DEAD-like helicases superfamily. A diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd17919','DEXHc_Snf'),(2605355,'gnl|CDD|350769',_binary 'DEXH-box helicase domain of RapA.  In bacteria, RapA is an RNA polymerase (RNAP)-associated SWI2/SNF2 (switch/sucrose non-fermentable) protein that mediates RNAP recycling during transcription. The ATPase activity of RapA is stimulated by its interaction with RNAP and inhibited by its N-terminal domain. The conformational changes of RapA and its interaction with RNAP are essential for RNAP recycling.  RapA is part of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18011','DEXDc_RapA'),(2605367,'gnl|CDD|283256',_binary 'Zinc-binding loop region of homing endonuclease.  This domain is the short zinc-binding loops region of a number of much longer chain homing endonucleases. Such loops are probably stabilized by the zinc and may be viewed as small but separate domains. The common structural feature of these domains is that at least three zinc ligands lie very close to each other in the sequence and are not incorporated into regular secondary structural elements. The biological roles played by these small zinc-binding domains are presently unknown.','pfam05551','zf-His_Me_endon'),(2605382,'gnl|CDD|334515',_binary 'Helix-turn-helix.  This large family of DNA binding helix-turn helix proteins includes Cro and CI. Within Neisseria gonorrhoeae NGO_0477, the full protein fold incorporates a helix-turn-helix motif, but the function of this member is unlikely to be that of a DNA-binding regulator, the function of most other members, so is not necessarily characteristic of the whole family.','pfam01381','HTH_3'),(2605383,'gnl|CDD|224393',_binary 'Predicted transcriptional regulators [Transcription].','COG1476','COG1476'),(2605460,'gnl|CDD|316087',_binary 'Peptidase_C39 like family.','pfam13529','Peptidase_C39_2'),(2605465,'gnl|CDD|239109',_binary 'A sub-family of peptidase family C39. Peptidase family C39 mostly contains bacteriocin-processing endopeptidases from bacteria. The cysteine peptidases in family C39 cleave the \'double-glycine\' leader peptides from the precursors of various bacteriocins (mostly non-lantibiotic). The cleavage is mediated by the transporter as part of the secretion process. Bacteriocins are antibiotic proteins secreted by some species of bacteria that inhibit the growth of other bacterial species. The bacteriocin is synthesized as a precursor with an N-terminal leader peptide, and processing involves removal of the leader peptide by cleavage at a Gly-Gly bond, followed by translocation of the mature bacteriocin across the cytoplasmic membrane. Most endopeptidases of family C39 are N-terminal domains in larger proteins (ABC transporters) that serve both functions. The proposed protease active site is conserved in this sub-family of proteins with a single peptidase domain, which are lacking the nucleotide-binding transporter signature or have different domain architectures.','cd02549','Peptidase_C39A'),(2605537,'gnl|CDD|227000',_binary 'Predicted phage phi-C31 gp36 major capsid-like protein [General function prediction only].','COG4653','COG4653'),(2605542,'gnl|CDD|313836',_binary 'Protein of unknown function (DUF2510).  This is family of proteins conserved in Actinobacteria. Many members are annotated as putative membrane proteins but this could not be confirmed.','pfam10708','DUF2510'),(2605578,'gnl|CDD|225635',_binary 'Plasmid maintenance system antidote protein [General function prediction only].','COG3093','VapI'),(2605579,'gnl|CDD|339008',_binary 'Helix-turn-helix domain.  This helix-turn-helix domain is often found in transferases and is likely to be DNA-binding.','pfam13936','HTH_38'),(2605668,'gnl|CDD|306651',_binary 'Chitinase class I.','pfam00182','Glyco_hydro_19'),(2605829,'gnl|CDD|187774',_binary 'CRISPR/Cas system-associated protein Cas9.  CRISPR (Clustered Regularly Interspaced Short Palindromic Repeats) and associated Cas proteins comprise a system for heritable host defense by prokaryotic cells against phage and other foreign DNA; Very large protein containing McrA/HNH-nuclease related domain and a RuvC-like nuclease domain; signature gene for type II.','cd09643','Csn1'),(2605831,'gnl|CDD|273840',_binary 'CRISPR subtype II/NMENI RNA-guided endonuclease Cas9/Csn1.  CRISPR loci appear to be mobile elements with a wide host range. This model represents a protein found only in CRISPR-containing species, near other CRISPR-associated proteins (cas), as part of the NMENI subtype of CRISPR/Cas locus. The species range so far for this protein is animal pathogens and commensals only.','TIGR01865','conserved_hypothetical...'),(2605833,'gnl|CDD|338719',_binary 'HNH endonuclease.  This HNH nuclease domain is found in CRISPR-related proteins.','pfam13395','HNH_4'),(2606000,'gnl|CDD|239330',_binary 'Arsenate Reductase (ArsC) family, Spx subfamily; Spx is a unique RNA polymerase (RNAP)-binding protein present in bacilli and some mollicutes. It inhibits transcription by binding to the C-terminal domain of the alpha subunit of RNAP, disrupting complex formation between RNAP and certain transcriptional activator proteins like ResD and ComA. In response to oxidative stress, Spx can also activate transcription, making it a general regulator that exerts both positive and negative control over transcription initiation. Spx has been shown to exert redox-sensitive transcriptional control over genes like trxA (TRX) and trxB (TRX reductase), genes that function in thiol homeostasis. This redox-sensitive activity is dependent on the presence of a CXXC motif, present in some members of the Spx subfamily, that acts as a thiol/disulfide switch. Spx has also been shown to repress genes in a sulfate-dependent manner independent of the presence of the CXXC motif.','cd03032','ArsC_Spx'),(2606002,'gnl|CDD|283436',_binary 'Glutaredoxin-like domain (DUF836).  These proteins are related to the pfam00462 family.','pfam05768','DUF836'),(2606067,'gnl|CDD|236167',_binary 'anaerobic benzoate catabolism transcriptional regulator; Reviewed.','PRK08154','PRK08154'),(2606074,'gnl|CDD|315607',_binary 'Domain of unknown function (DUF3846).  A family of uncharacterized proteins found by clustering human gut metagenomic sequences. This domain is found associated with an pfam07275 like domain. This suggests that this family may also be involved in evading host restriction.','pfam12957','DUF3846'),(2606075,'gnl|CDD|107157',_binary 'ATPase-like protein.','PHA02244','PHA02244'),(2606076,'gnl|CDD|223786',_binary 'MoxR-like ATPases [General function prediction only].','COG0714','COG0714'),(2606077,'gnl|CDD|336785',_binary 'AAA domain (dynein-related subfamily).  This Pfam entry includes some of the AAA proteins not detected by the pfam00004 model.','pfam07728','AAA_5'),(2606080,'gnl|CDD|99707',_binary 'The AAA+ (ATPases Associated with a wide variety of cellular Activities) superfamily represents an ancient group of ATPases belonging to the ASCE (for additional strand, catalytic E) division of the P-loop NTPase fold. The ASCE division also includes ABC, RecA-like, VirD4-like, PilT-like, and SF1/2 helicases. Members of the AAA+ ATPases function as molecular chaperons, ATPase subunits of proteases, helicases, or nucleic-acid stimulated ATPases. The AAA+ proteins contain several distinct features in addition to the conserved alpha-beta-alpha core domain structure and the Walker A and B motifs of the P-loop NTPases.','cd00009','AAA'),(2606081,'gnl|CDD|333757',_binary 'ATPase family associated with various cellular activities (AAA).  AAA family proteins often perform chaperone-like functions that assist in the assembly, operation, or disassembly of protein complexes.','pfam00004','AAA'),(2606082,'gnl|CDD|131688',_binary 'gas vesicle protein GvpN.  Members of this family are the GvpN protein associated with the production of gas vesicles produced in some prokaryotes to give cells buoyancy. This family belongs to a larger family of ATPases (pfam07728). [Cellular processes, Other].','TIGR02640','Gas_vesicle_protein_GvpN'),(2606093,'gnl|CDD|274008',_binary 'chromosome segregation protein SMC, common bacterial type.  SMC (structural maintenance of chromosomes) proteins bind DNA and act in organizing and segregating chromosomes for partition. SMC proteins are found in bacteria, archaea, and eukaryotes. This family represents the SMC protein of most bacteria. The smc gene is often associated with scpB (TIGR00281) and scpA genes, where scp stands for segregation and condensation protein. SMC was shown (in Caulobacter crescentus) to be induced early in S phase but present and bound to DNA throughout the cell cycle. [Cellular processes, Cell division, DNA metabolism, Chromosome-associated proteins].','TIGR02168','Chromosome_partition_p...'),(2606096,'gnl|CDD|224117',_binary 'Chromosome segregation ATPases [Cell division and chromosome partitioning].','COG1196','Smc'),(2606099,'gnl|CDD|224428',_binary 'Predicted membrane protein [Function unknown].','COG1511','COG1511'),(2606111,'gnl|CDD|313370',_binary 'Predicted nucleotidyltransferase.  Members of this family of bacterial proteins catalyze the transfer of nucleotide residues from nucleoside diphosphates or triphosphates into dimer or polymer forms.','pfam10127','Nuc-transf'),(2606112,'gnl|CDD|222905',_binary 'hypothetical protein; Provisional.','PHA02603','nrdC.11'),(2606113,'gnl|CDD|226071',_binary 'Predicted nucleotidyltransferase [General function prediction only].','COG3541','COG3541'),(2606126,'gnl|CDD|317104',_binary 'Phage integrase, N-terminal SAM-like domain.  This domain is found in a variety of phage integrase proteins.','pfam14659','Phage_int_SAM_3'),(2606139,'gnl|CDD|338600',_binary 'Phage integrase SAM-like domain.  A family of uncharacterized proteins found by clustering human gut metagenomic sequences. This family appears related to the N-terminal domain of phage integrases.','pfam13102','Phage_int_SAM_5'),(2606145,'gnl|CDD|307341',_binary 'SPFH domain / Band 7 family.  This family has been called SPFH, Band 7 or PHB domain. Recent phylogenetic analysis has shown this domain to be a slipin or Stomatin-like integral membrane domain conserved from protozoa to mammals.','pfam01145','Band_7'),(2606149,'gnl|CDD|183178',_binary 'DNA-damage-inducible protein D; Provisional.','PRK11525','dinD'),(2606150,'gnl|CDD|335307',_binary 'Phage antirepressor protein KilAC domain.  This domain was called the KilAC domain by Iyer and colleagues.','pfam03374','ANT'),(2606151,'gnl|CDD|226171',_binary 'Uncharacterized phage-encoded protein [Function unknown].','COG3645','COG3645'),(2606152,'gnl|CDD|334947',_binary 'BRO family, N-terminal domain.  This family includes the N-terminus of baculovirus BRO and ALI motif proteins. The function of BRO proteins is unknown. It has been suggested that BRO-A and BRO-C are DNA binding proteins that influence host DNA replication and/or transcription. This Pfam domain does not include the characteristic invariant alanine, leucine, isoleucine motif of the ALI proteins.','pfam02498','Bro-N'),(2606191,'gnl|CDD|273523',_binary 'ribose-phosphate pyrophosphokinase.  Alternate name: phosphoribosylpyrophosphate synthetase In some systems, close homologs lacking enzymatic activity exist and perform regulatory functions. The model is designated subfamily rather than equivalog for this reason. [Purines, pyrimidines, nucleosides, and nucleotides, Purine ribonucleotide biosynthesis].','TIGR01251','Ribose-phosphate_pyrop...'),(2606192,'gnl|CDD|223538',_binary 'Phosphoribosylpyrophosphate synthetase [Nucleotide transport and metabolism / Amino acid transport and metabolism].','COG0462','PrsA'),(2606193,'gnl|CDD|234868',_binary 'ribose-phosphate pyrophosphokinase; Provisional.','PRK00934','PRK00934'),(2606194,'gnl|CDD|234929',_binary 'ribose-phosphate pyrophosphokinase; Provisional.','PRK01259','PRK01259'),(2606196,'gnl|CDD|179893',_binary 'ribose-phosphate pyrophosphokinase; Provisional.','PRK04923','PRK04923'),(2606197,'gnl|CDD|215209',_binary 'ribose-phosphate pyrophosphokinase.','PLN02369','PLN02369'),(2606198,'gnl|CDD|235960',_binary 'phosphoribosylpyrophosphate synthetase; Provisional.','PRK07199','PRK07199'),(2606199,'gnl|CDD|240290',_binary 'phosphoribosylpyrophosphate synthetase; Provisional.','PTZ00145','PTZ00145'),(2606200,'gnl|CDD|167353',_binary 'ribose-phosphate pyrophosphokinase; Provisional.','PRK02269','PRK02269'),(2606208,'gnl|CDD|312064',_binary 'Chromatin associated protein KTI12.  This is a family of chromatin associated proteins which interact with the Elongator complex, a component of the elongating form of RNA polymerase II. The Elongator complex has histone acetyltransferase activity.','pfam08433','KTI12'),(2606209,'gnl|CDD|132613',_binary 'L-seryl-tRNA(Sec) kinase, archaeal.  Members of this protein are L-seryl-tRNA(Sec) kinase. This enzyme is part of a two-step pathway in Eukaryota and Archaea for performing selenocysteine biosynthesis by changing serine misacylated on selenocysteine-tRNA to selenocysteine. This enzyme performs the first step, phosphorylation of the OH group of the serine side chain. This family represents archaeal proteins with this activity. [Protein synthesis, tRNA aminoacylation].','TIGR03574','L-seryl-tRNASec_kinase'),(2606214,'gnl|CDD|222898',_binary 'nicotinamide phosphoribosyl transferase; Provisional.','PHA02594','nadV'),(2606215,'gnl|CDD|236407',_binary 'putative nicotinate phosphoribosyltransferase; Provisional.','PRK09198','PRK09198'),(2606216,'gnl|CDD|238803',_binary 'pre-B-cell colony-enhancing factor (PBEF)-like. The mammalian members of this group of nicotinate phosphoribosyltransferases (NAPRTases) were originally identified as genes whose expression is upregulated upon activation in lymphoid cells. In general, nicotinate phosphoribosyltransferase catalyses the formation of NAMN and PPi from 5-phosphoribosy -1-pyrophosphate (PRPP) and nicotinic acid, this is the first, and also rate limiting, reaction in the NAD salvage synthesis.','cd01569','PBEF_like'),(2606217,'gnl|CDD|238801',_binary 'Nicotinate phosphoribosyltransferase (NAPRTase) family. Nicotinate phosphoribosyltransferase catalyses the formation of NAMN and PPi from 5-phosphoribosy -1-pyrophosphate (PRPP) and nicotinic acid, this is the first, and also rate limiting, reaction in the NAD salvage synthesis. This salvage pathway serves to recycle NAD degradation products.','cd01567','NAPRTase_PncB'),(2606218,'gnl|CDD|335618',_binary 'Nicotinate phosphoribosyltransferase (NAPRTase) family.  Nicotinate phosphoribosyltransferase (EC:2.4.2.11) is the rate limiting enzyme that catalyzes the first reaction in the NAD salvage synthesis. This family also includes Pre-B cell enhancing factor that is a cytokine. This family is related to Quinolinate phosphoribosyltransferase pfam01729.','pfam04095','NAPRTase'),(2606219,'gnl|CDD|224405',_binary 'Nicotinic acid phosphoribosyltransferase [Coenzyme metabolism].','COG1488','PncB'),(2606220,'gnl|CDD|238286',_binary 'Phosphoribosyltransferase (PRTase) type II; This family contains two enzymes that play an important role in NAD production by either allowing quinolinic acid (QA) , quinolinate phosphoribosyl transferase (QAPRTase), or nicotinic acid (NA), nicotinate phosphoribosyltransferase (NAPRTase), to be used in the synthesis of NAD. QAPRTase catalyses the reaction of quinolinic acid (QA) with 5-phosphoribosyl-1-pyrophosphate (PRPP) in the presence of Mg2+ to produce nicotinic acid mononucleotide (NAMN), pyrophosphate and carbon dioxide, an important step in the de novo synthesis of NAD. NAPRTase catalyses a similar reaction leading to NAMN and pyrophosphate, using nicotinic acid an PPRP as substrates, used in the NAD salvage pathway.','cd00516','PRTase_typeII'),(2606265,'gnl|CDD|310133',_binary 'Protein of unknown function (DUF732).  This family consists of several uncharacterized Mycobacterium tuberculosis and leprae proteins of unknown function.','pfam05305','DUF732'),(2606296,'gnl|CDD|279297',_binary 'Exonuclease.  This family includes a variety of exonuclease proteins, such as ribonuclease T and the epsilon subunit of DNA polymerase III.;.','pfam00929','RNase_T'),(2606315,'gnl|CDD|334401',_binary 'tRNA-splicing ligase RtcB.  This family of RNA ligases (EC:6.5.1.3) join 2\',3\'-cyclic phosphate and 5\'-OH ends. They catalyze the splicing of tRNA and may also participate in tRNA repair and recovery from stress-induced RNA damage.','pfam01139','RtcB'),(2606316,'gnl|CDD|224604',_binary 'Uncharacterized conserved protein [Function unknown].','COG1690','RtcB'),(2606317,'gnl|CDD|181972',_binary 'hypothetical protein; Reviewed.','PRK09588','PRK09588'),(2606318,'gnl|CDD|274417',_binary 'release factor H-coupled RctB family protein.  Members of this family are related to RctB. RctB a protein of known structure but unknown function that often is encoded near RNA cyclase and therefore is suggested to be a tRNA or mRNA processing enzyme. This family of RctB-like proteins in encoded upstream of, and apparently is translationally coupled to, the putative peptide chain release factor RF-H (TIGR03072), product of the prfH gene. Note that a large deletion at the junction between this gene and the prfH gene in Escherichia coli K-12 marks both as probable pseudogenes. [Protein synthesis, Other].','TIGR03073','release_rtcB'),(2606410,'gnl|CDD|274682',_binary 'probable DNA repair protein.  Members of this protein family are bacterial proteins of about 900 amino acids in length. Members show extended homology to proteins in TIGR02786, the AddB protein of double-strand break repair via homologous recombination. Members of this family, therefore, may be DNA repair proteins.','TIGR03623','TIGR03623'),(2606468,'gnl|CDD|315374',_binary 'PDDEXK-like domain of unknown function (DUF3799).  This family of proteins is functionally uncharacterized. This family of proteins is found in bacteria and viruses. Proteins in this family are typically between 265 and 420 amino acids in length. It appears that these proteins are distantly related to the PDDEXK superfamily and so these domains are likely to be nucleases. This family has a C-terminal cysteine cluster similar to that found in pfam01930.','pfam12684','DUF3799'),(2606471,'gnl|CDD|223627',_binary 'Superfamily II DNA/RNA helicases, SNF2 family [Transcription / DNA replication, recombination, and repair].','COG0553','HepA'),(2606475,'gnl|CDD|350757',_binary 'DEXH-box helicase domain of Mot1.  Modifier of transcription 1 (Mot1, also known as TAF172 in eukaryotes) regulates transcription in association with TATA binding protein (TBP). Mot1, Ino80C, and NC2 function coordinately to regulate pervasive transcription in yeast and mammals. Mot1 is a member of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd17999','DEXHc_Mot1'),(2606476,'gnl|CDD|350759',_binary 'DEXH-box helicase domain of ERCC6L.  ERCC excision repair 6 like, spindle assembly checkpoint helicase (ERCC6L, also known as RAD26L) is an essential component of the mitotic spindle assembly checkpoint, by acting as a tension sensor that associates with catenated DNA which is stretched under tension until it is resolved during anaphase. ERCC6L is proposed to stimulate cancer cell proliferation by promoting cell cycle through a way of RAB31-MAPK-CDK2. ERCC6L is a member of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18001','DEXHc_ERCC6L'),(2606477,'gnl|CDD|306645',_binary 'SNF2 family N-terminal domain.  This domain is found in proteins involved in a variety of processes including transcription regulation (e.g., SNF2, STH1, brahma, MOT1), DNA repair (e.g., ERCC6, RAD16, RAD5), DNA recombination (e.g., RAD54), and chromatin unwinding (e.g., ISWI) as well as a variety of other proteins with little functional information (e.g., lodestar, ETL1).','pfam00176','SNF2_N'),(2606479,'gnl|CDD|350768',_binary 'DEXH-box helicase domain of SMARCAL1.  SMARCAL1 (SWI/SNF related, matrix associated, actin dependent regulator of chromatin, subfamily a like 1, also known as HARP) is recruited to stalled replication forks to promote repair and helps restart replication. It plays a role in DNA repair, telomere maintenance and replication fork stability in response to DNA replication stress. Mutations cause Schimke Immunoosseous Dysplasia. SMARCAL1 is part of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18010','DEXHc_HARP_SMARCAL1'),(2606480,'gnl|CDD|350770',_binary 'DEAQ-box helicase domain of archaeal and bacterial SNF2-related proteins.  Proteins belonging to SNF2 family of DNA dependent ATPases are important members of the chromatin remodeling complexes that are implicated in epigenetic control of gene expression. The Snf2 family comprises a large group of ATP-hydrolyzing proteins that are ubiquitous in eukaryotes, but also present in eubacteria and archaea. Archaeal SWI2 and SNF2 are members of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18012','DEXQc_arch_SWI2_SNF2'),(2606481,'gnl|CDD|350762',_binary 'DEXH-box helicase domain of RAD54.  RAD54 proteins play a role in recombination. They are members of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18004','DEXHc_RAD54'),(2606482,'gnl|CDD|350764',_binary 'DEAH/Q-box helicase domain of CHD1L.  Chromodomain helicase DNA binding protein 1 like (CHD1L, also known as ALC1) is involved in DNA repair by regulating chromatin relaxation following DNA damage. CHD1L is a member of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18006','DEXHc_CHD1L'),(2606487,'gnl|CDD|350771',_binary 'DEXQ-box helicase domain of bacterial SNF2 family proteins.  Proteins belonging to the SNF2 family of DNA dependent ATPases are important members of the chromatin remodeling complexes that are implicated in epigenetic control of gene expression. The Snf2 family comprise a large group of ATP-hydrolyzing proteins that are ubiquitous in eukaryotes, but also present in eubacteria and archaea. The bacterial SNF2 present in this family are members of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18013','DEXQc_bact_SNF2'),(2606489,'gnl|CDD|350753',_binary 'DEXH-box helicase domain of the chromodomain helicase DNA binding protein 6, 7, 8 and 9.  Chromodomain-helicase-DNA-binding protein 6-9 (CHD6, CHD7, CHD8, and CHD9) are members of the DEAD-like helicases superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd17995','DEXHc_CHD6_7_8_9'),(2606490,'gnl|CDD|215601',_binary 'Probable chromatin-remodeling complex ATPase chain; Provisional.','PLN03142','PLN03142'),(2606492,'gnl|CDD|350758',_binary 'DEXH-box helicase domain of ERCC6.  ERCC excision repair 6, chromatin remodeling factor (ERCC6, also known Cockayne syndrome group B (CSB), Rad26 in Saccharomyces cerevisiae, and Rhp26 in Schizosaccharomyces pombe) is a DNA-binding protein that is important in transcription-coupled excision repair. ERCC6 is a member of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18000','DEXHc_ERCC6'),(2606498,'gnl|CDD|350816',_binary 'DEAH-box helicase domain of the chromodomain helicase DNA binding protein 6.  Chromodomain-helicase-DNA-binding protein 6 (CHD6) is a DNA-dependent ATPase that plays a role in chromatin remodeling. It regulates transcription by disrupting nucleosomes in a largely non-sliding manner which strongly increases the accessibility of chromatin. It activates transcription of specific genes in response to oxidative stress through interaction with NFE2L2.2 and acts as a transcriptional repressor of different viruses including influenza virus or papillomavirus. During influenza virus infection, the viral polymerase complex localizes CHD6 to inactive chromatin where it gets degraded in a proteasome independent-manner. CHD6 is a member of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18058','DEXHc_CHD6'),(2606503,'gnl|CDD|350766',_binary 'DEXH-box helicase domain of SHPRH-like proteins.  The SHPRH-like subgroup belongs to the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18008','DEXDc_SHPRH-like'),(2606506,'gnl|CDD|350765',_binary 'DEXH-box helicase domain of ATRX-like proteins.  This family includes ATRX-like members such as transcriptional regulator ATRX (also called alpha thalassemia/mental retardation syndrome X-linked and X-linked nuclear protein or XNP) which is involved in transcriptional regulation and chromatin remodeling, and ARIP4 (also called androgen receptor-interacting protein 4, RAD54 like 2 or RAD54L2) which modulates androgen receptor (AR)-dependent transactivation in a promoter-dependent manner. They are members of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd18007','DEXHc_ATRX-like'),(2606514,'gnl|CDD|310599',_binary 'IrrE N-terminal-like domain.  This entry includes the catalytic domain of the protein ImmA, which is a metallopeptidase containing an HEXXH zinc-binding motif from peptidase family M78. ImmA is encoded on a conjugative transposon. Conjugating bacteria are able to transfer conjugative transposons that can, for example, confer resistance to antibiotics. The transposon is integrated into the chromosome, but during conjugation excises itself and then moves to the recipient bacterium and re-integrate into its chromosome. Typically a conjugative tranposon encodes only the proteins required for this activity and the proteins that regulate it. During exponential growth, the ICEBs1 transposon of Bacillus subtilis is inactivated by the immunity repressor protein ImmR, which is encoded by the transposon and represses the genes for excision and transfer. Cleavage of ImmR relaxes repression and allows transfer of the transposon. ImmA has been shown to be essential for the cleavage of ImmR. This domain is also found in in metalloprotease IrrE, a central regulator of DNA damage repair in Deinococcaceae, HTH-type transcriptional regulators RamB and PrpC.','pfam06114','Peptidase_M78'),(2606539,'gnl|CDD|226809',_binary 'Uncharacterized protein conserved in bacteria with the myosin-like domain [Function unknown].','COG4372','COG4372'),(2606541,'gnl|CDD|173412',_binary 'MAEBL; Provisional.','PTZ00121','PTZ00121'),(2606550,'gnl|CDD|236545',_binary 'cell envelope integrity inner membrane protein TolA; Provisional.','PRK09510','tolA'),(2606553,'gnl|CDD|214959',_binary 'This model contains proteins with the VRR-NUC domain.  It is associated with members of the PD-(D/E)XK nuclease superfamily, which include the type III restriction modification enzymes, for example StyLTI.','smart00990','VRR_NUC'),(2606590,'gnl|CDD|350752',_binary 'DEAH-box helicase domain of the chromodomain helicase DNA binding proteins 3, 4 and 5.  Chromodomain-helicase-DNA-binding protein 3 (CHD3) is a component of the histone deacetylase NuRD complex which participates in the remodeling of chromatin by deacetylating histones. It is required for anchoring centrosomal pericentrin in both interphase and mitosis, for spindle organization and centrosome integrity. Chromodomain-helicase-DNA-binding protein 4 (CHD4) is a component of the histone deacetylase NuRD complex which participates in the remodeling of chromatin by deacetylating histones. Chromodomain-helicase-DNA-binding protein 5 (CHD5) is a chromatin-remodeling protein that binds DNA through histones and regulates gene transcription. It is thought to specifically recognize and bind trimethylated \'Lys-27\' (H3K27me3) and non-methylated \'Lys-4\' of histone H3 and plays a role in the development of the nervous system by activating the expression of genes promoting neuron terminal differentiation. In parallel, it may also positively regulate the trimethylation of histone H3 at \'Lys-27\' thereby specifically repressing genes that promote the differentiation into non-neuronal cell lineages. As a tumor suppressor, it regulates the expression of genes involved in cell proliferation and differentiation. In spermatogenesis, it probably regulates histone hyperacetylation and the replacement of histones by transition proteins in chromatin, a crucial step in the condensation of spermatid chromatin and the production of functional spermatozoa. CHD3, CHD4, and CHD5 are members of the DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd17994','DEXHc_CHD3_4_5'),(2606678,'gnl|CDD|309113',_binary 'Phage major capsid protein E.  Major capsid protein E is involved with the stabilisation of the condensed form of the DNA molecule in phage heads.','pfam03864','Phage_cap_E'),(2606707,'gnl|CDD|274009',_binary 'chromosome segregation protein SMC, primarily archaeal type.  SMC (structural maintenance of chromosomes) proteins bind DNA and act in organizing and segregating chromosomes for partition. SMC proteins are found in bacteria, archaea, and eukaryotes. It is found in a single copy and is homodimeric in prokaryotes, but six paralogs (excluded from this family) are found in eukarotes, where SMC proteins are heterodimeric. This family represents the SMC protein of archaea and a few bacteria (Aquifex, Synechocystis, etc); the SMC of other bacteria is described by TIGR02168. The N- and C-terminal domains of this protein are well conserved, but the central hinge region is skewed in composition and highly divergent. [Cellular processes, Cell division, DNA metabolism, Chromosome-associated proteins].','TIGR02169','chromosome_segregation...'),(2606715,'gnl|CDD|340358',_binary 'Lytic transglycosylase (LT) and goose egg-white lysozyme (GEWL)-like domain.  Members include the soluble and insoluble membrane-bound LTs in bacteria, LTs in bacteriophage lambda, as well as eukaryotic \'goose-type\' lysozymes (goose egg-white lysozyme; GEWL). LTs catalyze the cleavage of the beta-1,4-glycosidic bond between N-acetylmuramic acid (MurNAc) and N-acetyl-D-glucosamine (GlcNAc), as do \'goose-type\' lysozymes. However, in addition to this, they also make a new glycosidic bond with the C6 hydroxyl group of the same muramic acid residue.','cd00254','LT_GEWL_like'),(2606719,'gnl|CDD|223496',_binary 'ATPase involved in DNA repair [DNA replication, recombination, and repair].','COG0419','SbcC'),(2606720,'gnl|CDD|279766',_binary 'Transglycosylase SLT domain.  This family is distantly related to pfam00062. Members are found in phages, type II, type III and type IV secretion systems.','pfam01464','SLT'),(2606797,'gnl|CDD|214621',_binary 'von Willebrand factor (vWF) type A domain.  VWA domains in extracellular eukaryotic proteins mediate adhesion via metal ion-dependent adhesion sites (MIDAS). Intracellular VWA domains and homologues in prokaryotes have recently been identified. The proposed VWA domains in integrin beta subunits have recently been substantiated using sequence-based methods.','smart00327','VWA'),(2606801,'gnl|CDD|335628',_binary 'Low affinity iron permease.','pfam04120','Iron_permease'),(2606802,'gnl|CDD|227765',_binary 'Predicted small integral membrane protein [Function unknown].','COG5478','COG5478'),(2606803,'gnl|CDD|334297',_binary 'NlpC/P60 family.  The function of this domain is unknown. It is found in several lipoproteins.','pfam00877','NLPC_P60'),(2606804,'gnl|CDD|223862',_binary 'Cell wall-associated hydrolases (invasion-associated proteins) [Cell envelope biogenesis, outer membrane].','COG0791','Spr'),(2606806,'gnl|CDD|236773',_binary 'outer membrane lipoprotein; Provisional.','PRK10838','spr'),(2606813,'gnl|CDD|224600',_binary 'D-alanyl-D-alanine carboxypeptidase [Cell envelope biogenesis, outer membrane].','COG1686','DacC'),(2606815,'gnl|CDD|334245',_binary 'D-alanyl-D-alanine carboxypeptidase.','pfam00768','Peptidase_S11'),(2606821,'gnl|CDD|223611',_binary 'Diadenosine tetraphosphate (Ap4A) hydrolase and other HIT family hydrolases [Nucleotide transport and metabolism / Carbohydrate transport and metabolism / General function prediction only].','COG0537','Hit'),(2606822,'gnl|CDD|238608',_binary 'HINT (histidine triad nucleotide-binding protein) subgroup: Members of this CD belong to the superfamily of histidine triad hydrolases that act on alpha-phosphate of ribonucleotides. This subgroup includes members from all three forms of cellular life. Although the biochemical function has not been characterised for many of the members of this subgroup, the proteins from Yeast have been shown to be involved in secretion, peroxisome formation and gene expression.','cd01277','HINT_subgroup'),(2606823,'gnl|CDD|238606',_binary 'FHIT (fragile histidine family): FHIT proteins, related to the HIT family carry a motif HxHxH/Qxx (x, is a hydrophobic amino acid), On the basis of sequence, substrate specificity, structure, evolution and mechanism, HIT proteins are classified into three  branches: the Hint branch, which consists of adenosine 5\' -monophosphoramide hydrolases, the Fhit branch, that consists of diadenosine polyphosphate hydrolases, and the GalT branch consisting of specific nucloside monophosphate transferases. Fhit plays a very important role in the development of tumours. Infact, Fhit deletions are among the earliest and most frequent genetic alterations in the development of tumours.','cd01275','FHIT'),(2606824,'gnl|CDD|334445',_binary 'HIT domain.','pfam01230','HIT'),(2606825,'gnl|CDD|238607',_binary 'Protein Kinase C Interacting protein related (PKCI): PKCI and related proteins belong to the ubiquitous HIT family of hydrolases that act on alpha-phosphates of ribonucleotides. The members of this subgroup have a conserved HxHxHxx motif (x is a hydrophobic residue) that is a signature for this family. No enzymatic activity has been reported however, for PKCI and its related members.','cd01276','PKCI_related'),(2606826,'gnl|CDD|238263',_binary 'HIT family: HIT (Histidine triad) proteins, named for a motif related to the sequence HxHxH/Qxx (x, a hydrophobic amino acid), are a superfamily of nucleotide hydrolases and transferases, which act on the alpha-phosphate of ribonucleotides. On the basis of sequence, substrate specificity, structure, evolution and mechanism, HIT proteins are classified in the literacture into three major branches: the Hint branch, which consists of adenosine 5\' -monophosphoramide hydrolases, the Fhit branch, that consists of diadenosine polyphosphate hydrolases, and the GalT branch consisting of specific nucloside monophosphate transferases. Further sequence analysis reveals several new closely related, yet uncharacterized subgroups.','cd00468','HIT_like'),(2606827,'gnl|CDD|236153',_binary 'hypothetical protein; Validated.','PRK08116','PRK08116'),(2606828,'gnl|CDD|224401',_binary 'DNA replication protein [DNA replication, recombination, and repair].','COG1484','DnaC'),(2606829,'gnl|CDD|235871',_binary 'DNA replication protein DnaC; Validated.','PRK06835','PRK06835'),(2606830,'gnl|CDD|180750',_binary 'hypothetical protein; Provisional.','PRK06921','PRK06921'),(2606831,'gnl|CDD|181180',_binary 'DNA replication protein DnaC; Validated.','PRK07952','PRK07952'),(2606833,'gnl|CDD|183482',_binary 'putative replication protein; Provisional.','PRK12377','PRK12377'),(2606834,'gnl|CDD|99735',_binary 'Acetyl ornithine aminotransferase family. This family belongs to pyridoxal phosphate (PLP)-dependent aspartate aminotransferase superfamily (fold I). The major groups in this CD correspond to ornithine aminotransferase, acetylornithine aminotransferase, alanine-glyoxylate aminotransferase, dialkylglycine decarboxylase, 4-aminobutyrate aminotransferase, beta-alanine-pyruvate aminotransferase, adenosylmethionine-8-amino-7-oxononanoate aminotransferase, and glutamate-1-semialdehyde 2,1-aminomutase. All the enzymes belonging to this family act on basic amino acids and their derivatives are involved in transamination or decarboxylation.','cd00610','OAT_like'),(2606835,'gnl|CDD|223238',_binary '4-aminobutyrate aminotransferase and related aminotransferases [Amino acid transport and metabolism].','COG0160','GabT'),(2606836,'gnl|CDD|227325',_binary 'Ornithine/acetylornithine aminotransferase [Amino acid transport and metabolism].','COG4992','ArgD'),(2606837,'gnl|CDD|273228',_binary 'transaminase, acetylornithine/succinylornithine family.  This family of proteins, for which ornithine aminotransferases form an outgroup, consists mostly of proteins designated acetylornithine aminotransferase. However, the two very closely related members from E. coli are assigned different enzymatic activities. One is acetylornithine aminotransferase (EC 2.6.1.11), ArgD, an enzyme of arginine biosynthesis, while another is succinylornithine aminotransferase, an enzyme of the arginine succinyltransferase pathway, an ammonia-generating pathway of arginine catabolism (See MEDLINE:98361920). Members of this family may also act on ornithine, like ornithine aminotransferase (EC 2.6.1.13) (see MEDLINE:90337349) and on succinyldiaminopimelate, like N-succinyldiaminopmelate-aminotransferase (EC 2.6.1.17, DapC, an enzyme of lysine biosynthesis) (see MEDLINE:99175097).','TIGR00707','Acetylornithine_aminot...'),(2606838,'gnl|CDD|333920',_binary 'Aminotransferase class-III.','pfam00202','Aminotran_3'),(2606839,'gnl|CDD|235599',_binary '4-aminobutyrate aminotransferase; Provisional.','PRK05769','PRK05769'),(2606840,'gnl|CDD|223239',_binary 'Adenosylmethionine-8-amino-7-oxononanoate aminotransferase [Coenzyme metabolism].','COG0161','BioA'),(2606841,'gnl|CDD|179270',_binary 'acetylornithine transaminase protein; Provisional.','PRK01278','argD'),(2606842,'gnl|CDD|235056',_binary 'acetylornithine aminotransferase; Provisional.','PRK02627','PRK02627'),(2606843,'gnl|CDD|181401',_binary '4-aminobutyrate aminotransferase; Provisional.','PRK08360','PRK08360'),(2606844,'gnl|CDD|177748',_binary 'acetylornithine transaminase.','PLN00144','PLN00144'),(2606845,'gnl|CDD|235112',_binary 'acetylornithine aminotransferase; Provisional.','PRK03244','argD'),(2606846,'gnl|CDD|235687',_binary 'hypothetical protein; Provisional.','PRK06062','PRK06062'),(2606848,'gnl|CDD|183175',_binary 'putrescine--2-oxoglutarate aminotransferase; Provisional.','PRK11522','PRK11522'),(2606849,'gnl|CDD|240281',_binary 'ornithine aminotransferase-like protein; Provisional.','PTZ00125','PTZ00125'),(2606850,'gnl|CDD|181234',_binary '4-aminobutyrate aminotransferase; Provisional.','PRK08117','PRK08117'),(2606851,'gnl|CDD|129783',_binary '4-aminobutyrate aminotransferase, prokaryotic type.  This enzyme is a class III pyridoxal-phosphate-dependent aminotransferase. This model describes known bacterial examples of the enzyme. The best archaeal matches are presumed but not trusted to have the equivalent function. The degree of sequence difference between this set and known eukaryotic (mitochondrial) examples is greater than the distance to some proteins known to have different functions, and so separate models are built for prokaryotic and eukaryotic sets. E. coli has two isozymes. Alternate names include GABA transaminase, gamma-amino-N-butyrate transaminase, and beta-alanine--oxoglutarate aminotransferase. [Central intermediary metabolism, Other].','TIGR00700','semialdehyde_transamin...'),(2606852,'gnl|CDD|215335',_binary 'ornithine-delta-aminotransferase.','PLN02624','PLN02624'),(2606853,'gnl|CDD|179636',_binary 'acetylornithine transaminase protein; Provisional.','PRK03715','argD'),(2606854,'gnl|CDD|168145',_binary '4-aminobutyrate aminotransferase; Provisional.','PRK05639','PRK05639'),(2606855,'gnl|CDD|235885',_binary '4-aminobutyrate aminotransferase; Reviewed.','PRK06918','PRK06918'),(2606856,'gnl|CDD|181493',_binary '4-aminobutyrate aminotransferase; Provisional.','PRK08593','PRK08593'),(2606857,'gnl|CDD|235685',_binary '4-aminobutyrate aminotransferase; Provisional.','PRK06058','PRK06058'),(2606858,'gnl|CDD|132415',_binary 'putrescine aminotransferase.  Members of this family are putrescine aminotransferase, as found in Escherichia coli, Erwinia carotovora subsp. atroseptica, and closely related species. This pyridoxal phosphate enzyme, as characterized in E. coli, can act also on cadaverine and, more weakly, spermidine. [Central intermediary metabolism, Polyamine biosynthesis].','TIGR03372','Putrescine_aminotransf...'),(2606859,'gnl|CDD|179505',_binary 'acetylornithine aminotransferase; Provisional.','PRK02936','argD'),(2606860,'gnl|CDD|235913',_binary 'hypothetical protein; Provisional.','PRK07036','PRK07036'),(2606861,'gnl|CDD|180390',_binary '4-aminobutyrate aminotransferase; Provisional.','PRK06082','PRK06082'),(2606862,'gnl|CDD|179933',_binary 'bifunctional N-succinyldiaminopimelate-aminotransferase/acetylornithine transaminase protein; Reviewed.','PRK05093','argD'),(2606863,'gnl|CDD|273853',_binary 'ornithine aminotransferase.  This model describes the final step in the biosynthesis of ornithine from glutamate via the non-acetylated pathway. Ornithine amino transferase takes L-glutamate 5-semialdehyde and makes it into ornithine, which is used in the urea cycle, as well as in the biosynthesis of arginine. This model includes low-GC bacteria and eukaryotic species. The genes from two species are annotated as putative acetylornithine aminotransferases - one from Porphyromonas gingivalis (OMNI|PG1271), and the other from Staphylococcus aureus (OMNI|SA0170). After homology searching using BLAST it was determined that these two sequences were most closely related to ornithine aminotransferases. This model\'s seed includes one characterized hit, from Bacillus subtilis (SP|P38021).','TIGR01885','Ornithine_aminotransfe...'),(2606864,'gnl|CDD|183486',_binary 'bifunctional succinylornithine transaminase/acetylornithine transaminase; Provisional.','PRK12381','PRK12381'),(2606865,'gnl|CDD|273109',_binary 'adenosylmethionine-8-amino-7-oxononanoate transaminase.  All members of the seed alignment have been demonstrated experimentally to act as EC 2.6.1.62, an enzyme in the biotin biosynthetic pathway. Alternate names include 7,8-diaminopelargonic acid aminotransferase, DAPA aminotransferase, and adenosylmethionine-8-amino-7-oxononanoate aminotransferase. The gene symbol is bioA in E. coli and BIO3 in S. cerevisiae. [Biosynthesis of cofactors, prosthetic groups, and carriers, Biotin].','TIGR00508','hypothetical_protein_D...'),(2606866,'gnl|CDD|236149',_binary '4-aminobutyrate aminotransferase; Validated.','PRK08088','PRK08088'),(2606867,'gnl|CDD|168967',_binary 'hypothetical protein; Provisional.','PRK07481','PRK07481'),(2606868,'gnl|CDD|180401',_binary 'aminotransferase; Provisional.','PRK06105','PRK06105'),(2606869,'gnl|CDD|182078',_binary '4-aminobutyrate transaminase; Provisional.','PRK09792','PRK09792'),(2606870,'gnl|CDD|180690',_binary '4-aminobutyrate aminotransferase; Provisional.','PRK06777','PRK06777'),(2606871,'gnl|CDD|235823',_binary 'hypothetical protein; Provisional.','PRK06541','PRK06541'),(2606872,'gnl|CDD|274490',_binary 'succinylornithine transaminase family.  Members of the seed alignment for this protein family are the enzyme succinylornithine transaminase (EC 2.6.1.81), which catalyzes the third of five steps in arginine succinyltransferase (AST) pathway, an ammonia-releasing pathway of arginine degradation. All seed alignment sequences are found within arginine succinyltransferase operons, and all proteins that score above 820.0 bits should function as succinylornithine transaminase. However, a number of sequences extremely closely related in sequence, found in different genomic contexts, are likely to act in different biological processes and may act on different substrates. This model is desigated subfamily rather than equivalog, pending further consideration, for this reason. [Energy metabolism, Amino acids and amines].','TIGR03246','arg_catab_astC'),(2606873,'gnl|CDD|181707',_binary 'beta alanine--pyruvate transaminase; Provisional.','PRK09221','PRK09221'),(2606874,'gnl|CDD|180994',_binary 'putative aminotransferase; Validated.','PRK07480','PRK07480'),(2606875,'gnl|CDD|179803',_binary 'acetylornithine aminotransferase; Provisional.','PRK04260','PRK04260'),(2606876,'gnl|CDD|236026',_binary 'hypothetical protein; Provisional.','PRK07482','PRK07482'),(2606877,'gnl|CDD|183999',_binary 'omega amino acid--pyruvate transaminase; Provisional.','PRK13360','PRK13360'),(2606878,'gnl|CDD|235716',_binary 'hypothetical protein; Provisional.','PRK06149','PRK06149'),(2606879,'gnl|CDD|235892',_binary 'diaminobutyrate--2-oxoglutarate aminotransferase; Provisional.','PRK06938','PRK06938'),(2606880,'gnl|CDD|273230',_binary 'glutamate-1-semialdehyde-2,1-aminomutase.  This enzyme, glutamate-1-semialdehyde-2,1-aminomutase (glutamate-1-semialdehyde aminotransferase, GSA aminotransferase), contains a pyridoxal phosphate attached at a Lys residue at position 283 of the seed alignment. It is in the family of class III aminotransferases. [Biosynthesis of cofactors, prosthetic groups, and carriers, Heme, porphyrin, and cobalamin].','TIGR00713','Glutamate-1-semialdehy...'),(2606881,'gnl|CDD|274117',_binary 'diaminobutyrate--2-oxoglutarate aminotransferase.  Members of this family of class III pyridoxal-phosphate-dependent aminotransferases are diaminobutyrate--2-oxoglutarate aminotransferase (EC 2.6.1.76) that catalyze the first step in ectoine biosynthesis from L-aspartate beta-semialdehyde. This family is readily separated phylogenetically from enzymes with the same substrate and product but involved in other process such as siderophore (SP|Q9Z3R2) or 1,3-diaminopropane (SP|P44951) biosynthesis. The family TIGR00709 previously included both groups but has now been revised to exclude the ectoine biosynthesis proteins of this family. Ectoine is a compatible solute particularly effective in conferring salt tolerance. [Cellular processes, Adaptations to atypical conditions].','TIGR02407','Diaminobutyrate--2-oxo...'),(2606882,'gnl|CDD|235884',_binary 'hypothetical protein; Provisional.','PRK06917','PRK06917'),(2606883,'gnl|CDD|179736',_binary 'ornithine--oxo-acid transaminase; Provisional.','PRK04073','rocD'),(2606884,'gnl|CDD|236032',_binary '4-aminobutyrate aminotransferase; Provisional.','PRK07495','PRK07495'),(2606885,'gnl|CDD|236437',_binary 'diaminobutyrate--2-oxoglutarate aminotransferase; Validated.','PRK09264','PRK09264'),(2606886,'gnl|CDD|223080',_binary 'Glutamate-1-semialdehyde aminotransferase [Coenzyme metabolism].','COG0001','HemL'),(2606887,'gnl|CDD|171472',_binary 'putative aminotransferase; Provisional.','PRK12403','PRK12403'),(2606888,'gnl|CDD|129792',_binary '2,4-diaminobutyrate 4-transaminases.  This family consists of L-diaminobutyric acid transaminases. This general designation covers both 2.6.1.76 (diaminobutyrate-2-oxoglutarate transaminase, which uses glutamate as the amino donor in DABA biosynthesis), and 2.6.1.46 (diaminobutyrate--pyruvate transaminase, which uses alanine as the amino donor). Most members with known function are 2.6.1.76, and at least some annotations as 2.6.1.46 in current databases at time of model revision are incorrect. A distinct branch of this family contains examples of 2.6.1.76 nearly all of which are involved in ectoine biosynthesis. A related enzyme is 4-aminobutyrate aminotransferase (EC 2.6.1.19), also called GABA transaminase. These enzymes all are pyridoxal phosphate-containing class III aminotransferase. [Central intermediary metabolism, Other].','TIGR00709','Diaminobutyrate--2-oxo...'),(2606889,'gnl|CDD|234848',_binary 'ornithine--oxo-acid transaminase; Reviewed.','PRK00854','rocD'),(2606890,'gnl|CDD|181078',_binary 'aminotransferase; Validated.','PRK07678','PRK07678'),(2606891,'gnl|CDD|180746',_binary 'adenosylmethionine--8-amino-7-oxononanoate transaminase; Provisional.','PRK06916','PRK06916'),(2606892,'gnl|CDD|183493',_binary 'glutamate-1-semialdehyde aminotransferase; Provisional.','PRK12389','PRK12389'),(2606893,'gnl|CDD|235656',_binary 'adenosylmethionine--8-amino-7-oxononanoate transaminase; Provisional.','PRK05964','PRK05964'),(2606894,'gnl|CDD|234607',_binary 'glutamate-1-semialdehyde aminotransferase; Provisional.','PRK00062','PRK00062'),(2606895,'gnl|CDD|180174',_binary 'adenosylmethionine--8-amino-7-oxononanoate transaminase; Provisional.','PRK05630','PRK05630'),(2606896,'gnl|CDD|235889',_binary 'diaminobutyrate--2-oxoglutarate aminotransferase; Provisional.','PRK06931','PRK06931'),(2606897,'gnl|CDD|234803',_binary 'glutamate-1-semialdehyde aminotransferase; Provisional.','PRK00615','PRK00615'),(2606898,'gnl|CDD|235894',_binary 'adenosylmethionine--8-amino-7-oxononanoate transaminase; Provisional.','PRK06943','PRK06943'),(2606899,'gnl|CDD|236336',_binary 'adenosylmethionine--8-amino-7-oxononanoate transaminase; Provisional.','PRK08742','PRK08742'),(2606900,'gnl|CDD|181189',_binary 'adenosylmethionine--8-amino-7-oxononanoate transaminase; Validated.','PRK07986','PRK07986'),(2606901,'gnl|CDD|101376',_binary 'acetylornithine/acetyl-lysine aminotransferase; Provisional.','PRK04013','argD'),(2606902,'gnl|CDD|178100',_binary 'glutamate-1-semialdehyde 2,1-aminomutase.','PLN02482','PLN02482'),(2606903,'gnl|CDD|179868',_binary 'acetylornithine transaminase protein; Provisional.','PRK04612','argD'),(2606904,'gnl|CDD|180441',_binary 'adenosylmethionine--8-amino-7-oxononanoate transaminase; Provisional.','PRK06173','PRK06173'),(2606905,'gnl|CDD|236027',_binary 'hypothetical protein; Provisional.','PRK07483','PRK07483'),(2606919,'gnl|CDD|222864',_binary '41 helicase; Provisional.','PHA02542','41'),(2606920,'gnl|CDD|237666',_binary 'chaperone protein DnaJ; Provisional.','PRK14296','PRK14296'),(2606921,'gnl|CDD|237659',_binary 'chaperone protein DnaJ; Provisional.','PRK14287','PRK14287'),(2606922,'gnl|CDD|237667',_binary 'chaperone protein DnaJ; Provisional.','PRK14299','PRK14299'),(2606923,'gnl|CDD|182347',_binary 'curved DNA-binding protein CbpA; Provisional.','PRK10266','PRK10266'),(2606924,'gnl|CDD|237656',_binary 'chaperone protein DnaJ; Provisional.','PRK14280','PRK14280'),(2606925,'gnl|CDD|184612',_binary 'chaperone protein DnaJ; Provisional.','PRK14298','PRK14298'),(2606926,'gnl|CDD|237655',_binary 'chaperone protein DnaJ; Provisional.','PRK14279','PRK14279'),(2606927,'gnl|CDD|184604',_binary 'chaperone protein DnaJ; Provisional.','PRK14283','PRK14283'),(2606928,'gnl|CDD|237662',_binary 'chaperone protein DnaJ; Provisional.','PRK14292','PRK14292'),(2606929,'gnl|CDD|333939',_binary 'DnaJ domain.  DnaJ domains (J-domains) are associated with hsp70 heat-shock system and it is thought that this domain mediates the interaction. DnaJ-domain is therefore part of a chaperone (protein folding) system. The T-antigens, although not in Prosite are confirmed as DnaJ containing domains from literature.','pfam00226','DnaJ'),(2606930,'gnl|CDD|237663',_binary 'chaperone protein DnaJ; Provisional.','PRK14293','PRK14293'),(2606931,'gnl|CDD|237653',_binary 'chaperone protein DnaJ; Provisional.','PRK14276','PRK14276'),(2606932,'gnl|CDD|172778',_binary 'chaperone protein DnaJ; Provisional.','PRK14290','PRK14290'),(2606933,'gnl|CDD|237661',_binary 'chaperone protein DnaJ; Provisional.','PRK14291','PRK14291'),(2606938,'gnl|CDD|334097',_binary 'RF-1 domain.  This domain is found in peptide chain release factors such as RF-1 and RF-2, and a number of smaller proteins of unknown function. This domain contains the peptidyl-tRNA hydrolase activity. The domain contains a highly conserved motif GGQ, where the glutamine is thought to coordinate the water that mediates the hydrolysis.','pfam00472','RF-1'),(2606939,'gnl|CDD|223294',_binary 'Protein chain release factor A [Translation, ribosomal structure and biogenesis].','COG0216','PrfA'),(2606940,'gnl|CDD|234799',_binary 'peptide chain release factor 2; Validated.','PRK00578','prfB'),(2606941,'gnl|CDD|234801',_binary 'peptide chain release factor 1; Validated.','PRK00591','prfA'),(2606942,'gnl|CDD|129130',_binary 'peptide chain release factor 1.  This model describes peptide chain release factor 1 (PrfA, RF-1), and excludes the related peptide chain release factor 2 (PrfB, RF-2). RF-1 helps recognize and terminate translation at UAA and UAG stop codons. The mitochondrial release factors are prfA-like, although not included above the trusted cutoff for this model. RF-1 does not have a translational frameshift. [Protein synthesis, Translation factors].','TIGR00019','Peptide_chain_release_...'),(2606943,'gnl|CDD|224107',_binary 'Protein chain release factor B [Translation, ribosomal structure and biogenesis].','COG1186','PrfB'),(2606944,'gnl|CDD|272858',_binary 'peptide chain release factor 2.  In many but not all taxa, there is a conserved real translational frameshift at a TGA codon. RF-2 helps terminate translation at TGA codons and can therefore regulate its own production by readthrough when RF-2 is insufficient. There is a Pfam model called \'RF-1\' for the superfamily of RF-1, RF-2, mitochondrial, RF-H, etc. [Protein synthesis, Translation factors].','TIGR00020','Peptide_chain_release_...'),(2606945,'gnl|CDD|213768',_binary 'putative peptide chain release factor H.  Members of this protein family are bacterial proteins homologous to peptide chain release factors 1 (RF-1, product of the prfA gene), and 2 (RF-2, product of the prfB gene). The member from Escherichia coli K-12, designated prfH, appears to be a pseudogene. This class I release factor is always found as the downstream gene of a two-gene operon. [Protein synthesis, Translation factors].','TIGR03072','release_prfH'),(2606946,'gnl|CDD|235997',_binary 'peptide chain release factor 2; Provisional.','PRK07342','PRK07342'),(2606947,'gnl|CDD|75726',_binary 'peptide chain release factor 2; Provisional.','PRK06746','PRK06746'),(2606948,'gnl|CDD|235520',_binary 'peptide chain release factor 2; Provisional.','PRK05589','PRK05589'),(2606949,'gnl|CDD|181271',_binary 'peptide chain release factor-like protein; Reviewed.','PRK08179','prfH'),(2606950,'gnl|CDD|136970',_binary 'peptide chain release factor 2; Provisional.','PRK08787','PRK08787'),(2606961,'gnl|CDD|310072',_binary 'Homing endonuclease.  Homing endonucleases are encoded by mobile DNA elements that are found inserted within host genes in all domains of life.','pfam05204','Hom_end'),(2606993,'gnl|CDD|310383',_binary 'TROVE domain.  This presumed domain is found in TEP1 and Ro60 proteins, that are RNA-binding components of Telomerase, Ro and Vault RNPs. This domain has been named TROVE, (after Telomerase, Ro and Vault). This domain is probably RNA-binding.','pfam05731','TROVE'),(2606994,'gnl|CDD|133017',_binary 'RfbF is a putative dTDP-rhamnosyl transferase.  Shigella flexneri RfbF protein is a putative dTDP-rhamnosyl transferase. dTDP rhamnosyl  transferases of Shigella flexneri  add rhamnose sugars to N-acetyl-glucosamine in the O-antigen tetrasaccharide repeat. Lipopolysaccharide O antigens are important virulence determinants for many bacteria. The variations of sugar composition, the sequence of the sugars and the linkages in the O antigen provide structural diversity of the O antigen.','cd02526','GT2_RfbF_like'),(2606995,'gnl|CDD|313356',_binary 'Glycosyltransferase like family 2.  Members of this family of prokaryotic proteins include putative glucosyltransferase, which are involved in bacterial capsule biosynthesis.','pfam10111','Glyco_tranf_2_2'),(2607005,'gnl|CDD|270622',_binary 'Catalytic domain of Protein Kinases.  PKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine or tyrosine residues on protein substrates. PKs make up a large family of serine/threonine kinases (STKs), protein tyrosine kinases (PTKs), and dual-specificity PKs that phosphorylate both serine/threonine and tyrosine residues of target proteins. Majority of protein phosphorylation occurs on serine residues while only 1% occurs on tyrosine residues. Protein phosphorylation is a mechanism by which a wide variety of cellular proteins, such as enzymes and membrane channels, are reversibly regulated in response to certain stimuli. PKs often function as components of signal transduction pathways in which one kinase activates a second kinase, which in turn, may act on other kinases; this sequential action transmits a signal from the cell surface to target proteins, which results in cellular responses. The PK family is one of the largest known protein families with more than 100 homologous yeast enzymes and more than 500 human proteins. A fraction of PK family members are pseudokinases that lack crucial residues for catalytic activity. The mutiplicity of kinases allows for specific regulation according to substrate, tissue distribution, and cellular localization. PKs regulate many cellular processes including proliferation, division, differentiation, motility, survival, metabolism, cell-cycle progression, cytoskeletal rearrangement, immunity, and neuronal functions. Many kinases are implicated in the development of various human diseases including different types of cancer. The PK family is part of a larger superfamily that includes the catalytic domains of RIO kinases, aminoglycoside phosphotransferase, choline kinase, phosphoinositide 3-kinase (PI3K), and actin-fragmin kinase.','cd00180','PKc'),(2607006,'gnl|CDD|270916',_binary 'Catalytic domain of bacterial Serine/Threonine kinases, PknB and similar proteins.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. This subfamily includes many bacterial eukaryotic-type STKs including Staphylococcus aureus PknB (also called PrkC or Stk1), Bacillus subtilis PrkC, and Mycobacterium tuberculosis Pkn proteins (PknB, PknD, PknE, PknF, PknL, and PknH), among others. S. aureus PknB is the only eukaryotic-type STK present in this species, although many microorganisms encode for several such proteins. It is important for the survival and pathogenesis of S. aureus as it is involved in the regulation of purine and pyrimidine biosynthesis, cell wall metabolism, autolysis, virulence, and antibiotic resistance. M. tuberculosis PknB is essential for growth and it acts on diverse substrates including proteins involved in peptidoglycan synthesis, cell division, transcription, stress responses, and metabolic regulation. B. subtilis PrkC is located at the inner membrane of endospores and functions to trigger spore germination. Bacterial STKs in this subfamily show varied domain architectures. The well-characterized members such as S. aureus and M. tuberculosis PknB, and B. subtilis PrkC, contain an N-terminal cytosolic  kinase domain, a transmembrane (TM) segment, and mutliple C-terminal extracellular PASTA domains. The PknB subfamily is part of a larger superfamily that includes the catalytic domains of other protein STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd14014','STKc_PknB_like'),(2607007,'gnl|CDD|270688',_binary 'Catalytic domain of CMGC family Serine/Threonine Kinases.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. The CMGC family consists of Cyclin-Dependent protein Kinases (CDKs), Mitogen-activated protein kinases (MAPKs) such as Extracellular signal-regulated kinase (ERKs), c-Jun N-terminal kinases (JNKs), and p38, and other kinases. CDKs belong to a large subfamily of STKs that are regulated by their cognate cyclins. Together, they are involved in the control of cell-cycle progression, transcription, and neuronal function. MAPKs serve as important mediators of cellular responses to extracellular signals. They control critical cellular functions including differentiation, proliferation, migration, and apoptosis. They are also implicated in the pathogenesis of many diseases including multiple types of cancer, stroke, diabetes, and chronic inflammation. Other members of the CMGC family include casein kinase 2 (CK2), Dual-specificity tYrosine-phosphorylated and -Regulated Kinase (DYRK), Glycogen Synthase Kinase 3 (GSK3), among many others. The CMGC family is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd05118','STKc_CMGC'),(2607008,'gnl|CDD|223589',_binary 'Serine/threonine protein kinase [General function prediction only / Signal transduction mechanisms / Transcription / DNA replication, recombination, and repair].','COG0515','SPS1'),(2607009,'gnl|CDD|214567',_binary 'Serine/Threonine protein kinases, catalytic domain.  Phosphotransferases. Serine or threonine-specific kinase subfamily.','smart00220','S_TKc'),(2607010,'gnl|CDD|271034',_binary 'Catalytic subunit (alpha) of the Serine/Threonine Kinase, Casein Kinase 2.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. CK2 is a tetrameric protein with two catalytic (alpha) and two regulatory (beta) subunits. It is constitutively active and ubiquitously expressed, and is found in the cytoplasm, nucleus, as well as in the plasma membrane. It phosphorylates a wide variety of substrates including gylcogen synthase, cell cycle proteins, nuclear proteins (e.g. DNA topoisomerase II), and ion channels (e.g. ENaC), among others. It may be considered a master kinase controlling the activity or lifespan of many other kinases and exerting its effect over cell fate, gene expression, protein synthesis and degradation, and viral infection. CK2 is implicated in every stage of the cell cycle and is required for cell cycle progression. It plays crucial roles in cell differentiation, proliferation, and survival, and is thus implicated in cancer. CK2 is not an oncogene by itself but elevated CK2 levels create an environment that enhances the survival of tumor cells. The CK2 subfamily is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd14132','STKc_CK2_alpha'),(2607011,'gnl|CDD|270687',_binary 'The catalytic domain of CAMK family Serine/Threonine Kinases.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. CaMKs are multifunctional calcium and calmodulin (CaM) stimulated STKs involved in cell cycle regulation. There are several types of CaMKs including CaMKI, CaMKII, and CaMKIV. CaMKI proteins are monomeric and they play pivotal roles in the nervous system, including long-term potentiation, dendritic arborization, neurite outgrowth, and the formation of spines, synapses, and axons. CaMKII is a signaling molecule that translates upstream calcium and reactive oxygen species (ROS) signals into downstream responses that play important roles in synaptic function and cardiovascular physiology. CAMKIV is implicated in regulating several transcription factors like CREB, MEF2, and retinoid orphan receptors, as well as in T-cell development and signaling. The CAMK family also consists of other related kinases including the Phosphorylase kinase Gamma subunit (PhKG), the C-terminal kinase domains of Ribosomal S6 kinase (RSK) and Mitogen and stress-activated kinase (MSK), Doublecortin-like kinase (DCKL), and the MAPK-activated protein kinases MK2, MK3, and MK5, among others. The CAMK family is part of a larger superfamily that includes the catalytic domains of other protein STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd05117','STKc_CAMK'),(2607012,'gnl|CDD|333812',_binary 'Protein kinase domain.','pfam00069','Pkinase'),(2607013,'gnl|CDD|270827',_binary 'Catalytic domain of Cyclin-Dependent protein Kinase Like Serine/Threonine Kinases.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. This subfamily is composed of CDKL1-5 and similar proteins. Some CDKLs, like CDKL1 and CDKL3, may be implicated in transformation and others, like CDKL3 and CDKL5, are associated with mental retardation when impaired. CDKL2 plays a role in learning and memory. CDKs belong to a large family of STKs that are regulated by their cognate cyclins. Together, they are involved in the control of cell-cycle progression, transcription, and neuronal function. The CDKL subfamily is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd07833','STKc_CDKL'),(2607014,'gnl|CDD|270875',_binary 'Pseudokinase domain of the peptidoglycan biosynthetic protein MviN.  The pseudokinase domain shows similarity to protein kinases but lacks crucial residues for catalytic activity. This family is composed of the mycobacterial protein MviN and similar proteins. MviN is an integral membrane protein that is essential for growth and is required for cell wall integrity and peptidogylcan (PG) biosynthesis. It comprises of 14 predicted transmembrane (TM) helices at the N-terminus, followed by an intracellular pseudokinase domain linked through a single TM helix to a carbohydrate binding extracellular domain. Phosphorylation of the MviN pseudokinase domain by the PG-sensitive serine/threonine protein kinase PknB recruits a forkhead associated (FHA) domain protein FhaA, which modulates local PG synthesis at cell poles and the septum. The MviN pseudokinase forms a canonical receptor kinase dimer.','cd13973','PK_MviN-like'),(2607015,'gnl|CDD|270905',_binary 'Catalytic domain of AMP-activated protein kinase-like Serine/Threonine Kinases.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. The AMPK-like subfamily is composed of AMPK, MARK, BRSK, NUAK, MELK, SNRK, TSSK, and SIK, among others. LKB1 serves as a master upstream kinase that activates AMPK and most AMPK-like kinases. AMPK, also called SNF1 (sucrose non-fermenting1) in yeasts and SnRK1 (SNF1-related kinase1) in plants, is a heterotrimeric enzyme composed of a catalytic alpha subunit and two regulatory subunits, beta and gamma. It is a stress-activated kinase that serves as master regulator of glucose and lipid metabolism by monitoring carbon and energy supplies, via sensing the cell\'s AMP:ATP ratio. MARKs phosphorylate tau and related microtubule-associated proteins (MAPs), and regulates microtubule-based intracellular transport. They are involved in embryogenesis, epithelial cell polarization, cell signaling, and neuronal differentiation. BRSKs play important roles in establishing neuronal polarity. TSSK proteins are almost exclusively expressed postmeiotically in the testis and play important roles in spermatogenesis and/or spermiogenesis. The AMPK-like subfamily is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd14003','STKc_AMPK-like'),(2607016,'gnl|CDD|270733',_binary 'Catalytic domain of the Serine/Threonine Kinase, Phosphoinositide-dependent kinase 1.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. PDK1 carries an N-terminal catalytic domain and a C-terminal pleckstrin homology (PH) domain that binds phosphoinositides. It phosphorylates the activation loop of AGC kinases that are regulated by PI3K such as PKB, SGK, and PKC, among others, and is crucial for their activation. Thus, it contributes in regulating many processes including metabolism, growth, proliferation, and survival. PDK1 also has the ability to autophosphorylate and is constitutively active in mammalian cells. It is essential for normal embryo development and is important in regulating cell volume. The PDK1 subfamily is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd05581','STKc_PDK1'),(2607017,'gnl|CDD|270856',_binary 'Pseudokinase domain of STE20-related kinase adapter protein.  The pseudokinase domain shows similarity to protein kinases but lacks crucial residues for catalytic activity. STRAD forms a complex with the scaffolding protein MO25, and the serine/threonine kinase (STK), LKB1, resulting in the activation of the kinase. In the complex, LKB1 phosphorylates and activates adenosine monophosphate-activated protein kinases (AMPKs), which regulate cell energy metabolism and cell polarity. LKB1 is a tumor suppressor linked to the rare inherited disease, Peutz-Jeghers syndrome, which is characterized by a predisposition to benign polyps and hyperpigmentation of the buccal mucosa. There are two forms of STRAD, alpha and beta, that complex with LKB1 and MO25. The structure of STRAD-alpha is available and shows that this protein binds ATP, has an ordered activation loop, and adopts a closed conformation typical of fully active protein kinases. It does not possess activity due to nonconservative substitutions of essential catalytic residues. ATP binding enhances the affinity of STRAD for MO25. The conformation of STRAD-alpha stabilized through ATP and MO25 may be needed to activate LKB1. The STRAD subfamily is part of a larger superfamily that includes the catalytic domains of STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd08216','PK_STRAD'),(2607018,'gnl|CDD|271009',_binary 'Catalytic kinase domain, first repeat, of the Giant Serine/Threonine Kinase Obscurin.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. Obscurin, approximately 800 kDa in size, is one of three giant proteins expressed in vetebrate striated muscle, together with titin and nebulin. It is a multidomain protein composed of tandem adhesion and signaling domains, including 49 immunoglobulin (Ig) and 2 fibronectin type III (FN3) domains at the N-terminus followed by a more complex region containing more Ig domains, a conserved SH3 domain near a RhoGEF and PH domains, non-modular regions, as well as IQ and phosphorylation motifs. The obscurin gene also encode two kinase domains, which are not expressed as part of the 800 kDa protein, but as a smaller, alternatively spliced product present mainly in the heart muscle, also called obscurin-MLCK. Obscurin is localized at the peripheries of Z-disks and M-lines, where it is able to communicate with the surrounding myoplasm. It interacts with diverse proteins including sAnk1, myosin, titin, and MyBP-C. It may act as a scaffold for the assembly of elements of the contractile apparatus. The obscurin subfamily is part of a larger superfamily that includes the catalytic domains of other protein STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd14107','STKc_obscurin_rpt1'),(2607019,'gnl|CDD|270948',_binary 'Catalytic domain, repeat 2, of the Serine/Threonine kinase, eukaryotic translation Initiation Factor 2-Alpha Kinase 4 or General Control Non-derepressible-2.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. GCN2 (or EIF2AK4) is activated by amino acid or serum starvation and UV irradiation. It induces GCN4, a transcriptional activator of amino acid biosynthetic genes, leading to increased production of amino acids under amino acid-deficient conditions. In serum-starved cells, GCN2 activation induces translation of the stress-responsive transcription factor ATF4, while under UV stress, GCN2 triggers transcriptional rescue via NF-kB signaling. GCN2 contains an N-terminal RWD, a degenerate kinase-like (repeat 1), the catalytic kinase (repeat 2), a histidyl-tRNA synthetase (HisRS)-like, and a C-terminal ribosome-binding and dimerization (RB/DD) domains. Its kinase domain is activated via conformational changes as a result of the binding of uncharged tRNA to the HisRS-like domain. EIF2AKs phosphorylate the alpha subunit of eIF-2, resulting in the overall downregulation of protein synthesis. The GCN2 subfamily is part of a larger superfamily that includes the catalytic domains of other protein STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd14046','STKc_EIF2AK4_GCN2_rpt2'),(2607020,'gnl|CDD|270731',_binary 'Catalytic domain of Microtubule-associated serine/threonine (MAST) kinase-like proteins.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. This subfamily includes MAST kinases, MAST-like (MASTL) kinases (also called greatwall kinase or Gwl), and fungal kinases with similarity to Saccharomyces cerevisiae Rim15 and Schizosaccharomyces pombe cek1. MAST kinases contain an N-terminal domain of unknown function, a central catalytic domain, and a C-terminal PDZ domain that mediates protein-protein interactions. MASTL kinases carry only a catalytic domain which contains a long insert relative to other kinases. The fungal kinases in this subfamily harbor other domains in addition to a central catalytic domain, which like in MASTL, also contains an insert relative to MAST kinases. Rim15 contains a C-terminal signal receiver (REC) domain while cek1 contains an N-terminal PAS domain. MAST kinases are cytoskeletal associated kinases of unknown function that are also expressed at neuromuscular junctions and postsynaptic densities. MASTL/Gwl is involved in the regulation of mitotic entry, mRNA stabilization, and DNA checkpoint recovery. The fungal proteins Rim15 and cek1 are involved in the regulation of meiosis and mitosis, respectively. The MAST-like kinase subfamily is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd05579','STKc_MAST_like'),(2607021,'gnl|CDD|270881',_binary 'Catalytic domain of the Serine/Threonine kinase, Oocyte maturation factor Mos.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. Mos (or c-Mos) is a germ-cell specific kinase that plays roles in both the release of primary arrest and the induction of secondary arrest in oocytes. It is expressed towards the end of meiosis I and is quickly degraded upon fertilization. It is a component of the cytostatic factor (CSF), which is responsible for metaphase II arrest. In addition, Mos activates a phoshorylation cascade that leads to the activation of the p34 subunit of MPF (mitosis-promoting factor or maturation promoting factor), a cyclin-dependent kinase that is responsible for the release of primary arrest in meiosis I. The Mos subfamily is part of a larger superfamily that includes the catalytic domains of other protein STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd13979','STKc_Mos'),(2607022,'gnl|CDD|270921',_binary 'Catalytic domain of the Serine/Threonine Kinase, Cell Division Cycle 7 kinase.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. Cdc7 kinase (or Hsk1 in fission yeast) is a critical regulator in the initiation of DNA replication. It forms a complex with a Dbf4-related regulatory subunit, a cyclin-like molecule that activates the kinase in late G1 phase, and is also referred to as Dbf4-dependent kinase (DDK). Its main targets are mini-chromosome maintenance (MCM) proteins. Cdc7 kinase may also have additional roles in meiosis, checkpoint responses, the maintenance and repair of chromosome structures, and cancer progression. The Cdc7 kinase subfamily is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd14019','STKc_Cdc7'),(2607023,'gnl|CDD|270762',_binary 'Catalytic domain of fungal Rim15-like Protein Serine/Threonine Kinases.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. Members of this group include Saccharomyces cerevisiae Rim15, Schizosaccharomyces pombe cek1, and similar fungal proteins. They contain a central catalytic domain, which contains an insert relative to MAST kinases. In addition, Rim15 contains a C-terminal signal receiver (REC) domain while cek1 contains an N-terminal PAS domain. Rim15 (or Rim15p) functions as a regulator of meiosis. It acts as a downstream effector of PKA and regulates entry into stationary phase (G0). Thus, it plays a crucial role in regulating yeast proliferation, differentiation, and aging. Cek1 may facilitate progression of mitotic anaphase. The Rim15-like subfamily is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd05611','STKc_Rim15_like'),(2607024,'gnl|CDD|270831',_binary 'Catalytic domain of Cyclin-Dependent protein Kinase 4 and 6-like Serine/Threonine Kinases.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. CDK4 and CDK6 partner with D-type cyclins to regulate the early G1 phase of the cell cycle. They are the first kinases activated by mitogenic signals to release cells from the G0 arrested state. CDK4 and CDK6 are both expressed ubiquitously, associate with all three D cyclins (D1, D2 and D3), and phosphorylate the retinoblastoma (pRb) protein. They are also regulated by the INK4 family of inhibitors which associate with either the CDK alone or the CDK/cyclin complex. CDK4 and CDK6 show differences in subcellular localization, sensitivity to some inhibitors, timing in activation, tumor selectivity, and possibly substrate profiles. Although CDK4 and CDK6 seem to show some redundancy, they also have discrete, nonoverlapping functions. CDK6 plays an important role in cell differentiation. CDKs belong to a large family of STKs that are regulated by their cognate cyclins. Together, they are involved in the control of cell-cycle progression, transcription, and neuronal function. The CDK4/6-like subfamily is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd07838','STKc_CDK4_6_like'),(2607025,'gnl|CDD|183880',_binary 'serine/threonine-protein kinase; Reviewed.','PRK13184','pknD'),(2607026,'gnl|CDD|270914',_binary 'Pseudokinase domain, repeat 1, of eukaryotic translation Initiation Factor 2-Alpha Kinase 4 or General Control Non-derepressible-2.  The pseudokinase domain shows similarity to protein kinases but lacks crucial residues for catalytic activity. EIF2AKs phosphorylate the alpha subunit of eIF-2, resulting in the overall downregulation of protein synthesis. eIF-2 phosphorylation is induced in response to cellular stresses including virus infection, heat shock, nutrient deficiency, and the accummulation of unfolded proteins, among others. There are four distinct kinases that phosphorylate eIF-2 and control protein synthesis under different stress conditions: GCN2, protein kinase regulated by RNA (PKR), heme-regulated inhibitor kinase (HRI), and PKR-like endoplasmic reticulum kinase (PERK). GCN2 is activated by amino acid or serum starvation and UV irradiation. It induces GCN4, a transcriptional activator of amino acid biosynthetic genes, leading to increased production of amino acids under amino acid-deficient conditions. In serum-starved cells, GCN2 activation induces translation of the stress-responsive transcription factor ATF4, while under UV stress, GCN2 triggers transcriptional rescue via NF-kappaB signaling. GCN2 contains an N-terminal RWD, a degenerate kinase-like (repeat 1), the catalytic kinase (repeat 2), a histidyl-tRNA synthetase (HisRS)-like, and a C-terminal ribosome-binding and dimerization (RB/DD) domains. The degenerate pseudokinase domain of GCN2 may function as a regulatory domain. The GCN2 subfamily is part of a larger superfamily that includes the catalytic domains of serine/threonine kinases, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd14012','PK_eIF2AK_GCN2_rpt1'),(2607027,'gnl|CDD|270952',_binary 'Catalytic domain of the Dual-specificity protein kinase, Myt1.  Dual-specificity PKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine as well as tyrosine residues on protein substrates. Myt1 is a cytoplasmic cell cycle checkpoint kinase that can keep the cyclin-dependent kinase CDK1 in an inactive state through phosphorylation of N-terminal thr (T14) and tyr (Y15) residues, leading to the delay of meiosis I entry. Meiotic progression is ensured by a two-step inhibition and downregulation of Myt1 by CDK1/XRINGO and p90Rsk during oocyte maturation. In addition, Myt1 targets cyclin B1/B2 and is essential for Golgi and ER assembly during telophase. In Drosophila, Myt1 may be a downstream target of Notch during eye development. The Myt1 subfamily is part of a larger superfamily that includes the catalytic domains of other protein serine/threonine PKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd14050','PKc_Myt1'),(2607028,'gnl|CDD|270910',_binary 'Catalytic domain of the Serine/Threonine kinases, Liver Kinase B1, Calmodulin Dependent Protein Kinase Kinase, and similar proteins.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. Both LKB1 and CaMKKs can phosphorylate and activate AMP-activated protein kinase (AMPK). LKB1, also called STK11, serves as a master upstream kinase that activates AMPK and most AMPK-like kinases. LKB1 and AMPK are part of an energy-sensing pathway that links cell energy to metabolism and cell growth. They play critical roles in the establishment and maintenance of cell polarity, cell proliferation, cytoskeletal organization, as well as T-cell metabolism, including T-cell development, homeostasis, and effector function. CaMKKs are upstream kinases of the CaM kinase cascade that phosphorylate and activate CaMKI and CamKIV. They may also phosphorylate other substrates including PKB and AMPK. Vertebrates contain two CaMKKs, CaMKK1 (or alpha) and CaMKK2 (or beta). CaMKK1 is involved in the regulation of glucose uptake in skeletal muscles. CaMKK2 is involved in regulating energy balance, glucose metabolism, adiposity, hematopoiesis, inflammation, and cancer. The LKB1/CaMKK subfamily is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd14008','STKc_LKB1_CaMKK'),(2607029,'gnl|CDD|270889',_binary 'Catalytic domain of the Serine/Threonine kinase, SH3 Binding Kinase 1.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. SBK1, also called BSK146, is predominantly expressed in the brain. Its expression is increased in the developing brain during the late embryonic stage, coinciding with dramatic neuronal proliferation, migration, and maturation. SBK1 may play an important role in regulating brain development. The SBK1 subfamily is part of a larger superfamily that includes the catalytic domains of other protein STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd13987','STKc_SBK1'),(2607030,'gnl|CDD|270796',_binary 'Catalytic domain of the Protein Serine/Threonine Kinase, Mitogen-Activated Protein (MAP)/Extracellular signal-Regulated Kinase (ERK) Kinase Kinase 4.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. MEKK4 is a MAPK kinase kinase that phosphorylates and activates the c-Jun N-terminal kinase (JNK) and p38 MAPK signaling pathways by directly activating their respective MAPKKs, MKK4/MKK7 and MKK3/MKK6. JNK and p38 are collectively known as stress-activated MAPKs, as they are activated in response to a variety of environmental stresses and pro-inflammatory cytokines. MEKK4 also plays roles in the re-polarization of the actin cytoskeleton in response to osmotic stress, in the proper closure of the neural tube, in cardiovascular development, and in immune responses. The MEKK4 subfamily is part of a larger superfamily that includes the catalytic domains of other STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd06626','STKc_MEKK4'),(2607031,'gnl|CDD|334220',_binary 'Adenylosuccinate synthetase.','pfam00709','Adenylsucc_synt'),(2607032,'gnl|CDD|197875',_binary 'Adenylosuccinate synthetase.  Adenylosuccinate synthetase plays an important role in purine biosynthesis, by catalyzing the GTP-dependent conversion of IMP and aspartic acid to AMP. Adenylosuccinate synthetase has been characterized from various sources ranging from Escherichia coli (gene purA) to vertebrate tissues. In vertebrates, two isozymes are present - one involved in purine biosynthesis and the other in the purine nucleotide cycle. The crystal structure of adenylosuccinate synthetase from E. coli reveals that the dominant structural element of each monomer of the homodimer is a central beta-sheet of 10 strands. The first nine strands of the sheet are mutually parallel with right-handed crossover connections between the strands. The 10th strand is antiparallel with respect to the first nine strands. In addition, the enzyme has two antiparallel beta-sheets, comprised of two strands and three strands each, 11 alpha-helices and two short 3/10-helices. Further, it has been suggested that the similarities in the GTP-binding domains of the synthetase and the p21ras protein are an example of convergent evolution of two distinct families of GTP-binding proteins. Structures of adenylosuccinate synthetase from Triticum aestivum and Arabidopsis thaliana when compared with the known structures from E. coli reveals that the overall fold is very similar to that of the E. coli protein.','smart00788','Adenylsucc_synt'),(2607033,'gnl|CDD|223182',_binary 'Adenylosuccinate synthase [Nucleotide transport and metabolism].','COG0104','PurA'),(2607034,'gnl|CDD|272949',_binary 'adenylosuccinate synthase.  Alternate name IMP--aspartate ligase. [Purines, pyrimidines, nucleosides, and nucleotides, Purine ribonucleotide biosynthesis].','TIGR00184','Adenylosuccinate_synth...'),(2607035,'gnl|CDD|349762',_binary 'adenylosuccinate synthetase.  Adenylosuccinate synthetase (AdSS) catalyzes the first step in the de novo biosynthesis of AMP. IMP and L-aspartate are conjugated in a two-step reaction accompanied by the hydrolysis of GTP to GDP in the presence of Mg2+. In the first step, the r-phosphate group of GTP is transferred to the 6-oxygen atom of IMP. An aspartate then displaces this 6-phosphate group to form the product adenylosuccinate. Because of its critical role in purine biosynthesis, AdSS is a target of antibiotics, herbicides and antitumor drugs.','cd03108','AdSS'),(2607036,'gnl|CDD|234904',_binary 'adenylosuccinate synthetase; Provisional.','PRK01117','PRK01117'),(2607037,'gnl|CDD|184326',_binary 'adenylosuccinate synthetase; Provisional.','PRK13788','PRK13788'),(2607038,'gnl|CDD|237506',_binary 'adenylosuccinate synthetase; Provisional.','PRK13785','PRK13785'),(2607039,'gnl|CDD|237505',_binary 'adenylosuccinate synthetase; Provisional.','PRK13783','PRK13783'),(2607040,'gnl|CDD|184325',_binary 'adenylosuccinate synthetase; Provisional.','PRK13786','PRK13786'),(2607041,'gnl|CDD|240376',_binary 'adenylosuccinate synthetase; Provisional.','PTZ00350','PTZ00350'),(2607042,'gnl|CDD|178129',_binary 'adenylosuccinate synthase.','PLN02513','PLN02513'),(2607043,'gnl|CDD|172322',_binary 'adenylosuccinate synthetase; Provisional.','PRK13784','PRK13784'),(2607044,'gnl|CDD|172324',_binary 'adenylosuccinate synthetase; Provisional.','PRK13787','PRK13787'),(2607045,'gnl|CDD|179812',_binary 'adenylosuccinate synthetase; Provisional.','PRK04293','PRK04293'),(2607046,'gnl|CDD|173544',_binary 'adenylosuccinate synthetase; Provisional.','PTZ00351','PTZ00351'),(2607054,'gnl|CDD|259799',_binary 'Prohibitin family; SPFH (stomatin, prohibitin, flotillin, and HflK/C) superfamily.  This model characterizes proteins similar to prohibitin (a lipid raft-associated integral membrane protein). Individual proteins of the SPFH (band 7) domain superfamily may cluster to form membrane microdomains which may in turn recruit multiprotein complexes. These microdomains, in addition to being stable scaffolds, may also be dynamic units with their own regulatory functions. Prohibitin is a mitochondrial inner-membrane protein which may act as a chaperone for the stabilization of mitochondrial proteins. Human prohibitin forms a hetero-oligomeric complex with Bap-37 (prohibitin 2, an SPFH domain carrying homolog). This complex may protect non-assembled membrane proteins against proteolysis by the m-AAA protease. Prohibitin and Bap-37 yeast homologs have been implicated in yeast longevity and in the maintenance of mitochondrial morphology.','cd03401','SPFH_prohibitin'),(2607055,'gnl|CDD|259802',_binary 'High frequency of lysogenization K (HflK) family; SPFH (stomatin, prohibitin, flotillin, and HflK/C) superfamily.  This model characterizes proteins similar to prokaryotic HflK (High frequency of lysogenization K). Although many members of the SPFH (or band 7) superfamily are lipid raft associated, prokaryote plasma membranes lack cholesterol and are unlikely to have lipid raft domains. Individual proteins of this SPFH domain superfamily may cluster to form membrane microdomains which may in turn recruit multiprotein complexes. Escherichia coli HflK is an integral membrane protein which may localize to the plasma membrane. HflK associates with another SPFH superfamily member (HflC) to form an HflKC complex. HflKC interacts with FtsH in a large complex termed the FtsH holo-enzyme. FtsH is an AAA ATP-dependent protease which exerts progressive proteolysis against membrane-embedded and soluble substrate proteins. HflKC can modulate the activity of FtsH. HflKC plays a role in the decision between lysogenic and lytic cycle growth during lambda phage infection.','cd03404','SPFH_HflK'),(2607056,'gnl|CDD|223407',_binary 'Membrane protease subunits, stomatin/prohibitin homologs [Posttranslational modification, protein turnover, chaperones].','COG0330','HflC'),(2607057,'gnl|CDD|259803',_binary 'High frequency of lysogenization C (HflC) family; SPFH (stomatin, prohibitin, flotillin, and HflK/C) superfamily.  This model characterizes proteins similar to prokaryotic HflC (High frequency of lysogenization C). Although many members of the SPFH (or band 7) superfamily are lipid raft associated, prokaryote plasma membranes lack cholesterol and are unlikely to have lipid raft domains. Individual proteins of this SPFH domain superfamily may cluster to form membrane microdomains which may in turn recruit multiprotein complexes. Escherichia coli HflC is an integral membrane protein which may localize to the plasma membrane. HflC associates with another SPFH superfamily member (HflK) to form an HflKC complex. HflKC interacts with FtsH in a large complex termed the FtsH holo-enzyme. FtsH is an AAA ATP-dependent protease which exerts progressive proteolysis against membrane-embedded and soluble substrate proteins. HflKC can modulate the activity of FtsH. HflKC plays a role in the decision between lysogenic and lytic cycle growth during lambda phage infection.','cd03405','SPFH_HflC'),(2607058,'gnl|CDD|316281',_binary 'Helix-turn-helix domain.  Members of this family contains a DNA-binding helix-turn-helix domain.','pfam13744','HTH_37'),(2607062,'gnl|CDD|226147',_binary 'Predicted transcriptional regulator with C-terminal CBS domains [Transcription].','COG3620','COG3620'),(2607063,'gnl|CDD|106954',_binary 'putative Cro-like protein.','PHA00542','PHA00542'),(2607064,'gnl|CDD|223876',_binary 'Sec-independent protein secretion pathway component TatC [Intracellular trafficking and secretion].','COG0805','TatC'),(2607078,'gnl|CDD|282904',_binary 'Herpes virus major outer envelope glycoprotein (BLLF1).  This family consists of the BLLF1 viral late glycoprotein, also termed gp350/220. It is the most abundantly expressed glycoprotein in the viral envelope of the Herpesviruses and is the major antigen responsible for stimulating the production of neutralising antibodies in vivo.','pfam05109','Herpes_BLLF1'),(2607083,'gnl|CDD|314474',_binary 'Mediator complex subunit 3 fungal.  Mediator is a large complex of up to 33 proteins that is conserved from plants to fungi to humans - the number and representation of individual subunits varying with species. It is arranged into four different sections, a core, a head, a tail and a kinase-activity part, and the number of subunits within each of these is what varies with species. Overall, Mediator regulates the transcriptional activity of RNA polymerase II but it would appear that each of the four different sections has a slightly different function. Mediator subunit Hrs1/Med3 is a physical target for Cyc8-Tup1, a yeast transcriptional co-repressor.','pfam11593','Med3'),(2607084,'gnl|CDD|185594',_binary 'Sec24-related protein; Provisional.','PTZ00395','PTZ00395'),(2607088,'gnl|CDD|227938',_binary 'PPE-repeat proteins [Cell motility and secretion].','COG5651','COG5651'),(2607089,'gnl|CDD|337102',_binary 'Fungal domain of unknown function (DUF1750).  This is a fungal domain of unknown function.','pfam08549','SWI-SNF_Ssr4'),(2607090,'gnl|CDD|223039',_binary 'transcriptional regulator ICP4; Provisional.','PHA03307','PHA03307'),(2607125,'gnl|CDD|340360',_binary 'Lysozyme-like domains.  This family contains several members, including soluble lytic transglycosylases (SLT), goose egg-white lysozymes (GEWL), hen egg-white lysozymes (HEWL), chitinases, bacteriophage lambda lysozymes, endolysins, autolysins, chitosanases, and pesticin. Typical members are involved in the hydrolysis of beta-1,4- linked polysaccharides.','cd00442','Lyz_like'),(2607137,'gnl|CDD|336696',_binary 'Domain of unknown function (DUF1508).  This family represents a series of bacterial domains of unknown function of around 50 residues in length. Members of this family are often found as tandem repeats and in some cases represent the whole protein. All member proteins are described as being hypothetical.','pfam07411','DUF1508'),(2607184,'gnl|CDD|130679',_binary 'phage nucleotide-binding protein.  This model represents an uncharacterized family of proteins from a number of phage of Gram-positive bacteria. This protein contains a P-loop motif, G/A-X-X-G-X-G-K-T near its amino end. The function of this protein is unknown. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR01618','phage_P_loop'),(2607346,'gnl|CDD|224305',_binary 'Histidinol phosphatase and related hydrolases of the PHP family [Amino acid transport and metabolism / General function prediction only].','COG1387','HIS2'),(2607582,'gnl|CDD|270895',_binary 'Catalytic domain of Fungal Pat1-like Serine/Threonine kinases.  STKs catalyze the transfer of the gamma-phosphoryl group from ATP to serine/threonine residues on protein substrates. This subfamily is composed of Schizosaccharomyces pombe Pat1 (also called Ran1), Saccharomyces cerevisiae VHS1 and KSP1, and similar fungal STKs. Pat1 blocks Mei2, an RNA-binding protein which is indispensable in the initiation of meiosis. Pat1 is inactivated and Mei2 activated, which initiates meiosis, under nutrient-deprived conditions through a signaling cascade involving Ste11. Meiosis induced by Pat1 inactivation may show different characteristics than normal meiosis including aberrant positioning of centromeres. VHS1 was identified in a screen for suppressors of cell cycle arrest at the G1/S transition, while KSP1 may be involved in regulating PRP20, which is required for mRNA export and maintenance of nuclear structure. The Pat1-like subfamily is part of a larger superfamily that includes the catalytic domains of other protein STKs, protein tyrosine kinases, RIO kinases, aminoglycoside phosphotransferase, choline kinase, and phosphoinositide 3-kinase.','cd13993','STKc_Pat1_like'),(2607895,'gnl|CDD|139206',_binary 'bifunctional gluaredoxin/ribonucleoside-diphosphate reductase subunit beta; Provisional.','PRK12759','PRK12759'),(2607896,'gnl|CDD|239511',_binary 'Glutaredoxin (GRX) family, GRX human class 1 and 2 (h_1_2)-like subfamily; composed of proteins similar to human GRXs, approximately 10 kDa in size, and proteins containing a GRX or GRX-like domain. GRX is a glutathione (GSH) dependent reductase, catalyzing the disulfide reduction of target proteins such as ribonucleotide reductase. It contains a redox active CXXC motif in a TRX fold and uses a similar dithiol mechanism employed by TRXs for intramolecular disulfide bond reduction of protein substrates. Unlike TRX, GRX has preference for mixed GSH disulfide substrates, in which it uses a monothiol mechanism where only the N-terminal cysteine is required. The flow of reducing equivalents in the GRX system goes from NADPH -> GSH reductase -> GSH -> GRX -> protein substrates. By altering the redox state of target proteins, GRX is involved in many cellular functions including DNA synthesis, signal transduction and the defense against oxidative stress. Different classes are known including human GRX1 and GRX2, which are members of this subfamily. Also included in this subfamily are the N-terminal GRX domains of proteins similar to human thioredoxin reductase 1 and 3.','cd03419','GRX_GRXh_1_2_like'),(2607900,'gnl|CDD|226649',_binary 'Predicted phosphoesterase or phosphohydrolase [General function prediction only].','COG4186','COG4186'),(2607901,'gnl|CDD|277336',_binary 'Aquifex aeolicus AQ1575 and related proteins, metallophosphatase domain.  This family includes bacterial and archeal proteins homologous to AQ1575, an uncharacterized Aquifex aeolicus protein.  AQ1575 may play an accessory role in DNA repair, based on the close proximity of its gene to Holliday junction resolvasome genes.  The domain present in members of this family belongs to the metallophosphatase (MPP) superfamily.  MPPs are functionally diverse, but all share a conserved domain with an active site consisting of two metal ions (usually manganese, iron, or zinc) coordinated with octahedral geometry by a cage of histidine, aspartate, and asparagine residues. The MPP superfamily includes: Mre11/SbcD-like exonucleases, Dbr1-like RNA lariat debranching enzymes, YfcE-like phosphodiesterases, purple acid phosphatases (PAPs), YbbF-like UDP-2,3-diacylglucosamine hydrolases, and acid sphingomyelinases (ASMases).  The conserved domain is a double beta-sheet sandwich with a di-metal active site made up of residues located at the C-terminal side of the sheets. This domain is thought to allow for productive metal coordination.','cd07390','MPP_AQ1575'),(2607942,'gnl|CDD|316207',_binary 'Toprim domain.  The toprim domain is found in a wide variety of enzymes involved in nucleic acid manipulation.','pfam13662','Toprim_4'),(2608043,'gnl|CDD|314130',_binary 'Minor capsid protein.  Most of the members of this family are annotated as being minor capsid proteins. The genomes carrying the genes usually have three similar proteins adjacent to each other, hence this one being named as No.2.','pfam11114','Minor_capsid_2'),(2608045,'gnl|CDD|223048',_binary 'putative ATPase subunit of terminase; Provisional.','PHA03333','PHA03333'),(2608086,'gnl|CDD|308511',_binary 'Phage integrase, N-terminal SAM-like domain.','pfam02899','Phage_int_SAM_1'),(2608095,'gnl|CDD|314518',_binary 'Protein of unknown function (DUF3263).  This family of proteins with unknown function appears to be restricted to Actinobacteria.','pfam11662','DUF3263'),(2608116,'gnl|CDD|271187',_binary 'Putative Transposase B from transposon Tn554, C-terminal catalytic domain.  This family includes putative Transposase B from transposon Tn554. It belongs to a DNA breaking-rejoining enzyme superfamily. The catalytic domain containing six conserved active site residues. The recombination reaction involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA. Many DNA breaking-rejoining enzymes also have N-terminal domains, which show little sequence or structure similarity.','cd01187','INT_tnpB_C_Tn554'),(2608138,'gnl|CDD|223961',_binary 'Membrane-bound serine protease (ClpP class) [Posttranslational modification, protein turnover, chaperones].','COG1030','NfeD'),(2608140,'gnl|CDD|132926',_binary 'Nodulation formation efficiency D (NfeD) is a membrane-bound ClpP-class protease.  Nodulation formation efficiency D (NfeD; stomatin operon partner protein, STOPP; DUF107) is a member of membrane-anchored ClpP-class proteases. Currently, more than 300 NfeD homologs have been identified - all of which are bacterial or archaeal in origin. Majority of these genomes have been shown to possess operons containing a homologous NfeD/stomatin gene pair, causing NfeD to be previously named STOPP (stomatin operon partner protein). NfeD homologs can be divided into two groups: long and short forms. Long-form homologs have a putative ClpP-class serine protease domain while the short form homologs do not. Downstream from the ClpP-class domain is the so-called NfeD or DUF107 domain. N-terminal region of the NfeD homolog PH1510 (1510-N or PH1510-N) from Pyrococcus horikoshii has been shown to possess serine protease activity and has a Ser-Lys catalytic dyad, preferentially cleaving hydrophobic substrates. Difference in oligomeric form and catalytic residues between 1510-N (forming a dimer) and ClpP (forming a tetradecamer) shows a possible functional difference: 1510-N is likely to have a regulatory function while ClpP is involved in protein quality control.','cd07015','Clp_protease_NfeD'),(2608156,'gnl|CDD|236615',_binary 'exonuclease VIII; Reviewed.','PRK09709','PRK09709'),(2608414,'gnl|CDD|338521',_binary 'Calcineurin-like phosphoesterase superfamily domain.  Members of this family are part of the Calcineurin-like phosphoesterase superfamily.','pfam12850','Metallophos_2'),(2608458,'gnl|CDD|226144',_binary 'Prophage antirepressor [Transcription].','COG3617','COG3617'),(2608459,'gnl|CDD|214989',_binary 'BRO family, N-terminal domain.  This family includes the N-terminus of baculovirus BRO and ALI motif proteins. The function of BRO proteins is unknown. It has been suggested that BRO-A and BRO-C are DNA binding proteins that influence host DNA replication and/or transcription. This Pfam domain does not include the characteristic invariant alanine, leucine, isoleucine motif of the ALI proteins.','smart01040','Bro-N'),(2608757,'gnl|CDD|338820',_binary '2\'-5\' RNA ligase superfamily.  This family contains proteins related to pfam02834. These proteins are likely to be enzymes, but they may not share the RNA ligase activity.','pfam13563','2_5_RNA_ligase2'),(2608767,'gnl|CDD|273629',_binary 'intein N-terminal splicing region.  This model is based on interated search results, starting with a curated collection of intein N-terminal splicing regions from InBase, the New England Biolabs Intein Database, as presented on its web site. It is designed to recognize inteins but not the related region of the sonic hedgehog protein.','TIGR01445','Probable_translation_i...'),(2608770,'gnl|CDD|340005',_binary 'Terminase RNaseH-like domain.','pfam17289','Terminase_6C'),(2608785,'gnl|CDD|309835',_binary 'Bacteriophage HK97-gp10, putative tail-component.  This family of proteins is found in the caudovirales. It may be a tail component.','pfam04883','HK97-gp10_like'),(2608923,'gnl|CDD|238211',_binary 'Thymidylate synthase and pyrimidine hydroxymethylase: Thymidylate synthase (TS) and deoxycytidylate hydroxymethylase (dCMP-HMase) are homologs that catalyze analogous alkylation of C5 of pyrimidine nucleotides. Both enzymes are involved in the biosynthesis of DNA precursors and are active as homodimers. However, they exhibit distinct pyrimidine base specificities and differ in the details of their catalyzed reactions. TS is biologically ubiquitous and catalyzes the conversion of dUMP and methylene-tetrahydrofolate (CH2THF) to dTMP and dihydrofolate (DHF). It also acts as a regulator of its own expression by binding and inactivating its own RNA. Due to its key role in the de novo pathway for thymidylate synthesis and, hence, DNA synthesis, it is one of the most conserved enzymes across species and phyla. TS is a well-recognized target for anticancer chemotherapy, as well as a valuable new target against infectious diseases. Interestingly, in several protozoa, a single polypeptide chain codes for both, dihydrofolate reductase (DHFR) and thymidylate synthase (TS), forming a bifunctional enzyme (DHFR-TS), possibly through gene fusion at a single evolutionary point. DHFR-TS is also active as a dimer. Virus encoded dCMP-HMase catalyzes the reversible conversion of dCMP and CH2THF to hydroxymethyl-dCMP and THF. This family also includes dUMP hydroxymethylase, which is encoded by several bacteriophages that infect Bacillus subtilis, for their own protection against the host restriction system,  and contain hydroxymethyl-dUMP instead of dTMP in their DNA.','cd00351','TS_Pyrimidine_HMase'),(2608982,'gnl|CDD|318902',_binary 'RepB DNA-primase from phage plasmid.  RepB_primase is a DNA-primase produced by P4-like phages. It is a zinc-independent primase unlike Pri-type primases. It takes up a dumbbell shaped consisting of an N-terminal catalytic domain separated by a long alpha-helix plus tether and a C-terminal helical-bundle domain. Primases are necessary for phage replication. RepBprime primases such as in this family recognize both ssiA and ssiB, ie only 1 single-stranded primase initiation site on each strand, independently of each other and then synthesize primers that are elongated by DNA polymerase III. The phage is thus replicated exclusively in leading strand mode.','pfam16793','RepB_primase'),(2609053,'gnl|CDD|223695',_binary 'Predicted phosphoesterase [General function prediction only].','COG0622','COG0622'),(2609105,'gnl|CDD|336654',_binary 'Antirestriction protein (ArdA).  This family consists of several bacterial antirestriction (ArdA) proteins. ArdA functions in bacterial conjugation to allow an unmodified plasmid to evade restriction in the recipient bacterium and yet acquire cognate modification.','pfam07275','ArdA'),(2609123,'gnl|CDD|285830',_binary 'BetR domain.  This family includes an N-terminal helix-turn-helix domain.','pfam08667','BetR'),(2609160,'gnl|CDD|271190',_binary 'Putative XerD in Streptococcus pneumonia and similar proteins, C-terminal catalytic domain.  This family includes a putative XerD recombinase in Streptococcus pneumonia and similar tyrosine recombinases. However, the members of this family contain unusual active site motifs from the XerD from Escherichia coli. E. coli XerD and homologous enzymes show four conserved amino acids R-H-R-H that are spaced along the C-terminal domain. The putative S. pneumoniae XerD contains three unique replacements at the conserved positions resulting in L-Q-R-L. Severe growth defects in a loss-of-function xerD mutant demonstrate an important in vivo function of the S. pneumoniae XerD protein. This family belongs to the superfamily of DNA breaking-rejoining enzymes, which share the same fold in their catalytic domain and the overall reaction mechanism. The catalytic domain contains six conserved active site residues. Their overall reaction mechanism involves cleavage of a single strand of a DNA duplex by nucleophilic attack of a conserved tyrosine to give a 3\' phosphotyrosyl protein-DNA adduct. In the second rejoining step, a terminal 5\' hydroxyl attacks the covalent adduct to release the enzyme and generate duplex DNA.','cd01190','INT_StrepXerD_C_like'),(2609582,'gnl|CDD|335095',_binary 'Helix-turn-helix domain of resolvase.','pfam02796','HTH_7'),(2609612,'gnl|CDD|277320',_binary 'Escherichia coli YfcE and related proteins, metallophosphatase domain.  YfcE is a manganase-dependent metallophosphatase, found in bacteria and archaea, that cleaves bis-p-nitrophenyl phosphate, thymidine 5\'-monophosphate-p-nitrophenyl ester, and p-nitrophenyl phosphorylcholine, but is unable to hydrolyze 2\',3 \' or 3\',5\' cyclic nucleic phosphodiesters, and various phosphomonoesters, including p-nitrophenyl phosphate. This family also includes the Bacilus subtilis YsnB and Methanococcus jannaschii MJ0936 proteins.  This domain family belongs to the metallophosphatase (MPP) superfamily.  MPPs are functionally diverse, but all share a conserved domain with an active site consisting of two metal ions (usually manganese, iron, or zinc) coordinated with octahedral geometry by a cage of histidine, aspartate, and asparagine residues. The MPP superfamily includes: Mre11/SbcD-like exonucleases, Dbr1-like RNA lariat debranching enzymes, YfcE-like phosphodiesterases, purple acid phosphatases (PAPs), YbbF-like UDP-2,3-diacylglucosamine hydrolases, and acid sphingomyelinases (ASMases).  The conserved domain is a double beta-sheet sandwich with a di-metal active site made up of residues located at the C-terminal side of the sheets. This domain is thought to allow for productive metal coordination.','cd00841','MPP_YfcE'),(2609754,'gnl|CDD|132997',_binary 'Glycosyltransferase family A (GT-A) includes diverse families of glycosyl transferases with a common GT-A type structural fold.  Glycosyltransferases (GTs) are enzymes that synthesize oligosaccharides, polysaccharides, and glycoconjugates by transferring the sugar moiety from an activated nucleotide-sugar donor to an acceptor molecule, which may be a growing oligosaccharide, a lipid, or a protein.  Based on the stereochemistry of the donor and acceptor molecules, GTs are classified as either retaining or inverting enzymes. To date, all GT structures adopt one of two possible folds, termed GT-A fold and GT-B fold.  This hierarchy includes diverse families of glycosyl transferases with a common GT-A type structural fold, which has two tightly associated beta/alpha/beta domains that tend to form a continuous central sheet of at least eight beta-strands. The majority of the proteins in this superfamily are Glycosyltransferase family 2 (GT-2) proteins. But it also includes families GT-43, GT-6, GT-8, GT13 and GT-7; which are evolutionarily related to GT-2 and share structure similarities.','cd00761','Glyco_tranf_GTA_type'),(2609755,'gnl|CDD|334132',_binary 'Glycosyl transferase family 2.  Diverse family, transferring sugar from UDP-glucose, UDP-N-acetyl- galactosamine, GDP-mannose or CDP-abequose, to a range of substrates including cellulose, dolichol phosphate and teichoic acids.','pfam00535','Glycos_transf_2'),(2609756,'gnl|CDD|224137',_binary 'Predicted glycosyltransferases [General function prediction only].','COG1216','COG1216'),(2609811,'gnl|CDD|213767',_binary 'transcriptional regulator, y4mF family.  Members of this family belong to a clade of helix-turn-helix DNA-binding proteins, among the larger family pfam01381 (HTH_3; Helix-turn-helix). Members are similar in sequence to the HipB protein of E. coli. Genes for members of the seed alignment for this protein family were found to be closely linked to genes encoding proteins related to HipA. The HibBA operon appears to have some features in common with toxin-antitoxin post-segregational killing systems. [Regulatory functions, DNA interactions].','TIGR03070','couple_hipB'),(2609815,'gnl|CDD|177363',_binary 'hypothetical protein.','PHA02446','PHA02446'),(2609835,'gnl|CDD|334582',_binary 'GIY-YIG catalytic domain.  This domain called GIY-YIG is found in the amino terminal region of excinuclease abc subunit c (uvrC), bacteriophage T4 endonucleases segA, segB, segC, segD and segE; it is also found in putative endonucleases encoded by group I introns of fungi and phage. The structure of I-TevI a GIY-YIG endonuclease, reveals a novel alpha/beta-fold with a central three-stranded antiparallel beta-sheet flanked by three helices. The most conserved and putative catalytic residues are located on a shallow, concave surface and include a metal coordination site.','pfam01541','GIY-YIG'),(2609837,'gnl|CDD|214677',_binary 'GIY-YIG type nucleases (URI domain).','smart00465','GIYc'),(2609838,'gnl|CDD|198380',_binary 'GIY-YIG nuclease domain superfamily.  The GIY-YIG nuclease domain superfamily includes a large and diverse group of proteins involved in many cellular processes, such as class I homing GIY-YIG family endonucleases, prokaryotic nucleotide excision repair proteins UvrC and Cho, type II restriction enzymes, the endonuclease/reverse transcriptase of eukaryotic retrotransposable elements, and a family of eukaryotic enzymes that repair stalled replication forks. All of these members contain a conserved GIY-YIG nuclease domain that may serve as a scaffold for the coordination of a divalent metal ion required for catalysis of the phosphodiester bond cleavage. By combining with different specificity, targeting, or other domains, the GIY-YIG nucleases may perform different functions.','cd00719','GIY-YIG_SF'),(2609969,'gnl|CDD|227660',_binary 'Phage-related terminase [General function prediction only].','COG5362','COG5362'),(2609970,'gnl|CDD|130691',_binary 'phage uncharacterized protein (putative large terminase), C-terminal domain.  This model represents the C-terminal region of a set of phage proteins typically about 400-500 amino acids in length, although some members are considerably shorter. An article on Methanobacterium phage Psi-M2 ( calls the member from that phage, ORF9, a putative large terminase subunit, and ORF8 a candidate terminase small subunit. Most proteins in this family have an apparent P-loop nucleotide-binding sequence toward the N-terminus. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR01630','psiM2_ORF9'),(2610020,'gnl|CDD|212137',_binary 'Nucleoside Triphosphate Pyrophosphohydrolase (EC 3.6.1.8) MazG-like domain found in Deinococcus radiodurans DR2231 protein and its bacterial homologs.  This family includes a MazG-like NTP-PPase from Deinococcus radiodurans (DR2231), a putative NTP-PPase YP_001813558.1 from Exiguobacterium sibiricum and their bacterial homologs. DR2231 shows significant structural resemblance to MazG proteins, but is functionally related to the dimeric dUTPases. It can hydrolyze dUTP into dUMP. DR2231-like proteins contain a well conserved divalent ion binding motif, EXXEX(12-28)EXXD, which is the identity signature for the all-alpha-helical NTP-PPase superfamily. Unlike normal dimeric dUTPase-like proteins with a central four-helix bundle forming the active site, YP_001813558.1 displays a very unusual interlaced segment-swapped dimer. It potentially prefers to hydrolyze dCTPs or its derivatives. YP_001813558.1-like proteins contain a variant divalent ion binding motif, EXXEX(12-28)AXXD.','cd11530','NTP-PPase_DR2231_like'),(2610021,'gnl|CDD|227040',_binary 'Uncharacterized protein conserved in bacteria [Function unknown].','COG4696','COG4696'),(2610022,'gnl|CDD|212152',_binary 'Nucleoside Triphosphate Pyrophosphohydrolase (EC 3.6.1.8) MazG-like domain found in Exiguobacterium sibiricum YP_001813558.1 protein and its bacterial homologs.  This family contains a putative NTP_PPase (YP_001813558.1) from Exiguobacterium sibiricum and its bacterial homologs. Unlike normal dimeric dUTPase-like proteins with a central four-helix bundle forming the active site, YP_001813558.1 displays a very unusual interlaced segment-swapped dimer that might be important for it to adapt to an extremely cold environment. Moreover, structural analysis and comparisons indicate that YP_001813558.1 potentially prefers to hydrolyze dCTPs or its derivatives.','cd11545','NTP-PPase_YP_001813558'),(2610023,'gnl|CDD|212151',_binary 'Nucleoside Triphosphate Pyrophosphohydrolase (EC 3.6.1.8) MazG-like domain found in Deinococcus radiodurans DR2231 protein and its bacterial homologs.  This family corresponds to the DR2231 protein, a MazG-like NTP-PPase from Deinococcus radiodurans, and its bacterial homologs. All family members contain a well-conserved divalent ion binding motif, EXXEX(12-28)EXXD, which is the identity signature for all-alpha-helical NTP-PPase superfamily. DR2231 shows significant structural resemblance to MazG proteins, but is functionally related to the dimeric dUTPases. It might be an evolutionary precursor of dimeric dUTPases with  very high specificity in hydrolyzing dUTP into dUMP, but an inability to hydrolyze dTTP, a typical feature of dUTPases. Moreover, unlike the dUPase monomer containing a single active site, the DR2231 protein dimer holds two putative active sites.','cd11544','NTP-PPase_DR2231'),(2610024,'gnl|CDD|334568',_binary 'Phosphoribosyl-ATP pyrophosphohydrolase.  This enzyme catalyzes the second step in the histidine biosynthetic pathway.','pfam01503','PRA-PH'),(2610184,'gnl|CDD|119385',_binary 'Lyc muramidase is an autolytic lysozyme (autolysin) from Clostridium acetobutylicum encoded by the lyc gene.  Lyc has a glycosyl hydrolase family 25 (GH25) catalytic domain.  Endo-N-acetylmuramidases are lysozymes (also referred to as peptidoglycan hydrolases) that degrade bacterial cell walls by catalyzing the hydrolysis of 1,4-beta-linkages between N-acetylmuramic acid and N-acetyl-D-glucosamine residues.','cd06525','GH25_Lyc-like'),(2610418,'gnl|CDD|273720',_binary 'transcriptional regulator, Spx/MgsR family.  This model represents a portion of the proteins within the larger set covered by pfam03960. That larger family includes a glutaredoxin-dependent arsenate reductase (TIGR00014). Characterized members of this family include Spx and MgsR from Bacillus subtili. Spx is a global regulator for response to thiol-specific oxidative stress. It interacts with RNA polymerase. MgsR (modulator of the general stress response, also called YqgZ) provides a second level of regulation for more than a third of the proteins in the B. subtilis general stress regulon controlled by Sigma-B. [Regulatory functions, DNA interactions].','TIGR01617','Uncharacterized_protei...'),(2610422,'gnl|CDD|239334',_binary 'Arsenate Reductase (ArsC) family, unknown subfamily; uncharacterized proteins containing a CXXC motif with similarity to thioredoxin (TRX)-fold arsenic reductases, ArsC. Proteins containing a redox active CXXC motif like TRX and glutaredoxin (GRX) function as protein disulfide oxidoreductases, altering the redox state of target proteins via the reversible oxidation of the active site dithiol. ArsC catalyzes the reduction of arsenate [As(V)] to arsenite [As(III)], using reducing equivalents derived from glutathione via GRX, through a single catalytic cysteine.','cd03036','ArsC_like'),(2610467,'gnl|CDD|319246',_binary 'ParB N-terminal domain and sulfiredoxin protein-related families.  The ParB N-terminal domain/Sulfiredoxin (Srx) superfamily contains proteins with diverse activities. Many of the families are involved in segregation and competition between plasmids and chromosomes. Several families share similar activities with the N-terminal domain of ParB (Spo0J in Bacillus subtilis), a DNA-binding component of the prokaryotic parABS partitioning system. Also within this superfamily is sulfiredoxin (Srx; reactivator of oxidatively inactivated 2-cys peroxiredoxins), RepB N-terminal domain (plasmid segregation replication protein B like protein), nucleoid occlusion protein, KorB N-terminal domain partition protein of low copy number plasmid RK2, irbB (immunoglobulin-binding regulator that activates eib genes), N-terminal domain of sopB protein (promotes proper partitioning of F1 plasmid), fertility inhibition factors OSA and FiwA,DNA sulfur modification protein DndB, and a ParB-like toxin domain. Other activities includes a StrR (regulator in the streptomycin biosynthetic gene cluster), and a family containing a Pyrococcus furiosus nuclease and putative transcriptional regulators sbnI (Staphylococcus aureus siderophore biosynthetic gene cluster ). Nuclease activity has also been reported in Arabidopsis Srx.','cd16387','ParB_N_Srx'),(2610471,'gnl|CDD|319260',_binary 'ParB N-terminal-like domain, some attached to C-terminal S-adenosylmethionine-dependent methyltransferase.  This family represents domains related to the N-terminal domain of ParB, a DNA-binding component of the prokaryotic parABS partitioning system, fused to a variety of C-terminal domains, including S-adenosylmethionine-dependent methyltransferase-like domains. parABS contributes to the efficient segregation of chromosomes and low-copy number plasmids to daughter cells during prokaryotic cell division. The process includes the parA (Walker box) ATPase, the ParB DNA-binding protein and a parS cis-acting DNA sites. Binding of ParB to centromere-like parS sites is followed by non-specific binding to DNA (\'spreading\', which has been implicated in gene silencing in plasmid P1) and oligomerization of additional ParB molecules near the parS sites. It has been proposed that ParB-ParB cross-linking compacts the DNA, binds to parA via the N-terminal region, and leads to parA separating the ParB-parS complexes and the recruitment of the SMC (structural maintenance of chromosomes) complexes. The ParB N-terminal domain of Bacillus subtilis and other species contains a Arginine-rich ParB Box II with residues essential for bridging of the ParB-parS complexes. The arginine-rich ParB Box II consensus (I[VIL]AGERR[FYW]RA[AS] identified in several species is partially conserved with this family and related families. Mutations within the basic columns particularly debilitate spreading from the parS sites and impair SMC recruitment. The C-terminal domain contains a HTH DNA-binding motif and is the primary homo-dimerization domain, and binds to parS DNA sites. Additional homo-dimerization contacts are found along the N-terminal domain, but dimerization of the N-terminus may only occur after concentration at ParB-parS foci.','cd16403','ParB_N_like_MT'),(2610639,'gnl|CDD|310893',_binary 'Prophage endopeptidase tail.  This family is of prophage tail proteins that are probably acting as endopeptidases.','pfam06605','Prophage_tail'),(2610640,'gnl|CDD|273743',_binary 'phage minor structural protein, N-terminal region.  This model represents the conserved N-terminal region, typically from about residue 25 to about residue 350, of a family of uncharacterized phage proteins 500 to 1700 residues in length. [Mobile and extrachromosomal element functions, Prophage functions].','TIGR01665','structural_protein'),(2610641,'gnl|CDD|227263',_binary 'Phage-related protein [Function unknown].','COG4926','PblB'),(2610647,'gnl|CDD|119353',_binary 'Cortical fragment-lytic enzyme (CFLE) is a peptidoglycan hydrolase involved in  bacterial endospore germination.  CFLE is expressed as an inactive preprotein (called SleB) in the forespore compartment of sporulating cells.  SleB translocates across the forespore inner membrane and is deposited as a mature enzyme in the cortex layer of the spore.  As part of a sensory mechanism capable of initiating germination, CFLE degrades a spore-specific peptidoglycan constituent called muramic-acid delta-lactam that comprises the outer cortex.  CFLE has a C-terminal glycosyl hydrolase family 18 (GH18) catalytic domain as well as two N-terminal LysM peptidoglycan-binding domains.  In addition to SleB, this family includes YaaH, YdhD, and YvbX from Bacillus subtilis.','cd02874','GH18_CFLE_spore_hydrolase'),(2610648,'gnl|CDD|226376',_binary 'Predicted glycosyl hydrolase [General function prediction only].','COG3858','COG3858'),(2610650,'gnl|CDD|334217',_binary 'Glycosyl hydrolases family 18.','pfam00704','Glyco_hydro_18'),(2610651,'gnl|CDD|214753',_binary 'Glyco_18 domain.','smart00636','Glyco_18'),(2610652,'gnl|CDD|119366',_binary 'GH18 domain of an uncharacterized family of bacterial proteins, which share a common three-domain architecture: an N-terminal glycosyl hydrolase family 18 (GH18) domain, a glycosyl transferase family 2 domain, and a C-terminal polysaccharide deacetylase domain.','cd06549','GH18_trifunctional'),(2610653,'gnl|CDD|119365',_binary 'The GH18 (glycosyl hydrolases, family 18) type II chitinases hydrolyze chitin, an abundant polymer of N-acetylglucosamine and have been identified in bacteria, fungi, insects, plants, viruses, and protozoan parasites.  The structure of this domain is an eight-stranded alpha/beta barrel with a pronounced active-site cleft at the C-terminal end of the beta-barrel.','cd06548','GH18_chitinase'),(2610654,'gnl|CDD|119355',_binary 'Stabilin-1 interacting chitinase-like protein (SI-CLP) is a eukaryotic chitinase-like protein of unknown function that interacts with the endocytic/sorting transmembrane receptor stabilin-1 and is secreted from the lysosome.  SI-CLP has a glycosyl hydrolase family 18 (GH18) domain but lacks a chitin-binding domain. The catalytic amino acids of the GH18 domain are not conserved in SI-CLP, similar to the chitolectins YKL-39, YKL-40, and YM1/2.  Human SI-CLP is sorted to late endosomes and secretory lysosomes in alternatively activated macrophages.','cd02876','GH18_SI-CLP'),(2610655,'gnl|CDD|119362',_binary 'The Bacteroides thetaiotaomicron protein represented by pdb structure 3CO4 is an uncharacterized bacterial member of the family 18 glycosyl hydrolases with homologs found in Flavobacterium, Stigmatella, and Pseudomonas.','cd06545','GH18_3CO4_chitinase'),(2610656,'gnl|CDD|225862',_binary 'Chitinase [Carbohydrate transport and metabolism].','COG3325','ChiA'),(2610657,'gnl|CDD|119358',_binary 'The class V plant chitinases have a glycosyl hydrolase family 18 (GH18) domain, but lack the chitin-binding domain present in other GH18 enzymes.  The GH18 domain of the class V chitinases has endochitinase activity in some cases and no catalytic activity in others.  Included in this family is a lectin found in black locust (Robinia pseudoacacia) bark, which binds chitin but lacks chitinase activity.  Also included is a chitinase-related receptor-like kinase (CHRK1) from tobacco (Nicotiana tabacum), with an N-terminal GH18 domain and a C-terminal kinase domain, which is thought to be part of a plant signaling pathway.  The GH18 domain of CHRK1 is expressed extracellularly where it binds chitin but lacks chitinase activity.','cd02879','GH18_plant_chitinase_c...'),(2610717,'gnl|CDD|133028',_binary 'Subfamily of Glycosyltransferase Family GT2 of unknown function.  GT-2 includes diverse families of glycosyltransferases with a common GT-A type structural fold, which has two tightly associated beta/alpha/beta domains that tend to form a continuous central sheet of at least eight beta-strands. These are enzymes that catalyze the transfer of sugar moieties from activated donor molecules to specific acceptor molecules, forming glycosidic bonds. Glycosyltransferases have been classified into more than 90 distinct sequence based families.','cd04185','GT_2_like_b'),(2610741,'gnl|CDD|224937',_binary 'Cytotoxic translational repressor of toxin-antitoxin stability system [Translation, ribosomal structure and biogenesis / Cell division and chromosome partitioning].','COG2026','RelE'),(2610742,'gnl|CDD|335982',_binary 'ParE toxin of type II toxin-antitoxin system, parDE.  ParE is the toxin family of a type II toxin-antitoxin family. It is toxic towards DNA gyrase, but is neutralized by the antitoxin ParD. The family also encompasses RelE/ParE described in.','pfam05016','ParE_toxin'),(2610743,'gnl|CDD|273688',_binary 'prevent-host-death family protein.  This model recognizes a region of about 55 amino acids toward the N-terminal end of bacterial proteins of about 85 amino acids in length. The best-characterized member is prevent-host-death (phd) of bacteriophage P1, the antidote partner of death-on-curing (doc) (TIGR01550) in an addiction module. Addiction modules prevent plasmid curing by killing the host cell as the longer-lived killing protein persists while the gene for the shorter-lived antidote is lost. Note, however, that relatively few members of this family appear to be plasmid or phage-encoded. Also, there is little overlap, except for phage P1 itself, of species with this family and with the doc family. [Cellular processes, Toxin production and resistance, Mobile and extrachromosomal element functions, Other].','TIGR01552','Hypothetical_protein_R...'),(2610744,'gnl|CDD|308299',_binary 'Antitoxin Phd_YefM, type II toxin-antitoxin system.  Members of this family act as antitoxins in type II toxin-antitoxin systems. When bound to their toxin partners, they can bind DNA via the N-terminus and repress the expression of operons containing genes encoding the toxin and the antitoxin. This domain complexes with Txe toxins containing pfam06769, Fic/DOC toxins containing pfam02661 and YafO toxins containing pfam13957.','pfam02604','PhdYeFM_antitox'),(2610745,'gnl|CDD|225072',_binary 'Antitoxin of toxin-antitoxin stability system [Cell division and chromosome partitioning].','COG2161','StbD'),(2610801,'gnl|CDD|224657',_binary 'Adenine-specific DNA methylase containing a Zn-ribbon [DNA replication, recombination, and repair].','COG1743','COG1743'),(2610810,'gnl|CDD|225318',_binary 'Predicted methyltransferase [General function prediction only].','COG2520','COG2520'),(2610846,'gnl|CDD|315926',_binary 'UvrD-like helicase C-terminal domain.  This domain is found at the C-terminus of a wide variety of helicase enzymes. This domain has a AAA-like structural fold.','pfam13361','UvrD_C'),(2611111,'gnl|CDD|197713',_binary 'helix_turn_helix, Arsenical Resistance Operon Repressor.','smart00418','HTH_ARSR'),(2611139,'gnl|CDD|312941',_binary 'ARC105 or Med15 subunit of Mediator complex non-fungal.  The approx. 70 residue Med15 domain of the ARC-Mediator co-activator is a three-helix bundle with marked similarity to the KIX domain. The sterol regulatory element binding protein (SREBP) family of transcription activators use the ARC105 subunit to activate target genes in the regulation of cholesterol and fatty acid homeostasis. In addition, Med15 is a critical transducer of gene activation signals that control early metazoan development.','pfam09606','Med15'),(2611310,'gnl|CDD|238319',_binary 'Glutathione S-transferase (GST) family, N-terminal domain; a large, diverse group of cytosolic dimeric proteins involved in cellular detoxification by catalyzing the conjugation of  glutathione (GSH) with a wide range of endogenous and xenobiotic alkylating agents, including carcinogens, therapeutic drugs, environmental toxins and products of oxidative stress. In addition, GSTs also show GSH peroxidase activity and are involved in the synthesis of prostaglandins and leukotrienes. This family, also referred to as soluble GSTs, is the largest family of GSH transferases and is only distantly related to the mitochondrial GSTs (GSTK subfamily, a member of the DsbA family). Soluble GSTs bear no structural similarity to microsomal GSTs (MAPEG family) and display additional activities unique to their group, such as catalyzing thiolysis, reduction  and isomerization of certain compounds. The GST fold contains an N-terminal TRX-fold domain and a C-terminal alpha helical domain, with an active site located in a cleft between the two domains. Based on sequence similarity, different classes of GSTs have been identified, which display varying tissue distribution, substrate specificities and additional specific activities. In humans, GSTs display polymorphisms which may influence individual susceptibility to diseases such as cancer, arthritis, allergy and sclerosis. Some GST family members with non-GST functions include glutaredoxin 2, the CLIC subfamily of anion channels, prion protein Ure2p, crystallins, metaxin 2 and stringent starvation protein A.','cd00570','GST_N_family'),(2611511,'gnl|CDD|237057',_binary 'DNA polymerase III subunits gamma and tau; Provisional.','PRK12323','PRK12323'),(2612398,'gnl|CDD|119351',_binary 'This conserved domain family includes a large number of catalytically inactive chitinase-like lectins (chitolectins) including YKL-39, YKL-40 (HCGP39), YM1, oviductin, and AMCase (acidic mammalian chitinase), as well as catalytically active chitotriosidases.  The conserved domain is an eight-stranded alpha/beta barrel fold belonging to the family 18 glycosyl hydrolases.  The fold has a pronounced active-site cleft at the C-terminal end of the beta-barrel.  The chitolectins lack a key active site glutamate (the proton donor required for hydrolytic activity) but retain highly conserved residues involved in oligosaccharide binding.  Chitotriosidase is a chitinolytic enzyme expressed in maturing macrophages, which suggests that it plays a part in antimicrobial defense.  Chitotriosidase hydrolyzes chitotriose, as well as colloidal chitin to yield chitobiose and is therefore considered an exochitinase. Chitotriosidase occurs in two major forms, the large form being converted to the small form by either RNA or post-translational processing.  Although the small form, containing the chitinase domain alone, is sufficient for the chitinolytic activity, the additional C-terminal chitin-binding domain of the large form plays a role in processing colloidal chitin. The chitotriosidase gene is nonessential in humans, as about 35% of the population are heterozygous and 6% homozygous for an inactivated form of the gene.  HCGP39 is a 39-kDa human cartilage glycoprotein thought to play a role in connective tissue remodeling and defense against pathogens.','cd02872','GH18_chitolectin_chito...'),(2613136,'gnl|CDD|238863',_binary 'SGNH_peri1; putative periplasmic member of the SGNH-family of hydrolases, a diverse family of lipases and esterases. The tertiary fold of the enzyme is substantially different from that of the alpha/beta hydrolase family and unique among all known hydrolases; its active site closely resembles the Ser-His-Asp(Glu) triad found in other serine hydrolases.','cd01825','SGNH_hydrolase_peri1'),(2613226,'gnl|CDD|212148',_binary 'Nucleoside Triphosphate Pyrophosphohydrolase (EC 3.6.1.8) MazG-like domain found in a group of uncharacterized proteins from bacteria and archaea.  This family corresponds to a group of uncharacterized hypothetical proteins from bacteria, showing a high sequence similarity to the dimeric 2-deoxyuridine 5\'-triphosphate nucleotidohydrolase (dUTP pyrophosphatase or dUTPase) and NTP-PPase MazG proteins. However, unlike typical tandem-domain MazG proteins, members in this family consist of a single MazG-like domain that contains a well conserved divalent ion-binding motif EXX[E/D].','cd11541','NTP-PPase_u4'),(2613315,'gnl|CDD|170049',_binary 'integrase; Provisional.','PRK09692','PRK09692'),(2613329,'gnl|CDD|133389',_binary 'Helix-Turn-Helix DNA binding domain of transcription regulators from the MerR superfamily.  Helix-turn-helix (HTH) transcription regulator MerR superfamily, N-terminal domain. The MerR family transcription regulators have been shown to mediate responses to stress including exposure to heavy metals, drugs, or oxygen radicals in eubacterial and some archaeal species. They regulate transcription of multidrug/metal ion transporter genes and oxidative stress regulons by reconfiguring the spacer between the -35 and -10 promoter elements. A typical MerR regulator is comprised of two distinct domains that harbor the regulatory (effector-binding) site and the active (DNA-binding) site. Their N-terminal domains are homologous and contain a DNA-binding winged HTH motif, while the C-terminal domains are often dissimilar and bind specific coactivator molecules such as metal ions, drugs, and organic substrates.','cd04761','HTH_MerR-SF'),(2613337,'gnl|CDD|338726',_binary 'MerR HTH family regulatory protein.','pfam13411','MerR_1'),(2613475,'gnl|CDD|307627',_binary 'Myosin tail.  The myosin molecule is a multi-subunit complex made up of two heavy chains and four light chains it is a fundamental contractile protein found in all eukaryote cell types. This family consists of the coiled-coil myosin heavy chain tail region. The coiled-coil is composed of the tail from two molecules of myosin. These can then assemble into the macromolecular thick filament. The coiled-coil region provides the structural backbone the thick filament.','pfam01576','Myosin_tail_1'),(2613691,'gnl|CDD|315057',_binary 'Protein of unknown function (DUF3626).  This family of proteins is found in bacteria. Proteins in this family are typically between 294 and 374 amino acids in length.','pfam12294','DUF3626'),(2613698,'gnl|CDD|225272',_binary 'Predicted drug exporters of the RND superfamily [General function prediction only].','COG2409','COG2409'),(2613767,'gnl|CDD|235745',_binary 'sulfite reductase; Provisional.','PRK06214','PRK06214'),(2613811,'gnl|CDD|277339',_binary 'Deinococcus radiodurans DR1119 and related proteins, metallophosphatase domain.  DR1119 is an uncharacterized Deinococcus radiodurans protein with a metallophosphatase domain.  The domain present in members of this family belongs to the metallophosphatase (MPP) superfamily.  MPPs are functionally diverse, but all share a conserved domain with an active site consisting of two metal ions (usually manganese, iron, or zinc) coordinated with octahedral geometry by a cage of histidine, aspartate, and asparagine residues. The MPP superfamily includes: Mre11/SbcD-like exonucleases, Dbr1-like RNA lariat debranching enzymes, YfcE-like phosphodiesterases, purple acid phosphatases (PAPs), YbbF-like UDP-2,3-diacylglucosamine hydrolases, and acid sphingomyelinases (ASMases).  The conserved domain is a double beta-sheet sandwich with a di-metal active site made up of residues located at the C-terminal side of the sheets. This domain is thought to allow for productive metal coordination.','cd07393','MPP_DR1119'),(2613812,'gnl|CDD|224682',_binary 'Predicted phosphohydrolase [General function prediction only].','COG1768','COG1768'),(2613871,'gnl|CDD|198027',_binary 'Rho termination factor, N-terminal domain.  The Rho termination factor disengages newly transcribed RNA from its DNA template at certain, specific transcripts. It it thought that two copies of Rho bind to RNA and that Rho functions as a hexamer of protomers. This domain is found to the N-terminus of the RNA binding domain.','smart00959','Rho_N'),(2614003,'gnl|CDD|179385',_binary 'chromosome segregation protein; Provisional.','PRK02224','PRK02224'),(2614170,'gnl|CDD|224608',_binary 'Predicted pyrophosphatase [General function prediction only].','COG1694','MazG'),(2614632,'gnl|CDD|316712',_binary 'Domain of unknown function (DUF4326).  This family of proteins is functionally uncharacterized. This family of proteins is found in bacteria, archaea, eukaryotes and viruses. Proteins in this family are typically between 100 and 162 amino acids in length. There are two completely conserved residues (P and C) that may be functionally important.','pfam14216','DUF4326'),(2614881,'gnl|CDD|237171',_binary 'transcription termination factor Rho; Provisional.','PRK12678','PRK12678'),(2614965,'gnl|CDD|349754',_binary 'accessory protein CooC1.  The accessory protein CooC1, a nickel-binding ATPase, participates in the incorporation of nickel into the complex active site ([Ni-4Fe-4S]) cluster of Ni,Fe-dependent carbon monoxide dehydrogenase (CODH). CODH from Rhodospirillum rubrum catalyzes the reversible oxidation of CO to CO2. CODH contains a nickel-iron-sulfur cluster (C-center) and an iron-sulfur cluster (B-center). CO oxidation occurs at the C-center. Three accessory proteins encoded by cooCTJ genes are involved in nickel incorporation into a nickel site. CooC functions as a nickel insertase that mobilizes nickel to apoCODH using energy released from ATP hydrolysis. CooC is a homodimer and has NTPase activities. Mutation at the P-loop abolishs its function.','cd02034','CooC1'),(2615045,'gnl|CDD|212133',_binary 'Nucleoside Triphosphate Pyrophosphohydrolase (EC 3.6.1.8) MazG-like domain superfamily.  This superfamily contains enzymes that hydrolyze the alpha-beta phosphodiester bond of all canonical NTPs into monophosphate derivatives and pyrophosphate (PPi). Divalent ions, such as Mg2+ ion(s), are essential to activate a proposed water nucleophile and stabilize the charged intermediates to facilitate catalysis. These enzymes share a conserved divalent ion-binding motif EXX[E/D] in their active sites. They also share a highly conserved four-helix bundle, where one face forms the active site, while the other participates in oligomer assembly. The four-helix bundle consists of two central antiparallel alpha-helices that can be contained within a single protomer or form upon dimerization. The superfamily members include dimeric dUTP pyrophosphatases (dUTPases; EC 3.6.1.23), the nonspecific NTP-PPase MazG proteins, HisE-encoded phosphoribosyl ATP pyrophosphohydolase (PRA-PH), fungal histidine biosynthesis trifunctional proteins, and several uncharacterized protein families.','cd11523','NTP-PPase'),(2615046,'gnl|CDD|212144',_binary 'Nucleoside Triphosphate Pyrophosphohydrolase (EC 3.6.1.8) MazG-like domain found in mouse RS21-C6 protein and its homologs.  RS21-C6 proteins, highly expressed in all vertebrate genomes and green plants, act as house-cleaning enzymes, removing 5-methyl dCTP (m5dCTP) in order to prevent gene silencing. They show significant sequence similarity to the dimeric 2-deoxyuridine 5\'-triphosphate nucleotidohydrolase (dUTP pyrophosphatase or dUTPase) and NTP-PPase MazG proteins. However, unlike typical tandem-domain MazG proteins, RS21-C6 contains a single MazG-like domain and functions as a tetramer (a dimer of dimers) with a typical four-helical bundle. Divalent ions, such as Mg2+, are required for its pyrophosphatase activity. This family also includes a pyrophosphatase from Archaeoglobus fulgidus (Af1178). Although its biological role remains unclear, Af1178 shows significant sequence similarity to the mouse RS21-C6 protein.','cd11537','NTP-PPase_RS21-C6_like'),(2615048,'gnl|CDD|281770',_binary 'MazG nucleotide pyrophosphohydrolase domain.  This domain is about 100 amino acid residues in length. It is found in the MazG protein from E. coli. It contains four conserved negatively charged residues that probably form an active site or metal binding site. This domain is found in isolation in some proteins as well as associated with pfam00590. This domain is clearly related to pfam01503 another pyrophosphohydrolase involved in histidine biosynthesis. This family may be structurally related to the NUDIX domain pfam00293 (Bateman A pers. obs.).','pfam03819','MazG'),(2615234,'gnl|CDD|226846',_binary 'Bacteriophage protein gp37 [Function unknown].','COG4422','COG4422'),(2615235,'gnl|CDD|311448',_binary 'Protein of unknown function (DUF5131).  This is a family of bacterial and phage proteins of unknown function. There are three highly conserved cysteine residues in the disposition, Cx6Cxxc, amongst many highly conserved residues.','pfam07505','DUF5131'),(2615236,'gnl|CDD|275264',_binary 'radical SAM mobile pair protein A.  Members of this family are the upstream member (A) of a pair of tandem-encoded radical SAM enzymes. Most of these radical SAM gene pairs have an additional upstream regulatory gene in the MarR family. Examples of high sequence identity (over 96 percent) from cassettes in several Treponema species of the oral cavity to those in multiple Firmicutes in the gut microbiome suggest recent lateral gene transfer, as might be expected for antibiotic resistance genes. The function is unknown.','TIGR04471','hypothetical_protein_A...'),(2615237,'gnl|CDD|100105',_binary 'Radical SAM superfamily. Enzymes of this family generate radicals by combining a 4Fe-4S cluster and S-adenosylmethionine (SAM) in close proximity. They are characterized by a conserved CxxxCxxC motif, which coordinates the conserved iron-sulfur cluster. Mechanistically, they share the transfer of a single electron from the iron-sulfur cluster to SAM, which leads to its reductive cleavage to methionine and a 5\'-deoxyadenosyl radical, which, in turn, abstracts a hydrogen from the appropriately positioned carbon atom. Depending on the enzyme, SAM is consumed during this process or it is restored and reused. Radical SAM enzymes catalyze steps in metabolism, DNA repair, the biosynthesis of vitamins and coenzymes, and the biosynthesis of many antibiotics. Examples are biotin synthase (BioB), lipoyl synthase (LipA), pyruvate formate-lyase (PFL), coproporphyrinogen oxidase (HemN), lysine 2,3-aminomutase (LAM), anaerobic ribonucleotide reductase (ARR), and  MoaA, an enzyme of the biosynthesis of molybdopterin.','cd01335','Radical_SAM'),(2615239,'gnl|CDD|275267',_binary 'three-Cys-motif partner protein.  Members of this family occur regularly as a partner to as a member of family pfam07505, which has been called a phage protein but which seems to occur also in other contexts. Members average about 400 residues in length, but the conserved region covered by the model averages 260 residues and excludes the C-terminus. Conserved motifs suggest enzymatic activity. Note that its frequent partner protein (see pfam07505) has a three-cysteine motif that resembles the Cx3CxxC motif of radical SAM proteins, and that in one branch (see TIGR04471) actually becomes Cx3CxxC. We suggest the name three-Cys-motif partner protein (tcmP), and renaming pfam07505 to three-Cys-motif family protein.','TIGR04474','conserved_hypothetical...'),(2615244,'gnl|CDD|313316',_binary 'Uncharacterized conserved protein (DUF2303).  Members of this family of hypothetical bacterial proteins have no known function.','pfam10065','DUF2303'),(2615266,'gnl|CDD|225606',_binary 'Membrane protein involved in colicin uptake [Cell envelope biogenesis, outer membrane].','COG3064','TolA'),(2615320,'gnl|CDD|315502',_binary 'Integrase.  This is a family of DNA-binding prophage integrases found in Proteobacteria.','pfam12835','Integrase_1'),(2615858,'gnl|CDD|238859',_binary 'Rhamnogalacturan_acetylesterase_like subgroup of SGNH-hydrolases. Rhamnogalacturan acetylesterase removes acetyl esters from rhamnogalacturonan substrates, and renders them susceptible to degradation by rhamnogalacturonases. Rhamnogalacturonans are highly branched regions in pectic polysaccharides, consisting of repeating -(1,2)-L-Rha-(1,4)-D-GalUA disaccharide units, with many rhamnose residues substituted by neutral oligosaccharides such as arabinans, galactans and arabinogalactans. Extracellular enzymes participating in the degradation of plant cell wall polymers, such as Rhamnogalacturonan acetylesterase, would typically be found in saprophytic and plant pathogenic fungi and bacteria.','cd01821','Rhamnogalacturan_acety...'),(2615859,'gnl|CDD|238860',_binary 'Lysophospholipase L1-like subgroup of SGNH-hydrolases. The best characterized member in this family is TesA, an E. coli periplasmic protein with thioesterase, esterase, arylesterase, protease and lysophospholipase activity.','cd01822','Lysophospholipase_L1_like'),(2615880,'gnl|CDD|309043',_binary 'HAD superfamily, subfamily IIIB (Acid phosphatase).  This family proteins includes acid phosphatases and a number of vegetative storage proteins.','pfam03767','Acid_phosphat_B'),(2616011,'gnl|CDD|317012',_binary 'Putative phage serine protease XkdF.  This domain is largely found on phage proteins. In a number of cases the domain is associated with a SAM-dependent methyltransferase. Members are serine peptidases.','pfam14550','Peptidase_S78_2'),(2616071,'gnl|CDD|337494',_binary 'Mitochondrial inner membrane protein.  Mitofilin controls mitochondrial cristae morphology. Mitofilin is enriched in the narrow space between the inner boundary and the outer membranes, where it forms a homotypic interaction and assembles into a large multimeric protein complex. The first 78 amino acids contain a typical amino-terminal-cleavable mitochondrial presequence rich in positive-charged and hydroxylated residues and a membrane anchor domain. In addition, it has three centrally located coiled coil domains.','pfam09731','Mitofilin'),(2616080,'gnl|CDD|224495',_binary 'Zn-ribbon protein, possibly nucleic acid-binding [General function prediction only].','COG1579','COG1579'),(2616255,'gnl|CDD|238119',_binary 'Von Willebrand factor type A (vWA) domain was originally found in the blood coagulation protein von Willebrand factor (vWF). Typically, the vWA domain is made up of approximately 200 amino acid residues folded into a classic a/b para-rossmann type of fold. The vWA domain, since its discovery, has drawn great interest because of its widespread occurrence and its involvement in a wide variety of important cellular functions. These include basal membrane formation, cell migration, cell differentiation, adhesion, haemostasis, signaling, chromosomal stability, malignant transformation and in immune defenses  In integrins these domains form heterodimers while in vWF it forms multimers. There are different interaction surfaces of this domain as seen by the various molecules it complexes with. Ligand binding in most cases is mediated by the presence of a metal ion dependent adhesion site termed as the MIDAS motif that is a characteristic feature of most, if not all A domains.','cd00198','vWFA'),(2616993,'gnl|CDD|273636',_binary 'group I intron endonuclease.  This model represents one subfamily of endonucleases containing the endo/excinuclease amino terminal domain, pfam01541 at its amino end. A distinct subfamily includes excinuclease abc subunit c (uvrC). Members of pfam01541 are often termed GIY-YIG endonucleases after conserved motifs near the amino end. This subfamily in this model is found in open reading frames of group I introns in both phage and mitochondria. The closely related endonucleases of phage T4: segA, segB, segC, segD and segE, score below the trusted cutoff for the family.','TIGR01453','unnamed_protein_produc...'),(2617130,'gnl|CDD|238741',_binary 'VWA subfamily: Von Willebrand factor type A (vWA) domain was originally found in the blood coagulation protein von Willebrand factor (vWF). Typically, the vWA domain is made up of approximately 200 amino acid residues folded into a classic a/b para-rossmann type of fold. The vWA domain, since its discovery, has drawn great interest because of its widespread occurrence and its involvement in a wide variety of important cellular functions. These include basal membrane formation, cell migration, cell differentiation, adhesion, haemostasis, signaling, chromosomal stability, malignant transformation and in immune defenses  In integrins these domains form heterodimers while in vWF it forms multimers. There are different interaction surfaces of this domain as seen by the various molecules it complexes with. Ligand binding in most cases is mediated by the presence of a metal ion dependent adhesion site termed as the MIDAS motif that is a characteristic feature of most, if not all A domains. Members of this subgroup have no assigned function. This subfamily is typified by the presence of a conserved MIDAS motif.','cd01464','vWA_subfamily'),(2617170,'gnl|CDD|319256',_binary 'ParB-like partition protein of low copy number plasmid RK2, N-terminal domain and related domains.  KorB, a member of the ParB like family, is present on the low copy number, broad host range plasmid RK2. KorB encodes a gene product involved in segregation of RK2 and acts as a transcriptional regulator, down-regulating at least 6 RK2 operons. KorB binds RNA polymerase and acts cooperatively with several co-repressors in modulating transcription. KorB is comprised of 3 domains, including a beta-strand C-terminal domain similar to SH3 domains and an alpha helical central domain that interacts with operator DNA. In ParB of P1 and SopB of F, the N-terminal region is responsible for interaction with the parA component. However, korB interaction with the RK2 parA-equivalent IncC has been mapped to the central HTH motif.  This family is related to the N-terminal domain of ParB, a DNA-binding component of the prokaryotic parABS partitioning system. parABS contributes to the efficient segregation of chromosomes and low-copy number plasmids to daughter cells during prokaryotic cell division. The process includes the parA (Walker box) ATPase, the ParB DNA-binding protein and a parS cis-acting DNA sites. Binding of ParB to centromere-like parS sites is followed by non-specific binding to DNA (\'spreading\', which has been implicated in gene silencing in plasmid P1) and oligomerization of additional ParB molecules near the parS sites. It has been proposed that ParB-ParB cross-linking compacts the DNA, binds to parA via the N-terminal region, and leads to parA separating the ParB-parS complexes and the recruitment of the SMC (structural maintenance of chromosomes) complexes. The ParB N-terminal domain of Bacillus subtilis and other species contains a Arginine-rich ParB Box II with residues essential for bridging of the ParB-parS complexes. The arginine-rich ParB Box II consensus (I[VIL]AGERR[FYW]RA[AS] identified in several species is partially conserved with this family and related families. Mutations within the basic columns particularly debilitate spreading from the parS sites and impair SMC recruitment. The C-terminal domain contains a HTH DNA-binding motif and is the primary homo-dimerization domain, and binds to parS DNA sites. Additional homo-dimerization contacts are found along the N-terminal domain, but dimerization of the N-terminus may only occur after concentration at ParB-parS foci.','cd16398','KorB_N_like'),(2617173,'gnl|CDD|275105',_binary 'nucleoid occlusion protein.  This model describes nucleoid occlusion protein, a close homolog to ParB chromosome partitioning proteins including Spo0J in Bacillus subtilis. Its gene often is located near the gene for the Spo0J ortholog. This protein bind a specific DNA sequence and blocks cytokinesis from happening until chromosome segregation is complete.','TIGR04285','parB-like_partition_pr...'),(2617174,'gnl|CDD|319265',_binary 'ParB N-terminal, parA -binding, -like domain of bacterial and plasmid parABS partitioning systems.  This family represents the N-terminal domain of ParB, a DNA-binding component of the prokaryotic parABS partitioning system. parABS contributes to the efficient segregation of chromosomes and low-copy number plasmids to daughter cells during prokaryotic cell division. The process includes the parA (Walker box) ATPase, the ParB DNA-binding protein and a parS cis-acting DNA sites. Binding of ParB to centromere-like parS sites is followed by non-specific binding to DNA (\'spreading\', which has been implicated in gene silencing in plasmid P1) and oligomerization of additional ParB molecules near the parS sites. It has been proposed that ParB-ParB cross-linking compacts the DNA, binds to parA via the N-terminal region, and leads to parA separating the ParB-parS complexes and the recruitment of the SMC (structural maintenance of chromosomes) complexes. The ParB N-terminal domain of Bacillus subtilis and other species contains a Arginine-rich ParB Box II with residues essential for bridging of the ParB-parS complexes. The arginine-rich ParB Box II consensus (I[VIL]AGERR[FYW]RA[AS] identified in several species is partially conserved with this family and related families. Mutations within the basic columns particularly debilitate spreading from the parS sites and impair SMC recruitment. The C-terminal domain contains a HTH DNA-binding motif and is the primary homo-dimerization domain, and binds to parS DNA sites. Additional homo-dimerization contacts are found along the N-terminal domain, but dimerization of the N-terminus may only occur after concentration at ParB-parS foci.','cd16408','ParB_N_like'),(2617890,'gnl|CDD|308527',_binary 'Bacteriophage lambda head decoration protein D.','pfam02924','HDPD'),(2617901,'gnl|CDD|224636',_binary 'Exonuclease VII small subunit [DNA replication, recombination, and repair].','COG1722','XseB'),(2617902,'gnl|CDD|179195',_binary 'exodeoxyribonuclease VII small subunit; Provisional.','PRK00977','PRK00977'),(2617903,'gnl|CDD|335003',_binary 'Exonuclease VII small subunit.  This family consist of exonuclease VII, small subunit EC:3.1.11.6 This enzyme catalyzes exonucleolytic cleavage in either 5\'->3\' or 3\'->5\' direction to yield 5\'-phosphomononucleotides. This exonuclease VII enzyme is composed of one large subunit and 4 small ones.','pfam02609','Exonuc_VII_S'),(2617904,'gnl|CDD|273536',_binary 'exodeoxyribonuclease VII, small subunit.  This protein is the small subunit for exodeoxyribonuclease VII. Exodeoxyribonuclease VII is made of a complex of four small subunits to one large subunit. The complex degrades single-stranded DNA into large acid-insoluble oligonucleotides. These nucleotides are then degraded further into acid-soluble oligonucleotides. [DNA metabolism, Degradation of DNA].','TIGR01280','xseB'),(2617909,'gnl|CDD|224486',_binary 'Exonuclease VII, large subunit [DNA replication, recombination, and repair].','COG1570','XseA'),(2617910,'gnl|CDD|334998',_binary 'Exonuclease VII, large subunit.  This family consist of exonuclease VII, large subunit EC:3.1.11.6 This enzyme catalyzes exonucleolytic cleavage in either 5\'->3\' or 3\'->5\' direction to yield 5\'-phosphomononucleotides. This exonuclease VII enzyme is composed of one large subunit and 4 small ones.','pfam02601','Exonuc_VII_L'),(2619036,'gnl|CDD|223540',_binary 'ATPases of the AAA+ class [Posttranslational modification, protein turnover, chaperones].','COG0464','SpoVK'),(2619062,'gnl|CDD|223676',_binary 'Predicted PP-loop superfamily ATPase [General function prediction only].','COG0603','COG0603'),(2619063,'gnl|CDD|238953',_binary 'ExsB is a transcription regulator related protein. It is a subfamily of a Adenosine nucleotide binding superfamily of proteins. This protein family is represented by a single member in nearly every completed large (> 1000 genes) prokaryotic genome. In Rhizobium meliloti, a species in which the exo genes make succinoglycan, a symbiotically important exopolysaccharide, exsB is located nearby and affects succinoglycan levels, probably through polar effects on exsA expression or the same polycistronic mRNA. In Arthrobacter viscosus, the homologous gene is designated ALU1 and is associated with an aluminum tolerance phenotype. The function is unknown.','cd01995','ExsB'),(2619064,'gnl|CDD|284031',_binary 'Queuosine biosynthesis protein QueC.  This family of proteins participate in the biosynthesis of 7-carboxy-7-deazaguanine. They catalyze the conversion of 7-deaza-7-carboxyguanine to preQ0.','pfam06508','QueC'),(2619065,'gnl|CDD|129461',_binary 'queuosine biosynthesis protein QueC.  Members of this protein family are QueC, involved in synthesizing pre-Q0 from GTP en route to tRNA modification with queuosine. This protein family is represented by a single member in nearly every completed large (> 1000 genes) prokaryotic genome. In Rhizobium meliloti, the gene was designated exsB, possibly because of polar effects on exsA expression in a shared polycistronic mRNA. In Arthrobacter viscosus, the homologous gene was designated ALU1 and was associated with an aluminum tolerance phenotype. [Unknown function, General].','TIGR00364','7-cyano-7-deazaguanine...'),(2619066,'gnl|CDD|182967',_binary 'queuosine biosynthesis protein QueC; Provisional.','PRK11106','PRK11106'),(2619067,'gnl|CDD|223792',_binary '6-pyruvoyl-tetrahydropterin synthase [Coenzyme metabolism].','COG0720','COG0720'),(2619068,'gnl|CDD|307413',_binary '6-pyruvoyl tetrahydropterin synthase.  6-Pyruvoyl tetrahydrobiopterin synthase catalyzes the conversion of dihydroneopterin triphosphate to 6-pyruvoyl tetrahydropterin, the second of three enzymatic steps in the synthesis of tetrahydrobiopterin from GTP. The functional enzyme is a hexamer of identical subunits.','pfam01242','PTPS'),(2619069,'gnl|CDD|274547',_binary 'queuosine biosynthesis protein QueD.  Members of this protein family, closely related to eukaryotic 6-pyruvoyl tetrahydrobiopterin synthase enzymes, are the QueD protein of queuosine biosynthesis. Queuosine is a hypermodified base in the wobble position of tRNAs for Tyr, His, Asp, and Asn in many species. This modification, although widespread, appears not to be important for viability. The queuosine precursor made by this enzyme may be converted instead to archeaosine as in some Archaea. [Protein synthesis, tRNA and rRNA base modification].','TIGR03367','queuosine_QueD'),(2619070,'gnl|CDD|272868',_binary '6-pyruvoyl tetrahydropterin synthase/QueD family protein.  This model has been downgraded from hypothetical_equivalog to subfamily. The animal enzymes are known to be 6-pyruvoyl tetrahydropterin synthase. The function of the bacterial branch of the sequence lineage had been thought to be the same, but many are now taken to be QueD, and enzyme of queuosine biosynthesis. Queuosine is a hypermodified base in the wobble position of some tRNAs in most species. A new model is built to be the QueD equivalog model. [Protein synthesis, tRNA and rRNA base modification].','TIGR00039','Putative_6-carboxy-567...'),(2619071,'gnl|CDD|238264',_binary '6-pyruvoyl tetrahydropterin synthase (PTPS). Folate derivatives are essential cofactors in the biosynthesis of purines, pyrimidines, and amino acids, as well as formyl-tRNA. Mammalian cells are able to utilize pre-formed folates after uptake by a carrier-mediated active transport system. Most microbes and plants lack this system and must synthesize folates de novo from guanosine triphosphate. One enzyme from this pathway is PTPS which catalyzes the conversion of dihydroneopterin triphosphate to 6-pyruvoyl tetrahydropterin. The functional enzyme is a hexamer of identical subunits.','cd00470','PTPS'),(2619077,'gnl|CDD|223675',_binary 'Organic radical activating enzymes [Posttranslational modification, protein turnover, chaperones].','COG0602','NrdG'),(2619078,'gnl|CDD|274545',_binary '7-cyano-7-deazaguanosine (preQ0) biosynthesis protein QueE.  This uncharacterized enzyme, designated QueE, participates in the biosynthesis, from GTP, of 7-cyano-7-deazaguanosine, also called preQ0 because in many species it is a precursor of queuosine. In most Archaea, it is instead the precursor of a different tRNA modified base, archaeosine. [Protein synthesis, tRNA and rRNA base modification].','TIGR03365','Bsubt_queE'),(2619079,'gnl|CDD|275126',_binary 'putative 7-cyano-7-deazaguanosine (preQ0) biosynthesis protein QueE.  Members of this radical SAM domain protein family appear to be the E. coli form of the queuosine biosynthesis protein QueE. QueE is involved in making preQ0 (7-cyano-7-deazaquanine), a precursor of both the bacterial/eukaryotic modified tRNA base queuosine and the archaeal modified base archaeosine. Members occur in species that lack known forms of QueE but usually are not found in queuosine biosynthesis operons. Members of this family tend to form bi-directional best hit matches to members of known (TIGR03365) and putative (TIGR03963) QueE families from other lineages.','TIGR04322','organic_radical_activa...'),(2619080,'gnl|CDD|188478',_binary 'putative 7-cyano-7-deazaguanosine (preQ0) biosynthesis protein QueE, clostridial.  Members of this radical SAM domain protein family appear to be the Clostridial form of the queuosine biosynthesis protein QueE. QueE is involved in making preQ0 (7-cyano-7-deazaquanine), a precursor of both the bacterial/eukaryotic modified tRNA base queuosine and the archaeal modified base archaeosine. Members occur in preQ0 operons species that lack members of related protein family TIGR03365. [Protein synthesis, tRNA and rRNA base modification].','TIGR03963','rSAM_QueE_Clost'),(2619081,'gnl|CDD|275301',_binary '7-carboxy-7-deazaguanine synthase, Cx14CxxC type.  In the pathway of 7-cyano-7-deazaquanine (preQ0) biosynthesis, the radical SAM enzyme QueE is quite variable. This model describes a variant form in which the three-Cys motif that binds the signature 4Fe-4S cluster takes the form Cx14CxxC, as in Burkholderia multivorans ATCC 17616. The crystal structure is known.','TIGR04508','queE_Cx14CxxC'),(2619082,'gnl|CDD|315957',_binary '4Fe-4S single cluster domain.','pfam13394','Fer4_14'),(2619083,'gnl|CDD|275145',_binary 'putative 7-cyano-7-deazaguanosine (preQ0) biosynthesis protein QueE, gammaproteobacterial type.  Members of this radical SAM domain protein family appear to be a form of the queuosine biosynthesis protein QueE. QueE is involved in making preQ0 (7-cyano-7-deazaquanine), a precursor of both the bacterial/eukaryotic modified tRNA base queuosine and the archaeal modified base archaeosine. Members occur in preQ0 operons species that lack members of related protein family TIGR03365.','TIGR04349','Radical_SAM_domain_pro...'),(2619084,'gnl|CDD|224101',_binary 'Pyruvate-formate lyase-activating enzyme [Posttranslational modification, protein turnover, chaperones].','COG1180','PflA'),(2619085,'gnl|CDD|338695',_binary '4Fe-4S single cluster domain.  This family includes proteins containing domains which bind to iron-sulfur clusters. Members include bacterial ferredoxins, various dehydrogenases, and various reductases. The structure of the domain is an alpha-antiparallel beta sandwich.','pfam13353','Fer4_12'),(2619086,'gnl|CDD|335595',_binary 'Radical SAM superfamily.  Radical SAM proteins catalyze diverse reactions, including unusual methylations, isomerisation, sulphur insertion, ring formation, anaerobic oxidation and protein radical formation.','pfam04055','Radical_SAM'),(2619087,'gnl|CDD|274164',_binary 'anaerobic ribonucleoside-triphosphate reductase activating protein.  This enzyme is a member of the radical-SAM family (pfam04055). It is often gene clustered with the class III (anaerobic) ribonucleotide triphosphate reductase (NrdD, TIGR02487) and presumably fulfills the identical function as NrdG, which utilizes S-adenosyl methionine, an iron-sulfur cluster and a reductant (dihydroflavodoxin) to produce a glycine-centered radical in NrdD. [Purines, pyrimidines, nucleosides, and nucleotides, 2\'-Deoxyribonucleotide metabolism, Protein fate, Protein modification and repair].','TIGR02495','RADICAL-ACTIVATING_ENZYME'),(2619088,'gnl|CDD|223609',_binary 'Predicted Fe-S oxidoreductases [General function prediction only].','COG0535','COG0535'),(2619090,'gnl|CDD|275271',_binary 'radical SAM/CxCxxxxC motif protein YfkAB.  Members of this highly conserved family in some Firmicutes have an N-terminal radical SAM domain (pfam04055) and a C-terminal pfam08756 domain with a CxCxxxxC motif that suggests binding to an additional metallocluster. It appears all correct sequences in this family are about 370 amino acids in length, containing the YfkA and YfkB regions originally reported as separate ORFs in Bacillus subtilis. Partial Phylogenetic Profiling shows occurrences almost exclusively in the Bacilli, with very few examples of either lateral transfer or gene loss. The essentially monophyletic distribution suggests a housekeeping function. Members have no well-conserved gene neighborhood. The function is unknown. [Unknown function, Enzymes of unknown specificity].','TIGR04478','radical_SAM_superfamil...'),(2619129,'gnl|CDD|307403',_binary 'GTP cyclohydrolase I.  This family includes GTP cyclohydrolase enzymes and a family of related bacterial proteins.','pfam01227','GTP_cyclohydroI'),(2619130,'gnl|CDD|236472',_binary 'GTP cyclohydrolase I; Provisional.','PRK09347','folE'),(2619131,'gnl|CDD|223379',_binary 'GTP cyclohydrolase I [Coenzyme metabolism].','COG0302','FolE'),(2619132,'gnl|CDD|238349',_binary 'GTP cyclohydrolase I (GTP-CH-I) catalyzes the conversion of GTP into dihydroneopterin triphosphate.  The enzyme product is the precursor of tetrahydrofolate in eubacteria, fungi, and plants and of the folate analogs in methanogenic bacteria.  In vertebrates and insects it is the biosynthtic precursor of tetrahydrobiopterin (BH4) which is involved in the formation of catacholamines, nitric oxide, and the stimulation of T lymphocytes. The biosynthetic reaction of BH4 is controlled by a regulatory protein GFRP which mediates feedback inhibition of GTP-CH-I by BH4.  This inhibition is reversed by phenylalanine. The decameric GTP-CH-I forms a complex with two pentameric GFRP in the presence of phenylalanine or a combination of GTP and BH4, respectively.','cd00642','GTP_cyclohydro1'),(2619133,'gnl|CDD|237149',_binary 'GTP cyclohydrolase I; Reviewed.','PRK12606','PRK12606'),(2619134,'gnl|CDD|129173',_binary 'GTP cyclohydrolase I.  alternate names: Punch (Drosophila),GTP cyclohydrolase I (EC 3.5.4.16) catalyzes the biosynthesis of formic acid and dihydroneopterin triphosphate from GTP. This reaction is the first step in the biosynthesis of tetrahydrofolate in prokaryotes, of tetrahydrobiopterin in vertebrates, and of pteridine-containing pigments in insects. [Biosynthesis of cofactors, prosthetic groups, and carriers, Folic acid].','TIGR00063','GTP_cyclohydrolase_1'),(2619135,'gnl|CDD|215549',_binary 'GTP cyclohydrolase I; Provisional.','PLN03044','PLN03044'),(2619136,'gnl|CDD|240434',_binary 'GTP cyclohydrolase I; Provisional.','PTZ00484','PTZ00484'),(2619137,'gnl|CDD|215290',_binary 'GTP cyclohydrolase I.','PLN02531','PLN02531'),(2619952,'gnl|CDD|179062',_binary 'ribose-phosphate pyrophosphokinase; Provisional.','PRK00553','PRK00553'),(2620244,'gnl|CDD|223539',_binary 'Glycosyltransferases involved in cell wall biogenesis [Cell envelope biogenesis, outer membrane].','COG0463','WcaA'),(2620320,'gnl|CDD|339744',_binary '3\' exoribonuclease, RNase T-like.  This is a highly divergent 3\' exoribonuclease family. The proteins constitute a typical RNase fold, where the active site residues form a magnesium catalytic centre. The protein of the solved structure readily cleaves 3\' overhangs in a time-dependent manner. It is similar to DEDD-type RNases and is an unusual ATP-binding protein that binds ATP and dATP. It forms a dimer in solution and both protomers in the asymmetric unit bind a magnesium ion through Asp-6 in UniProtKB:P9WJ73.','pfam16473','DUF5051'),(2620528,'gnl|CDD|213194',_binary 'ATP-binding cassette domain of non-transporter proteins.  ABC-type Class 2 contains systems involved in cellular processes other than transport. These families are characterized by the fact that the ABC subunit is made up of duplicated, fused ABC modules (ABC2). No known transmembrane proteins or domains are associated with these proteins.','cd03227','ABC_Class2'),(2620784,'gnl|CDD|274528',_binary 'type VI secretion ATPase, ClpV1 family.  Members of this protein family are homologs of ClpB, an ATPase associated with chaperone-related functions. These ClpB homologs, designated ClpV1, are a key component of the bacterial pathogenicity-associated type VI secretion system. [Protein fate, Protein and peptide secretion and trafficking, Cellular processes, Pathogenesis].','TIGR03345','VI_ClpV1'),(2620809,'gnl|CDD|133029',_binary 'Subfamily of Glycosyltransferase Family GT2 of unknown function.  GT-2 includes diverse families of glycosyltransferases with a common GT-A type structural fold, which has two tightly associated beta/alpha/beta domains that tend to form a continuous central sheet of at least eight beta-strands. These are enzymes that catalyze the transfer of sugar moieties from activated donor molecules to specific acceptor molecules, forming glycosidic bonds. Glycosyltransferases have been classified into more than 90 distinct sequence based families.','cd04186','GT_2_like_c'),(2620814,'gnl|CDD|274884',_binary 'mycofactocin system glycosyltransferase.  Members of this protein family are putative glycosyltransferases, members of pfam00535 (glycosyl transferase family 2). Members appear mostly in the Actinobacteria, where they appear to be part of a system for converting a precursor peptide (TIGR03969) into a novel redox carrier designated mycofactocin. A radical SAM enzyme, TIGR03962, is a proposed to be a key maturase for mycofactocin.','TIGR03965','glycosyltransferase_Rv...'),(2621334,'gnl|CDD|227618',_binary 'Phage-related tail fibre protein [General function prediction only].','COG5301','COG5301'),(2622079,'gnl|CDD|338766',_binary 'AAA domain.','pfam13476','AAA_23'),(2622080,'gnl|CDD|224116',_binary 'Recombinational DNA repair ATPase (RecF pathway) [DNA replication, recombination, and repair].','COG1195','RecF'),(2624356,'gnl|CDD|235334',_binary 'electron transport complex protein RnfC; Provisional.','PRK05035','PRK05035'),(2624427,'gnl|CDD|235072',_binary 'ribose-phosphate pyrophosphokinase; Provisional.','PRK02812','PRK02812'),(2624431,'gnl|CDD|180714',_binary 'phosphoribosylpyrophosphate synthetase; Provisional.','PRK06827','PRK06827'),(2624433,'gnl|CDD|235039',_binary 'ribose-phosphate pyrophosphokinase; Provisional.','PRK02458','PRK02458'),(2624434,'gnl|CDD|179535',_binary 'ribose-phosphate pyrophosphokinase; Provisional.','PRK03092','PRK03092'),(2624446,'gnl|CDD|227066',_binary 'Phage-related protein [Function unknown].','COG4722','COG4722'),(2624537,'gnl|CDD|275027',_binary 'ribonucleoside-diphosphate reductase, class 1b, beta subunit.  Members of this family are NrdF, the beta subunit of class 1b ribonucleotide reductase. This form uses a dimanganese moiety associated with a tyrosine radical to reduce the cellular requirement for iron. [Purines, pyrimidines, nucleosides, and nucleotides, 2\'-Deoxyribonucleotide metabolism].','TIGR04171','ribonucleotide-diphosp...'),(2624538,'gnl|CDD|184425',_binary 'ribonucleotide-diphosphate reductase subunit beta; Provisional.','PRK13965','PRK13965'),(2624539,'gnl|CDD|236591',_binary 'ribonucleotide-diphosphate reductase subunit beta; Reviewed.','PRK09614','nrdF'),(2624540,'gnl|CDD|140022',_binary 'ribonucleotide-diphosphate reductase subunit beta; Provisional.','PRK13966','nrdF2'),(2624541,'gnl|CDD|140023',_binary 'ribonucleotide-diphosphate reductase subunit beta; Provisional.','PRK13967','nrdF1'),(2624542,'gnl|CDD|223286',_binary 'Ribonucleotide reductase, beta subunit [Nucleotide transport and metabolism].','COG0208','NrdF'),(2624543,'gnl|CDD|333968',_binary 'Ribonucleotide reductase, small chain.','pfam00268','Ribonuc_red_sm'),(2624544,'gnl|CDD|153108',_binary 'Ribonucleotide Reductase, R2/beta subunit, ferritin-like diiron-binding domain.  Ribonucleotide Reductase, R2/beta subunit (RNRR2) is a member of a broad superfamily of ferritin-like diiron-carboxylate proteins. The RNR protein catalyzes the conversion of ribonucleotides to deoxyribonucleotides and is found in all eukaryotes, many prokaryotes, several viruses, and few archaea. The catalytically active form of RNR is a proposed alpha2-beta2 tetramer. The homodimeric alpha subunit (R1) contains the active site and redox active cysteines as well as the allosteric binding sites. The beta subunit (R2) contains a diiron cluster that, in its reduced state, reacts with dioxygen to form a stable tyrosyl radical and a diiron(III) cluster. This essential tyrosyl radical is proposed to generate a thiyl radical, located on a cysteine residue in the R1 active site that initiates ribonucleotide reduction. The beta subunit is composed of 10-13 helices, the 8 longest helices form an alpha-helical bundle; some have 2 addition beta strands. Yeast is unique in that it assembles both homodimers and heterodimers of RNRR2. The yeast heterodimer, Y2Y4, contains R2 (Y2) and a R2 homolog (Y4) that lacks the diiron center and is proposed to only assist in cofactor assembly, and perhaps stabilize R1 (Y1) in its active conformation.','cd01049','RNRR2'),(2624545,'gnl|CDD|181647',_binary 'ribonucleotide-diphosphate reductase subunit beta; Reviewed.','PRK09101','nrdB'),(2624546,'gnl|CDD|240315',_binary 'ribonucleoside-diphosphate reductase small subunit; Provisional.','PTZ00211','PTZ00211'),(2624547,'gnl|CDD|215272',_binary 'ribonucleoside-diphosphate reductase.','PLN02492','PLN02492'),(2624749,'gnl|CDD|223690',_binary 'tRNA nucleotidyltransferase/poly(A) polymerase [Translation, ribosomal structure and biogenesis].','COG0617','PcnB'),(2624750,'gnl|CDD|237339',_binary 'tRNA CCA-pyrophosphorylase; Provisional.','PRK13299','PRK13299'),(2624751,'gnl|CDD|143388',_binary 'Nucleotidyltransferase (NT) domain of ClassII CCA-adding enzymes.  CCA-adding enzymes add the sequence [cytidine(C)-cytidine-adenosine (A)], one nucleotide at a time, onto the 3\' end of tRNA, in a template-independent reaction. This Class II group is comprised mainly of eubacterial and eukaryotic enzymes and includes Bacillus stearothermophilus CCAase, Escherichia coli poly(A) polymerase I, human mitochondrial CCAase, and Saccharomyces cerevisiae CCAase (CCA1). CCA-adding enzymes have a single catalytic pocket, which recognizes both ATP and CTP substrates. Included in this subgroup are CC- and A-adding enzymes from various ancient species of bacteria such as Aquifex aeolicus; these enzymes collaborate to add CCA to tRNAs. This family belongs to the Pol beta-like NT superfamily. In the majority of enzymes in this superfamily, two carboxylates, Dx[D/E], together with a third more distal carboxylate, coordinate two divalent metal cations involved in a two-metal ion mechanism of nucleotide addition. These carboxylate residues are fairly well conserved in this family. Escherichia coli CCAase is related to this group but has not been included in this alignment as this enzyme lacks the N-terminal helix conserved in the remainder of the NT superfamily.','cd05398','NT_ClassII-CCAase'),(2624752,'gnl|CDD|131739',_binary 'tRNA adenylyltransferase.  The enzyme tRNA adenylyltransferase, also called tRNA-nucleotidyltransferase and CCA-adding enzyme, can add or repair the required CCA triplet at the 3\'-end of tRNA molecules. Genes encoding tRNA include the CCA tail in some but not all bacteria, and this enzyme may be required for viability. Members of this family represent a distinct clade within the larger family pfam01743 (tRNA nucleotidyltransferase/poly(A) polymerase family protein). The example from Streptomyces coelicolor was shown to act as a CCA-adding enzyme and not as a poly(A) polymerase. [Protein synthesis, tRNA and rRNA base modification].','TIGR02692','putative_tRNA_nucleoti...'),(2624753,'gnl|CDD|182810',_binary 'multifunctional tRNA nucleotidyl transferase/2\'3\'-cyclic phosphodiesterase/2\'nucleotidase/phosphatase; Reviewed.','PRK10885','cca'),(2624754,'gnl|CDD|280000',_binary 'Poly A polymerase head domain.  This family includes nucleic acid independent RNA polymerases, such as Poly(A) polymerase, which adds the poly (A) tail to mRNA EC:2.7.7.19. This family also includes the tRNA nucleotidyltransferase that adds the CCA to the 3\' of the tRNA EC:2.7.7.25. This family is part of the nucleotidyltransferase superfamily.','pfam01743','PolyA_pol'),(2624755,'gnl|CDD|237338',_binary 'tRNA CCA-pyrophosphorylase; Provisional.','PRK13298','PRK13298'),(2624756,'gnl|CDD|106256',_binary 'tRNA CCA-pyrophosphorylase; Provisional.','PRK13296','PRK13296'),(2624757,'gnl|CDD|139469',_binary 'tRNA CCA-pyrophosphorylase; Provisional.','PRK13297','PRK13297'),(2624758,'gnl|CDD|130997',_binary 'poly(A) polymerase.  This model describes the pcnB family of poly(A) polymerases (also known as plasmid copy number protein). These enzymes sequentially add adenosine nucleotides to the 3\' end of RNAs, targeting them for degradation by the cell. This was originally described for anti-sense RNAs, but was later demonstrated for mRNAs as well. Members of this family are as yet limited to the gamma- and beta-proteobacteria, with putative members in the Chlamydiacae and spirochetes. This family has homology to tRNA nucleotidyltransferase (cca).','TIGR01942','pcnB'),(2624759,'gnl|CDD|236939',_binary 'poly(A) polymerase I; Provisional.','PRK11623','pcnB'),(2627141,'gnl|CDD|350348',_binary 'dual-specificity phosphatase domain.  The dual-specificity phosphatase domain is found in typical and atypical dual-specificity phosphatases (DUSPs), which function as protein-serine/threonine phosphatases (EC 3.1.3.16) and protein-tyrosine-phosphatases (EC 3.1.3.48). Typical DUSPs, also called mitogen-activated protein kinase (MAPK) phosphatases (MKPs), deactivate MAPKs by dephosphorylating the threonine and tyrosine residues in the conserved Thr-Xaa-Tyr motif residing in their activation sites. All MKPs contain an N-terminal Cdc25/rhodanese-like domain, which is responsible for MAPK-binding, and a C-terminal catalytic dual specificity phosphatase domain. Atypical DUSPs contain the catalytic dual specificity phosphatase domain but lack the N-terminal Cdc25/rhodanese-like domain that is present in typical DUSPs or MKPs. Also included in this family are dual specificity phosphatase-like domains of catalytically inactive members such as serine/threonine/tyrosine-interacting protein (STYX) and serine/threonine/tyrosine interacting like 1 (STYXL1), as well as active phosphatases with substrates that are not phosphoproteins such as PTP localized to the mitochondrion 1 (PTPMT1), which is a lipid phosphatase, and laforin, which is a glycogen phosphatase.','cd14498','DSP'),(2627142,'gnl|CDD|214551',_binary 'Dual specificity phosphatase, catalytic domain.','smart00195','DSPc'),(2627143,'gnl|CDD|334251',_binary 'Dual specificity phosphatase, catalytic domain.  Ser/Thr and Tyr protein phosphatases. The enzyme\'s tertiary fold is highly similar to that of tyrosine-specific phosphatases, except for a \'recognition\' region.','pfam00782','DSPc'),(2627144,'gnl|CDD|350374',_binary 'protein-tyrosine phosphatase mitochondrial 1.  Protein-tyrosine phosphatase mitochondrial 1 or PTP localized to the mitochondrion 1 (PTPMT1), also called phosphoinositide lipid phosphatase (PLIP), phosphatidylglycerophosphatase and protein-tyrosine phosphatase 1, or PTEN-like phosphatase, is a lipid phosphatase or phosphatidylglycerophosphatase (EC 3.1.3.27) which dephosphorylates phosphatidylglycerophosphate (PGP) to phosphatidylglycerol (PG). It is targeted to the mitochondrion by an N-terminal signal sequence and is found anchored to the matrix face of the inner membrane. It is essential for the biosynthesis of cardiolipin, a mitochondrial-specific phospholipid regulating the membrane integrity and activities of the organelle. PTPMT1 also plays a crucial role in hematopoietic stem cell (HSC) function, and has been shown to display activity  toward phosphoprotein substrates.','cd14524','PTPMT1'),(2627146,'gnl|CDD|350370',_binary 'dual specificity phosphatase domain of dual specificity protein phosphatase 12 and similar proteins.  Dual specificity protein phosphatase 12 (DUSP12), also called YVH1, functions as a protein-serine/threonine phosphatase (EC 3.1.3.16) and a protein-tyrosine-phosphatase (EC 3.1.3.48). It deactivates its MAPK substrates by dephosphorylating the threonine and tyrosine residues in the conserved Thr-Xaa-Tyr motif residing in their activation sites. DUSP12 is an atypical DUSP; it contains the catalytic dual specificity phosphatase domain but lacks the N-terminal Cdc25/rhodanese-like domain that is present in typical DUSPs or MKPs. It targets p38 MAPK to regulate macrophage response to bacterial infection. It also ameliorates cardiac hypertrophy in response to pressure overload through c-Jun N-terminal kinase (JNK) inhibition. DUSP12 has been identified as a modulator of cell cycle progression, a function independent of phosphatase activity and mediated by its C-terminal zinc-binding domain.','cd14520','DSP_DUSP12'),(2627147,'gnl|CDD|225297',_binary 'Predicted protein-tyrosine phosphatase [Signal transduction mechanisms].','COG2453','CDC14'),(2627148,'gnl|CDD|350368',_binary 'dual specificity phosphatase domain of fungal YVH1-like dual specificity protein phosphatase.  This family is composed of Saccharomyces cerevisiae dual specificity protein phosphatase Yvh1 and similar fungal proteins. Yvh1 could function as a protein-serine/threonine phosphatase (EC 3.1.3.16) and a protein-tyrosine-phosphatase (EC 3.1.3.48). It regulates cell growth, sporulation, and glycogen accumulation. It plays an important role in ribosome assembly. Yvh1 associates transiently with late pre-60S particles and is required for the release of the nucleolar/nuclear pre-60S factor Mrt4, which is necessary to construct a translation-competent 60S subunit and mature ribosome stalk. Yvh1 contains an N-terminal catalytic dual specificity phosphatase domain and a C-terminal tail.','cd14518','DSP_fungal_YVH1'),(2627152,'gnl|CDD|350344',_binary 'cys-based protein tyrosine phosphatase and dual-specificity phosphatase superfamily.  This superfamily is composed of cys-based phosphatases, which includes classical protein tyrosine phosphatases (PTPs) as well as dual-specificity phosphatases (DUSPs or DSPs). They are characterized by a CxxxxxR conserved catalytic loop (where C is the catalytic cysteine, x is any amino acid, and R is an arginine). PTPs are part of the tyrosine phosphorylation/dephosphorylation regulatory mechanism, and are important in the response of the cells to physiologic and pathologic changes in their environment. DUSPs show more substrate diversity (including RNA and lipids) and include pTyr, pSer, and pThr phosphatases.','cd14494','PTP_DSP_cys'),(2627153,'gnl|CDD|214649',_binary 'Protein tyrosine phosphatase, catalytic domain motif.','smart00404','PTPc_motif'),(2627154,'gnl|CDD|214469',_binary 'Protein tyrosine phosphatase, catalytic domain, undefined specificity.  Protein tyrosine phosphatases. Homologues detected by this profile and not by those of \'PTPc\' or \'DSPc\' are predicted to be protein phosphatases with a similar fold to DSPs and PTPs, yet with unpredicted specificities.','smart00012','PTPc_DSPc'),(2627158,'gnl|CDD|350354',_binary 'dual specificity phosphatase 23.  Dual specificity phosphatase 23 (DUSP23), also known as VH1-like phosphatase Z (VHZ) or low molecular mass dual specificity phosphatase 3 (LDP-3), functions as a protein-serine/threonine phosphatase (EC 3.1.3.16) and a protein-tyrosine-phosphatase (EC 3.1.3.48). It deactivates its MAPK substrates by dephosphorylating the threonine and tyrosine residues in the conserved Thr-Xaa-Tyr motif residing in their activation sites. DUSP23 is an atypical DUSP; it contains the catalytic dual specificity phosphatase domain but lacks the N-terminal Cdc25/rhodanese-like domain that is present in typical DUSPs or MKPs. It is able to enhance activation of JNK and p38 MAPK, and has been shown to dephosphorylate p44-ERK1 (MAPK3) in vitro. It has been associated with cell growth and human primary cancers. It has also been identified as a cell-cell adhesion regulatory protein; it promotes the dephosphorylation of beta-catenin at Tyr 142 and enhances the interaction between alpha- and beta-catenin.','cd14504','DUSP23'),(2628328,'gnl|CDD|179147',_binary 'haloalkane dehalogenase; Provisional.','PRK00870','PRK00870'),(2629337,'gnl|CDD|239091',_binary 'Peptidyl-tRNA hydrolase, type 2 (PTH2)_like . Peptidyl-tRNA hydrolase activity releases tRNA from the premature translation termination product peptidyl-tRNA. Two structurally different enzymes have been reported to encode such activity, Pth present in bacteria and eukaryotes and Pth2 present in archaea and eukaryotes.','cd02407','PTH2_family'),(2629338,'gnl|CDD|334773',_binary 'Peptidyl-tRNA hydrolase PTH2.  Peptidyl-tRNA hydrolases are enzymes that release tRNAs from peptidyl-tRNA during translation.','pfam01981','PTH2'),(2629339,'gnl|CDD|224901',_binary 'Peptidyl-tRNA hydrolase [Translation, ribosomal structure and biogenesis].','COG1990','pth2'),(2629340,'gnl|CDD|239107',_binary 'Peptidyl-tRNA hydrolase, type 2 (PTH2)_like . Peptidyl-tRNA hydrolase activity releases tRNA from the premature translation termination product peptidyl-tRNA. Two structurally different enzymes have been reported  to encode such activity, Pth present in bacteria and eukaryotes and  Pth2 present in archaea and eukaryotes. There is no functional information for this eukaryote-specific subgroup.','cd02429','PTH2_like'),(2629341,'gnl|CDD|239108',_binary 'Peptidyl-tRNA hydrolase, type 2 (PTH2). Peptidyl-tRNA hydrolase (PTH) activity releases tRNA from the premature translation termination product peptidyl-tRNA, therefore allowing the tRNA and peptide to be reused in protein synthesis. PTH2 is present in archaea and eukaryotes.','cd02430','PTH2'),(2629342,'gnl|CDD|235280',_binary 'peptidyl-tRNA hydrolase; Provisional.','PRK04322','PRK04322'),(2630593,'gnl|CDD|161803',_binary 'peptidyl-tRNA hydrolase.  This model describes an archaeal/eukaryotic form of peptidyl-tRNA hydrolase. Most bacterial forms are described by TIGR00447. [Protein synthesis, Other].','TIGR00283','Peptidyl-tRNA_hydrolase'),(2631826,'gnl|CDD|177934',_binary 'ribose-phosphate pyrophosphokinase.','PLN02297','PLN02297'),(2632619,'gnl|CDD|274755',_binary 'PRTRC system ParB family protein.  A novel genetic system characterized by six major proteins, included a ParB homolog and a ThiF homolog, is designated PRTRC, or ParB-Related,ThiF-Related Cassette. It is often found on plasmids. This protein family the member related to ParB, and is designated PRTRC system ParB family protein.','TIGR03734','PRTRC_parB'),(2633671,'gnl|CDD|338090',_binary 'Protein of unknown function (DUF3307).  This family of bacterial proteins has no known function.','pfam11750','DUF3307'),(2633868,'gnl|CDD|273883',_binary 'HflC protein.  HflK and HflC are paralogs encoded by tandem genes in Proteobacteria, spirochetes, and some other bacterial lineages. The HflKC complex is anchored in the membrane and exposed to the periplasm. The complex is not active as a protease, but rather binds to and appears to modulate the ATP-dependent protease FtsH. The overall function of HflKC is not fully described. [Protein fate, Degradation of proteins, peptides, and glycopeptides, Regulatory functions, Protein interactions].','TIGR01932','Protein_HflC'),(2634092,'gnl|CDD|212138',_binary 'Nucleoside Triphosphate Pyrophosphohydrolase (EC 3.6.1.8) MazG-like domain putative pyrophosphatase YpjD from Bacillus subtilis and its bacterial homologs.  This family includes a putative pyrophosphatase Ypjd from Bacillus subtilis (BsYpjD) and its homologs. Although its biological role has not been described in detail, BsYpjD shows significant sequence similarity to the dimeric 2-deoxyuridine 5\'-triphosphate nucleotidohydrolase (dUTP pyrophosphatase or dUTPase) and NTP-PPase MazG proteins. However, unlike typical tandem-domain MazG proteins, BsYpjD contains a single MazG-like domain.','cd11531','NTP-PPase_BsYpjD'),(2634209,'gnl|CDD|227819',_binary 'Uncharacterized conserved protein [Function unknown].','COG5532','COG5532'),(2634371,'gnl|CDD|225281',_binary 'Uncharacterized protein containing a von Willebrand factor type A (vWA) domain [General function prediction only].','COG2425','COG2425'),(2634491,'gnl|CDD|274228',_binary 'addiction module antidote protein, HigA family.  Members of this family form a distinct clade within the larger family HTH_3 of helix-turn-helix proteins, described by pfam01381. Members of this clade are strictly bacterial and nearly always shorter than 110 amino acids. This family includes the characterized member HigA, without which the killer protein HigB cannot be cloned. The hig (host inhibition of growth) system is noted to be unusual in that killer protein is uncoded by the upstream member of the gene pair. [Regulatory functions, DNA interactions, Regulatory functions, Protein interactions, Mobile and extrachromosomal element functions, Other].','TIGR02607','Virulence-associated_p...'),(2634593,'gnl|CDD|319262',_binary 'plasmid segregation replication protein B like protein, N-terminal domain.  RepB, found on plasmids and secondary chromosomes, works along with repA in directing plasmid segregation, and has been shown in Rhizobium etli to require the parS centromere-like sequence for full transcriptional repression of the repABC operon, inducing plasmid incompatibility. RepA is a Walker-type ATPase that complexes with RepB to form DNA-protein complexes in the presence of ATP/ADP. RepC is an initiator protein for the plasmid. repA and repB are homologous to the parA and ParB genes of the parABS partitioning system found on primary chromosomes.','cd16405','RepB_like_N'),(2634595,'gnl|CDD|274586',_binary 'plasmid partitioning protein RepB.  Members of this family are the RepB protein involved in replicon partitioning. RepB is found, in general, as part of a repABC operon in plasmids and small chromosomes, separate from the main chromosome, in various bacteria. This model describes a rather narrow clade of proteins; it should be noted that additional homologs scoring below the trusted cutoff have very similar functions, although they may be named differently. [Mobile and extrachromosomal element functions, Plasmid functions].','TIGR03454','partition_RepB'),(2636099,'gnl|CDD|291893',_binary 'Proline-rich.  This family includes several eukaryotic proline-rich proteins.','pfam15240','Pro-rich'),(2636542,'gnl|CDD|238873',_binary 'SGNH_hydrolase subfamily. SGNH hydrolases are a diverse family of lipases and esterases. The tertiary fold of the enzyme is substantially different from that of the alpha/beta hydrolase family and unique among all known hydrolases; its active site closely resembles the Ser-His-Asp(Glu) triad found in other serine hydrolases.','cd01835','SGNH_hydrolase_like_3'),(2638992,'gnl|CDD|114011',_binary 'Borrelia P83/100 protein.  This family consists of several Borrelia P83/P100 antigen proteins.','pfam05262','Borrelia_P83'),(2641523,'gnl|CDD|336849',_binary 'Ion channel.  This family includes the two membrane helix type ion channels found in bacteria.','pfam07885','Ion_trans_2'),(2641524,'gnl|CDD|236711',_binary 'voltage-gated potassium channel; Provisional.','PRK10537','PRK10537'),(2641831,'gnl|CDD|239110',_binary 'C1 Peptidase family (MEROPS database nomenclature), also referred to as the papain family; composed of two subfamilies of cysteine peptidases (CPs), C1A (papain) and C1B (bleomycin hydrolase). Papain-like enzymes are mostly endopeptidases with some exceptions like cathepsins B, C, H and X, which are exopeptidases. Papain-like CPs have different functions in various organisms. Plant CPs are used to mobilize storage proteins in seeds while mammalian CPs are primarily lysosomal enzymes responsible for protein degradation in the lysosome. Papain-like CPs are synthesized as inactive proenzymes with N-terminal propeptide regions, which are removed upon activation. Bleomycin hydrolase (BH) is a CP that detoxifies bleomycin by hydrolysis of an amide group. It acts as a carboxypeptidase on its C-terminus to convert itself into an aminopeptidase and peptide ligase. BH is found in all tissues in mammals as well as in many other eukaryotes. It forms a hexameric ring barrel structure with the active sites imbedded in the central channel. Some members of the C1 family are proteins classified as non-peptidase homologs which lack peptidase activity or have missing active site residues.','cd02619','Peptidase_C1'),(2641868,'gnl|CDD|336965',_binary 'CW_7 repeat.  This domain was originally found in the C-terminal moiety of the Cpl-7 lysozyme encoded by the Streptococcus pneumoniae bacteriophage Cp-7. It is also found in the cell wall hydrolases of human and life-stock pathogens. CW_7 repeats make up a cell wall binding motif.','pfam08230','CW_7'),(2641871,'gnl|CDD|198163',_binary 'Cpl-7 lysozyme C-terminal domain.  This domain was originally found in the C-terminal moiety of the Cpl-7 lysozyme encoded by the Streptococcus pneumoniae bacteriophage Cp-7. It is assumed that these repeats represent cell wall binding motifs although no direct evidence has been obtained so far.','smart01095','Cpl-7'),(2642458,'gnl|CDD|236766',_binary 'ribonuclease E; Reviewed.','PRK10811','rne'),(2644194,'gnl|CDD|214361',_binary 'Clp protease ATP binding subunit.','CHL00095','clpC'),(2644195,'gnl|CDD|223616',_binary 'ATP-binding subunits of Clp protease and DnaK/DnaJ chaperones [Posttranslational modification, protein turnover, chaperones].','COG0542','clpA'),(2645718,'gnl|CDD|240034',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04678','Nudix_Hydrolase_19'),(2645719,'gnl|CDD|223979',_binary 'ADP-ribose pyrophosphatase [Nucleotide transport and metabolism].','COG1051','COG1051'),(2645720,'gnl|CDD|240030',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04673','Nudix_Hydrolase_15'),(2645721,'gnl|CDD|240035',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04679','Nudix_Hydrolase_20'),(2645722,'gnl|CDD|240039',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04683','Nudix_Hydrolase_24'),(2645723,'gnl|CDD|239217',_binary 'Nudix hydrolase is a superfamily of enzymes found in all three kingdoms of life, and it catalyzes the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+ for their activity. Members of this family are recognized by a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which forms a structural motif that functions as a metal binding and catalytic site. Substrates of nudix hydrolase include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance and \'house-cleaning\' enzymes. Substrate specificity is used to define child families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required. This superfamily consists of at least nine families: IPP (isopentenyl diphosphate) isomerase, ADP ribose pyrophosphatase, mutT pyrophosphohydrolase, coenzyme-A pyrophosphatase, MTH1-7,8-dihydro-8-oxoguanine-triphosphatase, diadenosine tetraphosphate hydrolase, NADH pyrophosphatase, GDP-mannose hydrolase and the c-terminal portion of the mutY adenine glycosylase.','cd02883','Nudix_Hydrolase'),(2645725,'gnl|CDD|240033',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04677','Nudix_Hydrolase_18'),(2645726,'gnl|CDD|240032',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04676','Nudix_Hydrolase_17'),(2645727,'gnl|CDD|333985',_binary 'NUDIX domain.','pfam00293','NUDIX'),(2645728,'gnl|CDD|239517',_binary 'The MutT pyrophosphohydrolase is a prototypical Nudix hydrolase that catalyzes the hydrolysis of nucleoside and deoxynucleoside triphosphates (NTPs and dNTPs) by substitution at a beta-phosphorus to yield a nucleotide monophosphate (NMP) and inorganic pyrophosphate (PPi). This enzyme requires two divalent cations for activity; one coordinates the phosphoryl groups of the NTP/dNTP substrate, and the other coordinates to the enzyme. It also contains the Nudix motif, a highly conserved 23-residue block (GX5EX7REUXEEXGU, where U = I, L or V), that functions as metal binding and catalytic site. MutT pyrophosphohydrolase is important in preventing errors in DNA replication by hydrolyzing mutagenic nucleotides such as 8-oxo-dGTP (a product of oxidative damage), which can mispair with template adenine during DNA replication, to guanine nucleotides.','cd03425','MutT_pyrophosphohydrolase'),(2645729,'gnl|CDD|239519',_binary 'MutT homolog-1 (MTH1) is a member of the Nudix hydrolase superfamily. MTH1, the mammalian counterpart of MutT, hydrolyzes oxidized purine nucleoside triphosphates, such as 8-oxo-dGTP and 2-hydroxy-ATP, to monophosphates, thereby preventing the incorporation of such oxygen radicals during replication. This is an important step in the repair mechanism in genomic and mitochondrial DNA.  Like other members of the Nudix family, it requires a divalent cation, such as Mg2+ or Mn2+, for activity, and contain the Nudix motif, a highly conserved 23-residue block (GX5EX7REUXEEXGU, where U = I, L or V), that functions as a metal binding and catalytic site. MTH1 is predominantly localized in the cytoplasm and mitochondria. Structurally, this enzyme adopts a similar fold to MutT despite low sequence similarity outside the conserved nudix motif. The most distinctive structural difference between MutT and MTH1 is the presence of a beta-hairpin, which is absent in MutT. This results in a much deeper and narrower substrate binding pocket. Mechanistically, MTH1 contains dual specificity for nucleotides that contain 2-OH-adenine bases and those that contain 8-oxo-guanine bases.','cd03427','MTH1'),(2645730,'gnl|CDD|236361',_binary 'hypothetical protein; Provisional.','PRK08999','PRK08999'),(2645731,'gnl|CDD|239646',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity. They also contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, U=I, L or V), which forms a structural motif that functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd03674','Nudix_Hydrolase_1'),(2645732,'gnl|CDD|240027',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04670','Nudix_Hydrolase_12'),(2645733,'gnl|CDD|240037',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalen