 nudix motif (GX5EX7REUXEEXGU, where U=I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04689','Nudix_Hydrolase_30'),(2645762,'gnl|CDD|339389',_binary 'NUDIX domain.','pfam14815','NUDIX_4'),(2645763,'gnl|CDD|240031',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04674','Nudix_Hydrolase_16'),(2645764,'gnl|CDD|240028',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04671','Nudix_Hydrolase_13'),(2645765,'gnl|CDD|239645',_binary 'Diadenosine hexaphosphate (Ap6A) hydrolase is a member of the Nudix hydrolase superfamily. Ap6A hydrolase specifically hydrolyzes diadenosine polyphosphates, but not ATP or diadenosine triphosphate, and it generates ATP as the product. Ap6A, the most preferred substrate, hydrolyzes to produce two ATP molecules, which is a novel hydrolysis mode for Ap6A. These results indicate that Ap6A  hydrolase is a diadenosine polyphosphate hydrolase. It requires the presence of a divalent cation, such as Mn2+, Mg2+, Zn2+, and Co2+, for activity. Members of the Nudix superfamily are recognized by a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which forms a structural motif that functions as a metal binding and catalytic site.','cd03673','Ap6A_hydrolase'),(2645766,'gnl|CDD|240042',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04686','Nudix_Hydrolase_27'),(2647712,'gnl|CDD|337998',_binary 'Stealth protein CR2, conserved region 2.  Stealth_CR2 is the second of several highly conserved regions on stealth proteins in metazoa and bacteria. There are up to four CR regions on all member proteins. CR2 carries a well-conserved NDD sequence-motif. The domain is found in tandem with CR1, CR3 and CR4 on both potential metazoan hosts and pathogenic eubacterial species that are capsular polysaccharide phosphotransferases. The CR domains appear on eukaryotic proteins such as GNPTAB, N-acetylglucosamine-1-phosphotransferase subunits alpha/beta. Horizontal gene-transfer seems to have occurred between host and bacteria of these sequence-regions in order for the bacteria to evade detection by the host innate immune system.','pfam11380','Stealth_CR2'),(2648512,'gnl|CDD|350376',_binary 'unknown subfamily of bacterial and plant dual specificity protein phosphatases.  This subfamily is composed of uncharacterized bacterial and plant dual-specificity protein phosphatases. DUSPs function as a protein-serine/threonine phosphatases (EC 3.1.3.16) and a protein-tyrosine-phosphatases (EC 3.1.3.48).','cd14527','DSP_bac'),(2648520,'gnl|CDD|350413',_binary 'dual specificity phosphatase domain of class I mitogen-activated protein kinase phosphatase.  Mitogen-activated protein kinase (MAPK) phosphatases (MKPs) are eukaryotic dual-specificity phosphatases (DUSPs) that act on MAPKs and function as a protein-serine/threonine phosphatase (EC 3.1.3.16) and a protein-tyrosine-phosphatase (EC 3.1.3.48). They deactivate MAPKs by dephosphorylating the threonine and tyrosine residues in the conserved Thr-Xaa-Tyr motif residing in their activation sites. Based on sequence homology, subcellular localization and substrate specificity, 10 MKPs can be subdivided into three subfamilies (class I-III). Class I MKPs consist of DUSP1/MKP-1, DUSP2 (PAC1), DUSP4/MKP-2 and DUSP5. They are all mitogen- and stress-inducible nuclear MKPs. All MKPs contain an N-terminal Cdc25/rhodanese-like domain, which is responsible for MAPK-binding, and a C-terminal catalytic dual specificity phosphatase domain.','cd14565','DSP_MKP_classI'),(2648521,'gnl|CDD|350415',_binary 'dual specificity phosphatase domain of dual specificity protein phosphatase 10.  Dual specificity protein phosphatase 10 (DUSP10), also called mitogen-activated protein kinase (MAPK) phosphatase 5 (MKP-5), functions as a protein-serine/threonine phosphatase (EC 3.1.3.16) and a protein-tyrosine-phosphatase (EC 3.1.3.48). Like other MKPs, it deactivates its MAPK substrates by dephosphorylating the threonine and tyrosine residues in the conserved Thr-Xaa-Tyr motif residing in their activation sites. It belongs to the class III subfamily and is a JNK/p38-selective cytoplasmic MKP. DUSP10/MKP-5 coordinates skeletal muscle regeneration by negatively regulating mitochondria-mediated apoptosis. It is also an important regulator of intestinal epithelial barrier function and a suppressor of colon tumorigenesis. DUSP10/MKP-5 contains an N-terminal Cdc25/rhodanese-like domain, which is responsible for MAPK-binding, and a C-terminal catalytic dual specificity phosphatase domain.','cd14567','DSP_DUSP10'),(2648523,'gnl|CDD|350366',_binary 'dual specificity phosphatase domain of fungal dual specificity protein phosphatase PPS1-like.  This subfamily contains fungal proteins with similarity to dual specificity protein phosphatase PPS1 from Saccharomyces cerevisiae, which has a role in the DNA synthesis phase of the cell cycle. As a dual specificity protein phosphatase, PPS1 functions as a protein-serine/threonine phosphatase (EC 3.1.3.16) and a protein-tyrosine-phosphatase (EC 3.1.3.48). It contains a C-terminal catalytic dual specificity phosphatase domain.','cd14516','DSP_fungal_PPS1'),(2648524,'gnl|CDD|350369',_binary 'dual specificity phosphatase domain of dual specificity protein phosphatase 22, 15, and similar proteins.  Dual specificity protein phosphatase 22 (DUSP22, also known as VHX) and 15 (DUSP15, also known as VHY) function as protein-serine/threonine phosphatases (EC 3.1.3.16) and protein-tyrosine-phosphatases (EC 3.1.3.48). They are atypical DUSPs; they contain the catalytic dual specificity phosphatase domain but lack the N-terminal Cdc25/rhodanese-like domain that is present in typical DUSPs or MKPs. The both contain N-terminal myristoylation recognition sequences and myristoylation regulates their subcellular location. DUSP22 negatively regulates the estrogen receptor-alpha-mediated signaling pathway and the IL6-leukemia inhibitory factor (LIF)-STAT3-mediated signaling pathway. DUSP15 has been identified as a regulator of oligodendrocyte differentiation. DUSP22 is a single domain protein containing only the catalytic dual specificity phosphatase domain while DUSP15 contains a short C-terminal tail.','cd14519','DSP_DUSP22_15'),(2648525,'gnl|CDD|350362',_binary 'dual specificity phosphatase domain of mitogen-activated protein kinase phosphatase.  Mitogen-activated protein kinase (MAPK) phosphatases (MKPs) are eukaryotic dual-specificity phosphatases (DUSPs) that act on MAPKs, which are involved in gene regulation, cell proliferation, programmed cell death and stress responses, as an important feedback control mechanism that limits MAPK cascades. MKPs, also referred to as typical DUSPs, function as a protein-serine/threonine phosphatase (EC 3.1.3.16) and a protein-tyrosine-phosphatase (EC 3.1.3.48). They deactivate MAPKs by dephosphorylating the threonine and tyrosine residues in the conserved Thr-Xaa-Tyr motif residing in their activation sites. All MKPs contain an N-terminal Cdc25/rhodanese-like domain, which is responsible for MAPK-binding, and a C-terminal catalytic dual specificity phosphatase domain. Based on sequence homology, subcellular localization and substrate specificity, 10 MKPs can be subdivided into three subfamilies (class I-III).','cd14512','DSP_MKP'),(2648527,'gnl|CDD|350364',_binary 'dual specificity protein phosphatases 14, 18, 21, 28 and similar proteins.  This family is composed of dual specificity protein phosphatase 14 (DUSP14, also known as MKP-6), 18 (DUSP18), 21 (DUSP21), 28 (DUSP28), and similar proteins. They function as protein-serine/threonine phosphatases (EC 3.1.3.16) and protein-tyrosine-phosphatases (EC 3.1.3.48), and are atypical DUSPs. They contain the catalytic dual specificity phosphatase domain but lack the N-terminal Cdc25/rhodanese-like domain that is present in typical DUSPs or MKPs. DUSP14 directly interacts and dephosphorylates TGF-beta-activated kinase 1 (TAK1)-binding protein 1 (TAB1) in T cells, and negatively regulates TCR signaling and immune responses. DUSP18 has been shown to interact and dephosphorylate SAPK/JNK, and may play a role in regulating the SAPK/JNK pathway. DUSP18 and DUSP21 target to opposing sides of the mitochondrial inner membrane. DUSP28 has been implicated in hepatocellular carcinoma progression and in migratory activity and drug resistance of pancreatic cancer cells.','cd14514','DUSP14-like'),(2648529,'gnl|CDD|350355',_binary 'cyclin-dependent kinase inhibitor 3 and similar proteins.  This family is composed of eukaryotic cyclin-dependent kinase inhibitor 3 (CDKN3) and related archaeal and bacterial proteins. CDKN3 is also known as kinase-associated phosphatase (KAP), CDK2-associated dual-specificity phosphatase, cyclin-dependent kinase interactor 1 (CDI1), or cyclin-dependent kinase-interacting protein 2 (CIP2). It has been characterized as dual-specificity phosphatase, which function as a protein-serine/threonine phosphatase (EC 3.1.3.16) and protein-tyrosine-phosphatase (EC 3.1.3.48). It dephosphorylates CDK2 at a threonine residue in a cyclin-dependent manner, resulting in the inhibition of G1/S cell cycle progression. It also interacts with CDK1 and controls progression through mitosis by dephosphorylating CDC2. CDKN3 may also function as a tumor suppressor; its loss of function was found in a variety of cancers including glioblastoma and hepatocellular carcinoma. However, it has also been found over-expressed in many cancers such as breast, cervical, lung and prostate cancers, and may also have an oncogenic function.','cd14505','CDKN3-like'),(2648549,'gnl|CDD|235968',_binary 'ribonucleotide-diphosphate reductase subunit beta; Validated.','PRK07209','PRK07209'),(2648553,'gnl|CDD|153120',_binary 'Ribonucleotide Reductase R2-like protein, Mn/Fe-binding domain.  Rv0233 is a Mycobacterium tuberculosis ribonucleotide reductase R2 protein with a  heterodinuclear manganese/iron-carboxylate cofactor located in its metal center. The Rv0233-like family may represent a structural/functional counterpart of the evolutionary ancestor of the RNRR2\'s (Ribonucleotide Reductase, R2/beta subunit) and the bacterial multicomponent monooxygenases.  RNRR2s belong to a broad superfamily of ferritin-like diiron-carboxylate proteins. The RNR protein catalyzes the conversion of ribonucleotides to deoxyribonucleotides and is found in prokaryotes and archaea. The catalytically active form of RNR is a proposed alpha2-beta2 tetramer. The homodimeric alpha subunit (R1) contains the active site and redox active cysteines as well as the allosteric binding sites.','cd07911','RNRR2_Rv0233_like'),(2651529,'gnl|CDD|183303',_binary 'adenosine nucleotide hydrolase NudE; Provisional.','PRK11762','nudE'),(2651531,'gnl|CDD|240023',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04665','Nudix_Hydrolase_8'),(2651544,'gnl|CDD|240047',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04691','Nudix_Hydrolase_32'),(2651549,'gnl|CDD|240041',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily requires a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04685','Nudix_Hydrolase_26'),(2653506,'gnl|CDD|238865',_binary 'sialate O-acetylesterase_like family of the SGNH hydrolases, a diverse family of lipases and esterases. The tertiary fold of the enzyme is substantially different from that of the alpha/beta hydrolase family and unique among all known hydrolases; its active site closely resembles the Ser-His-Asp(Glu) triad found in other serine hydrolases.','cd01827','sialate_O-acetylestera...'),(2653510,'gnl|CDD|317058',_binary 'GDSL-like Lipase/Acylhydrolase family.','pfam14606','Lipase_GDSL_3'),(2653954,'gnl|CDD|236353',_binary 'primosomal protein DnaI; Reviewed.','PRK08939','PRK08939'),(2653979,'gnl|CDD|222859',_binary 'terminase ATPase subunit; Provisional.','PHA02535','P'),(2662040,'gnl|CDD|236224',_binary 'L-lysine aminotransferase; Provisional.','PRK08297','PRK08297'),(2664481,'gnl|CDD|338197',_binary 'Scavenger mRNA decapping enzyme C-term binding.  This family consists of several scavenger mRNA decapping enzymes (DcpS) and is the C-terminal region. DcpS is a scavenger pyrophosphatase that hydrolyzes the residual cap structure following 3\' to 5\' decay of an mRNA. The association of DcpS with 3\' to 5\' exonuclease exosome components suggests that these two activities are linked and there is a coupled exonucleolytic decay-dependent decapping pathway. The C-terminal domain contains a histidine triad (HIT) sequence with three histidines separated by hydrophobic residues. The central histidine within the DcpS HIT motif is critical for decapping activity and defines the HIT motif as a new mRNA decapping domain, making DcpS the first member of the HIT family of proteins with a defined biological function.','pfam11969','DcpS_C'),(2665654,'gnl|CDD|350692',_binary 'DEXXQ-box helicase domain of Upf1-like helicase.  The Upf1-like helicase family includes UPF1, HELZ, Mov10L1, Aquarius, IGHMBP2 (SMUBP2), and similar proteins. They belong to the  DEAD-like helicase superfamily, a diverse family of proteins involved in ATP-dependent RNA or DNA unwinding. This domain contains the ATP-binding region.','cd17934','DEXXQc_Upf1-like'),(2665810,'gnl|CDD|99841',_binary 'N-terminal DEDDh 3\'-5\' exonuclease domain of Escherichia coli exonuclease I and similar proteins.  This subfamily is composed of the N-terminal domain of Escherichia coli exonuclease I (ExoI) and similar proteins. ExoI is a monomeric enzyme that hydrolyzes single stranded DNA in the 3\' to 5\' direction. It plays a role in DNA recombination and repair. It primarily functions in repairing frameshift mutations. The N-terminal domain of ExoI is a DEDDh-type DnaQ-like 3\'-5 exonuclease containing three conserved sequence motifs termed ExoI, ExoII and ExoIII, with a specific Hx(4)D conserved pattern at ExoIII. These motifs are clustered around the active site and contain four conserved acidic residues that serve as ligands for the two metal ions required for catalysis. The ExoI structure is unique among DnaQ family enzymes in that there is a large distance between the two metal ions required for catalysis and the catalytic histidine is oriented away from the active site.','cd06138','ExoI_N'),(2669061,'gnl|CDD|316757',_binary 'Domain of unknown function (DUF4355).  This family of proteins is found in bacteria and viruses. Proteins in this family are typically between 180 and 214 amino acids in length.','pfam14265','DUF4355'),(2670886,'gnl|CDD|309098',_binary 'Recombination protein U.','pfam03838','RecU'),(2671273,'gnl|CDD|335968',_binary 'Phage tail sheath protein subtilisin-like domain.  This entry represents the second domain in a variety of phage tail sheath proteins. According to ECOD this domain has a subtilisin-like structure.','pfam04984','Phage_sheath_1'),(2671299,'gnl|CDD|338957',_binary 'Domain of unknown function (DUF4185).','pfam13810','DUF4185'),(2671347,'gnl|CDD|224161',_binary 'Mg-chelatase subunit ChlD [Coenzyme metabolism].','COG1240','ChlD'),(2671349,'gnl|CDD|238739',_binary 'VWA YIEM type: Von Willebrand factor type A (vWA) domain was originally found in the blood coagulation protein von Willebrand factor (vWF). Typically, the vWA domain is made up of approximately 200 amino acid residues folded into a classic a/b para-rossmann type of fold. The vWA domain, since its discovery, has drawn great interest because of its widespread occurrence and its involvement in a wide variety of important cellular functions. These include basal membrane formation, cell migration, cell differentiation, adhesion, haemostasis, signaling, chromosomal stability, malignant transformation and in immune defenses  In integrins these domains form heterodimers while in vWF it forms multimers. There are different interaction surfaces of this domain as seen by the various molecules it complexes with. Ligand binding in most cases is mediated by the presence of a metal ion dependent adhesion site termed as the MIDAS motif that is a characteristic feature of most, if not all A domains. Members of this subgroup have a conserved MIDAS motif, however, their biochemical function is not well characterised.','cd01462','VWA_YIEM_type'),(2672027,'gnl|CDD|338615',_binary 'AAA ATPase domain.  This family of domains contain a P-loop motif that is characteristic of the AAA superfamily.','pfam13175','AAA_15'),(2672029,'gnl|CDD|213243',_binary 'ATP-binding cassette domain of eukaryotic SM6 proteins.  The structural maintenance of chromosomes (SMC) proteins are large (approximately 110 to 170 kDa), and each is arranged into five recognizable domains. Amino-acid sequence homology of SMC proteins between species is largely confined to the amino- and carboxy-terminal globular domains. The amino-terminal domain contains a \'Walker A\' nucleotide-binding domain (GxxGxGKS/T, in the single-letter amino-acid code), which by mutational studies has been shown to be essential in several proteins. The carboxy-terminal domain contains a sequence (the DA-box) that resembles a \'Walker B\' motif, and a motif with homology to the signature sequence of the ATP-binding cassette (ABC) family of ATPases. The sequence homology within the carboxy-terminal domain is relatively high within the SMC1-SMC4 group, whereas SMC5 and SMC6 show some divergence in both of these sequences. In eukaryotic cells, the proteins are found as heterodimers of SMC1 paired with SMC3, SMC2 with SMC4, and SMC5 with SMC6 (formerly known as Rad18).','cd03276','ABC_SMC6_euk'),(2677937,'gnl|CDD|320683',_binary 'Oma1 peptidase-like, integral membrane metallopeptidase.  This family contains peptidase M48 subfamily C (also known as Oma1 peptidase or mitochondrial metalloendopeptidase OMA1), including similar peptidases containing tetratricopeptide (TPR) repeats, as well as uncharacterized proteins such as E. coli bepA (formerly yfgC), ycaL and loiP (formerly yggG), considered to be putative metallopeptidases. Oma1 peptidase is part of the quality control system in the inner membrane of mitochondria, with its catalytic site facing the matrix space. It cleaves and thereby promotes the turnover of mistranslated or misfolded membrane proteins. Oma1 can cleave the misfolded multi-pass membrane protein Oxa1, thus exerting a function similar to the ATP-dependent m-AAA protease for quality control of inner membrane proteins. It has been proposed that in the absence of m-AAA protease, proteolysis of Oxa1 is mediated by Oma1 in an ATP-independent manner. Homologs of Oma1 are present in higher eukaryotes, eubacteria and archaebacteria, suggesting that Oma1 is the founding member of a conserved family of membrane-embedded metallopeptidases, all containing the zinc metalloprotease motif (HEXXH). M48 peptidases proteolytically remove the C-terminal three residues of farnesylated proteins.','cd07324','M48C_Oma1-like'),(2682271,'gnl|CDD|338427',_binary 'Probable RNA and SrmB- binding site of polymerase A.  This region encompasses much of the RNA and SrmB binding motifs on polymerase A.','pfam12627','PolyA_pol_RNAbd'),(2682304,'gnl|CDD|350350',_binary 'protein tyrosine phosphatase type IVA family.  Protein tyrosine phosphatases type IVA (PTP-IVa), also known as protein-tyrosine phosphatases of regenerating liver (PRLs) constitute a family of small, prenylated phosphatases that are the most oncogenic of all PTPs. They stimulate progression from G1 into S phase during mitosis and enhances cell proliferation, cell motility and invasive activity, and promotes cancer metastasis. They associate with magnesium transporters of the cyclin M (CNNM) family, which results in increased intracellular magnesium levels that promote oncogenic transformation. Vertebrates contain three members: PRL-1, PRL-2, and PRL-3.','cd14500','PTP-IVa'),(2682309,'gnl|CDD|185524',_binary 'protein tyrosine phosphatase; Provisional.','PTZ00242','PTZ00242'),(2682994,'gnl|CDD|283721',_binary 'Tail length tape measure protein.  This family consists of the tail length tape measure protein from bacteriophage HK97 and related sequences from Escherichia coli O157:H7.','pfam06120','Phage_HK97_TLTM'),(2683333,'gnl|CDD|131546',_binary 'pyruvate formate-lyase 1-activating enzyme.  An iron-sulfur protein with a radical-SAM domain (pfam04055). A single glycine residue in EC 2.3.1.54, formate C-acetyltransferase (formate-pyruvate lyase), is oxidized to the corresponding radical by transfer of H from its CH2 to AdoMet with concomitant cleavage of the latter. The reaction requires Fe2+. The first stage is reduction of the AdoMet to give methionine and the 5\'-deoxyadenosin-5-yl radical, which then abstracts a hydrogen radical from the glycine residue. [Energy metabolism, Anaerobic, Protein fate, Protein modification and repair].','TIGR02493','PFLA'),(2690821,'gnl|CDD|318322',_binary 'Domain of unknown function (DUF4813).  This family of proteins is functionally uncharacterized. This family of proteins is found in eukaryotes. Proteins in this family are typically between 345 and 672 amino acids in length.','pfam16072','DUF4813'),(2705540,'gnl|CDD|237665',_binary 'chaperone protein DnaJ; Provisional.','PRK14295','PRK14295'),(2705541,'gnl|CDD|223560',_binary 'DnaJ-class molecular chaperone with C-terminal Zn finger domain [Posttranslational modification, protein turnover, chaperones].','COG0484','DnaJ'),(2705543,'gnl|CDD|184599',_binary 'chaperone protein DnaJ; Provisional.','PRK14277','PRK14277'),(2705544,'gnl|CDD|99751',_binary 'DnaJ domain or J-domain.  DnaJ/Hsp40 (heat shock protein 40) proteins are highly conserved and play crucial roles in protein translation, folding, unfolding, translocation, and degradation. They act primarily by stimulating the ATPase activity of Hsp70s, an important chaperonine family. Hsp40 proteins are characterized by the presence of a J domain, which mediates the interaction with Hsp70. They may contain other domains as well, and the architectures provide a means of classification.','cd06257','DnaJ'),(2705545,'gnl|CDD|237654',_binary 'chaperone protein DnaJ; Provisional.','PRK14278','PRK14278'),(2705546,'gnl|CDD|274090',_binary 'chaperone protein DnaJ.  This model represents bacterial forms of DnaJ, part of the DnaK-DnaJ-GrpE chaperone system. The three components typically are encoded by consecutive genes. DnaJ homologs occur in many genomes, typically not near DnaK and GrpE-like genes; most such genes are not included by this family. Eukaryotic (mitochondrial and chloroplast) forms are not included in the scope of this family.','TIGR02349','Chaperone_protein_DnaJ'),(2705549,'gnl|CDD|197617',_binary 'DnaJ molecular chaperone homology domain.','smart00271','DnaJ'),(2705551,'gnl|CDD|184611',_binary 'chaperone protein DnaJ; Provisional.','PRK14297','PRK14297'),(2705552,'gnl|CDD|274808',_binary 'terminal organelle assembly protein TopJ.  This model describes TopJ (MG_200, CbpA), a DnaJ homolog and probable assembly protein of the Mycoplasma terminal organelle. The terminal organelle is involved in both cytadherence and gliding motility. [Cellular processes, Chemotaxis and motility].','TIGR03835','DnaJ-like_protein_MG20...'),(2705554,'gnl|CDD|172773',_binary 'chaperone protein DnaJ; Provisional.','PRK14285','PRK14285'),(2705556,'gnl|CDD|184603',_binary 'chaperone protein DnaJ; Provisional.','PRK14282','PRK14282'),(2705559,'gnl|CDD|172774',_binary 'chaperone protein DnaJ; Provisional.','PRK14286','PRK14286'),(2705560,'gnl|CDD|240236',_binary 'DnaJ_C chaperone protein; Provisional.','PTZ00037','PTZ00037'),(2705561,'gnl|CDD|236757',_binary 'chaperone protein DnaJ; Provisional.','PRK10767','PRK10767'),(2705564,'gnl|CDD|237658',_binary 'chaperone protein DnaJ; Provisional.','PRK14284','PRK14284'),(2705565,'gnl|CDD|237660',_binary 'chaperone protein DnaJ; Provisional.','PRK14289','PRK14289'),(2705566,'gnl|CDD|225124',_binary 'DnaJ-class molecular chaperone [Posttranslational modification, protein turnover, chaperones].','COG2214','CbpA'),(2705567,'gnl|CDD|237668',_binary 'chaperone protein DnaJ; Provisional.','PRK14301','PRK14301'),(2705568,'gnl|CDD|237664',_binary 'chaperone protein DnaJ; Provisional.','PRK14294','PRK14294'),(2705570,'gnl|CDD|172788',_binary 'chaperone protein DnaJ; Provisional.','PRK14300','PRK14300'),(2705571,'gnl|CDD|237657',_binary 'chaperone protein DnaJ; Provisional.','PRK14281','PRK14281'),(2707618,'gnl|CDD|223115',_binary 'tRNA(Ile)-lysidine synthase MesJ [Cell cycle control, cell division, chromosome partitioning].','COG0037','MesJ'),(2722780,'gnl|CDD|238949',_binary 'The C-terminal domain of Asparagine Synthase B. This domain is always found associated n-terminal amidotransferase domain. Family members that contain this domain catalyse the conversion of aspartate to asparagine. Asparagine synthetase B  catalyzes the assembly of asparagine from aspartate, Mg(2+)ATP, and glutamine. The three-dimensional architecture of the N-terminal domain of asparagine synthetase B is similar to that observed for glutamine phosphoribosylpyrophosphate amidotransferase while the molecular motif of the C-domain is reminiscent to that observed for GMP synthetase .','cd01991','Asn_Synthase_B_C'),(2727067,'gnl|CDD|340379',_binary 'Membrane-bound lytic murein transglycosylases MltC and MltE, and similar proteins.  MltC and MltE are periplasmic, outer membrane attached lytic transglycosylases (LTs), which cleave beta-1,4-glycosidic bonds joining N-acetylmuramic acid and N-acetylglucosamine in the cell wall peptidoglycan, yielding 1,6-anhydromuropeptides. Proteins similar to this family include the soluble and insoluble membrane-bound LTs in bacteria, the LTs in bacteriophage lambda, as well as the eukaryotic \'goose-type\' lysozymes (goose egg-white lysozyme; GEWL).','cd16893','LT_MltC_MltE'),(2737402,'gnl|CDD|239647',_binary 'Contains a crystal structure of the Nudix hydrolase from Nitrosomonas europaea, which has an unknown function. In general, members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity. They also contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which forms a structural motif that functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd03675','Nudix_Hydrolase_2'),(2737419,'gnl|CDD|234820',_binary 'RNA pyrophosphohydrolase; Reviewed.','PRK00714','PRK00714'),(2737463,'gnl|CDD|236516',_binary 'dihydroneopterin triphosphate pyrophosphatase; Provisional.','PRK09438','nudB'),(2742033,'gnl|CDD|225868',_binary 'Penicillin-binding protein-related factor A, putative recombinase [General function prediction only].','COG3331','PrfA'),(2768295,'gnl|CDD|234608',_binary 'recombination protein F; Reviewed.','PRK00064','recF'),(2770939,'gnl|CDD|198396',_binary 'Catalytic GIY-YIG domain of yeast structure-specific endonuclease subunit SLX1 and its homologs.  Structure-specific endonuclease subunit SLX1 is a highly conserved protein from yeast to human, with an N-terminal GIY-YIG endonuclease domain and a C-terminal PHD-type zinc finger postulated to mediate protein-protein or protein-DNA interaction. SLX1 forms active heterodimeric complexes with its SLX4 partner, which has additional roles in the DNA damage response that are distinct from the function of the heterodimeric SLX1-SLX4 nuclease. In yeast, the SLX1-SLX4 complex functions as a 5\' flap endonuclease that maintains ribosomal DNA copy number, where SLX1 and SLX4 are shown to be catalytic and regulatory subunits, respectively. This endonuclease introduces single-strand cuts in duplex DNA on the 3\' side of junctions with single-strand DNA. In addition to 5\' flap endonuclease activity, human SLX1-SLX4 complex has been identified as a Holliday junction resolvase that promotes symmetrical cleavage of static and migrating Holliday junctions. SLX1 also associates with MUS81, EME1, C20orf94, PLK1, and ERCC1. Some eukaryotic SLX1 homologs lack the zinc finger domain, but possess intrinsically unstructured extensions of unknown function. These unstructured segments might be involved in interactions with other proteins.','cd10449','GIY-YIG_SLX1_like'),(2781420,'gnl|CDD|340369',_binary '70kDa soluble lytic transglycosylase (Slt70) and similar proteins.  Catalytic domain of the 70kda soluble lytic transglycosylase (LT)-like proteins, which also have an N-terminal U-shaped U-domain and a linker L-domain. LTs catalyze the cleavage of the beta-1,4-glycosidic bond between N-acetylmuramic acid (MurNAc) and N-acetyl-D-glucosamine (GlcNAc) as do \'goose-type\' lysozymes. However, in addition to this, they also make a new glycosidic bond with the C6 hydroxyl group of the same muramic acid residue. Proteins similar to this family include the soluble and insoluble membrane-bound LTs in bacteria, the LTs in bacteriophage lambda, as well as the eukaryotic \'goose-type\' lysozymes (goose egg-white lysozyme; GEWL).','cd13401','Slt70_like'),(2786653,'gnl|CDD|184491',_binary 'recombination protein F; Provisional.','PRK14079','recF'),(2794397,'gnl|CDD|335058',_binary 'N-terminal domain of galactosyltransferase.  This is the N-terminal domain of a family of galactosyltransferases from a wide range of Metazoa with three related galactosyltransferases activities, all three of which are possessed by one sequence in some cases. EC:2.4.1.90, N-acetyllactosamine synthase; EC:2.4.1.38, Beta-N-acetylglucosaminyl-glycopeptide beta-1,4- galactosyltransferase; and EC:2.4.1.22 Lactose synthase. Note that N-acetyllactosamine synthase is a component of Lactose synthase along with alpha-lactalbumin, in the absence of alpha-lactalbumin EC:2.4.1.90 is the catalyzed reaction.','pfam02709','Glyco_transf_7C'),(2797340,'gnl|CDD|183574',_binary 'RNA polymerase sigma factor; Provisional.','PRK12529','PRK12529'),(2799155,'gnl|CDD|273676',_binary 'asparagine synthase (glutamine-hydrolyzing).  This model describes the glutamine-hydrolysing asparagine synthase. A poorly conserved C-terminal extension was removed from the model. Bacterial members of the family tend to have a long, poorly conserved insert lacking from archaeal and eukaryotic sequences. Multiple isozymes have been demonstrated, such as in Bacillus subtilis. Long-branch members of the phylogenetic tree (which typically were also second or third candidate members from their genomes) were removed from the seed alignment and score below trusted cutoff. [Amino acid biosynthesis, Aspartate family].','TIGR01536','Asparagine_synthetase_1'),(2816310,'gnl|CDD|106982',_binary 'hypothetical protein.','PHA00675','PHA00675'),(2827174,'gnl|CDD|238944',_binary 'Adenine nucleotide alpha hydrolases superfamily  including N type ATP PPases and ATP sulphurylases. The domain forms a apha/beta/apha fold which  binds to Adenosine group..','cd01986','Alpha_ANH_like'),(2827224,'gnl|CDD|274967',_binary 'putative peptide-modifying radical SAM enzyme, AF0577 family.  This radical SAM family contains a C-terminal region motif CXXCX5CX3C that is found in PqqE and other radical SAM enzymes that act on peptide substrates. Members of this family are found primarily in the Archaea, but also several eukaryotes (Trichomonas vaginalis G3, Entamoeba dispar SAW760, Giardia intestinalis ATCC 50581, etc.). The function is unknown.','TIGR04084','rSAM_AF0577'),(2841276,'gnl|CDD|237430',_binary 'putative outer membrane porin HofQ; Provisional.','PRK13568','hofQ'),(2841319,'gnl|CDD|320692',_binary 'Peptidase M48C Ste24p bepA-like, integral membrane protein.  This family contains peptidase M48C Ste24p protease bepA (formerly yfgC)-like proteins considered to be putative metallopeptidases, containing a zinc-binding motif, HEXXH, and a COOH-terminal ER retrieval signal (KKXX). They proteolytically remove the C-terminal three residues of farnesylated proteins. They are integral membrane proteins associated with the endoplasmic reticulum and golgi, binding one zinc ion per subunit.  In eukaryotes, Ste24p is required for the first NH2-terminal proteolytic processing event within the a-factor precursor, which takes place after COOH-terminal CAAX modification (C is cysteine; A is usually aliphatic; X is one of several amino acids) is complete. Mutation studies have shown that the HEXXH protease motif, which is extracellular but adjacent to a transmembrane domain and therefore close to the membrane surface, is critical for Ste24p activity.  Several members of this family also contain tetratricopeptide (TPR) repeat motifs, which are involved in a variety of functions including protein-protein interactions. BepA has been shown to possess protease activity and is responsible for the degradation of incorrectly folded LptD, an essential outer-membrane protein (OMP) involved in OM transport and assembly of lipopolysaccharide. Overexpression of the bepA protease causes abnormal biofilm architecture.','cd07333','M48C_bepA_like'),(2841321,'gnl|CDD|320704',_binary 'Peptidase M48 subfamily A-like, putative CaaX prenyl protease.  This family contains peptidase family M48 subfamily A-like CaaX prenyl protease 1, most of which are uncharacterized. Some of these contain tetratricopeptide (TPR) repeats at the C-terminus. Proteins in this family contain the zinc metalloprotease motif (HEXXH), likely exposed on the cytoplasmic side. They are thought to be possibly associated with the endoplasmic reticulum (ER), regardless of whether their genes possess the conventional signal motif (KKXX) in the C-terminal. These proteins putatively remove the C-terminal three residues of farnesylated proteins proteolytically.','cd07345','M48A_Ste24p-like'),(2841363,'gnl|CDD|240021',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belong to this superfamily requires a divalent cation, such as Mg2+ or Mn2+ for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, U=I, L or V) which functions as metal binding and catalytic site. Substrates of nudix hydrolase include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04663','Nudix_Hydrolase_6'),(2841368,'gnl|CDD|240024',_binary 'Members of the Nudix hydrolase superfamily catalyze the hydrolysis of NUcleoside DIphosphates linked to other moieties, X. Enzymes belonging to this superfamily require a divalent cation, such as Mg2+ or Mn2+, for their activity and contain a highly conserved 23-residue nudix motif (GX5EX7REUXEEXGU, where U = I, L or V), which functions as a metal binding and catalytic site. Substrates of nudix hydrolases include intact and oxidatively damaged nucleoside triphosphates, dinucleoside polyphosphates, nucleotide-sugars and dinucleotide enzymes. These substrates are metabolites or cell signaling molecules that require regulation during different stages of the cell cycle or during periods of stress. In general, the role of the nudix hydrolase is to sanitize the nucleotide pools and to maintain cell viability, thereby serving as surveillance & \'house-cleaning\' enzymes. Substrate specificity is used to define families within the superfamily. Differences in substrate specificity are determined by the N-terminal extension or by residues in variable loop regions. Mechanistically, substrate hydrolysis occurs by a nucleophilic substitution reaction, with variation in the numbers and roles of divalent cations required.','cd04666','Nudix_Hydrolase_9'),(2841391,'gnl|CDD|213209',_binary 'ATP-binding cassette domain of RecF.  RecF is a recombinational DNA repair ATPase that maintains replication in the presence of DNA damage. When replication is prematurely disrupted by DNA damage, several recF pathway gene products play critical roles processing the arrested replication fork, allowing it to resume and complete its task. This CD represents the nucleotide binding domain of RecF. RecF belongs to a large superfamily of ABC transporters involved in the transport of a wide variety of different compounds including sugars, ions, peptides, and more complex organic molecules. The nucleotide binding domain shows the highest similarity between all members of the family. ABC transporters are a subset of nucleotide hydrolases with a signature motif, Q-loop, and H-loop/switch region, in addition to, the Walker A motif/P-loop and Walker B motif commonly found in a number of ATP- and GTP-binding and hydrolyzing proteins.','cd03242','ABC_RecF'),(2841419,'gnl|CDD|235393',_binary 'carbamoyl phosphate synthase large subunit; Reviewed.','PRK05294','carB'),(2841420,'gnl|CDD|198164',_binary 'Carbamoyl-phosphate synthetase large chain, oligomerisation domain.  Carbamoyl-phosphate synthase catalyses the ATP-dependent synthesis of carbamyl-phosphate from glutamine or ammonia and bicarbonate. The carbamoyl-phosphate synthase (CPS) enzyme in prokaryotes is a heterodimer of a small and large chain.','smart01096','CPSase_L_D3'),(2841421,'gnl|CDD|292600',_binary 'Tn7-like transposition protein D.  TnsD is a family of putative Tn7-like transposition proteins type D.','pfam15978','TnsD'),(2841423,'gnl|CDD|237320',_binary '7-cyano-7-deazaguanine reductase; Provisional.','PRK13258','PRK13258'),(2841424,'gnl|CDD|223851',_binary 'Enzyme related to GTP cyclohydrolase I [General function prediction only].','COG0780','COG0780'),(2841425,'gnl|CDD|213775',_binary '7-cyano-7-deazaguanine reductase.  This enzyme catalyzes the 4-electron reduction of the cyano group of 7-cyano-7-deazaguanine (proQ1) to an amine. Although related to a large family of GTP cyclohydrolases (pfam01227), the relationship is structural and not germane to the catalytic mechanism. This mode represents the shorter, gram-positive version of the enzyme as found in B. subtilis. The enzymatic step represents the first point at which the biosynthesis of queuosine in bacteria and eukaryotes is distinguished from the biosynthesis of archaeosine in archaea.','TIGR03139','QueF-II'),(2841426,'gnl|CDD|316961',_binary 'QueF-like protein.  This protein is involved in the biosynthesis of queuosine. In some proteins this domain appears to be fused to pfam06508.','pfam14489','QueF'),(2841427,'gnl|CDD|274443',_binary '7-cyano-7-deazaguanine reductase.  This enzyme catalyzes the 4-electron reduction of the cyano group of 7-cyano-7-deazaguanine (preQ0) to an amine. Although related to a large family of GTP cyclohydrolases (pfam01227), the relationship is structural and not germane to the catalytic mechanism. This mode represents the longer, gram-negative version of the enzyme as found in E. coli. The enzymatic step represents the first point at which the biosynthesis of queuosine in bacteria and eukaryotes is distinguished from the biosynthesis of archaeosine in archaea. [Transcription, RNA processing].','TIGR03138','QueF'),(2841429,'gnl|CDD|339390',_binary 'Nitrile reductase, 7-cyano-7-deazaguanine-reductase N-term.  The QueF monomer is made up of two ferredoxin-like domains aligned together with their beta-sheets that have additional embellishments. This subunit is composed of a three-stranded beta-sheet and two alpha-helices. QueF reduces a nitrile bond to a primary amine. The two monomer units together create suitable substrate-binding pockets.','pfam14819','QueF_N'),(2841430,'gnl|CDD|236986',_binary '7-cyano-7-deazaguanine reductase; Provisional.','PRK11792','queF'),(2841461,'gnl|CDD|307055',_binary 'Asparagine synthase.  This family is always found associated with pfam00310. Members of this family catalyze the conversion of aspartate to asparagine.','pfam00733','Asn_synthase'),(2841464,'gnl|CDD|223444',_binary 'Asparagine synthase (glutamine-hydrolyzing) [Amino acid transport and metabolism].','COG0367','AsnB'),(2841466,'gnl|CDD|129369',_binary 'TIGR00268 family protein.  The N-terminal region of the model shows similarity to Argininosuccinate synthase proteins using PSI-blast and using the recognize protein identification server. [Hypothetical proteins, Conserved].','TIGR00268','Uncharacterized_protei...'),(2841467,'gnl|CDD|238948',_binary 'This is a subfamily of Adenine nucleotide alpha hydrolases superfamily. Adenine nucleotide alpha hydrolases superfamily  includes N type ATP PPases and ATP sulphurylases. It forms a apha/beta/apha fold which  binds to Adenosine group.  This subfamily   of proteins probably binds ATP. This domain is about 200 amino acids long with a strongly conserved motif SGGKD at the N terminus.','cd01990','Alpha_ANH_like_I'),(2841468,'gnl|CDD|224522',_binary 'ATP-utilizing enzymes of the PP-loop superfamily [General function prediction only].','COG1606','COG1606'),(2841469,'gnl|CDD|199987',_binary 'argininosuccinate synthase.  argG in bacteria, ARG1 in Saccharomyces cerevisiae. There is a very unusual clustering in the alignment, with a deep split between one cohort of E. coli, H. influenzae, and Streptomyces, and the other cohort of eukaryotes, archaea, and the rest of the eubacteria. [Amino acid biosynthesis, Glutamate family].','TIGR00032','Argininosuccinate_synt...'),(2841471,'gnl|CDD|132152',_binary 'exosortase A system-associated amidotransferase 1.  The predicted protein-sorting transpeptidase that we call exosortase (see TIGR02602) has distinct subclasses that associated with different types of exopolysaccharide production loci. This model represents a distinct clade among a set of amidotransferases largely annotated (not necessarily accurately) as glutatime-hydrolyzing asparagine synthases. Members of this clade are essentially restricted to the characteristic exopolysaccharide (EPS) regions that contain the exosortase 1 genome (xrtA), in genomes that also have numbers of PEP-CTERM domain (TIGR02595) proteins.','TIGR03108','eps_aminotran_1'),(2841472,'gnl|CDD|238309',_binary 'NAD+ synthase is a homodimer, which catalyzes the final step in de novo nicotinamide adenine dinucleotide (NAD+) biosynthesis, an amide transfer from either ammonia or glutamine to nicotinic acid adenine dinucleotide (NaAD). The conversion of NaAD to NAD+ occurs via an NAD-adenylate intermediate and requires ATP and Mg2+. The intemediate is subsequently cleaved into NAD+ and AMP. In many prokaryotes, such as E. coli , NAD synthetase consists of a single domain and is strictly ammonia dependent. In contrast, eukaryotes and other prokaryotes have an additional N-terminal amidohydrolase domain that prefer glutamine, Interestingly, NAD+ synthases in these prokaryotes, can also utilize ammonia as an amide source .','cd00553','NAD_synthase'),(2841498,'gnl|CDD|200384',_binary 'radical SAM enzyme, rSAM/lipoprotein system.  Members of this protein family are radical SAM enzymes with an additional 4Fe4S cluster-binding C-terminal domain (TIGR04085) shared with PqqE and many other peptide and protein-modifying radical SAM enzymes. All members occur in the context of a predicted lipoprotein that usually is encoded by an adjacent gene.','TIGR04133','coenzyme_PQQ_synthesis...'),(2841499,'gnl|CDD|274848',_binary 'quinohemoprotein amine dehydrogenase maturation protein.  Members of this protein family are radical SAM enzymes responsible for post-translational modifications to the gamma subunit of quinohemoprotein amine dehydrogenases. Ono, et al. () suggest that this protein is responsible for intrapeptidyl thioether cross-linking rather than cysteine tryptophylquinone biogenesis in the gamma subunit. [Protein fate, Protein modification and repair].','TIGR03906','quino_hemo_SAM'),(2844540,'gnl|CDD|335555',_binary 'Flagellar Assembly Protein A.  Members of this family include FapA (flagellar assembly protein A), found in Vibrio vulnificus. The synthesis of flagella allows bacteria to respond to chemotaxis by facilitating motility. Studies examining the role of FapA show that the loss or delocalization of FapA results in a complete failure of the flagellar biosynthesis and motility in response to glucose mediated chemotaxis. The polar localization of FapA is required for flagellar synthesis, and dephosphorylated EIIAGlc (Glucose-permease IIA component) inhibited the polar localization of FapA through direct interaction.','pfam03961','FapA'),(2844571,'gnl|CDD|274492',_binary 'L-lysine 6-transaminase.  Characterized members of this protein family are L-lysine 6-transaminase, also called lysine epsilon-aminotransferase (LAT). The immediate product of the reaction of this enzyme on lysine, 2-aminoadipate 6-semialdehyde, becomes 1-piperideine 6-carboxylate, or P6C. This product may be converted subsequently to pipecolate or alpha-aminoadipate, lysine catabolites that may be precursors of certain seconary metabolites.','TIGR03251','LAT_fam'),(2844596,'gnl|CDD|129782',_binary '4-aminobutyrate aminotransferase, eukaryotic type.  This enzyme is a class III pyridoxal-phosphate-dependent aminotransferase. This model describes known eukaryotic examples of the enzyme. The degree of sequence difference between this set and known bacterial examples is greater than the distance between either set the most similar enzyme with distinct function, and so separate models are built for prokaryotic and eukaryotic sets. Alternate names include GABA transaminase, gamma-amino-N-butyrate transaminase, and beta-alanine--oxoglutarate aminotransferase. [Central intermediary metabolism, Other].','TIGR00699','4-aminobutyrate_aminot...'),(2844609,'gnl|CDD|180330',_binary 'hypothetical protein; Provisional.','PRK05965','PRK05965'),(2844613,'gnl|CDD|215405',_binary '4-aminobutyrate:pyruvate transaminase.','PLN02760','PLN02760'),(2844650,'gnl|CDD|222844',_binary 'putative DnaG-like primase.','PHA02031','PHA02031'),(2844688,'gnl|CDD|227694',_binary 'Preprotein translocase subunit Sec63 [Intracellular trafficking and secretion].','COG5407','SEC63'),(2844762,'gnl|CDD|274529',_binary 'ATP-dependent chaperone ClpB.  Members of this protein family are the bacterial ATP-dependent chaperone ClpB. This protein belongs to the AAA family, ATPases associated with various cellular activities (pfam00004). This molecular chaperone does not act as a protease, but rather serves to disaggregate misfolded and aggregated proteins. [Protein fate, Protein folding and stabilization].','TIGR03346','chaperone_ClpB'),(2844764,'gnl|CDD|335127',_binary 'Clp amino terminal domain, pathogenicity island component.  This short domain is found in one or two copies at the amino terminus of ClpA and ClpB proteins from bacteria and eukaryotes. The function of these domains is uncertain but they may form a protein binding site. In many bacterial species, including E.coli, this region represents the N-terminus of one of the key components of the pathogenicity island complex that injects toxin from one bacterium into another.','pfam02861','Clp_N'),(2844766,'gnl|CDD|274241',_binary 'ATP-dependent Clp protease ATP-binding subunit clpA.  [Protein fate, Degradation of proteins, peptides, and glycopeptides].','TIGR02639','ATP-dependent_Clp_prot...'),(2844768,'gnl|CDD|182791',_binary 'protein disaggregation chaperone; Provisional.','PRK10865','PRK10865'),(2844769,'gnl|CDD|316737',_binary 'Domain of unknown function (DUF4343).  This domain family is found in bacteria, eukaryotes and viruses, and is typically between 127 and 142 amino acids in length.','pfam14243','DUF4343'),(2844808,'gnl|CDD|310381',_binary 'NACHT domain.  This NTPase domain is found in apoptosis proteins as well as those involved in MHC transcription activation. This family is closely related to pfam00931.','pfam05729','NACHT'),(2844817,'gnl|CDD|223128',_binary 'GTPases - translation elongation factors [Translation, ribosomal structure and biogenesis].','COG0050','TufB'),(2844818,'gnl|CDD|237184',_binary 'elongation factor Tu; Reviewed.','PRK12736','PRK12736'),(2844821,'gnl|CDD|316533',_binary 'Protein of unknown function (DUF4236).  This family of proteins is functionally uncharacterized. This family of proteins is found in bacteria and viruses. Proteins in this family are typically between 69 and 402 amino acids in length.','pfam14020','DUF4236'),(2850729,'gnl|CDD|222858',_binary 'large terminase protein; Provisional.','PHA02533','17'),(2851481,'gnl|CDD|350373',_binary 'dual specificity phosphatase domain of dual specificity protein phosphatase 19.  Dual specificity protein phosphatase 19 (DUSP19), also called low molecular weight dual specificity phosphatase 3 (LMW-DSP3) or stress-activated protein kinase (SAPK) pathway-regulating phosphatase 1 (SKRP1), functions as a protein-serine/threonine phosphatase (EC 3.1.3.16) and a protein-tyrosine-phosphatase (EC 3.1.3.48). It is an atypical DUSP; it contains the catalytic dual specificity phosphatase domain but lacks the N-terminal Cdc25/rhodanese-like domain that is present in typical DUSPs or MKPs. DUSP19  interacts with the MAPK kinase MKK7, a JNK activator, and inactivates the JNK MAPK pathway.','cd14523','DSP_DUSP19'),(2851491,'gnl|CDD|350356',_binary 'protein tyrosine phosphatase domain of PTP domain-containing protein 1.  protein tyrosine phosphatase domain-containing protein 1 (PTPDC1) is an uncharacterized non-receptor class protein-tyrosine phosphatase (PTP). PTPs (EC 3.1.3.48) catalyze the dephosphorylation of phosphotyrosine peptides. Small interfering RNA (siRNA) knockdown of the ptpdc1 gene is associated with elongated cilia.','cd14506','PTP_PTPDC1'),(2858882,'gnl|CDD|183271',_binary 'murein transglycosylase C; Provisional.','PRK11671','mltC'),(2880543,'gnl|CDD|350429',_binary 'dual specificity protein phosphatase 22.  Dual specificity protein phosphatase 22 (DUSP22), also called JNK-stimulatory phosphatase-1 (JSP-1), low molecular weight dual specificity phosphatase 2 (LMW-DSP2), mitogen-activated protein kinase phosphatase x (MKP-x) or VHR-related MKPx (VHX), functions as a protein-serine/threonine phosphatase (EC 3.1.3.16) and a protein-tyrosine-phosphatase (EC 3.1.3.48). It deactivates its MAPK substrates by dephosphorylating the threonine and tyrosine residues in the conserved Thr-Xaa-Tyr motif residing in their activation sites. DUSP22 is an atypical DUSP; it contains the catalytic dual specificity phosphatase domain but lacks the N-terminal Cdc25/rhodanese-like domain that is present in typical DUSPs or MKPs. DUSP22 negatively regulates the estrogen receptor-alpha-mediated signaling pathway and the IL6-leukemia inhibitory factor (LIF)-STAT3-mediated signaling pathway. It also regulates cell death by acting as a scaffold protein for the ASK1-MKK7-JNK signal transduction pathway independently of its phosphatase activity.','cd14581','DUSP22'),(2880552,'gnl|CDD|350430',_binary 'dual specificity phosphatase domain of dual specificity protein phosphatase 15.  Dual specificity protein phosphatase 15 (DUSP15), also called Vaccinia virus VH1-related dual-specific protein phosphatase Y (VHY) or VH1-related member Y, functions as a protein-serine/threonine phosphatase (EC 3.1.3.16) and a protein-tyrosine-phosphatase (EC 3.1.3.48). DUSP15 is an atypical DUSP; it contains the catalytic dual specificity phosphatase domain but lacks the N-terminal Cdc25/rhodanese-like domain that is present in typical DUSPs or MKPs. It is highly expressed in the testis and is located in the plasma membrane in a myristoylation-dependent manner. It may be involved in the regulation of meiotic signal transduction in testis cells. It is also expressed in the brain and has been identified as a regulator of oligodendrocyte differentiation. DUSP15 contains an N-terminal catalytic dual specificity phosphatase domain and a short C-terminal tail.','cd14582','DSP_DUSP15'),(2939977,'gnl|CDD|223044',_binary 'nuclear-egress-membrane-like protein; Provisional.','PHA03325','PHA03325'),(2996115,'gnl|CDD|183473',_binary 'hypothetical protein; Provisional.','PRK12361','PRK12361'),(2996127,'gnl|CDD|350510',_binary 'dual specificity phosphatase domain of plant IBR5-like protein phosphatases.  This subfamily is composed of Arabidopsis thaliana INDOLE-3-BUTYRIC ACID (IBA) RESPONSE 5 (IBR5) and similar plant proteins. IBR5 protein is also called SKP1-interacting partner 33. The IBR5 gene encodes a dual-specificity phosphatase (DUSP) which acts as a positive regulator of plant responses to auxin and abscisic acid. DUSPs function as protein-serine/threonine phosphatases (EC 3.1.3.16) and protein-tyrosine-phosphatases (EC 3.1.3.48). Typical DUSPs, also called mitogen-activated protein kinase (MAPK) phosphatases (MKPs), deactivate MAPKs by dephosphorylating the threonine and tyrosine residues in the conserved Thr-Xaa-Tyr motif residing in their activation sites. IBR5 is an atypical DUSP; it contains the catalytic dual specificity phosphatase domain but lacks the N-terminal Cdc25/rhodanese-like domain that is present in typical DUSPs. It has been shown to target MPK12, which is a negative regulator of auxin signaling.','cd18534','DSP_plant_IBR5-like'),(2996131,'gnl|CDD|214550',_binary 'Protein tyrosine phosphatase, catalytic domain.','smart00194','PTPc'),(2996233,'gnl|CDD|350337',_binary 'second PDC (PhoQ/DcuS/CitA) domain of methyl-accepting chemotaxis proteins and similar domains.  Members of this subfamily display varying domain architectures but all contain double PDC (PhoQ/DcuS/CitA) sensor domains. This model represents the second PDC domain of Methyl-accepting chemotaxis proteins (MCPs), Histidine kinases (HKs), and other similar domains. Many members contain both HAMP (HK, Adenylyl cyclase, MCP, and Phosphatase) and MCP domains, which are signalling domains that interact with protein partners to relay a signal. MCPs are part of a transmembrane protein complex that controls bacterial chemotaxis. HK receptors are part of two-component systems (TCS) in bacteria that play a critical role for sensing and adapting to environmental changes. Typically, HK receptors contain an extracellular sensing domain flanked by two transmembrane helices, an intracellular dimerization histidine phosphorylation domain (DHp), and a C-terminal kinase domain, with many variations on this theme. In the case of HKs, signals detected by the sensor domain are transmitted through DHp to the kinase domain, resulting in the phosphorylation of a conserved histidine residue in DHp; phosphotransfer to a conserved aspartate in its cognate response regulator (RR) follows, which leads to the activation of genes for downstream cellular responses.','cd12912','PDC2_MCP_like');
